	eval("module.exports = {\"title\":\"5 Steps to organizing a successful Campsite event\",\"order\":5,\"body\":\"<h1>In-person group programming sessions and events are fun!</h1>\\n<h2>This Wiki will help you with organizing a successful Campsite event.</h2>\\n<p>With a little planning and communication, having a successful Campsite event can be easy! Here are some steps to help you in doing this:</p>\\n<ul>\\n<li>\\n<p>Determine the topic for the event (code and coffee, hack session, invite campers to another organization’s event).</p>\\n</li>\\n<li>\\n<p>Find a suitable location. Campsite events should always take place in a public space (library, cafe, hackerspace).</p>\\n</li>\\n<li>\\n<p>Create an event on your Campsite’s Facebook page for the event, and link to it on your Campsite Facebook Group page.</p>\\n</li>\\n<li>\\n<p>Follow-up with reminder posts for the event 1 week prior to the event and then again the day before the event.</p>\\n</li>\\n<li>\\n<p>On the day of the event, arrive early, get set up, greet members, and kick the event off. Don’t forget to thank everyone afterwards and extend invites for future meetups.</p>\\n</li>\\n</ul>\\n<p><strong>Try to take some pictures and post them on your Campsite’s Facebook group page.</strong></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/5-Steps-to-organizing-a-successful-Campsite-event/index.md\n ** module id = 289\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/5-Steps-to-organizing-a-successful-Campsite-event/index.md?");

