	eval("module.exports = {\"title\":\"Accessing the database from your frontend\",\"order\":5,\"body\":\"<p>You must have noticed in <strong>main.controller.js</strong> how <em>things</em> were retrieved from the database and displayed:</p>\\n<pre><code class=\\\"language-javascript\\\">\\n$http.get(<span class=\\\"hljs-string\\\">'/api/things'</span>).success(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">awesomeThings</span>)</span>{  \\n\\t$scope.awesomeThings = awesomeThings;  \\n});\\n\\n</code></pre>\\n<p>What this does is call the api with a “get” request, which is then routed by <strong>/server/api/thing/index.js</strong> to the <em>exports.index</em> function in <strong>thing.controller.js</strong>. You’ll also notice in <strong>main.controller.js</strong> that there are included examples of <em>$http.post</em> and <em>$http.delete</em> functions too! How nice!</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Fixing-exports.update\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Seed-data\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Accessing-the-database-from-your-frontend/index.md\n ** module id = 291\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Accessing-the-database-from-your-frontend/index.md?");

