	eval("module.exports = {\"title\":\"Arithmetic Operators\",\"order\":5,\"body\":\"<p>JavaScript provides the user with five arithmetic operators: <code>+</code>, <code>-</code>, <code>*</code>, <code>/</code> and <code>%</code>. The operators are for addition, subtraction, multiplication, division and remainder respectively.</p>\\n<h3>Addition</h3>\\n<p><strong>Syntax</strong></p>\\n<p><code>a + b</code></p>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-number\\\">2</span> + <span class=\\\"hljs-number\\\">3</span>          <span class=\\\"hljs-comment\\\">// returns 5</span>\\n<span class=\\\"hljs-literal\\\">true</span> + <span class=\\\"hljs-number\\\">2</span>       <span class=\\\"hljs-comment\\\">// interprets true as 1 and returns 3</span>\\n<span class=\\\"hljs-literal\\\">false</span> + <span class=\\\"hljs-number\\\">5</span>      <span class=\\\"hljs-comment\\\">// interprets false as 0 and returns 5</span>\\n<span class=\\\"hljs-literal\\\">true</span> + <span class=\\\"hljs-string\\\">\\\"bar\\\"</span>   <span class=\\\"hljs-comment\\\">// concatenates the boolean value and returns \\\"truebar\\\"</span>\\n<span class=\\\"hljs-number\\\">5</span> + <span class=\\\"hljs-string\\\">\\\"foo\\\"</span>      <span class=\\\"hljs-comment\\\">// concatenates the string and the number and returns \\\"5foo\\\"</span>\\n<span class=\\\"hljs-string\\\">\\\"foo\\\"</span> + <span class=\\\"hljs-string\\\">\\\"bar\\\"</span>  <span class=\\\"hljs-comment\\\">// concatenates the strings and returns \\\"foobar\\\"</span>\\n</code></pre>\\n<p><em>Hint:</em> There is a handy <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators#Increment_()\\\">increment</a> operator that is a great shortcut when you’re adding numbers by 1.</p>\\n<h3>Subtraction</h3>\\n<p><strong>Syntax</strong></p>\\n<p><code>a - b</code></p>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-number\\\">2</span> - <span class=\\\"hljs-number\\\">3</span>      <span class=\\\"hljs-comment\\\">// returns -1</span>\\n<span class=\\\"hljs-number\\\">3</span> - <span class=\\\"hljs-number\\\">2</span>      <span class=\\\"hljs-comment\\\">// returns 1</span>\\n<span class=\\\"hljs-literal\\\">false</span> - <span class=\\\"hljs-number\\\">5</span>  <span class=\\\"hljs-comment\\\">// interprets false as 0 and returns -5</span>\\n<span class=\\\"hljs-literal\\\">true</span> + <span class=\\\"hljs-number\\\">3</span>   <span class=\\\"hljs-comment\\\">// interprets true as 1 and returns 4</span>\\n<span class=\\\"hljs-number\\\">5</span> + <span class=\\\"hljs-string\\\">\\\"foo\\\"</span>  <span class=\\\"hljs-comment\\\">// returns NaN (Not a Number)</span>\\n</code></pre>\\n<p><em>Hint:</em> There is a handy <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators#Decrement_(--)\\\">decrement</a> operator that is a great shortcut when you’re subtracting numbers by 1.</p>\\n<h3>Multiplication</h3>\\n<p><strong>Syntax</strong></p>\\n<p><code>a * b</code></p>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-number\\\">2</span> * <span class=\\\"hljs-number\\\">3</span>                <span class=\\\"hljs-comment\\\">// returns 6</span>\\n<span class=\\\"hljs-number\\\">3</span> * -<span class=\\\"hljs-number\\\">2</span>               <span class=\\\"hljs-comment\\\">// returns -6</span>\\n<span class=\\\"hljs-literal\\\">false</span> * <span class=\\\"hljs-number\\\">5</span>            <span class=\\\"hljs-comment\\\">// interprets false as 0 and returns 0</span>\\n<span class=\\\"hljs-literal\\\">true</span> * <span class=\\\"hljs-number\\\">3</span>             <span class=\\\"hljs-comment\\\">// interprets true as 1 and returns 3</span>\\n<span class=\\\"hljs-number\\\">5</span> * <span class=\\\"hljs-string\\\">\\\"foo\\\"</span>            <span class=\\\"hljs-comment\\\">// returns NaN (Not a Number)</span>\\n<span class=\\\"hljs-literal\\\">Infinity</span> * <span class=\\\"hljs-number\\\">0</span>         <span class=\\\"hljs-comment\\\">// returns NaN</span>\\n<span class=\\\"hljs-literal\\\">Infinity</span> * <span class=\\\"hljs-literal\\\">Infinity</span>  <span class=\\\"hljs-comment\\\">// returns Infinity</span>\\n</code></pre>\\n<h3>Division</h3>\\n<p><strong>Syntax</strong></p>\\n<p><code>a / b</code></p>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-number\\\">3</span> / <span class=\\\"hljs-number\\\">2</span>                <span class=\\\"hljs-comment\\\">// returns 1.5</span>\\n<span class=\\\"hljs-number\\\">3.0</span> / <span class=\\\"hljs-number\\\">2</span>/<span class=\\\"hljs-number\\\">0</span>            <span class=\\\"hljs-comment\\\">// returns 1.5</span>\\n<span class=\\\"hljs-number\\\">3</span> / <span class=\\\"hljs-number\\\">0</span>                <span class=\\\"hljs-comment\\\">// returns Infinity</span>\\n<span class=\\\"hljs-number\\\">3.0</span> / <span class=\\\"hljs-number\\\">0.0</span>            <span class=\\\"hljs-comment\\\">// returns Infinity</span>\\n-<span class=\\\"hljs-number\\\">3</span> / <span class=\\\"hljs-number\\\">0</span>               <span class=\\\"hljs-comment\\\">// returns -Infinity</span>\\n<span class=\\\"hljs-literal\\\">false</span> / <span class=\\\"hljs-number\\\">5</span>            <span class=\\\"hljs-comment\\\">// interprets false as 0 and returns 0</span>\\n<span class=\\\"hljs-literal\\\">true</span> / <span class=\\\"hljs-number\\\">2</span>             <span class=\\\"hljs-comment\\\">// interprets true a 1 and returns 0.5</span>\\n<span class=\\\"hljs-number\\\">5</span> + <span class=\\\"hljs-string\\\">\\\"foo\\\"</span>            <span class=\\\"hljs-comment\\\">// returns NaN (Not a Number)</span>\\n<span class=\\\"hljs-literal\\\">Infinity</span> / <span class=\\\"hljs-literal\\\">Infinity</span>  <span class=\\\"hljs-comment\\\">// returns NaN</span>\\n</code></pre>\\n<h3>Remainder</h3>\\n<p><strong>Syntax</strong></p>\\n<p><code>a % b</code></p>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-number\\\">3</span> % <span class=\\\"hljs-number\\\">2</span>          <span class=\\\"hljs-comment\\\">// returns 1</span>\\n<span class=\\\"hljs-literal\\\">true</span> % <span class=\\\"hljs-number\\\">5</span>       <span class=\\\"hljs-comment\\\">// interprets true as 1 and returns 1</span>\\n<span class=\\\"hljs-literal\\\">false</span> % <span class=\\\"hljs-number\\\">4</span>      <span class=\\\"hljs-comment\\\">// interprets false as 0 and returns 0</span>\\n<span class=\\\"hljs-number\\\">3</span> % <span class=\\\"hljs-string\\\">\\\"bar\\\"</span>      <span class=\\\"hljs-comment\\\">// returns NaN</span>\\n</code></pre>\\n<p><em>!Important!</em> As you can see, you <strong>cannot</strong> perform any sort of operations on <code>Infinity</code>.</p>\\n<p>Source: The amazing <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators\\\">MDN</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Arithmetic-Operators/index.md\n ** module id = 294\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Arithmetic-Operators/index.md?");

