	eval("module.exports = {\"title\":\"Array.isArray\",\"order\":5,\"body\":\"<h1>Array.isArray</h1>\\n<p>The <code>Array.isArray()</code> method returns <code>true</code> if an object is an array, <code>false</code> if it is not.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">Array</span>.isArray(obj)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>obj</strong>\\nThe object to be checked.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/isArray\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff848265%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// all following calls return true</span>\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray([]);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray([<span class=\\\"hljs-number\\\">1</span>]);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>());\\n<span class=\\\"hljs-comment\\\">// Little known fact: Array.prototype itself is an array:</span>\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-built_in\\\">Array</span>.prototype); \\n\\n<span class=\\\"hljs-comment\\\">// all following calls return false</span>\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray();\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray({});\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-literal\\\">null</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-literal\\\">undefined</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-number\\\">17</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-string\\\">'Array'</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-literal\\\">true</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray(<span class=\\\"hljs-literal\\\">false</span>);\\n<span class=\\\"hljs-built_in\\\">Array</span>.isArray({ __proto__: <span class=\\\"hljs-built_in\\\">Array</span>.prototype });\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Array.isArray/index.md\n ** module id = 295\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Array.isArray/index.md?");

