	eval("module.exports = {\"title\":\"August 2015 Improvements\",\"order\":5,\"body\":\"<h2>Sunday’s Improvements</h2>\\n<ul>\\n<li>replaced our getting-started videos with a simple 10-minute process (using GIFs instead of videos)</li>\\n<li>doubled the number of our HTML5 and Bootstrap challenges</li>\\n<li>replaced Codecademy’s JavaScript and jQuery challenges with our own challenges</li>\\n<li>added our own Object-oriented Programming and Functional Programming challenges</li>\\n<li>added two new Zipline front end challenges (Personal Portfolio and Simon game), and moved our Ziplines to much earlier in our curriculum</li>\\n<li>completely replaced our Field Guide with a searchable, and easily-editable open-source wiki</li>\\n<li>made it so your Bonfire code is stored in your browser, so if you leave the page, your code will be there when you come back</li>\\n<li>simplified our portfolio pages. You can now click a single button to mirror your Free Code Camp profile with your GitHub profile. Bonfire solutions are no longer shown here, but they’ll eventually be accessible through our API.</li>\\n<li>fixed some issues with Brownie Points and Streaks</li>\\n<li>improved our Camper News page by removing the (mostly unused) comments and adding one-click upvoting</li>\\n<li>added a Creative Commons license to literally all of our images and text</li>\\n<li>thanks to Loopback, everything is now an API, and we will soon publish cool ways to interact with Free Code Camp’s (non-sensitive) data</li>\\n</ul>\\n<h2>FAQ</h2>\\n<h3>The challenge I was most recently doing disappeared.</h3>\\n<p>You can just keep going. If you have time to go back and try our new challenges, they should be a quick review for you. Otherwise, keep moving forward.</p>\\n<h3>Why are you deploying all these improvements at once?</h3>\\n<p>We’ve been working on some of the features for months on our Staging branch. Most of them were held up by a single task: our transition to <a href=\\\"http://loopback.io/\\\">Loopback</a>. @BerkeleyTrue started working on this back in March.</p>\\n<h3>Was deploying everything at once necessary?</h3>\\n<p>Probably not. Going forward, we will deploy new code several times a day (as we did prior to the Loopback feature). We plan to start using a <a href=\\\"https://en.wikipedia.org/wiki/Continuous_integration\\\">continuous integration</a> and other agile best practices as we reduce our <a href=\\\"https://en.wikipedia.org/wiki/Technical_debt\\\">technical debt</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/August-2015-Improvements/index.md\n ** module id = 296\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/August-2015-Improvements/index.md?");

