	eval("module.exports = {\"title\":\"Backend file structure\",\"order\":5,\"body\":\"<p>Your app’s backend api that interacts with your database is located in <strong>/server/api</strong><br>\\nLet’s take a look at <strong>/server/api/thing</strong>:</p>\\n<ol>\\n<li><strong>index.js</strong>:  this file routes the $http API requests made from your app’s front-end to the appropriate function in **thing.controller.js **</li>\\n<li><strong>thing.controller.js</strong>: Here is where we actually deal with the database! Take a minute to look through here and figure out what’s going on. These functions will: return all items in a collection, return a single item from a collection when passed its id, post an item to a collection, update an item in the collection (this doesn’t really work as intended out of the box, we’re going to fix that in a minute), and of course, delete an item from the collection.</li>\\n<li><strong>thing.model.js</strong>: Here, the actual structure of a <em>thing</em> object is defined. You can add or remove any fields you want from the <em>thing</em> model, and as long as they’re syntactically correct they won’t break anything, even if there are <em>things</em> with different schemas in your database already. But! You don’t just have to edit the <em>thing</em> model to make a new type of collection, because generator-angular-fullstack can do it for you!</li>\\n</ol>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Grunt\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-API-endpoint\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Backend-file-structure/index.md\n ** module id = 298\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Backend-file-structure/index.md?");

