	eval("module.exports = {\"title\":\"Basejump Resources\",\"order\":5,\"body\":\"<p>The curriculum lead-up to the first Basejump is not very comprehensive.  Here are a number of common resources which other campers have found helpful.</p>\\n<h3>Getting Started with Basejumps</h3>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Intro-to-Yeoman-Angular-Fullstack-Basejumps\\\">https://freecodecamp.com/wiki/docs/Intro-to-Yeoman-Angular-Fullstack-Basejumps</a> - Lots of helpful tips and tricks for the Yeoman Angular Fullstack setup</li>\\n<li><a href=\\\"https://github.com/DaftMonk/generator-angular-fullstack#generators\\\">https://github.com/DaftMonk/generator-angular-fullstack#generators</a> - Generator used by Yeoman, you can find syntax and what files it creates</li>\\n</ul>\\n<h3>APIs</h3>\\n<ul>\\n<li>API for Charting the stock market: <a href=\\\"https://www.quandl.com/help/api\\\">https://www.quandl.com/help/api</a></li>\\n</ul>\\n<h3>MEAN Stack Tutorials &amp; Videos</h3>\\n<ul>\\n<li>\\n<p>5 Part Series on setting up a MEAN stack\\n<a href=\\\"https://www.youtube.com/watch?v=kHV7gOHvNdk\\\">https://www.youtube.com/watch?v=kHV7gOHvNdk</a></p>\\n</li>\\n<li>\\n<p>A MEAN tutorial that creates a simple Twitter clone\\n<a href=\\\"https://channel9.msdn.com/Series/MEAN-Stack-Jump-Start\\\">https://channel9.msdn.com/Series/MEAN-Stack-Jump-Start</a></p>\\n</li>\\n<li>\\n<p>Clementine is a stripped down MEAN stack, great for learning the fundamentals.<br>\\n<a href=\\\"https://johnstonbl01.github.io/clementinejs/tutorials/tutorial-beginner.html\\\">https://johnstonbl01.github.io/clementinejs/tutorials/tutorial-beginner.html</a></p>\\n</li>\\n<li>\\n<p>Authentication with Passport for the MEAN stack:\\n<a href=\\\"https://vickev.com/#!/article/authentication-in-single-page-applications-node-js-passportjs-angularjs\\\">https://vickev.com/#!/article/authentication-in-single-page-applications-node-js-passportjs-angularjs</a></p>\\n</li>\\n<li>\\n<p>An amazing list of resources for learning the MEAN stack:\\n<a href=\\\"https://github.com/ericdouglas/MEAN-Learning\\\">https://github.com/ericdouglas/MEAN-Learning</a></p>\\n</li>\\n</ul>\\n<h3>Scotch IO Tutorials</h3>\\n<ul>\\n<li><a href=\\\"https://scotch.io/tutorials/setting-up-a-mean-stack-single-page-application\\\">https://scotch.io/tutorials/setting-up-a-mean-stack-single-page-application</a></li>\\n<li><a href=\\\"https://scotch.io/tutorials/node-and-angular-to-do-app-application-organization-and-structure\\\">https://scotch.io/tutorials/node-and-angular-to-do-app-application-organization-and-structure</a></li>\\n</ul>\\n<h3>Node/Express</h3>\\n<ul>\\n<li><a href=\\\"http://stackoverflow.com/a/16512303/1420506\\\">Online Debugging for Node.js/Express</a></li>\\n</ul>\\n<h3>Cloud 9 Tricks</h3>\\n<h5>Speed up browser reloads</h5>\\n<ol>\\n<li>Open gruntfile.js and edit both instances of <code>livereload: true</code> to <code>livereload: false</code>.</li>\\n<li>Open server/config/express.js and comment out the line <code>app.use(require('connect-livereload')());</code></li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Basejump-Resources/index.md\n ** module id = 299\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Basejump-Resources/index.md?");

