	eval("module.exports = {\"title\":\"Bonfire Arguments Optional\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/63Iaec6.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>It can be quite complicated to understand what needs to be done. There are always many ways to do something when coding but regardless of the algorithm used,  we have to create a program that does the following:</p>\\n<ul>\\n<li>It has to add two numbers passed as parameters and return the sum.</li>\\n<li>It has to check if any of the numbers are actual numbers, otherwise return <strong>undefined</strong> and stop the program right there.</li>\\n<li>It has to check if it has one or two arguments passed. More are ignored.</li>\\n<li>If it has only one argument then it has to return a function that uses that number and expects another one, to then add it.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<p>Every time you deal with an argument, you have to check if it is a number or not. For this a function that handles this task will save you repeated code.</p>\\n<h2>Hint: 2</h2>\\n<p>When working on the case that it needs to return the function, it is wise to check if the first and only argument is a number again and base the code on that.</p>\\n<h2>Hint: 3</h2>\\n<p>In the case that only one argument was passed, do not worry about how to prompt input for the second one, just make the function definition properly and things will work out the way they should.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">add</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Function to check if a number is actually a number</span>\\n  <span class=\\\"hljs-comment\\\">// and return undefined otherwise.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> checkNum = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> num !== <span class=\\\"hljs-string\\\">'number'</span>) {\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> num;\\n  };\\n\\n  <span class=\\\"hljs-comment\\\">// Check if we have two parameters, check if they are numbers</span>\\n  <span class=\\\"hljs-comment\\\">// handle the case where one is not</span>\\n  <span class=\\\"hljs-comment\\\">// returns the addition.</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-built_in\\\">arguments</span>.length &gt; <span class=\\\"hljs-number\\\">1</span>) {\\n    <span class=\\\"hljs-keyword\\\">var</span> a = checkNum(<span class=\\\"hljs-built_in\\\">arguments</span>[<span class=\\\"hljs-number\\\">0</span>]);\\n    <span class=\\\"hljs-keyword\\\">var</span> b = checkNum(<span class=\\\"hljs-built_in\\\">arguments</span>[<span class=\\\"hljs-number\\\">1</span>]);\\n    <span class=\\\"hljs-keyword\\\">if</span> (a === <span class=\\\"hljs-literal\\\">undefined</span> || b === <span class=\\\"hljs-literal\\\">undefined</span>) {\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      <span class=\\\"hljs-keyword\\\">return</span> a + b;\\n    }\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-comment\\\">// If only one parameter was found, returns a new function that expects two</span>\\n    <span class=\\\"hljs-comment\\\">// Store first argument before entering the new function scope</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> c = <span class=\\\"hljs-built_in\\\">arguments</span>[<span class=\\\"hljs-number\\\">0</span>];\\n\\n    <span class=\\\"hljs-comment\\\">// Check the number again, must be outside the function to about returning an object</span>\\n    <span class=\\\"hljs-comment\\\">// instead of undefined.</span>\\n    <span class=\\\"hljs-keyword\\\">if</span> (checkNum(c)) {\\n      <span class=\\\"hljs-comment\\\">// Return function that expect a second argument.</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">arg2</span>) </span>{\\n        <span class=\\\"hljs-comment\\\">// Check for non-numbers</span>\\n        <span class=\\\"hljs-keyword\\\">if</span> (c === <span class=\\\"hljs-literal\\\">undefined</span> || checkNum(arg2) === <span class=\\\"hljs-literal\\\">undefined</span>) {\\n          <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n        } <span class=\\\"hljs-keyword\\\">else</span> {\\n          <span class=\\\"hljs-comment\\\">// if numbers then add them.</span>\\n          <span class=\\\"hljs-keyword\\\">return</span> c + arg2;\\n        }\\n      };\\n    }\\n  }\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>First, I create a function with the sole purpose of checking if a number is actually a number and returns undefined if it is not. It uses <strong>typeof</strong> to check.</li>\\n<li>Check if we have two parameters, if so, then check if they are numbers or not using the <strong>checkNum</strong> function I created.</li>\\n<li>If they are not <strong>undefined</strong> then add them and return the addition. If they any of them is undefined then return undefined.</li>\\n<li>In the case that we only have one argument, then we return a new function that expects two parameters. For this we store the first argument before going into a new scope to avoid our arguments being overwritten.</li>\\n<li>Still inside the big else, we need to check the argument we saved, if it is a number then we return the function expecting a second argument.</li>\\n<li>Now inside the function we are returning, we have to check for non numbers again just as at the beginning using <strong>checkNum</strong> if undefined then return that, otherwise if numbers add them and return the addition.</li>\\n</ul>\\n<h2>Second Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">add</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> args = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>(<span class=\\\"hljs-built_in\\\">arguments</span>.length);\\n  <span class=\\\"hljs-comment\\\">//Storing the arguments in an array</span>\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; args.length; ++i) {\\n      args[i] = <span class=\\\"hljs-built_in\\\">arguments</span>[i];\\n    }\\n <span class=\\\"hljs-comment\\\">//Check for the arguments length</span>\\n <span class=\\\"hljs-keyword\\\">if</span>(args.length == <span class=\\\"hljs-number\\\">2</span>){\\n    <span class=\\\"hljs-comment\\\">//If there are two arguments,check for the type of both arguments</span>\\n    <span class=\\\"hljs-comment\\\">//Use typeof to check the type of the argument(both should be numbers)</span>\\n    <span class=\\\"hljs-keyword\\\">if</span>(<span class=\\\"hljs-keyword\\\">typeof</span> args[<span class=\\\"hljs-number\\\">0</span>] !== <span class=\\\"hljs-string\\\">'number'</span> || <span class=\\\"hljs-keyword\\\">typeof</span> args[<span class=\\\"hljs-number\\\">1</span>] !==<span class=\\\"hljs-string\\\">'number'</span> ){\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n      }\\n    <span class=\\\"hljs-keyword\\\">return</span> args[<span class=\\\"hljs-number\\\">0</span>]+args[<span class=\\\"hljs-number\\\">1</span>];\\n   }\\n <span class=\\\"hljs-comment\\\">//When only one argument is provided</span>\\n <span class=\\\"hljs-keyword\\\">if</span>(args.length == <span class=\\\"hljs-number\\\">1</span>){\\n     a= args[<span class=\\\"hljs-number\\\">0</span>];\\n     <span class=\\\"hljs-comment\\\">//Check the  argument using typeof </span>\\n    <span class=\\\"hljs-keyword\\\">if</span>(<span class=\\\"hljs-keyword\\\">typeof</span> a!==<span class=\\\"hljs-string\\\">'number'</span>){\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n      }\\n    <span class=\\\"hljs-keyword\\\">else</span>{\\n       <span class=\\\"hljs-comment\\\">//Making use of closures </span>\\n       <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">b</span>)</span>{\\n       <span class=\\\"hljs-comment\\\">//Checking the second argument </span>\\n         <span class=\\\"hljs-keyword\\\">if</span>(<span class=\\\"hljs-keyword\\\">typeof</span> b !==<span class=\\\"hljs-string\\\">'number'</span>){\\n           <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n           }\\n         <span class=\\\"hljs-keyword\\\">else</span>\\n           <span class=\\\"hljs-keyword\\\">return</span> a+b;\\n          };\\n      }\\n    }\\n}\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @coded9 for your help with Bonfire: Arguments Optional</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Arguments-Optional/index.md\n ** module id = 301\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Arguments-Optional/index.md?");

