	eval("module.exports = {\"title\":\"Bonfire Binary Agents\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/HSwaSFK.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>This problem is very straight forward, you will get a string that will represent a sentence in binary code, and you need to translate that into words. There is not direct way to do this so you will have to translate twice.</p>\\n<h2>Hint: 1</h2>\\n<p>You should first convert from <strong>binary</strong> to <strong>decimal</strong> before translating those values into characters</p>\\n<h2>Hint: 2</h2>\\n<p>Things are easier when focusing on smaller parts, divide the input to focus on one letter at the time.</p>\\n<h2>Hint: 3</h2>\\n<p>Make sure that each time you transcode a character from binary to decimal, you reset whatever variable you used to keep track of the ones. Also do not forget to turn everything back into one string.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution 1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">binaryAgent</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  biString = str.split(<span class=\\\"hljs-string\\\">' '</span>);\\n  uniString = [];\\n  \\n<span class=\\\"hljs-comment\\\">/*using the radix (or base) parameter in parseInt, we can convert the binary \\n  number to a decimal number while simultaneously converting to a char*/</span>\\n\\n   <span class=\\\"hljs-keyword\\\">for</span>(i=<span class=\\\"hljs-number\\\">0</span>;i &lt; biString.length;i++){\\n   uniString.push(<span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(<span class=\\\"hljs-built_in\\\">parseInt</span>(biString[i], <span class=\\\"hljs-number\\\">2</span>))); \\n  }\\n<span class=\\\"hljs-comment\\\">//we then simply join the string</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> uniString.join(<span class=\\\"hljs-string\\\">''</span>);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Separate the string into an array of strings separated by whitespace.</li>\\n<li>Create some variables that will be needed along the way, the names are self explanatory for the most part.</li>\\n<li>Iterate through each binary string in the new array.</li>\\n<li>Convert to decimal by using parseInt(<em>binary</em>, 2) (with the second parameter we tell in which base our numbers currently are)</li>\\n<li>At the end, we return out converted message.</li>\\n</ul>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">binaryAgent</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Separate the binary code by space.</span>\\n  str = str.split(<span class=\\\"hljs-string\\\">' '</span>);\\n  <span class=\\\"hljs-keyword\\\">var</span> power;\\n  <span class=\\\"hljs-keyword\\\">var</span> decValue = <span class=\\\"hljs-number\\\">0</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> sentence = <span class=\\\"hljs-string\\\">''</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Check each binary number from the array.</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> s = <span class=\\\"hljs-number\\\">0</span>; s &lt; str.length; s++) {\\n    <span class=\\\"hljs-comment\\\">// Check each bit from binary number</span>\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> t = <span class=\\\"hljs-number\\\">0</span>; t &lt; str[s].length; t++) {\\n      <span class=\\\"hljs-comment\\\">// This only takes into consideration the active ones.</span>\\n      <span class=\\\"hljs-keyword\\\">if</span> (str[s][t] == <span class=\\\"hljs-number\\\">1</span>) {\\n        <span class=\\\"hljs-comment\\\">// This is quivalent to 2 ** position</span>\\n        power = <span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">2</span>, +str[s].length - t - <span class=\\\"hljs-number\\\">1</span>);\\n        decValue += power;\\n\\n        <span class=\\\"hljs-comment\\\">// Record the decimal value by adding the number to the previous one.</span>\\n      }\\n    }\\n\\n    <span class=\\\"hljs-comment\\\">// After the binary number is converted to decimal, convert it to string and store</span>\\n    sentence += (<span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(decValue));\\n\\n    <span class=\\\"hljs-comment\\\">// Reset decimal value for next binary number.</span>\\n    decValue = <span class=\\\"hljs-number\\\">0</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> sentence;\\n}\\n</code></pre>\\n<h1>Code Explanation</h1>\\n<ul>\\n<li>For each of these binary strings, check for the ones and ignore the zeroes.</li>\\n<li>For those that are one or active then convert them to decimal, this takes into account the position and the right power it needs to be raised to.</li>\\n<li>Store the power into the <strong>power</strong> variable by adding it to any previous ones on the variable <strong>decValue</strong>. This variable will add and add the powers of the active ones until the end of the loop and then return the decimal number.</li>\\n<li>Convert the final decimal outside of the inner loop and then convert it to ASCII and saving it to <strong>sentence</strong> along with any other text string already converted and stored.</li>\\n<li>Reset the variable <strong>decValue</strong> to avoid getting wrong decimals before continuing to the outer loop.</li>\\n</ul>\\n<h2>Code Solution 3:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">binaryAgent</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(...str.split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>).map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">char</span>)</span>{ <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">parseInt</span>(char, <span class=\\\"hljs-number\\\">2</span>); }));\\n}\\n</code></pre>\\n<h1>Code Explanation</h1>\\n<ul>\\n<li>First we use <code>split()</code> to be able to work on each character as an Array element</li>\\n<li>Then use <code>map()</code> to process each element  from binary to decimal using <code>pareseInt()</code></li>\\n<li>Last we can use <code>String.fromCharCode()</code> to convert each ASCII number into the corresponding character</li>\\n<li>However <code>fromCharCode()</code> expects a series of numbers rather than an Array! We can use ES6 Spread Operator to pass in an Array of numbers as individual numbers. See here for more info; <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Spread_operator\\\">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Spread_operator</a></li>\\n</ul>\\n<h2>Code Solution 4:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">binaryAgent</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> re = <span class=\\\"hljs-regexp\\\">/(\\\\d+)(\\\\s?)/g</span>;\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">convertToChar</span>(<span class=\\\"hljs-params\\\">match,p1,p2</span>)</span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(<span class=\\\"hljs-built_in\\\">parseInt</span>(p1, <span class=\\\"hljs-number\\\">2</span>));\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> str.replace(re, convertToChar);\\n}\\n</code></pre>\\n<h1>Code Explanation</h1>\\n<ul>\\n<li>In this solution we use <code>String.replace()</code> to find all the binary numbers and convert them to characters</li>\\n<li>First we use a regular expression to find all the binary numbers and optional trailing spaces</li>\\n<li>Then we define a function that converts the first parenthesized submatch into a number <code>parseInt()</code> and then into a character<code>String.fromCharCode()</code>. By not using the second parenthisized submatch we leave out all the spaces that where in between the binary numbers.</li>\\n<li>Lastly we use our defined regex and function in the <code>String.replace()</code> function.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>thanks @Rafase282 @JamesKee @sabahang @crisvdkooij for your help with Bonfire: Binary Agents</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Binary-Agents/index.md\n ** module id = 302\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Binary-Agents/index.md?");

