	eval("module.exports = {\"title\":\"Bonfire Boo who\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/CgROCEF.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Problem Explanation:</h1>\\n<ul>\\n<li>This program is very simple, the trick is to understand what a boolean primitive is. The programs requires a true or false answer.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>You will need to check for the type of the parameter to see if it is a boolean.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>To check for the type of a parameter, you can use <code>typeof</code></li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Since you must return true or false you can use if statements or just have it return the boolean used for the if statement.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">boo</span>(<span class=\\\"hljs-params\\\">bool</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">typeof</span> bool === <span class=\\\"hljs-string\\\">'boolean'</span>;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>Uses the operator <code>typeof</code> to check if the variable is a boolean.\\nIf it is, it will return <code>true</code>. Otherwise, if it is any other type it will return <code>false</code>.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 for your help with Bonfire: Boo-who</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Boo-who/index.md\n ** module id = 303\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Boo-who/index.md?");

