	eval("module.exports = {\"title\":\"Bonfire Caesars Cipher\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You need to write a function, which will take string encoded with\\n<em>Caesar cipher</em> as a parameter and decode it.</li>\\n<li>The one used here is ROT13 where the value of the letter is\\nshifted by 13 places.\\ne.g. ‘A’ ↔ ‘N’, ‘T’ ↔ ‘G’.</li>\\n<li>You have to shift it back 13 positions, such that ‘N’ ↔ ‘A’.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<p>Use <em>String.charCodeAt()</em> to convert the English character to ASCII.</p>\\n<h2>Hint: 2</h2>\\n<p>Use <em>String.fromCharCode()</em> to convert ASCII to English character.</p>\\n<h2>Hint: 3</h2>\\n<p>Leave anything that doesn’t come between A-Z as it is.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">rot13</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> nstr=<span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\n    <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i=<span class=\\\"hljs-number\\\">0</span>; i&lt;str.length; i++){\\n        <span class=\\\"hljs-comment\\\">//Checks if character lies between A-Z</span>\\n        <span class=\\\"hljs-keyword\\\">if</span>(str.charCodeAt(i) &lt; <span class=\\\"hljs-number\\\">65</span> || str.charCodeAt(i) &gt; <span class=\\\"hljs-number\\\">91</span>) {\\n            nstr += <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(str.charCodeAt(i));\\n            <span class=\\\"hljs-keyword\\\">continue</span>;\\n        }\\n        <span class=\\\"hljs-comment\\\">//If the ASCII gets out of range add 26 to it. (ASCII+26-13)</span>\\n        <span class=\\\"hljs-keyword\\\">if</span>(str.charCodeAt(i) &lt; <span class=\\\"hljs-number\\\">78</span>){\\n            nstr += <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(str.charCodeAt(i) + <span class=\\\"hljs-number\\\">13</span>);\\n        }\\n        <span class=\\\"hljs-keyword\\\">else</span>{\\n            <span class=\\\"hljs-comment\\\">//Shift the character 13 places backward</span>\\n            nstr += <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(str.charCodeAt(i) - <span class=\\\"hljs-number\\\">13</span>);\\n\\n        }\\n    }\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> nstr;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h4>First solution</h4>\\n<ul>\\n<li>A string variable nstr is declared and initialized to store the\\ndecoded string.</li>\\n<li>The for loop is used to loop through each character of the input string.</li>\\n<li>If the character is not uppercase English alphabets(i.e. its ascii doesn’t lie between 65 and 91 ), we’ll leave it\\nas it is and <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/continue\\\">continue</a> with next iteration.</li>\\n<li>If it’s the uppercase English alphabet, we’ll subtract 13 from it’s\\nascii code.</li>\\n<li>If the ascii code is less than 78, it’ll get out of\\nrange when subtracted by 13 so we’ll add 26(number of letters in\\nEnglish alphabets) to it so that after A it’ll go back to Z.\\ne.g. M(77) ↔ 77-13 = 64(Not an English alphabet) +26 = 90 ↔ Z(90)</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @anuragaryan for your help with Bonfire: Caesar's Cipher</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Caesars-Cipher/index.md\n ** module id = 304\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Caesars-Cipher/index.md?");

