	eval("module.exports = {\"title\":\"Bonfire Check for Palindromes\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/ozDWKEi.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>Our goal for solving this problem is tidying up the string passed in, and checking whether it is in fact a palindrome.</p>\\n<ul>\\n<li>If you are unsure of what a palindrome is, it is a word or phrase that when reversed spells the same thing forwards or backwards. A simple example is <code>mom</code>, when you reverse the letters, it spells the same thing! Another example of a palindrome is <code>race car</code>. When we take out anything that is not a character it becomes <code>racecar</code> which is the same spelled forwards or backwards!</li>\\n</ul>\\n<p>Once we have determined whether it is a palindrome or not we want to return either <code>true</code> or <code>false</code> based on our findings.</p>\\n<h2>Hint: 1</h2>\\n<p>Regular expressions, <code>RegEx</code>, can be used to remove unwanted characters from the string.</p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+RegExp\\\">http://devdocs.io/#q=js+RegExp</a></li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<p>The <code>Array.prototype.split</code> and <code>Array.prototype.join</code> methods can be of use here. <code>For</code> and <code>while</code> loops are another alternative, or why not even <code>map</code>!</p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+String+split\\\">http://devdocs.io/#q=js+String+split</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+Array+join\\\">http://devdocs.io/#q=js+Array+join</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+for\\\">http://devdocs.io/#q=js+for</a></li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<p><code>String.prototype.toLowerCase</code> can be used to make a string lowercase.</p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+String+toLowerCase\\\">http://devdocs.io/#q=js+String+toLowerCase</a></li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>First Solution</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">palindrome</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> str.replace(<span class=\\\"hljs-regexp\\\">/[\\\\W_]/g</span>, <span class=\\\"hljs-string\\\">''</span>).toLowerCase() ===\\n         str.replace(<span class=\\\"hljs-regexp\\\">/[\\\\W_]/g</span>, <span class=\\\"hljs-string\\\">''</span>).toLowerCase().split(<span class=\\\"hljs-string\\\">''</span>).reverse().join(<span class=\\\"hljs-string\\\">''</span>);\\n}\\n</code></pre>\\n<h2>Second Solution</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">palindrome</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  str = str.toLowerCase().replace(<span class=\\\"hljs-regexp\\\">/[\\\\W_]/g</span>, <span class=\\\"hljs-string\\\">''</span>);\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>, len = str.length - <span class=\\\"hljs-number\\\">1</span>; i &lt; len/<span class=\\\"hljs-number\\\">2</span>; i++) {\\n    <span class=\\\"hljs-keyword\\\">if</span>(str[i] !== str[len-i]) {\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n    }\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n}\\n</code></pre>\\n<h2>Third Solution</h2>\\n<p>(using recursion)</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">palindrome</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n<span class=\\\"hljs-comment\\\">// make all letters lowercase and remove non-alphanumeric characters</span>\\n  str = str.toLowerCase().replace(<span class=\\\"hljs-regexp\\\">/[^a-z|1-9]/g</span>, <span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n\\n  <span class=\\\"hljs-comment\\\">// if the length of the string is 0 then it is a palindrome</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (str.length === <span class=\\\"hljs-number\\\">0</span>){\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">// if the first letter and the last letter of the string</span>\\n  <span class=\\\"hljs-comment\\\">// do not equal each other, then it is not a palindrome</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (str[<span class=\\\"hljs-number\\\">0</span>] !== str[str.length-<span class=\\\"hljs-number\\\">1</span>]){\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">//Else, run the function without the first and last characters.</span>\\n  <span class=\\\"hljs-keyword\\\">else</span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> palindrome(str.slice(<span class=\\\"hljs-number\\\">1</span>,str.length - <span class=\\\"hljs-number\\\">1</span>));\\n  }\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h2>First Solution</h2>\\n<ul>\\n<li>\\n<p>We start by using regular expressions to replace any white space or non-alphanumeric characters with nothing (or <code>null</code>), which essentially removes them from the string.</p>\\n</li>\\n<li>\\n<p>Next we <em>chain</em> <code>.toLowerCase()</code> to remove any capital letters because <code>A</code> is a different character than <code>a</code>. The problem did not ask us to worry about making sure the case of the characters was identical, just the spelling.</p>\\n</li>\\n<li>\\n<p>Our next step is to take our string and <code>.split()</code> it, <code>.reverse()</code> it, and finally <code>.join()</code> it back together.</p>\\n</li>\\n<li>\\n<p>Last step is to check that the string is the same forwards and backwards and return our result!</p>\\n</li>\\n</ul>\\n<h2>Second solution</h2>\\n<ul>\\n<li>\\n<p>We start by using the same methods of replacing characters we don’t want in the string using <code>RegEx</code>'s, regular expressions, and then make our string lowercase.</p>\\n</li>\\n<li>\\n<p>Next we set up our <code>for</code> loop and declare an index <code>i</code> to keep track of the loop. We set our escape sequence to when <code>i</code> is greater than the length of the string divided by two, which tells the loop to stop after the halfway point of the string. And finally we set <code>i</code> to increment after every loop.</p>\\n</li>\\n<li>\\n<p>Inside of each loop we want to check that the letter in element <code>[i]</code> is equal to the letter in the length of the string minus i, <code>[str.length - i]</code>. Each loop, the element that is checked on both sides of the string moves closer to the center until we have checked all of the letters. If at any point the letters do not match, we return <code>false</code>. If the loop completes successfully, it means we have a palindrome and therefore we return <code>true</code>!</p>\\n</li>\\n</ul>\\n<h2>Third Solution</h2>\\n<ul>\\n<li>\\n<p>This solution uses the power of recursion instead of a for loop! Our first step is to once again use <code>RegEx</code>'s to remove any characters that we do not want in the string, like whitespace or non-alphanumeric characters.</p>\\n</li>\\n<li>\\n<p>Our next step is check if the length of the string is 0, if it is we return <code>true</code> because it is a palindrome. (this will make a little more sense after you read all the steps).</p>\\n</li>\\n<li>\\n<p>Next we want to check that the first and last elements of the string are the same. If they are not the same, we return false which exits the function, and breaks out of the recursive loop.</p>\\n</li>\\n<li>\\n<p>If neither of the first two conditions are met, then we assume that the two characters are equal, and we return a recursive call to the function. The difference here is that we pass the current value of <code>str</code> and we slice the first and last elements off the string. This process continues until there are no characters left to check!</p>\\n</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @abhisekp @shadowfool for your help with Bonfire: Check for Palindromes</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Check-for-Palindromes/index.md\n ** module id = 305\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Check-for-Palindromes/index.md?");

