	eval("module.exports = {\"title\":\"Bonfire Chunky Monkey\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/RdrnNvA.png\\\" alt=\\\"\\\"></p>\\n<h1>Explanation</h1>\\n<p>Our goal for this bonfire is to split <code>arr</code> (first argument) into smaller chunks of arrays with the length provided by <code>size</code> (second argument). There are 4 green checks (objectives) our code needs to pass in order to complete this bonfire:</p>\\n<ol>\\n<li><code>(['a', 'b', 'c', 'd'], 2)</code> is expected to be <code>[['a', 'b'], ['c', 'd']]</code></li>\\n<li><code>([0, 1, 2, 3, 4, 5], 3)</code> is expected to be <code>[[0, 1, 2], [3, 4, 5]]</code></li>\\n<li><code>([0, 1, 2, 3, 4, 5], 2)</code> is expected to be <code>[[0, 1], [2, 3], [4, 5]]</code></li>\\n<li><code>([0, 1, 2, 3, 4, 5], 4)</code> is expected to be <code>[[0, 1, 2, 3], [4, 5]]</code></li>\\n</ol>\\n<p>Click <strong>More information</strong> under the bonfire title and read the helpful links if you haven’t yet.</p>\\n<h2>How to approach the bonfire</h2>\\n<p>The helpful links suggest to use <code>Array.push()</code> so let’s start by first creating a new array to store the smaller arrays we will soon have like this:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> newArray = [];\\n</code></pre>\\n<p>Next we’ll need a <code>for loop</code> to loop through <code>arr</code> then finally we need a method to do the actual splitting and we can use <code>Array.slice()</code> to do that. The key to this bonfire is understanding how a <code>for loop</code>, <code>size</code>, <code>Array.slice()</code> and <code>Array.push()</code> all work together.</p>\\n<h1>How does a for loop and Array.slice() work</h1>\\n<p><strong>For Loop</strong></p>\\n<p>A <code>for loop</code> keeps looping until a condition evaluates to false for example if we had:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; arr.length; i++)\\n</code></pre>\\n<p><code>i</code> starts with a value of 0, <code>i</code> loops until <code>i</code> is no longer less than the length of <code>arr</code> and during each repeat loop, the value of <code>i</code> increases by 1 (one). If <code>arr.length</code> happens to be 4 then the <code>for loop</code> stops right before <code>i</code> reaches 4.</p>\\n<p><strong>Array.slice() Method</strong></p>\\n<p><code>Array.slice()</code> method extracts a portion of an array and returns a copy into a new array. We can declare which element to start and which element to stop. For example, if <code>arr</code> is <code>['a', 'b', 'c', 'd']</code> and we used <code>arr.slice(1, 3);</code>, the <code>Array.slice()</code> method starts at element 1 and stops at element 3 then returns:</p>\\n<pre><code class=\\\"language-js\\\">[<span class=\\\"hljs-string\\\">\\\"b\\\"</span>,<span class=\\\"hljs-string\\\">\\\"c\\\"</span>]\\n</code></pre>\\n<p><em>Notice how it captures the start element but doesn’t capture the stop element.</em></p>\\n<h1>Using a for loop and Array.slice() together</h1>\\n<p>If we use the following <code>for loop</code> while <code>size</code> is 2 (note: <code>size</code> = 2):</p>\\n<pre><code class=\\\"language-js\\\">(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; arr.length; i += size)\\n</code></pre>\\n<p>The loop starts at element 0, loops once then <code>i += 2</code> which is another way of stating <code>i = i + 2</code> so now the new value of <code>i</code> becomes 2. What happens if we combine the following <code>arr.slice()</code> with the <code>for loop</code>?</p>\\n<pre><code class=\\\"language-js\\\">arr.slice(i, i + size)\\n</code></pre>\\n<h1>Push the arrays out</h1>\\n<p>We can combine the <code>Array.slice()</code> method with the <code>Array.push()</code> method inside the <code>for loop</code> like this:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; arr.length; i += size) {\\nnewArray.push(arr.slice(i, i + size));\\n}\\n</code></pre>\\n<p><code>arr.slice()</code> will start at element 0 and stop at element 2. Here’s the fun part: once the <code>for loop</code>, loops again then the value of <code>i</code> becomes 2 while the <code>i</code> in the <code>arr.slice()</code> will also have a value of 2. The new <code>arr.slice()</code> becomes:</p>\\n<pre><code class=\\\"language-js\\\">arr.slice(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">2</span> + <span class=\\\"hljs-number\\\">2</span>)\\n</code></pre>\\n<p>Now <code>arr.slice()</code> starts at the element 2 and stops at element 4 and in the next loop, <code>arr.slice()</code> will start at element 4 and stop at element 6. <code>newArray.push()</code> will push all the elements out into chunks of smaller arrays with the length of <code>size</code>.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>Solution 1:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">chunk</span>(<span class=\\\"hljs-params\\\">arr, size</span>) </span>{\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> temp = [];\\n  <span class=\\\"hljs-keyword\\\">var</span> result = [];\\n\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> a = <span class=\\\"hljs-number\\\">0</span>; a &lt; arr.length; a++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (a % size !== size - <span class=\\\"hljs-number\\\">1</span>)\\n      temp.push(arr[a]);\\n    <span class=\\\"hljs-keyword\\\">else</span> {\\n      temp.push(arr[a]);\\n      result.push(temp);\\n      temp = [];\\n    }\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">if</span> (temp.length !== <span class=\\\"hljs-number\\\">0</span>)\\n    result.push(temp);\\n  <span class=\\\"hljs-keyword\\\">return</span> result;\\n}\\n</code></pre>\\n<h4>Solution 2:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">chunk</span>(<span class=\\\"hljs-params\\\">arr, size</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Break it up</span>\\n  <span class=\\\"hljs-comment\\\">// It's already broken :(</span>\\n  arr = arr.slice();\\n  <span class=\\\"hljs-keyword\\\">var</span> arr2 = [];\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>, len = arr.length; i &lt; len; i+=size) {\\n    arr2.push(arr.slice(<span class=\\\"hljs-number\\\">0</span>, size));\\n    arr = arr.slice(size);\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> arr2;\\n}\\n</code></pre>\\n<h4>Solution 3:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">chunk</span>(<span class=\\\"hljs-params\\\">arr, size</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Break it up.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = [];\\n  <span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>;\\n  \\n  <span class=\\\"hljs-keyword\\\">while</span> (i &lt; arr.length) {\\n    newArray.push(arr.slice(i, i+size));\\n    i += size;\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> newArr;\\n}\\nchunk([<span class=\\\"hljs-string\\\">\\\"a\\\"</span>, <span class=\\\"hljs-string\\\">\\\"b\\\"</span>, <span class=\\\"hljs-string\\\">\\\"c\\\"</span>, <span class=\\\"hljs-string\\\">\\\"d\\\"</span>], <span class=\\\"hljs-number\\\">2</span>);\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @kirah1314 @Rafase282 @jsommamtek for your help with Bonfire: Chunky Monkey</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Chunky-Monkey/index.md\n ** module id = 306\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Chunky-Monkey/index.md?");

