	eval("module.exports = {\"title\":\"Bonfire Diff Two Arrays\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/HkEgef5.gif\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>Check two arrays and return a new array that contains only the items that are not in either of the original arrays.</p>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Merge the list to make it easy to compare functions.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Use filter to get the new array, you will need to create a callback function.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>The best way to go about the callback function is to check if the number from the new merged array is not in <strong>both</strong> original arrays and return it.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">diff</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = arr1.concat(arr2);\\n\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">check</span>(<span class=\\\"hljs-params\\\">item</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (arr1.indexOf(item) === -<span class=\\\"hljs-number\\\">1</span> || arr2.indexOf(item) === -<span class=\\\"hljs-number\\\">1</span>) {\\n      <span class=\\\"hljs-keyword\\\">return</span> item;\\n    }\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> newArr.filter(check);\\n}\\n</code></pre>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">diff</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Same, same; but different.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = arr1.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">el</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> arr2.indexOf(el) === -<span class=\\\"hljs-number\\\">1</span>;\\n    \\n    <span class=\\\"hljs-comment\\\">// concat the previous output of filter method</span>\\n    <span class=\\\"hljs-comment\\\">// with the next output of filter method</span>\\n  }).concat(arr2.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">el</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> arr1.indexOf(el) === -<span class=\\\"hljs-number\\\">1</span>;\\n  }));\\n  <span class=\\\"hljs-keyword\\\">return</span> newArr;\\n}\\n</code></pre>\\n<h2>Code Solution 3:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// This solution runs two times faster than solutions 1 and 2</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">diff</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = [];\\n  <span class=\\\"hljs-comment\\\">// Looping through arr1 to find elements that do not exist in arr2  </span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; arr1.length; i++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (arr2.indexOf(arr1[i]) === -<span class=\\\"hljs-number\\\">1</span>){\\n      <span class=\\\"hljs-comment\\\">// Pushing the unique to arr1 elements to the newArr</span>\\n      newArr.push(arr1[i]);\\n    } \\n  }\\n  <span class=\\\"hljs-comment\\\">// Looping through arr2 to find elements that do not exist in arr1</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> j = <span class=\\\"hljs-number\\\">0</span>; j &lt; arr2.length; j++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (arr1.indexOf(arr2[j]) === -<span class=\\\"hljs-number\\\">1</span>){\\n      <span class=\\\"hljs-comment\\\">// Pushing the unique to arr2 elements to the newArr    </span>\\n      newArr.push(arr2[j]);\\n    } \\n  }\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> newArr;\\n}\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @aganita for your help with Bonfire: Diff Two Arrays</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Diff-Two-Arrays/index.md\n ** module id = 310\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Diff-Two-Arrays/index.md?");

