	eval("module.exports = {\"title\":\"Bonfire Drop it\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/goyTFy2.png\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>Basically while the second argument is not true, you will have to remove the first element from the left of the array that was passed as the first argument.</p>\\n<h2>Hint: 1</h2>\\n<p>You can use Array.shift() or filter that you should be more familiar with to solve this problem in a few lines of code.</p>\\n<h2>Hint: 2</h2>\\n<p>Shift returns the element that was removed which we don’t really need, all we need is the modified array that is left.</p>\\n<h2>Hint: 3</h2>\\n<p>If you still can’t figure out how to solve it with shift, then try solving it with filter, and check how filter works, if you become familiar with it, then you can make the code with shift.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution 1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">drop</span>(<span class=\\\"hljs-params\\\">arr, func</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Drop them elements.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> times = arr.length;\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; times; i++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (func(arr[<span class=\\\"hljs-number\\\">0</span>])) {\\n      <span class=\\\"hljs-keyword\\\">break</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      arr.shift();\\n    }\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\ndrop([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>], <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">n</span>) </span>{<span class=\\\"hljs-keyword\\\">return</span> n &lt; <span class=\\\"hljs-number\\\">3</span>; });\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Create a for loop to check each element.</li>\\n<li>Then check for the function given if true then stop, otherwise remove that element.</li>\\n<li>return the array.</li>\\n</ul>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">drop</span>(<span class=\\\"hljs-params\\\">arr, func</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.slice(arr.findIndex(func) &gt;= <span class=\\\"hljs-number\\\">0</span> &amp;&amp; arr.findIndex(func), arr.length);\\n}\\n\\ndrop([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>], <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">n</span>) </span>{<span class=\\\"hljs-keyword\\\">return</span> n &gt;= <span class=\\\"hljs-number\\\">3</span>;});\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Use ES6 <code>findIndex()</code> function to  find the index of the element that passes the condition</li>\\n<li>Slice the array from the found index until the end</li>\\n<li>There is one edge case! if the condition is not met against any of the elements ‘findIndex’ will return <code>-1</code> which messes up the input to <code>slice()</code>. In this case use a simple conditional operator to return <code>false</code> instead of <code>-1</code>. For more info see <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Conditional_Operator\\\">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Conditional_Operator</a></li>\\n</ul>\\n<h2>Code Solution 3:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">drop</span>(<span class=\\\"hljs-params\\\">arr, func</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">while</span>(!func(arr[<span class=\\\"hljs-number\\\">0</span>])){\\n    arr.shift();\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\n\\ndrop([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>], <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">n</span>) </span>{<span class=\\\"hljs-keyword\\\">return</span> n &lt; <span class=\\\"hljs-number\\\">3</span>; });\\n</code></pre>\\n<h1>Code Explanation</h1>\\n<ul>\\n<li>Use a while loop with <code>Array.shift()</code> to continue checking and dropping the first element of the array until the function returns true.</li>\\n<li>Return the trimmed array.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @sabahang for your help with Bonfire: Drop it</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Drop-it/index.md\n ** module id = 311\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Drop-it/index.md?");

