	eval("module.exports = {\"title\":\"Bonfire Everything be True\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/oKEJJJI.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Explanation:</h1>\\n<p>The program needs to check if the second argument is a <a href=\\\"https://freecodecamp.com/wiki/docs/js-truthy\\\">truthy</a> element, and it must check this for each object in the first argument.</p>\\n<h3>Hint: 1</h3>\\n<p>Remember to iterate through the first argument to check each object.</p>\\n<h3>Hint: 2</h3>\\n<p>Only if all of them are truth will we return true, so make sure all of them check.</p>\\n<h3>Hint: 3</h3>\\n<p>You could use loops or callbacks functions, there are multiple ways to solve this problem.</p>\\n<h3>Spoiler Alert!</h3>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solutions ahead!</strong></p>\\n<h2>Code Solution using for-in loop &amp; hasOwnProperty:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">every</span>(<span class=\\\"hljs-params\\\">collection, pre</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Create a counter to check how many are true.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> counter = <span class=\\\"hljs-number\\\">0</span>;\\n  <span class=\\\"hljs-comment\\\">// Check for each object</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> c <span class=\\\"hljs-keyword\\\">in</span> collection) {\\n    <span class=\\\"hljs-comment\\\">// If it is has property and value is truthy</span>\\n    <span class=\\\"hljs-keyword\\\">if</span> (collection[c].hasOwnProperty(pre) &amp;&amp; <span class=\\\"hljs-built_in\\\">Boolean</span>(collection[c][pre])) {\\n      counter++;\\n    }\\n  }\\n  <span class=\\\"hljs-comment\\\">// Outside the loop, check to see if we got true for all of them and return true or false</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> counter == collection.length;\\n}\\n</code></pre>\\n<h3>Code Explanation:</h3>\\n<ul>\\n<li>First I create a counter to check how many cases are actually true.</li>\\n<li>Then check for each object if the value is truthy</li>\\n<li>Outside the loop, I check to see if the counter variable has the same value as the length of <strong>collection</strong>, if true then return <strong>true</strong>, otherwise, return <strong>false</strong></li>\\n</ul>\\n<h2>Code Solution using Array.every():</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">every</span>(<span class=\\\"hljs-params\\\">collection, pre</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> collection.every(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">element</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> element.hasOwnProperty(pre) &amp;&amp; <span class=\\\"hljs-built_in\\\">Boolean</span>(element[pre]);\\n  });\\n}\\n</code></pre>\\n<h3>Code Explanation:</h3>\\n<ul>\\n<li>Uses the native “every” method to test whether all elements in the array pass the test.</li>\\n<li>This link will help <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/every\\\">Array.prototype.every()</a></li>\\n</ul>\\n<h2>Code solution using Array.reduce:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">every</span>(<span class=\\\"hljs-params\\\">collection, pre</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> collection.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">acc, next</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">if</span> (next[pre]) {\\n            <span class=\\\"hljs-keyword\\\">return</span> acc;\\n        } <span class=\\\"hljs-keyword\\\">else</span> {\\n            acc = <span class=\\\"hljs-literal\\\">false</span>;\\n            <span class=\\\"hljs-keyword\\\">return</span> acc;\\n        }\\n    },<span class=\\\"hljs-literal\\\">true</span>);\\n</code></pre>\\n<h3>Code Explanation:</h3>\\n<ul>\\n<li>Set initial reduce value to true.</li>\\n<li>Change it to false only when there is no key of a given name or it’s falsy. Otherwise stick to the initial truthy value.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @estevanmaito @HermanFassett for your help with Bonfire: Everything Be True</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Everything-be-True/index.md\n ** module id = 312\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Everything-be-True/index.md?");

