	eval("module.exports = {\"title\":\"Bonfire Exact Change\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You have to create a program that will handle when the register does not have enough cash or will have no cash after the transaction. Other than that it needs to return an array of the change in the form of an array, so that will be a 2D array.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Is easier to handle if you will have to close the register or if you will not have enough money to complete the transaction if you know beforehand how much money is on your register. For this it would be recommended to have a function get the information assigned to a variable.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Life is easier when you get to know the value of each currency type in the register instead of how much money is composed of that particular currency. So be sure to watch out for that.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will have to get as much change from one type before moving to the next from greater value to lesser, and keep going until you have covered the whole change.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Create an object which hold the denominations and their values</span>\\n<span class=\\\"hljs-keyword\\\">var</span> denom = [\\n\\t{ name: <span class=\\\"hljs-string\\\">'ONE HUNDRED'</span>, val: <span class=\\\"hljs-number\\\">100.00</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'TWENTY'</span>, val: <span class=\\\"hljs-number\\\">20.00</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'TEN'</span>, val: <span class=\\\"hljs-number\\\">10.00</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'FIVE'</span>, val: <span class=\\\"hljs-number\\\">5.00</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'ONE'</span>, val: <span class=\\\"hljs-number\\\">1.00</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'QUARTER'</span>, val: <span class=\\\"hljs-number\\\">0.25</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'DIME'</span>, val: <span class=\\\"hljs-number\\\">0.10</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'NICKEL'</span>, val: <span class=\\\"hljs-number\\\">0.05</span>},\\n\\t{ name: <span class=\\\"hljs-string\\\">'PENNY'</span>, val: <span class=\\\"hljs-number\\\">0.01</span>}\\n];\\n\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">drawer</span>(<span class=\\\"hljs-params\\\">price, cash, cid</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> change = cash - price;\\n\\n    <span class=\\\"hljs-comment\\\">// Transform CID array into drawer object</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> register = cid.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">acc, curr</span>) </span>{\\n        acc.total += curr[<span class=\\\"hljs-number\\\">1</span>];\\n        acc[curr[<span class=\\\"hljs-number\\\">0</span>]] = curr[<span class=\\\"hljs-number\\\">1</span>];\\n        <span class=\\\"hljs-keyword\\\">return</span> acc;\\n    }, {total: <span class=\\\"hljs-number\\\">0</span>});\\n    \\n    <span class=\\\"hljs-comment\\\">// Handle exact change</span>\\n    <span class=\\\"hljs-keyword\\\">if</span>(register.total === change) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">'Closed'</span>;\\n    }\\n    \\n    <span class=\\\"hljs-comment\\\">// Handle obvious insufficent funds</span>\\n    <span class=\\\"hljs-keyword\\\">if</span>(register.total &lt; change) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">'Insufficient Funds'</span>;\\n    }\\n    \\n    <span class=\\\"hljs-comment\\\">// Loop through the denomination array</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> change_arr = denom.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">acc, curr</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">var</span> value = <span class=\\\"hljs-number\\\">0</span>;\\n        <span class=\\\"hljs-comment\\\">// While there is still money of this type in the drawer</span>\\n        <span class=\\\"hljs-comment\\\">// And while the denomination is larger than the change reminaing</span>\\n        <span class=\\\"hljs-keyword\\\">while</span>(register[curr.name] &gt; <span class=\\\"hljs-number\\\">0</span> &amp;&amp; change &gt;= curr.val) {\\n            change -= curr.val;\\n            register[curr.name] -= curr.val;\\n            value += curr.val;\\n            \\n            <span class=\\\"hljs-comment\\\">// Round change to the nearest hundreth to deal with precision errors</span>\\n            change = <span class=\\\"hljs-built_in\\\">Math</span>.round(change * <span class=\\\"hljs-number\\\">100</span>) / <span class=\\\"hljs-number\\\">100</span>;\\n        }\\n        <span class=\\\"hljs-comment\\\">// Add this denomination to the output only if any was used.</span>\\n        <span class=\\\"hljs-keyword\\\">if</span>(value &gt; <span class=\\\"hljs-number\\\">0</span>) {\\n            acc.push([ curr.name, value ]);\\n        }\\n        <span class=\\\"hljs-keyword\\\">return</span> acc; <span class=\\\"hljs-comment\\\">// Return the current Change Array</span>\\n    }, []); <span class=\\\"hljs-comment\\\">// Initial value of empty array for reduce</span>\\n  \\n  <span class=\\\"hljs-comment\\\">// If there are no elements in change_arr or we have leftover change, return \\\"Insufficient Funds\\\"</span>\\n  <span class=\\\"hljs-keyword\\\">if</span>(change_arr.length &lt; <span class=\\\"hljs-number\\\">1</span> || change &gt; <span class=\\\"hljs-number\\\">0</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Insufficient Funds\\\"</span>;\\n  }\\n    \\n  <span class=\\\"hljs-comment\\\">// Here is your change, ma'am.</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> change_arr;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @SaintPeter for your help with Bonfire: Exact Change</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Exact-Change/index.md\n ** module id = 313\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Exact-Change/index.md?");

