	eval("module.exports = {\"title\":\"Bonfire Factorialize a Number\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<p>Return the factorial of the provided integer. If the integer is represented with the letter n, a factorial is the product of all positive integers less than or equal to n.</p>\\n<p>Factorials are often represented with the shorthand notation n!</p>\\n<p>For example: <code>5! = 1 * 2 * 3 * 4 * 5 = 120</code></p>\\n<h2>Outline</h2>\\n<p>This one starts easily since <code>0! = 1</code>, so you can go ahead and simply <code>return 1</code> there.</p>\\n<p>We can use that as an <code>if</code> in order to break the loop we’re going to create using a <strong>recursive function</strong>. It will check if the number you gave the function is 0 (which would be the end of your factorial chain). Functions “end” when they return anything. In fact, <strong>all</strong> functions without an explicit <code>return</code> statement will return <code>undefined</code>.</p>\\n<p>This is also why <strong>instead</strong> of having <em>“finished”</em>, a function is always said to <em>“have returned”</em>. And now this…</p>\\n<h2>Understanding recursion</h2>\\n<p>Recursion refers to a function repeating (calling) itself. In this case we are basically returning the given number (i.e. 5), multiplied by the function itself but this time the value passed to the <em>num</em> parameter is <code>num-1</code> (which initially translates to 4). The very function is going to <strong>run inside itself</strong> interesting, eh?</p>\\n<h1>Understanding the flow</h1>\\n<p>The first <strong>returned</strong> value can be visualized better if you think about those parenthesis operations you did in secondary school where you do the math inside every parenthesis from inside out, bracket and square bracket until you get a final result (a total). This time it’s the same thing, look at the program flow:</p>\\n<h3>During the first execution of the function:</h3>\\n<p>[<strong>num</strong> = 5]</p>\\n<p>Is 5 <em>equal</em> to 1 or 0? <strong>No</strong> —&gt; Oki doki, let’s continue…</p>\\n<p><strong>Returns:</strong></p>\\n<p>(<strong>5</strong> _ (<em>second execution</em>: <strong>4</strong> _ (<em>third execution</em>: <strong>3</strong> _ (<em>fourth execution</em>: <strong>2</strong> _ <em>fifth execution</em>: <strong>1</strong>))))</p>\\n<p>What it returns can be viewed as <code>(5*(4*(3*(2*1))))</code> or just <code>5 * 4 * 3 * 2 * 1</code>, and the function will return the result of that operation: <code>120</code>. Now, let’s check what the rest of the executions do:</p>\\n<h3>During the rest of the executions:</h3>\\n<p><strong>Second Execution</strong>:\\n<em>num</em> = 5-1 = <strong>4</strong> -&gt; is <em>num</em> 0 or 1? No<br>\\n–&gt; return the multiplication between 4 and the next result when <em>num</em> is now 4-1.</p>\\n<p><strong>Third Execution</strong>: <em>num</em> = 4 - 1 = <strong>3</strong> -&gt; is <em>num</em> 0 or 1? No<br>\\n–&gt; return the multiplication between 3 and the next result when <em>num</em> is now 3-1.</p>\\n<p><strong>Fourth Execution</strong>: <em>num</em> = 3-1 = <strong>2</strong> -&gt; is <em>num</em> 0 or 1? No<br>\\n–&gt; return the multiplication between 2 and the next result when <em>num</em> is now 2-1.</p>\\n<p><strong>Fifth Execution</strong>: <em>num</em> = 2-1 = <strong>1</strong> -&gt; is <em>num</em> 0 or 1? Yep<br>\\n–&gt; return <strong>1</strong>. And this is where the recursion stops because there are no more executions.</p>\\n<p>Got it? ;)</p>\\n<p><img src=\\\"http://i61.tinypic.com/28auvsw.jpg\\\" alt=\\\"Recursion\\\"></p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">factorialize</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (num === <span class=\\\"hljs-number\\\">0</span>) { <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">1</span>; }\\n  <span class=\\\"hljs-keyword\\\">return</span> num * factorialize(num-<span class=\\\"hljs-number\\\">1</span>);\\n}\\n\\nfactorialize(<span class=\\\"hljs-number\\\">5</span>);\\n</code></pre>\\n<h1>References</h1>\\n<ul>\\n<li><strong>Recursion</strong>: <a href=\\\"https://www.codecademy.com/es/courses/javascript-lesson-205/0/1\\\">https://www.codecademy.com/courses/javascript-lesson-205/0/1</a></li>\\n<li><strong>Factorialization</strong>: <a href=\\\"https://en.wikipedia.org/wiki/Factorial\\\">https://en.wikipedia.org/wiki/Factorial</a></li>\\n<li><strong>Arithmetic Operators</strong> <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators\\\">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Arithmetic_Operators</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @luishendrix92 @Rafase282 @hallaathrad for your help with Bonfire: Factorialize a Number</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n<pre><code>           ,,,         ,,,\\n          <span class=\\\"hljs-comment\\\">;\\\"   ^;     ;'   \\\",</span>\\n          <span class=\\\"hljs-comment\\\">;    s$$$$$$$s     ;</span>\\n          ,  ss$$$$$$$$$$s  ,'\\n          <span class=\\\"hljs-comment\\\">;s$$$$$$$$$$$$$$$</span>\\n          $$$$$$$$$$$$$$$$$$\\n         $$$$P<span class=\\\"hljs-string\\\">\\\"\\\"</span>Y$$$Y<span class=\\\"hljs-string\\\">\\\"\\\"</span>W$$$$$      -{ Happy Camping! }\\n         $$$$  p<span class=\\\"hljs-string\\\">\\\"$$$\\\"</span>q  $$$$$\\n         $$$$  .$$$$$.  $$$$\\n          $$DcaU$$$$$$$$$$\\n            <span class=\\\"hljs-string\\\">\\\"Y$$$\\\"</span>*<span class=\\\"hljs-string\\\">\\\"$$$Y\\\"</span>    \\n                <span class=\\\"hljs-string\\\">\\\"$b.$$\\\"</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Factorialize-a-Number/index.md\n ** module id = 314\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Factorialize-a-Number/index.md?");

