	eval("module.exports = {\"title\":\"Bonfire Falsy Bouncer\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/GluUbAz.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Problem Explanation:</h1>\\n<p>Remove all <a href=\\\"https://freecodecamp.com/wiki/docs/js-falsy\\\">falsy</a> values from an array.</p>\\n<h2>Hint: 1</h2>\\n<p>Falsy is something which evaluates to FALSE. There are only six falsy values in JavaScript: undefined, null, NaN, 0, “” (empty string), and false of course.</p>\\n<h2>Hint: 2</h2>\\n<p>We need to make sure we have all the falsy values to compare, we can know it, maybe with a function with all the falsy values…</p>\\n<h2>Hint: 3</h2>\\n<p>Then we need to add a <code>filter()</code> with the falsy values function…</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Solution Code:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">bouncer</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Don't show a false ID to this bouncer.</span>\\n  <span class=\\\"hljs-comment\\\">// I've a hammer fist.</span>\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.filter(<span class=\\\"hljs-built_in\\\">Boolean</span>);\\n}\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">bouncer</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isTruthy</span>(<span class=\\\"hljs-params\\\">arg</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">Boolean</span>(arg);\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> filteredArray = arr.filter(isTruthy);\\n  <span class=\\\"hljs-keyword\\\">return</span> filteredArray;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>The <code>Array.prototype.filter</code> method expects a function that returns a <code>Boolean</code> value which takes a single argument and returns <code>true</code> for <a href=\\\"https://freecodecamp.com/wiki/docs/js-truthy\\\">truthy</a> value or <code>false</code> for <a href=\\\"https://freecodecamp.com/wiki/docs/js-falsy\\\">falsy</a> value. Hence we pass the built-in <code>Boolean</code> function.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @renelis @abhisekp @Rafase282 for your help with Bonfire: Falsy Bouncer</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Falsy-Bouncer/index.md\n ** module id = 315\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Falsy-Bouncer/index.md?");

