	eval("module.exports = {\"title\":\"Bonfire Finders Keepers\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>The problem is quite simple to understand. You will check for each element in the array that is passed in the first argument, if the element plugged in to the function passed as the second argument returns true the first time. We do not care about the second or third one that is true, only the very first one if any. If there are none, then return undefined. This last bit is not explained but it is part of the tests used.</p>\\n<h2>Hint: 1</h2>\\n<p>You can use the function directly from the parameter, no need to rename it or anything.</p>\\n<h2>Hint: 2</h2>\\n<p>You need to pass an element and record it if the function returns true, for this you just have to pass the element as the parameter for the function.</p>\\n<h2>Hint: 3</h2>\\n<p>If no element satisfy the function then you must return <strong>undefined</strong></p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">find</span>(<span class=\\\"hljs-params\\\">arr, func</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Make num undefined by default</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> num;\\n\\n  <span class=\\\"hljs-comment\\\">// Loop thorugh the array and use the function to check</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> a = <span class=\\\"hljs-number\\\">0</span>; a &lt; arr.length; a++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (func(arr[a])) {\\n      <span class=\\\"hljs-comment\\\">// Store the first case and break the loop</span>\\n      num = arr[a];\\n      <span class=\\\"hljs-keyword\\\">return</span> num;\\n    }\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">// otherwise return undefined</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> num;\\n}\\n\\nfind([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>], <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> num % <span class=\\\"hljs-number\\\">2</span> === <span class=\\\"hljs-number\\\">0</span>;\\n});\\n</code></pre>\\n<h2>Another Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">find</span>(<span class=\\\"hljs-params\\\">arr, func</span>) </span>{\\n  filterArr = arr.filter(func); <span class=\\\"hljs-comment\\\">//filter array with the function provided</span>\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> filterArr[<span class=\\\"hljs-number\\\">0</span>]; <span class=\\\"hljs-comment\\\">//return the first element that returns true, or undefined if no elements return true</span>\\n}\\n\\nfind([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>], <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">num</span>)</span>{ <span class=\\\"hljs-keyword\\\">return</span> num % <span class=\\\"hljs-number\\\">2</span> === <span class=\\\"hljs-number\\\">0</span>; });\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>To make the code easier, create an undefined variable that will be returned.</li>\\n<li>Loop through the array to check for each element if it satisfy the function. This is done by passing the arr[index of the loop] as the parameter for the function from the second argument.</li>\\n<li>If true, then store the array element, and return it. This will stop the loop. No else needed.</li>\\n<li>If the loop was not broken and it has ended, then return <strong>num</strong> which by default is undefined. This means that none of the elements from the array satisfied the function.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @JamesKee for your help with Bonfire: Finders Keepers</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Finders-Keepers/index.md\n ** module id = 317\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Finders-Keepers/index.md?");

