	eval("module.exports = {\"title\":\"Bonfire Inventory Update\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>Look through an array of new products, in the format: <code>[quantity, name]</code></li>\\n<li>Return an array containing updated quantities for each item that already existed, and any new products</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>You need to work through each item of the new inventory to see if it exists in the current inventory or not.</li>\\n<li>Remember that the product name is stored as the second element of each sub-array: <code>arr2[0][1] = &quot;Bowling Ball&quot;</code></li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>If the item exists, you need to add the quantity from the new inventory</li>\\n<li>If the item doesn’t exist, you need to add the entire item</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Return the completed inventory in alphabetical order</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">inventory</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n\\n    <span class=\\\"hljs-comment\\\">// Variable for location of product</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> index;\\n\\n    <span class=\\\"hljs-comment\\\">// A helper method to return the index of a specified product (undefined if not found)</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> getProductIndex = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">name</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; <span class=\\\"hljs-keyword\\\">this</span>.length; i++) {\\n            <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">this</span>[i][<span class=\\\"hljs-number\\\">1</span>] === name) {\\n                <span class=\\\"hljs-keyword\\\">return</span> i;\\n            }\\n        }\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n    }\\n\\n    <span class=\\\"hljs-comment\\\">// For each item of the new Inventory</span>\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; arr2.length; i++) {\\n\\n        <span class=\\\"hljs-comment\\\">// Invoke our helper function using arr1 as this</span>\\n        index = getProductIndex.call(arr1, arr2[i][<span class=\\\"hljs-number\\\">1</span>]);\\n\\n        <span class=\\\"hljs-comment\\\">// If the item doesn't exist</span>\\n        <span class=\\\"hljs-keyword\\\">if</span> (index === <span class=\\\"hljs-literal\\\">undefined</span>) {\\n            <span class=\\\"hljs-comment\\\">// Push the entire item</span>\\n            arr1.push(arr2[i]);\\n        } <span class=\\\"hljs-keyword\\\">else</span> {\\n            <span class=\\\"hljs-comment\\\">// Add the new quantity of the current item</span>\\n            arr1[index][<span class=\\\"hljs-number\\\">0</span>] += arr2[i][<span class=\\\"hljs-number\\\">0</span>];\\n        }\\n\\n    }\\n\\n    <span class=\\\"hljs-comment\\\">// Sort alphabetically, by the product name of each item</span>\\n    arr1.sort(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">if</span> (a[<span class=\\\"hljs-number\\\">1</span>] &gt; b[<span class=\\\"hljs-number\\\">1</span>]) {\\n            <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">1</span>;\\n        }\\n        <span class=\\\"hljs-keyword\\\">if</span> (a[<span class=\\\"hljs-number\\\">1</span>] &lt; b[<span class=\\\"hljs-number\\\">1</span>]) {\\n            <span class=\\\"hljs-keyword\\\">return</span> -<span class=\\\"hljs-number\\\">1</span>;\\n        }\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0</span>;\\n    });\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> arr1;\\n}\\n</code></pre>\\n<h4>Second solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">inventory</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// All inventory must be accounted for or you're fired!</span>\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> index;\\n  <span class=\\\"hljs-keyword\\\">var</span> arrCurInvName = []; <span class=\\\"hljs-comment\\\">// Names of arr1's items</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> arrNeInvName = []; <span class=\\\"hljs-comment\\\">// Names of arr2's items</span>\\n\\n  <span class=\\\"hljs-comment\\\">// Same as using two for loops, this takes care of increasing the number of stock quantity.</span>\\n  arr1.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item1</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> arr2.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item2</span>) </span>{\\n      <span class=\\\"hljs-keyword\\\">if</span> (item1[<span class=\\\"hljs-number\\\">1</span>] === item2[<span class=\\\"hljs-number\\\">1</span>]) {\\n        item1[<span class=\\\"hljs-number\\\">0</span>] = item1[<span class=\\\"hljs-number\\\">0</span>] + item2[<span class=\\\"hljs-number\\\">0</span>]; <span class=\\\"hljs-comment\\\">//Increase number of stock</span>\\n      }\\n    });\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">// Get item's name for new Inventory</span>\\n  arr2.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>) </span>{\\n    arrNeInvName.push(item[<span class=\\\"hljs-number\\\">1</span>]);\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">// Get item's name for Current Inventory</span>\\n  arr1.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>) </span>{\\n    arrCurInvName.push(item[<span class=\\\"hljs-number\\\">1</span>]);\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">// Add new inventory items to current inventory.</span>\\n  arrNeInvName.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (arrCurInvName.indexOf(item) === -<span class=\\\"hljs-number\\\">1</span>) {\\n      index = arrNeInvName.indexOf(item);\\n      arr1.push(arr2[index]);\\n    }\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">// Sort the array alphabetically using the second element of the array as base.</span>\\n  arr1.sort(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">currItem, nextItem</span>) </span>{\\n\\n    <span class=\\\"hljs-comment\\\">//Ternary function to avoid using if else</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> currItem[<span class=\\\"hljs-number\\\">1</span>] &gt; nextItem[<span class=\\\"hljs-number\\\">1</span>] ? <span class=\\\"hljs-number\\\">1</span> : -<span class=\\\"hljs-number\\\">1</span>;\\n  });\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> arr1;\\n}\\n</code></pre>\\n<h4>Third solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">inventory</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> flag=<span class=\\\"hljs-number\\\">0</span>;\\n  arr2.forEach(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>)</span>{\\n    flag=<span class=\\\"hljs-number\\\">0</span>;\\n    arr1.forEach(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">list</span>)</span>{\\n        <span class=\\\"hljs-comment\\\">//If the product is already present, increase the quantity</span>\\n      <span class=\\\"hljs-keyword\\\">if</span>(item[<span class=\\\"hljs-number\\\">1</span>]===list[<span class=\\\"hljs-number\\\">1</span>]){ list[<span class=\\\"hljs-number\\\">0</span>]+=item[<span class=\\\"hljs-number\\\">0</span>]; flag=<span class=\\\"hljs-number\\\">1</span>;}\\n    });\\n    <span class=\\\"hljs-comment\\\">//If not already present, add the product</span>\\n    <span class=\\\"hljs-keyword\\\">if</span>(flag===<span class=\\\"hljs-number\\\">0</span>) arr1.push(item);\\n  });\\n  <span class=\\\"hljs-comment\\\">//Return the sorted inventory in alphabetical order wrt product name</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> arr1.sort(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{ \\n    <span class=\\\"hljs-keyword\\\">return</span> a[<span class=\\\"hljs-number\\\">1</span>] &gt; b[<span class=\\\"hljs-number\\\">1</span>] ? <span class=\\\"hljs-number\\\">1</span> : -<span class=\\\"hljs-number\\\">1</span>;\\n});\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h4>First solution</h4>\\n<ul>\\n<li>Start by creating a variable to store the index in.  Define variables outside of loops</li>\\n<li>Create a helper function to find the index of a product name</li>\\n<li>The helper function iterates through each element of the array that it is called on, until it can either find the name parameter, or if it cannot find it then returns undefined</li>\\n<li>Then, work through each item in the delivery, and set index to the result of invoking our helper function on the current inventory (IE: Search the new inventory for that product name, and return it’s index)</li>\\n<li>If we can’t find that product, then we can add the entire product (Name and quantity) to the current inventory</li>\\n<li>Otherwise, then we can add the quantity from the new inventory</li>\\n<li>Then we sort the array by the product name (<code>arr1[x][1]</code> holds the name)</li>\\n<li>Return the sorted array</li>\\n<li>For Solution two, the explanation is on the code. Feel free to use different components on each solution to create your own if you like.</li>\\n</ul>\\n<h4>Second and Third solutions</h4>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<h2>Related links</h2>\\n<ul>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Function/call\\\">Function.prototype.call</a></li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/sort\\\">Array.prototype.sort</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @guyjoseph @Rafase282 @anuragaryan for your help with Bonfire: Inventory Update</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Inventory-Update/index.md\n ** module id = 319\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Inventory-Update/index.md?");

