	eval("module.exports = {\"title\":\"Bonfire Make a Person\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>When I started the program I figured I just had to create the six functions mentioned in the details. However, it was not that simple. Creating them as a function was not the right way, I had to create them in a different way to make them a key.</p>\\n<p>There is also a tricky part as you need six keys no more or less, so at first I had the variable that store the original name as a key too which was wrong.</p>\\n<p>As for the usage of array, that is optional, you could also create new variable to hold the separated string if you wish but an array is easier to deal with as strings are immutable.</p>\\n<p>Read the instructions carefully, it is always a good hint in itself to run the code and check what the test results were so you know what to expect but do not fixate yourself on that. Once you understand what you need to do, this problem is very easy and straightforward.</p>\\n<h2>Hint: 1</h2>\\n<p>Use the <strong>this</strong> notation to create the keys instead of regular functions: This means instead of <code>var varName = function() {/*...*/}</code> you should use <code>this.varName = function() {/*...*/}</code></p>\\n<h2>Hint: 2</h2>\\n<p>The program has a test that checks for how many keys you used, they have to be exactly six, the six mentioned in the details section. This means if you need to work with variables, make them local and not a key: <code>this.fullName = firstAndLast;</code></p>\\n<h2>Hint: 3</h2>\\n<p>Often the code would not work the way you expect it due to wrong variable names, make sure to check that you spell them the right way. This happens to all of us at some point.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<p>Please try hard before you check this solution.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> Person = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">firstAndLast</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> fullName = firstAndLast;\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.getFirstName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> fullName.split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>)[<span class=\\\"hljs-number\\\">0</span>];\\n  };\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.getLastName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> fullName.split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>)[<span class=\\\"hljs-number\\\">1</span>];\\n  };\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.getFullName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> fullName;\\n  };\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.setFirstName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">name</span>) </span>{\\n    fullName = name + <span class=\\\"hljs-string\\\">\\\" \\\"</span> + fullName.split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>)[<span class=\\\"hljs-number\\\">1</span>];\\n  };\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.setLastName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">name</span>) </span>{\\n    fullName = fullName.split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>)[<span class=\\\"hljs-number\\\">0</span>] + <span class=\\\"hljs-string\\\">\\\" \\\"</span> + name;\\n  };\\n  \\n  <span class=\\\"hljs-keyword\\\">this</span>.setFullName = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">name</span>) </span>{\\n    fullName = name;\\n  };\\n};\\n\\n<span class=\\\"hljs-keyword\\\">var</span> bob = <span class=\\\"hljs-keyword\\\">new</span> Person(<span class=\\\"hljs-string\\\">'Bob Ross'</span>);\\nbob.getFullName();\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Create a variable that will make a copy of the full name that was passed as a parameter.</li>\\n<li>Then we can proceed to create the six methods needed and return what is asked for.</li>\\n<li>For the individual setters, we can use the split to turn the fullname into an array of first and last names and concatenate the unchanged portion of the name with what was passed as a parameter.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @ltegman for your help with Bonfire: Make a Person</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Make-a-Person/index.md\n ** module id = 320\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Make-a-Person/index.md?");

