	eval("module.exports = {\"title\":\"Bonfire Map the Debris\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/jSJ4E7L.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Problem Explanation:</h1>\\n<p>The first thing to do is to get familiar with what the program is for, for this I would suggest you check the Wikipedia link as that is very important and from where you can also get the formula for the conversion. The hardest part are finding the formula, implementing it and for some modifying objects by the key. However, something that is not very clear is the fact that your program has to be able to check for any number of objects in the array which is what is tested on the second part.</p>\\n<h2>Hint: 1</h2>\\n<p>The formula needed is: T = 2_pi _ sqrt(earthRadius + avgAlt to the cube / GM)</p>\\n<h2>Hint: 2</h2>\\n<p>Use Math.round() to round up to the next whole number as requested. Using Math.ceil() will let you pass the first test but fail the second one.</p>\\n<h2>Hint: 3</h2>\\n<p>Find out how to remove and add key to an object</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">orbitalPeriod</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> GM = <span class=\\\"hljs-number\\\">398600.4418</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> earthRadius = <span class=\\\"hljs-number\\\">6367.4447</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> a = <span class=\\\"hljs-number\\\">2</span> * <span class=\\\"hljs-built_in\\\">Math</span>.PI;\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = [];\\n  <span class=\\\"hljs-keyword\\\">var</span> getOrbPeriod = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> c = <span class=\\\"hljs-built_in\\\">Math</span>.pow(earthRadius + obj.avgAlt, <span class=\\\"hljs-number\\\">3</span>);\\n    <span class=\\\"hljs-keyword\\\">var</span> b = <span class=\\\"hljs-built_in\\\">Math</span>.sqrt(c / GM);\\n    <span class=\\\"hljs-keyword\\\">var</span> orbPeriod = <span class=\\\"hljs-built_in\\\">Math</span>.round(a * b);\\n    <span class=\\\"hljs-keyword\\\">delete</span> obj.avgAlt;\\n    obj.orbitalPeriod = orbPeriod;\\n    <span class=\\\"hljs-keyword\\\">return</span> obj;\\n  };\\n\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> elem <span class=\\\"hljs-keyword\\\">in</span> arr) {\\n    newArr.push(getOrbPeriod(arr[elem]));\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> newArr;\\n}\\n</code></pre>\\n<h4>Second solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">orbitalPeriod</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> GM = <span class=\\\"hljs-number\\\">398600.4418</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> earthRadius = <span class=\\\"hljs-number\\\">6367.4447</span>;\\n  \\n  <span class=\\\"hljs-comment\\\">//Looping through each key in arr object</span>\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> prop <span class=\\\"hljs-keyword\\\">in</span> arr){\\n    <span class=\\\"hljs-comment\\\">//formula  of orbital period https://en.wikipedia.org/wiki/Orbital_period here a = avgAlt+earthRadius</span>\\n    <span class=\\\"hljs-comment\\\">//Rounding off the orbital period value </span>\\n  <span class=\\\"hljs-keyword\\\">var</span> orbitalPer = <span class=\\\"hljs-built_in\\\">Math</span>.round(<span class=\\\"hljs-number\\\">2</span>*<span class=\\\"hljs-built_in\\\">Math</span>.PI*<span class=\\\"hljs-built_in\\\">Math</span>.sqrt(<span class=\\\"hljs-built_in\\\">Math</span>.pow(arr[prop].avgAlt+earthRadius,<span class=\\\"hljs-number\\\">3</span>)/GM));\\n  <span class=\\\"hljs-comment\\\">//deleting the avgAlt property </span>\\n  <span class=\\\"hljs-keyword\\\">delete</span> arr[prop].avgAlt;\\n  <span class=\\\"hljs-comment\\\">//adding orbitalPeriod property</span>\\n  arr[prop].orbitalPeriod = orbitalPer;\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\norbitalPeriod([{name : <span class=\\\"hljs-string\\\">\\\"sputnik\\\"</span>, avgAlt : <span class=\\\"hljs-number\\\">35873.5553</span>}]);\\n</code></pre>\\n<h4>Third solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">orbitalPeriod</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> GM = <span class=\\\"hljs-number\\\">398600.4418</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> earthRadius = <span class=\\\"hljs-number\\\">6367.4447</span>;\\n  <span class=\\\"hljs-comment\\\">// Loop through each item in the array arr</span>\\n  arr.forEach(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>)</span>{\\n    <span class=\\\"hljs-comment\\\">// Calculate the Orbital period value</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> tmp= <span class=\\\"hljs-built_in\\\">Math</span>.round(<span class=\\\"hljs-number\\\">2</span>*<span class=\\\"hljs-built_in\\\">Math</span>.PI*<span class=\\\"hljs-built_in\\\">Math</span>.sqrt(<span class=\\\"hljs-built_in\\\">Math</span>.pow(earthRadius+item.avgAlt,<span class=\\\"hljs-number\\\">3</span>)/GM));\\n    <span class=\\\"hljs-comment\\\">//Delete the avgAlt property</span>\\n    <span class=\\\"hljs-keyword\\\">delete</span> item.avgAlt;\\n    <span class=\\\"hljs-comment\\\">//Add orbitalPeriod property</span>\\n    item.orbitalPeriod=tmp;\\n  });\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h4>First solution</h4>\\n<ul>\\n<li>The GM and <code>earthRadius</code> is given to us.</li>\\n<li>To make the code easier to edit and read, I separated each part of the equation.</li>\\n<li>Create a new array to store the <code>orbPeriods</code>.</li>\\n<li>a is 2 times pi. The part that is a constant is on the global scope while the rest is part of a function.</li>\\n<li>Create a function that will do the required work for any amount of objects.</li>\\n<li>c is the power of <code>earthRadius</code> + the value of <code>avgAlt</code> to the cube.</li>\\n<li>b is the square root of c divided by GM.</li>\\n<li>Create <code>orbPeriod</code> to store the product of a &amp; b, with the ceiling function applied to round up to the next whole number.</li>\\n<li>Then we delete the key<code>avgAlt</code>, and add the new key and its value.</li>\\n</ul>\\n<h4>Second and Third solutions</h4>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @coded9 @anuragaryan for your help with Bonfire: Map the Debris</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Map-the-Debris/index.md\n ** module id = 321\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Map-the-Debris/index.md?");

