	eval("module.exports = {\"title\":\"Bonfire Meet Bonfire\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>This is very simple, they just want you to get familiar with how their Bonfires work.</p>\\n<h2>Hint: 1</h2>\\n<p>Read details.</p>\\n<h2>Hint: 2</h2>\\n<p>Did you read all the details?</p>\\n<h2>Hint: 3</h2>\\n<p>You need to change the return statement to what they ask.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">meetBonfire</span>(<span class=\\\"hljs-params\\\">argument</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Good luck!</span>\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"you can read this function's argument in the developer tools\\\"</span>, argument);\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n}\\n\\nmeetBonfire(<span class=\\\"hljs-string\\\">\\\"You can do this!\\\"</span>);\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>All you had to do was change from false to true.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 for your help with Bonfire: Meet Bonfire</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Meet-Bonfire/index.md\n ** module id = 322\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Meet-Bonfire/index.md?");

