	eval("module.exports = {\"title\":\"Bonfire Missing letters\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You will create a program that will find the missing letter from a string and add it. If there is not missing letter it will return undefined. There is currently no test case for it missing more than one letter, but if anything recursion can be implemented or a second or more calls to the same function as needed. Also the letters are always provided in order so there is no need to sort them.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>You will need to convert from character to ASCII code using the two methods provided in the description.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>You will have to check for the difference in ASCII code as they are in order. Using a chart would be very helpful.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will need to figure out where to insert the letter and how to do it, along with handling the case that there is not missing letter as it needs an specific return value.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<p>####First solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">fearNotLetter</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Create our variables.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> firstCharacter = str.charCodeAt(<span class=\\\"hljs-number\\\">0</span>);\\n  <span class=\\\"hljs-keyword\\\">var</span> valueToReturn = <span class=\\\"hljs-string\\\">''</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> secondCharacter = <span class=\\\"hljs-string\\\">''</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Function to find the missing letters</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> addCharacters = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">while</span> (a - <span class=\\\"hljs-number\\\">1</span> &gt; b) {\\n      b++;\\n      valueToReturn += <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(b);\\n    }\\n    <span class=\\\"hljs-keyword\\\">return</span> valueToReturn;\\n  };\\n\\n  <span class=\\\"hljs-comment\\\">// Check if letters are missing in between.</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> index = <span class=\\\"hljs-number\\\">1</span>; index &lt; str.length; index++) {\\n    secondCharacter = str.charCodeAt(index);\\n\\n    <span class=\\\"hljs-comment\\\">// Check if the diference in code is greater than one.</span>\\n    <span class=\\\"hljs-keyword\\\">if</span> (secondCharacter - firstCharacter &gt; <span class=\\\"hljs-number\\\">1</span>) {\\n      <span class=\\\"hljs-comment\\\">// Call function to missing letters</span>\\n      addCharacters(secondCharacter, firstCharacter);\\n    }\\n\\n    <span class=\\\"hljs-comment\\\">// Switch positions</span>\\n    firstCharacter = str.charCodeAt(index);\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">// Check whether to return undefined or the missing letters.</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (valueToReturn === <span class=\\\"hljs-string\\\">''</span>)\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n  <span class=\\\"hljs-keyword\\\">else</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> valueToReturn;\\n}\\n</code></pre>\\n<p>####Second solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">fearNotLetter</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  \\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; str.length; i++) {\\n    <span class=\\\"hljs-comment\\\">/* code of current character */</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> code = str.charCodeAt(i);\\n    \\n    <span class=\\\"hljs-comment\\\">/* if code of current character is not equal to first charcter + no of iteration\\n    hence character has been escaped*/</span>\\n    <span class=\\\"hljs-keyword\\\">if</span> ( code !== str.charCodeAt(<span class=\\\"hljs-number\\\">0</span>) + i) {\\n    \\n      <span class=\\\"hljs-comment\\\">/* if current character has escaped one character find previous char and return*/</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(code-<span class=\\\"hljs-number\\\">1</span>);\\n    }  \\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">undefined</span>;\\n}\\n</code></pre>\\n<p>####Third solution (Declarative)</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Adding this solution for the sake of avoiding using 'for' and 'while' loops.</span>\\n<span class=\\\"hljs-comment\\\">// See the explanation for reference as to why. It's worth the effort.</span>\\n\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">fearNotLetter</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> compare = str.charCodeAt(<span class=\\\"hljs-number\\\">0</span>), missing;\\n  \\n  str.split(<span class=\\\"hljs-string\\\">''</span>).map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">letter,index</span>)</span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (str.charCodeAt(index) == compare) { ++compare; }\\n    <span class=\\\"hljs-keyword\\\">else</span> { missing = <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(compare); }\\n  });\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> missing;\\n}\\n</code></pre>\\n<p>####Fourth solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">fearNotLetter</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> strArr = str.split(<span class=\\\"hljs-string\\\">''</span>);\\n  <span class=\\\"hljs-keyword\\\">var</span> missingChars = [], i = <span class=\\\"hljs-number\\\">0</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> nextChar = <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(strArr[i].charCodeAt(<span class=\\\"hljs-number\\\">0</span>)+<span class=\\\"hljs-number\\\">1</span>);\\n  <span class=\\\"hljs-keyword\\\">while</span> (i&lt;strArr.length - <span class=\\\"hljs-number\\\">1</span>) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (nextChar !== strArr[i+<span class=\\\"hljs-number\\\">1</span>]){\\n      missingChars.push(nextChar);\\n      nextChar = <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(nextChar.charCodeAt(<span class=\\\"hljs-number\\\">0</span>)+<span class=\\\"hljs-number\\\">1</span>);\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      i++;\\n      nextChar = <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(strArr[i].charCodeAt(<span class=\\\"hljs-number\\\">0</span>)+<span class=\\\"hljs-number\\\">1</span>);\\n    }\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> missingChars.join(<span class=\\\"hljs-string\\\">''</span>) === <span class=\\\"hljs-string\\\">''</span> ? <span class=\\\"hljs-literal\\\">undefined</span> : missingChars.join(<span class=\\\"hljs-string\\\">''</span>) ;\\n}\\n</code></pre>\\n<p>####Fifth solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">fearNotLetter</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> allChars = <span class=\\\"hljs-string\\\">''</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> notChars = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">RegExp</span>(<span class=\\\"hljs-string\\\">'[^'</span>+str+<span class=\\\"hljs-string\\\">']'</span>,<span class=\\\"hljs-string\\\">'g'</span>);\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i=<span class=\\\"hljs-number\\\">0</span>;allChars[allChars.length-<span class=\\\"hljs-number\\\">1</span>] !== str[str.length-<span class=\\\"hljs-number\\\">1</span>] ;i++)\\n    allChars += <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(str[<span class=\\\"hljs-number\\\">0</span>].charCodeAt(<span class=\\\"hljs-number\\\">0</span>)+i);\\n  <span class=\\\"hljs-keyword\\\">return</span> allChars.match(notChars) ? allChars.match(notChars).join(<span class=\\\"hljs-string\\\">''</span>) : <span class=\\\"hljs-literal\\\">undefined</span>;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>####First and second solutions:</p>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<p>####Third solution (Declarative):</p>\\n<ul>\\n<li>First we define variables to store the character code for the first letter in the string, and to store whatever missing letters we may find.</li>\\n<li>We turn the string to an array in order to map through it instead of using those nasty <code>for</code> and <code>whiles</code> (See <a href=\\\"http://www.sitepoint.com/quick-tip-stop-writing-loops-start-thinking-with-maps/\\\">this article</a> for refence as to why. And give it a serious try. Really… you’ll thank me for it.\\n(If you’re not sure how to <code>map</code>, you can review [Waypoint: Iterate over arrays with map] ](<a href=\\\"http://www.freecodecamp.com/challenges/waypoint-iterate-over-arrays-with-map\\\">http://www.freecodecamp.com/challenges/waypoint-iterate-over-arrays-with-map</a>) and <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/map\\\">MDN’s reference</a>).</li>\\n<li>As we <code>map</code> through our letters’ character codes, we go comparing with the one that should be in that position.</li>\\n<li>If the current letter matches, we move the comparison variable to its next position so we can compare on the next cycle.</li>\\n<li>if not, the missing letter will be assigned to the <code>missing</code> variable, which will be returned after the map is finished.</li>\\n</ul>\\n<p>####Fourth solution:</p>\\n<ul>\\n<li>Increase loop index only when you have found all the missing letters between current and next letter</li>\\n<li>Every time you find a missing letter push it to <code>missingchars</code></li>\\n</ul>\\n<p>####Fifth solution:</p>\\n<ul>\\n<li>Create a new String that consists all the letters in the range</li>\\n<li>Create a Regular Expression for anything except <code>str</code></li>\\n<li>Use <code>match()</code> to strip off the <code>str</code> letters from your newly created String</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @rohitnwn @sabahang @Hallaathrad for your help with Bonfire: Missing Letters</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Missing-letters/index.md\n ** module id = 323\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Missing-letters/index.md?");

