	eval("module.exports = {\"title\":\"Bonfire Mutations\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>Return true if the string in the first element of the array contains all of the letters of the string in the second element of the array…</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>If everything is lowercase it will be easier to compare.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Our strings might be easier to work with if they were arrays of characters.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>A loop might help. Use <code>indexOf()</code> to check if the letter of the second word is on the first.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h1>Code Solutions:</h1>\\n<p>####First solution (Procedural):</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">mutation</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> test = arr[<span class=\\\"hljs-number\\\">1</span>].toLowerCase();\\n  <span class=\\\"hljs-keyword\\\">var</span> target = arr[<span class=\\\"hljs-number\\\">0</span>].toLowerCase();\\n  <span class=\\\"hljs-keyword\\\">for</span> (i=<span class=\\\"hljs-number\\\">0</span>;i&lt;test.length;i++) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (target.indexOf(test[i]) &lt; <span class=\\\"hljs-number\\\">0</span>)\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n }\\n</code></pre>\\n<p>####Second Solution (Declarative):</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">mutation</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n <span class=\\\"hljs-keyword\\\">return</span> arr[<span class=\\\"hljs-number\\\">1</span>].toLowerCase()\\n              .split(<span class=\\\"hljs-string\\\">''</span>)\\n              .every(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">letter</span>)</span>{\\n                <span class=\\\"hljs-keyword\\\">return</span> arr[<span class=\\\"hljs-number\\\">0</span>].toLowerCase()\\n                             .indexOf(letter) != -<span class=\\\"hljs-number\\\">1</span>;\\n              });\\n}\\n</code></pre>\\n<h1>Code Explanations:</h1>\\n<p>####First solution (Procedural):\\nFirst we make the two strings in the array lowercase. <code>test</code> will hold what we are looking for in <code>target</code>.<br>\\nThen we loop through our test characters and if any of them is not found we <code>return false</code>.</p>\\n<p>If they are <em>all</em> found, the loop will finish without returning anything and we get to <code>return true</code>.</p>\\n<p>####Second solution (Declarative):</p>\\n<p>Grab the second string, lowercase and turn it into an array; then make sure <em>every</em> one of its <em>letters</em> is a part of the lowercased first string.</p>\\n<p><code>Every</code> will basically give you letter by letter to compare, which we do by using <code>indexOf</code> on the first string.\\n<code>indexOf</code> will give you -1 if the current <code>letter</code> is missing.\\nWe check that not to be the case, for if this happens even once <code>every</code> will be false.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @sxmxc @Rafase282 @anuragaryan @hallaathrad for your help with Bonfire: Mutations</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Mutations/index.md\n ** module id = 324\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Mutations/index.md?");

