	eval("module.exports = {\"title\":\"Bonfire No Repeats Please\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>\\n<p>This task requires us to look at each possible permutation of a string. This is best done using a recursion function. Being able to build a function which collects all permutations of a string is a common interview question, so there is no shortage of tutorials out there on how to do this, in many different code languages.</p>\\n</li>\\n<li>\\n<p>This task can still be daunting even after watching a tutorial. You will want to send each new use of the function  3 inputs: 1. a new string (or character array) that is being built, 2. a position in your new string that’s going to be filled next, and 3. an idea of what characters (more specifically positions) from the original string have yet to be used. The pseudo code will look something like this:</p>\\n<pre><code>var str = ???;\\nperm(current position <span class=\\\"hljs-keyword\\\">in</span> original <span class=\\\"hljs-type\\\">string</span>, what's been used <span class=\\\"hljs-keyword\\\">in</span> original <span class=\\\"hljs-type\\\">string</span>, current <span class=\\\"hljs-type\\\">string</span> build thus far){\\n<span class=\\\"hljs-keyword\\\">if</span>(current <span class=\\\"hljs-type\\\">string</span> <span class=\\\"hljs-keyword\\\">is</span> finished) {\\n  print current <span class=\\\"hljs-type\\\">string</span>;\\n}<span class=\\\"hljs-keyword\\\">else</span>{\\n  <span class=\\\"hljs-keyword\\\">for</span>(var i = <span class=\\\"hljs-number\\\">0</span>; i &lt; str.<span class=\\\"hljs-property\\\">length</span>; i++) {\\n    <span class=\\\"hljs-keyword\\\">if</span>(str[i] has <span class=\\\"hljs-keyword\\\">not</span> been used) {\\n      <span class=\\\"hljs-keyword\\\">put</span> str[i] <span class=\\\"hljs-keyword\\\">into</span> <span class=\\\"hljs-keyword\\\">the</span> current position;\\n      mark str[i] <span class=\\\"hljs-keyword\\\">as</span> used\\n      perm(current position <span class=\\\"hljs-keyword\\\">in</span> original <span class=\\\"hljs-type\\\">string</span>, what's been used <span class=\\\"hljs-keyword\\\">in</span> original <span class=\\\"hljs-type\\\">string</span>, current <span class=\\\"hljs-type\\\">string</span> build thus far)\\n      unmark str[i] <span class=\\\"hljs-keyword\\\">as</span> used because another branch <span class=\\\"hljs-keyword\\\">in</span> <span class=\\\"hljs-keyword\\\">the</span> tree <span class=\\\"hljs-keyword\\\">for</span> i + <span class=\\\"hljs-number\\\">1</span> will still likely use <span class=\\\"hljs-keyword\\\">it</span>;\\n    }\\n  }\\n}\\n}\\nperm(<span class=\\\"hljs-number\\\">0</span>, nothing used yet, empty new <span class=\\\"hljs-type\\\">string</span> (<span class=\\\"hljs-keyword\\\">or</span> array <span class=\\\"hljs-keyword\\\">the</span> same size <span class=\\\"hljs-keyword\\\">as</span> str);\\n</code></pre>\\n</li>\\n<li>\\n<p>Another way to think about this problem is to start from an empty space. Introduce the first letter to the space. This space will now contain the first sub-permutation. Here’s a diagram illustrating the idea:</p>\\n</li>\\n</ul>\\n<p><img src=\\\"http://i.imgur.com/zFm5gRx.png\\\" alt=\\\"diagram\\\"></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// An approach to introduce a new character to a permutation</span>\\n<span class=\\\"hljs-keyword\\\">var</span> ch = <span class=\\\"hljs-string\\\">'?'</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> source = [<span class=\\\"hljs-string\\\">'?'</span>, <span class=\\\"hljs-string\\\">'?'</span>, <span class=\\\"hljs-string\\\">'?'</span>];     <span class=\\\"hljs-comment\\\">// Current sub-permutation</span>\\n<span class=\\\"hljs-keyword\\\">var</span> temp, dest = [];\\n\\n<span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt;= source.length; ++i) {\\n    temp = source.slice(<span class=\\\"hljs-number\\\">0</span>);    <span class=\\\"hljs-comment\\\">// Copy the array</span>\\n    temp.splice(i, <span class=\\\"hljs-number\\\">0</span>, ch);    <span class=\\\"hljs-comment\\\">// Insert the new character</span>\\n    dest.push(temp);    <span class=\\\"hljs-comment\\\">// Store the new sub-permutation    </span>\\n}\\n</code></pre>\\n<p>Finding each permutation could then be done non-recursively by including the above in a function taking a source array and returning a destination array. For each letter of the input string, pass that character, as well as the array  returned from the previous call of the function.</p>\\n<p>A way to visualize this is by considering a tree that starts with the first character of your string: <img src=\\\"http://i.imgur.com/t8zNarc.png\\\" alt=\\\"Permutation Tree\\\"></p>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>The easiest way is to use Heap’s algorithm to recursively get a list of all the permutations.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Once you have the list then just create a regular expression to catch the repeating characters.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will want to have the permutations as an array of joined strings instead of separated characters.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">permAlone</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n\\n  <span class=\\\"hljs-comment\\\">// Create a regex to match repeated consecutive characters.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> regex = <span class=\\\"hljs-regexp\\\">/(.)\\\\1+/g</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Split the string into an array of characters.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> arr = str.split(<span class=\\\"hljs-string\\\">''</span>);\\n  <span class=\\\"hljs-keyword\\\">var</span> permutations = [];\\n  <span class=\\\"hljs-keyword\\\">var</span> tmp;\\n\\n  <span class=\\\"hljs-comment\\\">// FUnction to swap variables' content.</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">swap</span>(<span class=\\\"hljs-params\\\">index1, index2</span>) </span>{\\n    tmp = arr[index1];\\n    arr[index1] = arr[index2];\\n    arr[index2] = tmp;\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">//Generate arrays of permutations using the algorithm.</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">generate</span>(<span class=\\\"hljs-params\\\">int</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (int === <span class=\\\"hljs-number\\\">1</span>) {\\n      <span class=\\\"hljs-comment\\\">// Make sure to join the characters as we create  the permutation arrays</span>\\n      permutations.push(arr.join(<span class=\\\"hljs-string\\\">''</span>));\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i != int; ++i) {\\n        generate(int - <span class=\\\"hljs-number\\\">1</span>);\\n        swap(int % <span class=\\\"hljs-number\\\">2</span> ? <span class=\\\"hljs-number\\\">0</span> : i, int - <span class=\\\"hljs-number\\\">1</span>);\\n      }\\n    }\\n  }\\n\\n  generate(arr.length);\\n\\n  <span class=\\\"hljs-comment\\\">// Filter the array of repeated permutations.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> filtered = permutations.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">string</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> !string.match(regex);\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">//Return how many have no repetitions.</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> filtered.length;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Read comments in code</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Philosophist @Rafase282 for your help with Bonfire: No Repeats Please</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-No-Repeats-Please/index.md\n ** module id = 325\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-No-Repeats-Please/index.md?");

