	eval("module.exports = {\"title\":\"Bonfire Pairwise\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>The program should look for the numbers in the array which would add to make the number from the <strong>arg.</strong> Then instead of adding those numbers up, you will add their <strong>indices</strong> which is the reason why you get 11 on the example from detail.</p>\\n<p>Remember that arrays start at index 0 and go from there so from [1,4,2,3,0,5] if we switch to their indices it would be [0,1,2,3,4,5] then we add indices 1 + 2 + 3 + 5 and we get 11. That is what we need to return.</p>\\n<h2>Hint: 1</h2>\\n<p>Remember to return the smaller sum if multiple are possible. This means <code>[1,1,1],1 should use 0 + 1 instead of 0+1 &amp; 1 +1 , etc</code></p>\\n<h2>Hint: 2</h2>\\n<p>Try using an array of indices to track when an index has been used or not.</p>\\n<h2>Hint: 3</h2>\\n<p>It is easy to confuse indices as being numbers, but since you will be interacting with them, make sure to work with them as integers to prevent the code from behaving erratically.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">pairwise</span>(<span class=\\\"hljs-params\\\">arr, arg</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Create empty array to keep the arrays we will add.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> index = [];\\n\\n  <span class=\\\"hljs-comment\\\">// Loop to check the first number.</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> a <span class=\\\"hljs-keyword\\\">in</span> arr) {\\n    <span class=\\\"hljs-comment\\\">// temporal first number.</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> temp = arr[a];\\n\\n    <span class=\\\"hljs-comment\\\">// Second loop to check against the first number.</span>\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">1</span>; i &lt; arr.length; i++) {\\n      <span class=\\\"hljs-comment\\\">// temporal secodn number.</span>\\n      <span class=\\\"hljs-keyword\\\">var</span> temp2 = arr[i];\\n\\n      <span class=\\\"hljs-comment\\\">// Key element, this check to make sure that the numbers add to arg</span>\\n      <span class=\\\"hljs-comment\\\">// also that the second index is greater than the first, and that neither</span>\\n      <span class=\\\"hljs-comment\\\">// of those indices are already on the array.</span>\\n      <span class=\\\"hljs-keyword\\\">if</span> (temp + temp2 === arg &amp;&amp; i &gt; a &amp;&amp; index.indexOf(+a) === -<span class=\\\"hljs-number\\\">1</span> &amp;&amp; index.indexOf(+i) === -<span class=\\\"hljs-number\\\">1</span>) {\\n        <span class=\\\"hljs-comment\\\">// if true then add both indices as integers then stop checking to avoid repeats.</span>\\n        index.push(+a, +i);\\n        <span class=\\\"hljs-keyword\\\">break</span>;\\n      }\\n    }\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">// After the two loops are done, check if index is empty to return 0</span>\\n  <span class=\\\"hljs-comment\\\">// or if it is not, then use Array.reduce(callbackFunc) to returnt he sum</span>\\n  <span class=\\\"hljs-comment\\\">// of the numbers.</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (index.length &gt;= <span class=\\\"hljs-number\\\">1</span>) {\\n    <span class=\\\"hljs-keyword\\\">var</span> addAll = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n      <span class=\\\"hljs-keyword\\\">return</span> a + b;\\n    };\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> index.reduce(addAll);\\n  } <span class=\\\"hljs-keyword\\\">else</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0</span>;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>First I create an empty array to store the indices that i will be adding.</li>\\n<li>Then I create an outer loop to get the first number.</li>\\n<li>Then get the second number from another inner loop.</li>\\n<li>Then I check to make sure that the two numbers add to arg that was passed as a parameter to the function; we also have to make sure the index from the second loop is grater than the one from the first loop to avoid adding wrong indices. We also have to check to make sure the indices are not already part of the <strong>index</strong> array.</li>\\n<li>If all that is true, then we add the two indices as integer by using ‘+’ or parseInt(), and then we stop the inner loop since everything else would be redundant and wrong.</li>\\n<li>After all the loops are over, check in <strong>index</strong> is empty, if it is then return 0, otherwise return the addition of all the integers in it using Array.reduce(callbackFunc) to return the sum of the numbers.</li>\\n<li></li>\\n</ul>\\n<p>##Another Solution</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">pairwise</span>(<span class=\\\"hljs-params\\\">arr, arg</span>) </span>{\\n <span class=\\\"hljs-comment\\\">//Set sum of indices to zero</span>\\n <span class=\\\"hljs-keyword\\\">var</span> sum = <span class=\\\"hljs-number\\\">0</span>;\\n <span class=\\\"hljs-comment\\\">//looping from first element</span>\\n  <span class=\\\"hljs-keyword\\\">for</span>(i=<span class=\\\"hljs-number\\\">0</span>;i&lt;arr.length;i++){\\n  <span class=\\\"hljs-comment\\\">//Looping from second element by setting first element  constant</span>\\n <span class=\\\"hljs-keyword\\\">for</span>(j=i+<span class=\\\"hljs-number\\\">1</span>;j&lt;arr.length;j++){\\n <span class=\\\"hljs-comment\\\">//Check whether the sum is equal to arg</span>\\n   <span class=\\\"hljs-keyword\\\">if</span>(arr[i]+arr[j] ==arg){\\n   <span class=\\\"hljs-comment\\\">//Add the indices</span>\\n     sum += i+j;\\n     <span class=\\\"hljs-comment\\\">//Set the indices to NaN so that they can't be used in next iteration</span>\\n     arr[i] =arr[j] = <span class=\\\"hljs-literal\\\">NaN</span>;\\n    }\\n   } \\n  }\\n <span class=\\\"hljs-keyword\\\">return</span> sum;\\n}\\npairwise([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">1</span>], <span class=\\\"hljs-number\\\">2</span>);\\n</code></pre>\\n<p>#Code explanation in comments</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @coded9 @SaintPeter for your help with Bonfire: Pairwise</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Pairwise/index.md\n ** module id = 326\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Pairwise/index.md?");

