	eval("module.exports = {\"title\":\"Bonfire Pig Latin\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You need to create a program that will translate from English to Pig Latin. Check the instructions for converting to Pig Latin from the initial description or the wiki page. It might not be obvious but you need to remove all the consonants up to the first vowel in the case there letter does not start with a vowel.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>You will probably want to use regular expressions. This will allow you to convert the words easily.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>If the first character is a vowel, then take that whole word and add ‘way’ at the end. Otherwise comes the tricky part, take the consonant(s) before the first vowel and move it to the end and add ‘ay’. This is where I had trouble since it was not clear that it was not just the first consonant but all of them before the first vowel.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will need to use everything you know about string manipulation to get the last part right. However, it can be done with <code>substr</code> alone.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">translate</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Create variables to be used</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> pigLatin = <span class=\\\"hljs-string\\\">''</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> regex = <span class=\\\"hljs-regexp\\\">/[aeiou]/gi</span>;\\n  \\n  <span class=\\\"hljs-comment\\\">// Check if the first character is a vowel</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (str[<span class=\\\"hljs-number\\\">0</span>].match(regex)) {\\n    pigLatin = str + <span class=\\\"hljs-string\\\">'way'</span>;\\n  \\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    \\n    <span class=\\\"hljs-comment\\\">// Find how many consonants before the first vowel.</span>\\n    <span class=\\\"hljs-keyword\\\">var</span> vowelIndice = str.indexOf(str.match(regex)[<span class=\\\"hljs-number\\\">0</span>]);\\n    \\n    <span class=\\\"hljs-comment\\\">// Take the string from the first vowel to the last char</span>\\n    <span class=\\\"hljs-comment\\\">// then add the consonants that were previously omitted and add the ending.</span>\\n    pigLatin = str.substr(vowelIndice) + str.substr(<span class=\\\"hljs-number\\\">0</span>, vowelIndice) + <span class=\\\"hljs-string\\\">'ay'</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> pigLatin;\\n}\\n</code></pre>\\n<h4>Second solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">translate</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">//finding all the consonants in the beginning of the str. </span>\\n  <span class=\\\"hljs-comment\\\">//by using &amp;&amp; below I'm achiving a concept called Intersection of Regular Expressions</span>\\n  <span class=\\\"hljs-comment\\\">//where your pattern finds the union of two or more RegEx rules. </span>\\n  <span class=\\\"hljs-comment\\\">//In Java you can achive this with RegEx special character '&amp;&amp;' </span>\\n  <span class=\\\"hljs-comment\\\">//but in Javascript you can use the following instead. </span>\\n  <span class=\\\"hljs-comment\\\">//Credit goes to http://stackoverflow.com/q/6595477</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> consChars = str.match(<span class=\\\"hljs-regexp\\\">/^[a-z]/</span>) &amp;&amp; str.match(<span class=\\\"hljs-regexp\\\">/[^aeiou]*/</span>).join(<span class=\\\"hljs-string\\\">''</span>);\\n  \\n  <span class=\\\"hljs-comment\\\">//if no consonants found (i.e. str starts with vowels)</span>\\n  <span class=\\\"hljs-comment\\\">//use replace to remove consonants and construct newStr else add 'way' in the end</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (consChars !== <span class=\\\"hljs-string\\\">''</span>){\\n    newStr = str.replace(consChars, <span class=\\\"hljs-string\\\">''</span>) + consChars + <span class=\\\"hljs-string\\\">\\\"ay\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    newStr = str + <span class=\\\"hljs-string\\\">\\\"way\\\"</span>;\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> newStr;\\n}\\n</code></pre>\\n<h4>Third solution</h4>\\n<pre><code class=\\\"language-js\\\">\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">translate</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> strArr = [];\\n    <span class=\\\"hljs-keyword\\\">var</span> tmpChar;\\n    \\n    <span class=\\\"hljs-comment\\\">// check if the char is consonant using RegEx</span>\\n    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isConsonant</span>(<span class=\\\"hljs-params\\\">char</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">return</span> !<span class=\\\"hljs-regexp\\\">/[aeiou]/</span>.test(char);\\n    }\\n    \\n    <span class=\\\"hljs-comment\\\">// return initial str + \\\"way\\\" if it starts with vowel </span>\\n    <span class=\\\"hljs-comment\\\">// if not - convert str to array</span>\\n    <span class=\\\"hljs-keyword\\\">if</span> (!isConsonant(str.charAt(<span class=\\\"hljs-number\\\">0</span>)))\\n        <span class=\\\"hljs-keyword\\\">return</span> str + <span class=\\\"hljs-string\\\">\\\"way\\\"</span>;\\n    <span class=\\\"hljs-keyword\\\">else</span> \\n        strArr = str.split(<span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n        \\n    <span class=\\\"hljs-comment\\\">// push all consonats to the end of the array</span>\\n    <span class=\\\"hljs-keyword\\\">while</span> (isConsonant(strArr[<span class=\\\"hljs-number\\\">0</span>])) {\\n        tmpChar = strArr.shift();\\n        strArr.push(tmpChar);\\n    }\\n <span class=\\\"hljs-comment\\\">// convert array to string and concatenate \\\"ay\\\" at the end  </span>\\n <span class=\\\"hljs-keyword\\\">return</span> strArr.join(<span class=\\\"hljs-string\\\">\\\"\\\"</span>)+<span class=\\\"hljs-string\\\">\\\"ay\\\"</span>;\\n}\\n\\ntranslate(<span class=\\\"hljs-string\\\">\\\"consonant\\\"</span>);\\n</code></pre>\\n<h4>Fourth Solution (recursive and declarative)</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">translate</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">check</span>(<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n  \\t<span class=\\\"hljs-keyword\\\">return</span> [<span class=\\\"hljs-string\\\">'a'</span>,<span class=\\\"hljs-string\\\">'i'</span>,<span class=\\\"hljs-string\\\">'u'</span>,<span class=\\\"hljs-string\\\">'e'</span>,<span class=\\\"hljs-string\\\">'o'</span>].indexOf(str.charAt(obj)) == -<span class=\\\"hljs-number\\\">1</span> ?\\n      \\t\\t\\t\\t\\t\\t\\t\\t\\t\\t  check(obj+<span class=\\\"hljs-number\\\">1</span>) : obj;}\\n      \\t\\t\\t\\t\\t\\t\\t\\t\\t\\t  \\n  <span class=\\\"hljs-keyword\\\">return</span> str.substr(check(<span class=\\\"hljs-number\\\">0</span>))\\n            .concat((check(<span class=\\\"hljs-number\\\">0</span>) === <span class=\\\"hljs-number\\\">0</span> ? \\n                        <span class=\\\"hljs-string\\\">'w'</span> : str.substr(<span class=\\\"hljs-number\\\">0</span>, check(<span class=\\\"hljs-number\\\">0</span>))) \\n                        + <span class=\\\"hljs-string\\\">'ay'</span>);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>####First-Third solution:</p>\\n<ul>\\n<li>Read comments on code.</li>\\n</ul>\\n<h4>Fourth solution (recursive and declarative)</h4>\\n<p>Let’s start with a recursive function that will go checking for the first letter of the string to be in an <em>array of vowels</em>. In case of consonants, call itself on the next characters until finding the first vowel. It’ll return the index of whatever it finds to be the last initial consonant. (i.e. Schmidtsville’s would be 3).</p>\\n<p>Then we’ll grab our string, remove the letters up until that index, concatenate either that same chunk of removed string or <code>w</code> accordingly, and then <code>ay</code> regardless.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @sabahang @aganita @Hallaathrad for your help with Bonfire: Pig Latin</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Pig-Latin/index.md\n ** module id = 327\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Pig-Latin/index.md?");

