	eval("module.exports = {\"title\":\"Bonfire Repeat a String Repeat a String\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>The program is very simple, we have to take a variable and return that variable being repeated certain amount of times. No need to add space or anything, just keep repeating it into one single string.</p>\\n<h2>Hint: 1</h2>\\n<p>You can’t edit strings, you will need to create a variable to store the new string.</p>\\n<h2>Hint: 2</h2>\\n<p>Create a loop to repeat the code as many times as needed.</p>\\n<h2>Hint: 3</h2>\\n<p>Make the variable created store the current value and append the word to it.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<p>####First Solution</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">repeat</span>(<span class=\\\"hljs-params\\\">str, num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> accumulatedStr = <span class=\\\"hljs-string\\\">''</span>;\\n\\n  <span class=\\\"hljs-keyword\\\">while</span> (num &gt; <span class=\\\"hljs-number\\\">0</span>) {\\n    accumulatedStr += str;\\n    num--;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> accumulatedStr;\\n}\\n</code></pre>\\n<p>####Second Solution</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">repeat</span>(<span class=\\\"hljs-params\\\">str, num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> newstr = [];\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; num; i++) {\\n    newstr.push(str);\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> newstr.join(<span class=\\\"hljs-string\\\">''</span>);\\n}\\n\\nrepeat(<span class=\\\"hljs-string\\\">\\\"abc\\\"</span>, <span class=\\\"hljs-number\\\">3</span>);\\n</code></pre>\\n<p>####Third Solution\\n(using Recursion)</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">repeat</span>(<span class=\\\"hljs-params\\\">str, num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span>(num &lt; <span class=\\\"hljs-number\\\">0</span>)\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\n  <span class=\\\"hljs-keyword\\\">if</span>(num === <span class=\\\"hljs-number\\\">1</span>)\\n    <span class=\\\"hljs-keyword\\\">return</span> str;\\n  <span class=\\\"hljs-keyword\\\">else</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> str + repeat(str, num - <span class=\\\"hljs-number\\\">1</span>);\\n}\\n</code></pre>\\n<p>####Fourth Solution\\n(Declarative approach)</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">repeat</span>(<span class=\\\"hljs-params\\\">str, num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> num &gt;= <span class=\\\"hljs-number\\\">0</span> ? str.repeat(num) : <span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\n}\\n\\nrepeat(<span class=\\\"hljs-string\\\">\\\"abc\\\"</span>, <span class=\\\"hljs-number\\\">3</span>);\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>####First and Second solutions</p>\\n<ul>\\n<li>Create a variable to store the repeated word.</li>\\n<li>Use a while loop or for loop to repeat code as many times as needed according to <code>num</code></li>\\n<li>Then we just have to add the string to the variable created on step one. and increase or decrease num depending on how you set the loop.</li>\\n<li>At the end of the loop, return the variable for the repeated word.</li>\\n</ul>\\n<p>####Third solution\\n(using recursiveness)</p>\\n<ul>\\n<li>We check if <code>num</code> is a negative and return an empty string if true.</li>\\n<li>Then we check if it’s equal to 1 and in that case we return the string itself.</li>\\n<li>If not, we add the string to a call of our function with <code>num</code> being decreased by 1, which will add another <code>str</code> and another until eventually <code>num</code> is 1. And return that whole process.</li>\\n</ul>\\n<p>####Fourth solution\\n(Declarative approach)</p>\\n<ul>\\n<li>This solution is somewhat similar to the third solution, except it uses the ternary operator form of the <code>if</code> statement.</li>\\n<li>The conditional’s first statement (in this case our checking whether <code>num</code> is a negative number) is followed by <code>?</code>.</li>\\n<li>The next statement is what to execute, or in our case return, when the condition evaluates to true.</li>\\n<li>The final statement is what to execute, or again in our case return, if the initial statement evaluates to false.</li>\\n<li>In between the two statements for true and false, you use a colon <code>:</code> to indicate the separation.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @shadowfool @Hallaathrad @sgalizia for your help with Bonfire: Repeat a String Repeat a String</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Repeat-a-String-Repeat-a-String/index.md\n ** module id = 328\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Repeat-a-String-Repeat-a-String/index.md?");

