	eval("module.exports = {\"title\":\"Bonfire Return Largest Numbers in Arrays\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>You will get an array that contains sub arrays of numbers and you need to return an array with the largest number from each of the sub arrays.</p>\\n<h2>Hint: 1</h2>\\n<p>You will need to keep track of the array with the answer and the largest number of each sub-array.</p>\\n<h2>Hint: 2</h2>\\n<p>You can work with multidimensional arrays by <code>Array[Index][SubIndex]</code></p>\\n<h2>Hint: 3</h2>\\n<p>Pay close attention to the timing of the storing of variables when working with loops</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solutions ahead!</strong></p>\\n<h4>First solution</h4>\\n<p>(Procedural approach)</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">largestOfFour</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> results = [];\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> n = <span class=\\\"hljs-number\\\">0</span>; n &lt; arr.length; n++) {\\n    <span class=\\\"hljs-keyword\\\">var</span> largestNumber = <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> sb = <span class=\\\"hljs-number\\\">0</span>; sb &lt; arr[n].length; sb++) {\\n      <span class=\\\"hljs-keyword\\\">if</span> (arr[n][sb] &gt; largestNumber) {\\n        largestNumber = arr[n][sb];\\n      }\\n    }\\n\\n    results[n] = largestNumber;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> results;\\n}\\n</code></pre>\\n<h4>Second solution</h4>\\n<p>(Declarative approach)</p>\\n<blockquote>\\n<p>NOTE: This is an advanced solution. NOT FOR BEGINNERS.</p>\\n</blockquote>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">largestOfFour</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.map(<span class=\\\"hljs-built_in\\\">Function</span>.apply.bind(<span class=\\\"hljs-built_in\\\">Math</span>.max, <span class=\\\"hljs-literal\\\">null</span>));\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h4>First Solution</h4>\\n<p>(Procedural approach)</p>\\n<ul>\\n<li>Create a variable to store the <em>results</em> as an array.</li>\\n<li>Create an outer loop to iterate through the outer array.</li>\\n<li>Create a second variable to hold the largest number. This must be outside an inner loop so it won’t be reassigned until we find a larger number.</li>\\n<li>Create said inner loop to work with the sub-arrays.</li>\\n<li>Check if the element of the sub array is larger than the currently stored largest number. If so, then update the number in the variable.</li>\\n<li>After the inner loop, save the largest number in the corresponding position inside of the <code>results</code> array.</li>\\n<li>And finally return said array.</li>\\n</ul>\\n<h4>Second Solution</h4>\\n<p>(Declarative approach)</p>\\n<blockquote>\\n<p>TL;DR: **We build a special callback function (using the <code>Function.bind</code> method), that works just like <code>Math.max</code> but also has <code>Function.apply</code>'s ability to take arrays as its arguments ** :smiley:</p>\\n</blockquote>\\n<ul>\\n<li>\\n<p>We start by mapping through the elements inside the main array. Meaning each one of the inner arrays.</p>\\n</li>\\n<li>\\n<p>Now the need a callback function to find the max of each inner array provided by the map.<br>So we want to create a function that does the work of <code>Math.max</code> and accepts input as an array (which by it doesn’t by default).<br><br>In other words, it would be really nice and simple if this worked by itself:\\n<code>Math.max([9, 43, 20, 6]); // Resulting in 43</code><br>Alas, it doesn’t.</p>\\n</li>\\n<li>\\n<p>To do the work of accepting arguments in the shape of an array, there is this <code>Function.apply</code> method, but it complicates things a bit by <em>invoking</em> the <em>context</em> function.<br>\\ni.e. <code>Math.max.apply(null, [9, 43, 20, 6]);</code> would invoke something like a <code>Max.max</code> method. What we’re looking for… almost.</p>\\n</li>\\n</ul>\\n<blockquote>\\n<p>Here we’re passing <code>null</code> as the <em>context</em> of the <code>Function.apply</code> method as <code>Math.max</code> doesn’t need any context.</p>\\n</blockquote>\\n<ul>\\n<li>\\n<p>Since <code>arr.map</code> expects a callback function, not just an expression, we create a function out of the previous expression by using the <code>Function.bind</code> method.</p>\\n</li>\\n<li>\\n<p>Since, <code>Function.apply</code> is a static <em>method</em> of the same <code>Function</code> <em>object</em>, we can call <code>Function.prototype.bind</code> on <code>Function.apply</code> i.e. <code>Function.apply.bind</code>.</p>\\n</li>\\n<li>\\n<p>Now we pass the <em>context</em> for the <code>Function.apply.bind</code> call (in this case we want <code>Math.max</code>so we can gain its functionality).</p>\\n</li>\\n<li>\\n<p>Since the embedded <code>Function.apply</code> method will also require a context as it’s 1st argument, we need to pass it a bogus <em>context</em>.</p>\\n<ul>\\n<li>So, we pass <code>null</code> as the 2nd param to <code>Function.apply.bind</code> which gives a <em>context</em> to the <code>Math.max</code> method.</li>\\n<li>Since, <code>Math.max</code> is independent of any <em>context</em>, hence, it ignores the bogus <em>context</em> given by <code>Function.apply</code> method call.</li>\\n<li>Thus, our <code>Function.apply.bind(Math.max, null)</code> makes a new function accepting the <code>arr.map</code> values i.e. the inner arrays.</li>\\n</ul>\\n</li>\\n</ul>\\n<p><em>Bien noté</em>? :neutral_face:</p>\\n<p><strong>Reference:-</strong></p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+Math+max\\\">http://devdocs.io/#q=js+Math+max</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+Array+map\\\">http://devdocs.io/#q=js+Array+map</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+Function+apply\\\">http://devdocs.io/#q=js+Function+apply</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+Function+bind\\\">http://devdocs.io/#q=js+Function+bind</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @abhisekp @Hallaathrad for your help with Bonfire: Return Largest Numbers in Arrays</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Return-Largest-Numbers-in-Arrays/index.md\n ** module id = 329\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Return-Largest-Numbers-in-Arrays/index.md?");

