	eval("module.exports = {\"title\":\"Bonfire Reverse a String\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<p>We need to take the string and reverse it, so if it originally reads ‘hello’, it will now read ‘olleh’. We will need to split the string, and therefore we will be working with Arrays as well.</p>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Start by splitting the string by characters.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Look up the built in function to reverse a string.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Do not forget to join the characters back together after you reverse them.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">reverseString</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> str.split(<span class=\\\"hljs-string\\\">''</span>).reverse().join(<span class=\\\"hljs-string\\\">''</span>);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>\\n<p>Our goal is to take the input, <code>str</code>, and return it in reverse. Our first step is to split the string by characters using <code>split('')</code>. Notice that we don’t leave anything in between the single quotes, this tells the function to split the string by each character.</p>\\n</li>\\n<li>\\n<p>Using the <code>split()</code> function will turn our string into an array of characters, keep that in mind as we move forward.</p>\\n</li>\\n<li>\\n<p>Next we <em>chain</em> the <code>reverse()</code> function, which takes our array of characters and reverses them.</p>\\n</li>\\n<li>\\n<p>Finally, we <em>chain</em> <code>join('')</code> to put our characters back together into a string. Notice once again that we left no spaces in the argument for join, this makes sure that the array of characters is joined back together by each character.</p>\\n</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 for your help with Bonfire: Reverse a String</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Reverse-a-String/index.md\n ** module id = 330\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Reverse-a-String/index.md?");

