	eval("module.exports = {\"title\":\"Bonfire Roman Numeral Converter\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You will create a program that converts an integer to a roman numeral.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Creating an array with the Roman Numerals and one with the decimal equivalent for the new forms will be very helpful.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>If you add the numbers that go before the new letter is introduced, it will save you plenty of code, like values for 4, 9, and 40.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You can’t have more than three consecutive Roman numerals together.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h1>Code Solution:</h1>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> convert = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n\\n  <span class=\\\"hljs-comment\\\">// Create arrays with default conversion with matching indices.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> decimalValue = [ <span class=\\\"hljs-number\\\">1000</span>, <span class=\\\"hljs-number\\\">900</span>, <span class=\\\"hljs-number\\\">500</span>, <span class=\\\"hljs-number\\\">400</span>, <span class=\\\"hljs-number\\\">100</span>, <span class=\\\"hljs-number\\\">90</span>, <span class=\\\"hljs-number\\\">50</span>, <span class=\\\"hljs-number\\\">40</span>, <span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">9</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">1</span> ];\\n  <span class=\\\"hljs-keyword\\\">var</span> romanNumeral = [ <span class=\\\"hljs-string\\\">'M'</span>, <span class=\\\"hljs-string\\\">'CM'</span>, <span class=\\\"hljs-string\\\">'D'</span>, <span class=\\\"hljs-string\\\">'CD'</span>, <span class=\\\"hljs-string\\\">'C'</span>, <span class=\\\"hljs-string\\\">'XC'</span>, <span class=\\\"hljs-string\\\">'L'</span>, <span class=\\\"hljs-string\\\">'XL'</span>, <span class=\\\"hljs-string\\\">'X'</span>, <span class=\\\"hljs-string\\\">'IX'</span>, <span class=\\\"hljs-string\\\">'V'</span>, <span class=\\\"hljs-string\\\">'IV'</span>, <span class=\\\"hljs-string\\\">'I'</span> ];\\n\\n  <span class=\\\"hljs-comment\\\">//empty string variable for the final roman number</span>\\n  \\n  <span class=\\\"hljs-keyword\\\">var</span> romanized = <span class=\\\"hljs-string\\\">''</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Loop through the indices of the decimalValue array.</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> index = <span class=\\\"hljs-number\\\">0</span>; index &lt; decimalValue.length; index++) {\\n    <span class=\\\"hljs-comment\\\">// Continue to loop while the value at the current index will fit into numCopy</span>\\n    <span class=\\\"hljs-keyword\\\">while</span> (decimalValue[index] &lt;= num) {\\n      <span class=\\\"hljs-comment\\\">// Add the Roman numeral &amp; decrease numCopy by the decimal equivalent.</span>\\n      romanized += romanNumeral[index];\\n      num -= decimalValue[index];\\n    }\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> romanized;\\n};\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Read comments on code.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @SaintPeter @benschac for your help with Bonfire: Roman Numeral Converter</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Roman-Numeral-Converter/index.md\n ** module id = 331\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Roman-Numeral-Converter/index.md?");

