	eval("module.exports = {\"title\":\"Bonfire Search and Replace\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You will create a program that takes a sentence, then search for a word in it and replaces it for a new one while preserving the uppercase if there is one.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Find the index where <code>before</code> is in the string.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Check first letter case.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Strings are immutable, you will need to save the edits on another variable, even if you must reuse the same one just to make it look like the changes where done using just that one variable.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution #1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">myReplace</span>(<span class=\\\"hljs-params\\\">str, before, after</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Find index where before is on string</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> index = str.indexOf(before);\\n  <span class=\\\"hljs-comment\\\">// Check to see if the first letter is uppercase or not</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (str[index] === str[index].toUpperCase()) {\\n    <span class=\\\"hljs-comment\\\">// Change the after word to be capitalized before we use it.</span>\\n    after = after.charAt(<span class=\\\"hljs-number\\\">0</span>).toUpperCase() + after.slice(<span class=\\\"hljs-number\\\">1</span>);\\n  }\\n  <span class=\\\"hljs-comment\\\">// Now replace the original str with the edited one.</span>\\n  str = str.replace(before, after);\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> str;\\n}\\n</code></pre>\\n<h2>Code Solution #2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">myReplace</span>(<span class=\\\"hljs-params\\\">str, before, after</span>) </span>{\\n<span class=\\\"hljs-comment\\\">//Create a regular expression object</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> re = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">RegExp</span>(before,<span class=\\\"hljs-string\\\">\\\"gi\\\"</span>);\\n<span class=\\\"hljs-comment\\\">//Check whether the first letter is uppercase or not</span>\\n  <span class=\\\"hljs-keyword\\\">if</span>(<span class=\\\"hljs-regexp\\\">/[A-Z]/</span>.test(before[<span class=\\\"hljs-number\\\">0</span>])){\\n  <span class=\\\"hljs-comment\\\">//Change the word to be capitalized</span>\\n    after = after.charAt(<span class=\\\"hljs-number\\\">0</span>).toUpperCase()+after.slice(<span class=\\\"hljs-number\\\">1</span>);\\n     }\\n     <span class=\\\"hljs-comment\\\">//Replace the original word with new one</span>\\n  <span class=\\\"hljs-keyword\\\">var</span>  newStr =  str.replace(re,after);\\n\\n <span class=\\\"hljs-keyword\\\">return</span> newStr;\\n\\n}\\n</code></pre>\\n<h2>Code Solution #3:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">myReplace</span>(<span class=\\\"hljs-params\\\">str, before, after</span>) </span>{\\n\\n    <span class=\\\"hljs-comment\\\">// create a function that will change the casing of any number of letter in parameter \\\"target\\\" </span>\\n    <span class=\\\"hljs-comment\\\">// matching parameter \\\"source\\\"</span>\\n    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">applyCasing</span>(<span class=\\\"hljs-params\\\">source, target</span>) </span>{\\n        <span class=\\\"hljs-comment\\\">// split the source and target strings to array of letters</span>\\n        <span class=\\\"hljs-keyword\\\">var</span> targetArr = target.split(<span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n        <span class=\\\"hljs-keyword\\\">var</span> sourceArr = source.split(<span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n        <span class=\\\"hljs-comment\\\">// iterate through all the items of sourceArr and targetArr arrays till loop hits the end of shortes array</span>\\n        <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; <span class=\\\"hljs-built_in\\\">Math</span>.min(targetArr.length, sourceArr.length); i++){\\n            <span class=\\\"hljs-comment\\\">// find out the casing of every letter from sourceArr using regular expression</span>\\n            <span class=\\\"hljs-comment\\\">// if sourceArr[i] is upper case then convert targetArr[i] to upper case </span>\\n            <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-regexp\\\">/[A-Z]/</span>.test(sourceArr[i])) {\\n                targetArr[i] = targetArr[i].toUpperCase();\\n            }\\n            <span class=\\\"hljs-comment\\\">// if sourceArr[i] is not upper case then convert targetArr[i] to lower case</span>\\n            <span class=\\\"hljs-keyword\\\">else</span> targetArr[i] = targetArr[i].toLowerCase();\\n        } \\n        <span class=\\\"hljs-comment\\\">// join modified targetArr to string and return</span>\\n        <span class=\\\"hljs-keyword\\\">return</span> (targetArr.join(<span class=\\\"hljs-string\\\">\\\"\\\"</span>));\\n    }\\n    \\n    \\n    <span class=\\\"hljs-comment\\\">// replace \\\"before\\\" with \\\"after\\\" with \\\"before\\\"-casing </span>\\n    <span class=\\\"hljs-keyword\\\">return</span> str.replace(before, applyCasing(before, after));\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Read comments on program.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @coded9 @aganita for your help with Bonfire: Search and Replace</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Search-and-Replace/index.md\n ** module id = 332\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Search-and-Replace/index.md?");

