	eval("module.exports = {\"title\":\"Bonfire Seek and Destroy\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>This problem is a bit tricky because you have to familiarize yourself with Arguments, as you will have to work with two <strong>or more</strong> but on the script you only see two. Many people hardcode this program for three arguments. You will remove any number from the first argument that is the same as any other other arguments.</p>\\n<h2>Hint: 1</h2>\\n<p>You need to work with <code>arguments</code> as if it was a regular array. The best way is to convert it into one.</p>\\n<h2>Hint: 2</h2>\\n<p>You need to filter, this also means you need to create a callback function, one that checks if the element is on the <code>indexOf()</code></p>\\n<h2>Hint: 3</h2>\\n<p>To convert <code>arguments</code> into an array use this code <code>var args = Array.prototype.slice.call(arguments);</code></p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">destroyer</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> args = <span class=\\\"hljs-built_in\\\">Array</span>.prototype.slice.call(<span class=\\\"hljs-built_in\\\">arguments</span>);\\n  args.splice(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">1</span>);\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">element</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> args.indexOf(element) === -<span class=\\\"hljs-number\\\">1</span>;\\n  });\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>The first line will turn the <code>arguments</code> variable into a full array instead of the limited array it currently is.</li>\\n<li>Next I remove the first argument since I don’t need, since I only want the other arguments passed besides the first which is the array we are going to compare against.</li>\\n<li>Then use the <code>filter()</code> to filter out the elements that are on the array and keep the ones that are not.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 for your help with Bonfire: Seek and Destroy</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Seek-and-Destroy/index.md\n ** module id = 333\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Seek-and-Destroy/index.md?");

