	eval("module.exports = {\"title\":\"Bonfire Slasher Flick\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<p>Return the remaining elements of an array after chopping off n elements from the head.</p>\\n<p>For example: <code>slasher([1, 2, 3], 2);</code> must return [3]</p>\\n<h2>Analysis:</h2>\\n<p>We need only the remaining part of an array, so we can just remove what we don’t.</p>\\n<h2>Understanding slicing:</h2>\\n<p><code>.slice()</code> allows to get only what you want from an array.</p>\\n<h2>Understanding the splice:</h2>\\n<p>If you want the <strong>tail</strong> of a snake remove the head first. The <code>.splice()</code> method changes the content of an array by removing existing elements and/or adding new elements. This can be handy. Get an array, remove the first part and return the remaining.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">slasher</span>(<span class=\\\"hljs-params\\\">arr, howMany</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// remove the head</span>\\n  arr.splice(<span class=\\\"hljs-number\\\">0</span>,howMany);\\n  <span class=\\\"hljs-comment\\\">//return the remaining or the tail  \\\\__/(**)-&lt;</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\nslasher([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>], <span class=\\\"hljs-number\\\">2</span>);\\n</code></pre>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">slasher</span>(<span class=\\\"hljs-params\\\">arr, howMany</span>) </span>{\\n\\n  <span class=\\\"hljs-comment\\\">//Return string after the amount chopped off.</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.slice(howMany);\\n\\n}\\n</code></pre>\\n<h1>References</h1>\\n<ul>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/splice\\\">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/splice</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @clint74 @Rafase282 @M-Bowe for your help with Bonfire: Slasher Flick</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n<pre><code>           ,,,         ,,,\\n          <span class=\\\"hljs-comment\\\">;\\\"   ^;     ;'   \\\",</span>\\n          <span class=\\\"hljs-comment\\\">;    s$$$$$$$s     ;</span>\\n          ,  ss$$$$$$$$$$s  ,'\\n          <span class=\\\"hljs-comment\\\">;s$$$$$$$$$$$$$$$</span>\\n          $$$$$$$$$$$$$$$$$$\\n         $$$$P<span class=\\\"hljs-string\\\">\\\"\\\"</span>Y$$$Y<span class=\\\"hljs-string\\\">\\\"\\\"</span>W$$$$$      -{ Happy Camping! }\\n         $$$$  p<span class=\\\"hljs-string\\\">\\\"$$$\\\"</span>q  $$$$$\\n         $$$$  .$$$$$.  $$$$\\n          $$DcaU$$$$$$$$$$\\n            <span class=\\\"hljs-string\\\">\\\"Y$$$\\\"</span>*<span class=\\\"hljs-string\\\">\\\"$$$Y\\\"</span>\\n                <span class=\\\"hljs-string\\\">\\\"$b.$$\\\"</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Slasher-Flick/index.md\n ** module id = 334\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Slasher-Flick/index.md?");

