	eval("module.exports = {\"title\":\"Bonfire Smallest Common Multiple\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>This particular problem can be confusing because most people look for the smallest common multiple of the two number but forget the keyword <strong>range.</strong> This means that if you get <code>[1,5]</code> then you have to check for the smallest common multiple for all these numbers [1,2,3,4,5] that is evenly divisible by all of them.</p>\\n<h2>Hint: 1</h2>\\n<p>Create an array with all the numbers that are missing from the original array to make it easier to check when having to check for even division.</p>\\n<h2>Hint: 2</h2>\\n<p>You can use modulo <code>%</code> to check if the reminder is 0, which means it is evenly divisible.</p>\\n<h2>Hint: 3</h2>\\n<p>If you sort the array from greater to lowest then you can check for the first two numbers as it is more likely to the the smallest common multiple than the lower numbers.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">smallestCommons</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Sort array from greater to lowest</span>\\n  <span class=\\\"hljs-comment\\\">// This line of code was from Adam Doyle (http://github.com/Adoyle2014)</span>\\n  arr.sort(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> b - a;\\n  });\\n\\n  <span class=\\\"hljs-comment\\\">// Create new array and add all values from greater to smaller from the original array.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> newArr = [];\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = arr[<span class=\\\"hljs-number\\\">0</span>]; i &gt;= arr[<span class=\\\"hljs-number\\\">1</span>]; i--) {\\n    newArr.push(i);\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">// Variables needed declared outside the loops.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> quot = <span class=\\\"hljs-number\\\">0</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> loop = <span class=\\\"hljs-number\\\">1</span>;\\n  <span class=\\\"hljs-keyword\\\">var</span> n;\\n\\n  <span class=\\\"hljs-comment\\\">// run code while n is not the same as the array length.</span>\\n  <span class=\\\"hljs-keyword\\\">do</span> {\\n    quot = newArr[<span class=\\\"hljs-number\\\">0</span>] * loop * newArr[<span class=\\\"hljs-number\\\">1</span>];\\n    <span class=\\\"hljs-keyword\\\">for</span> (n = <span class=\\\"hljs-number\\\">2</span>; n &lt; newArr.length; n++) {\\n      <span class=\\\"hljs-keyword\\\">if</span> (quot % newArr[n] !== <span class=\\\"hljs-number\\\">0</span>) {\\n        <span class=\\\"hljs-keyword\\\">break</span>;\\n      }\\n    }\\n\\n    loop++;\\n  } <span class=\\\"hljs-keyword\\\">while</span> (n !== newArr.length);\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> quot;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Because the possibility of the smallest common denominator being among the two biggest numbers, it makes sense to check those first, so sort the array.</li>\\n<li>Create a new array to sore all the numbers.</li>\\n<li>Use a descending for loop to add the numbers from the biggest to the smallest in the new array.</li>\\n<li>Declare the variables for the quotient, the number of loops and the variable that we will use in a for loop on another scope, this will allow us access outside the loop.</li>\\n<li>Use a do while loop to check what we need while <strong>n</strong> is not the same length as the new array.</li>\\n<li>In the <strong>do</strong> part, we are going to multiply the very first number, times the number of loops, times the second number.</li>\\n<li>The loop part will allows us to increase the number beyond the greatest number we have without having to change the algorithm.</li>\\n<li>We enter a for loop that will go from n being 2 and going up by one while it is smaller than the array with all the numbers.</li>\\n<li>If the quotient is not even then stop the loop. If it is even then it check for the next elements in the array until it is not even or we find our answer.</li>\\n<li>Outside the loop, increase the value of loop.</li>\\n<li>At the end of the loop return the quotient.</li>\\n</ul>\\n<p>If the array only has two elements then the for loop never gets used and the return value is the product of said numbers. Otherwise, from the third element and until n is the same and the array length check if the remainder of the quotient and the third value of the array is not 0, if it is not 0 then stop loop increases and then we start over. If the remainder was 0 then keep checking until the end of the array.</p>\\n<h1>Alternate solution:</h1>\\n<p>Note: The solution above requires over 2,000 loops to calculate the test case smallestCommons([1,13]), and over 4 million loops to calculate smallestCommons([1,25]). The alternate code below evaluates smallestCommons([1,13]) in around 20 loops and smallestCommons([1,25]) in 40, by using a more efficient algorithm.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">smallestCommons</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">for</span>(i = <span class=\\\"hljs-built_in\\\">Math</span>.max(...arr); i &gt;= <span class=\\\"hljs-built_in\\\">Math</span>.min(...arr); i--) arr.push(i);\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> arr.slice(<span class=\\\"hljs-number\\\">2</span>).reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">x,y</span>)</span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> a = x, b = y, t = <span class=\\\"hljs-number\\\">0</span>;    \\n    <span class=\\\"hljs-keyword\\\">while</span>(a % b){a = a % b; t = a; a = b; b = t;}\\n    <span class=\\\"hljs-keyword\\\">return</span> x / b * y;\\n  });\\n}\\n\\n</code></pre>\\n<p>If you have trouble understanding the .reduce() method, you can compare it to this code, which essentially does the same thing:</p>\\n<pre><code><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">smallestCommons</span><span class=\\\"hljs-params\\\">(arr)</span> {</span>\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-built_in\\\">i</span> = Math.max(...arr); <span class=\\\"hljs-built_in\\\">i</span> &gt;= Math.min(...arr); <span class=\\\"hljs-built_in\\\">i</span>--) arr.push(<span class=\\\"hljs-built_in\\\">i</span>);\\n  \\n  var <span class=\\\"hljs-built_in\\\">lcm</span> = arr<span class=\\\"hljs-matrix\\\">[<span class=\\\"hljs-number\\\">2</span>]</span>, a = <span class=\\\"hljs-number\\\">0</span>, b = <span class=\\\"hljs-number\\\">0</span>, t = <span class=\\\"hljs-number\\\">0</span>;\\n  \\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-built_in\\\">i</span> = <span class=\\\"hljs-number\\\">3</span>; <span class=\\\"hljs-built_in\\\">i</span> &lt; arr.<span class=\\\"hljs-built_in\\\">length</span>; <span class=\\\"hljs-built_in\\\">i</span>++)<span class=\\\"hljs-cell\\\">{\\n    a = lcm, b = arr[i];  \\n    while(a % b){a = a % b; t = a; a = b; b = t;}</span>\\n    <span class=\\\"hljs-built_in\\\">lcm</span> = <span class=\\\"hljs-built_in\\\">lcm</span> / b * arr<span class=\\\"hljs-matrix\\\">[i]</span>;\\n  }\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-built_in\\\">lcm</span>;\\n}\\n</code></pre>\\n<p>This code is based on the <a href=\\\"https://en.wikipedia.org/wiki/Euclidean_algorithm\\\">Euclidean algorithm</a> for finding smallest common multiples.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @Adoyle2014 for your help with Bonfire: Smallest Common Multiple</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Smallest-Common-Multiple/index.md\n ** module id = 335\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Smallest-Common-Multiple/index.md?");

