	eval("module.exports = {\"title\":\"Bonfire Sorted Union\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>The program has to return a new array of unique values from two original arrays in the order they show up. So there is not sorting required, and no duplicates.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Since you have no idea how many parameters were passed, it would be best to loop through the <code>arguments</code> before looping through the arrays.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>I used loops, you can use something else like map, reduce or others if you want.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will have to check if the current value is already on the array to be returned for every value.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First Solution:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">unite</span>(<span class=\\\"hljs-params\\\">arr1, arr2, arr3</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Creates an empty array to store our final result.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> finalArray = [];\\n\\n  <span class=\\\"hljs-comment\\\">// Loop through the arguments object to truly made the program work with two or more arrays</span>\\n  <span class=\\\"hljs-comment\\\">// instead of 3.</span>\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; <span class=\\\"hljs-built_in\\\">arguments</span>.length; i++) {\\n    <span class=\\\"hljs-keyword\\\">var</span> arrayArguments = <span class=\\\"hljs-built_in\\\">arguments</span>[i];\\n\\n    <span class=\\\"hljs-comment\\\">// Loops through the array at hand</span>\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> j = <span class=\\\"hljs-number\\\">0</span>; j &lt; arrayArguments.length; j++) {\\n      <span class=\\\"hljs-keyword\\\">var</span> indexValue = arrayArguments[j];\\n\\n      <span class=\\\"hljs-comment\\\">// Checks if the value is already on the final array.</span>\\n      <span class=\\\"hljs-keyword\\\">if</span> (finalArray.indexOf(indexValue) &lt; <span class=\\\"hljs-number\\\">0</span>) {\\n        finalArray.push(indexValue);\\n      }\\n    }\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> finalArray;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Check comments in code.</li>\\n</ul>\\n<h4>Second Solution:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">unite</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> concatArr = [];\\n  <span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>;\\n  <span class=\\\"hljs-keyword\\\">while</span> (<span class=\\\"hljs-built_in\\\">arguments</span>[i]){\\n    concatArr = concatArr.concat(<span class=\\\"hljs-built_in\\\">arguments</span>[i]); i++;\\n  }\\n  uniqueArray = concatArr.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item, pos</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> concatArr.indexOf(item) == pos;\\n  }); \\n  <span class=\\\"hljs-keyword\\\">return</span> uniqueArray;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Number of arguments can change dynamically so we don’t need to bother providing our func with args at all</li>\\n<li>we use a while loop to concatanate all the arguments into one Array called <code>concatArr</code></li>\\n<li>we use <code>filter</code> to remove the duplicate elements by checking the index of each element and removing same elements with different positions</li>\\n<li>ordering will be preserved as we didn’t mess with it</li>\\n</ul>\\n<h4>Third Solution:</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">unite</span>(<span class=\\\"hljs-params\\\">arr1, arr2, arr3</span>) </span>{\\n <span class=\\\"hljs-keyword\\\">var</span> newArr;\\n <span class=\\\"hljs-comment\\\">//Convert the arguments object into an array</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> args = <span class=\\\"hljs-built_in\\\">Array</span>.prototype.slice.call(<span class=\\\"hljs-built_in\\\">arguments</span>);\\n  <span class=\\\"hljs-comment\\\">//Use reduce function to flatten the array</span>\\n  newArr = args.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">arrA,arrB</span>)</span>{\\n  <span class=\\\"hljs-comment\\\">//Apply filter to remove the duplicate elements in the array</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> arrA.concat(arrB.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">i</span>)</span>{\\n      <span class=\\\"hljs-keyword\\\">return</span> arrA.indexOf(i) === -<span class=\\\"hljs-number\\\">1</span>;\\n    }));\\n  });\\n\\n   <span class=\\\"hljs-keyword\\\">return</span> newArr;                    \\n}\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @sabahang @coded9 for your help with Bonfire: Sorted Union</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Sorted-Union/index.md\n ** module id = 336\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Sorted-Union/index.md?");

