	eval("module.exports = {\"title\":\"Bonfire Spinal Tap Case\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>Convert the given string to an all lowercase sentence joined by dashes.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Create a regex to for all white spaces and underscores.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>You will also have to make everything lowercase.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>The tricky part is getting the regex part to work, once you do that then just turn the uppercase to lowercase and replace spaces with underscores using <code>replace()</code></li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h4>First solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">spinalCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Create a variable for the white space and underscores.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> regex = <span class=\\\"hljs-regexp\\\">/\\\\s+|_+/g</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Replace low-upper case to low-space-uppercase</span>\\n  str = str.replace(<span class=\\\"hljs-regexp\\\">/([a-z])([A-Z])/g</span>, <span class=\\\"hljs-string\\\">'$1 $2'</span>);\\n\\n  <span class=\\\"hljs-comment\\\">// Replace space and underscore with -</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> str.replace(regex, <span class=\\\"hljs-string\\\">'-'</span>).toLowerCase();\\n}\\n</code></pre>\\n<h4>Second solution</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">spinalCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Replace low-upper case to low-space-uppercase</span>\\n  str = str.replace(<span class=\\\"hljs-regexp\\\">/([a-z])([A-Z])/g</span>, <span class=\\\"hljs-string\\\">'$1 $2'</span>);\\n  <span class=\\\"hljs-comment\\\">// Split on whitespace and underscores and join with dash</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> str.toLowerCase().split(<span class=\\\"hljs-regexp\\\">/(?:_| )+/</span>) .join(<span class=\\\"hljs-string\\\">'-'</span>);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<h4>First and Second solutions</h4>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @anuragaryan for your help with Bonfire: Spinal Tap Case</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Spinal-Tap-Case/index.md\n ** module id = 337\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Spinal-Tap-Case/index.md?");

