	eval("module.exports = {\"title\":\"Bonfire Steamroller\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>This problem seems simple but you need to make sure to flatten any array, regardless of the level which is what adds a bit of difficulty to the problem.</p>\\n<h2>Hint: 1</h2>\\n<p>You need to check if an element is an array or not.</p>\\n<h2>Hint: 2</h2>\\n<p>If you are dealing with an array, then you need flatten it by getting the value inside of the array. This means if you have [[4]] then instead of returning [4] you need to return 4. If you get [[[4]]] then the same, you want the 4. You can access it with arr[index1][index2] to go a level deeper.</p>\\n<h2>Hint: 3</h2>\\n<p>You will definitely need recursion or another way to go beyond two level arrays to make the code flexible and not hard-coded to the answers needed. Have fun!</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution 1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">steamroller</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> flattenedArray = [];\\n\\n  <span class=\\\"hljs-comment\\\">// Create function that adds an element if it is not an array.</span>\\n  <span class=\\\"hljs-comment\\\">// If it is an array, then loops through it and uses recursion on that array.</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> flatten = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">arg</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (!<span class=\\\"hljs-built_in\\\">Array</span>.isArray(arg)) {\\n      flattenedArray.push(arg);\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> a <span class=\\\"hljs-keyword\\\">in</span> arg) {\\n        flatten(arg[a]);\\n      }\\n    }\\n  };\\n\\n  <span class=\\\"hljs-comment\\\">// Call the function for each element in the array</span>\\n  arr.forEach(flatten);\\n  <span class=\\\"hljs-keyword\\\">return</span> flattenedArray;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Create a new variable to keep flattened arrays.</li>\\n<li>Create a function that will add non array elements to the new variable, and for the ones that are array it loops through them to get the element.</li>\\n<li>It does that by using recursion, if the element is an array then call the function again with a layer of array deeper to check if it is an array or not. if it is not then push that non-array element to the variable that gets returned. Otherwise, keep going deeper.</li>\\n<li>Invoke the function, the first time you will always pass it an array, so it always fall in to the isArray branch</li>\\n<li>Return the flattened array.</li>\\n</ul>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">steamroller</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">flat, toFlatten</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> flat.concat(<span class=\\\"hljs-built_in\\\">Array</span>.isArray(toFlatten) ? steamroller(toFlatten) : toFlatten);\\n  }, []);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Use reduce to concatenate each element into the last element</li>\\n<li>If the new element is an Array itself call the function recursively to flatten it before merging it with the rest of result</li>\\n<li>Pass an empty array to reduce as initial value to make sure even the first element will be processed</li>\\n<li>Credit goes to <a href=\\\"http://stackoverflow.com/a/15030117/1075499\\\">http://stackoverflow.com/a/15030117/1075499</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @sabahang for your help with Bonfire: Steamroller</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Steamroller/index.md\n ** module id = 338\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Steamroller/index.md?");

