	eval("module.exports = {\"title\":\"Bonfire Style Guide\",\"order\":5,\"body\":\"<p><em>work in progress</em></p>\\n<h1>Bonfire Style Guide</h1>\\n<p>Writing Bonfire challenges is a great way to exercise your own problem solving and testing abilities. It is a simple three step process.</p>\\n<ol>\\n<li>Fill out the <a href=\\\"http://www.freecodecamp.com/bonfire-challenge-generator\\\">generator</a> form and test your challenge.</li>\\n<li>Once you have confirmed a working bonfire challenge in the generator, copy and paste the fields into the <a href=\\\"http://www.freecodecamp.com/bonfire-json-generator\\\">JSON generator.</a></li>\\n<li>Copy the JSON, fork the freecodecamp repository, and submit a pull request with your addition to the <a href=\\\"https://github.com/FreeCodeCamp/freecodecamp/blob/master/seed_data/bonfires.json\\\">bonfires.json.</a></li>\\n</ol>\\n<h2>Name</h2>\\n<p>Name your challenge</p>\\n<h2>Difficulty</h2>\\n<p>Attempt to rate difficulty compared against existing bonfire challenges.</p>\\n<p><em>TODO: add basic quantifiers for each difficulty level</em></p>\\n<h2>Description</h2>\\n<p>Separate paragraphs with a line break. Only the first paragraph is visible prior to a user clicking the “More information” button.</p>\\n<p>All necessary information must be included in the first paragraph. Write this first paragraph as succinct as possible. Subsequent paragraphs should offer hints or details if needed.</p>\\n<p>If your subject matter warrants deeper understanding, you may link to Wikipedia.</p>\\n<h2>Challenge Seed</h2>\\n<p>This is important.</p>\\n<h2><s>Challenge Entry Point</s> (deprecated)</h2>\\n<p><em>Leave this field blank. It will soon be removed from the generator.</em></p>\\n<h2>Tests</h2>\\n<p>These tests are what bring your challenge to life. Without them, we cannot confirm the accuracy of a user’s submitted answer. Choose your tests wisely.</p>\\n<p>Bonfire tests are written using the <a href=\\\"http://chaijs.com/\\\">Chai.js</a> assertion library. Please use the <code>should</code> and <code>expect</code> syntax for end user readability. As an example of what not do to, many of the original Bonfire challenges are written with <code>assert</code> syntax and many of the test cases are difficult to read.</p>\\n<p>If your bonfire question has a lot of edge cases, you will need to write many tests for full coverage. If you find yourself writing more tests than you desire, you may consider simplifying the requirements of your bonfire challenge. For difficulty level 1 through 3, you will generally only need 2 to 4 tests.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @brandenbyers @Rafase282 for your help with the Bonfire Style Guide</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Style-Guide/index.md\n ** module id = 339\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Style-Guide/index.md?");

