	eval("module.exports = {\"title\":\"Bonfire Sum All Numbers in a Range\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>You need to create a program that will take an array of two numbers who are not necessarily in order, and then add not just those numbers but any numbers in between. For example, [3,1] will be the same as <code>1+2+3</code> and not just <code>3+1</code></li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Use <code>Math.max()</code> to find the maximum value of two numbers.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Use <code>Math.min()</code> to find the minimum value of two numbers.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Remember to that you must add all the numbers in between so this would require a way to get those numbers.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution 1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumAll</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> max = <span class=\\\"hljs-built_in\\\">Math</span>.max(arr[<span class=\\\"hljs-number\\\">0</span>], arr[<span class=\\\"hljs-number\\\">1</span>]);\\n    <span class=\\\"hljs-keyword\\\">var</span> min = <span class=\\\"hljs-built_in\\\">Math</span>.min(arr[<span class=\\\"hljs-number\\\">0</span>], arr[<span class=\\\"hljs-number\\\">1</span>]);\\n    <span class=\\\"hljs-keyword\\\">var</span> temp = <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i=min; i &lt;= max; i++){\\n        temp += i;\\n    }\\n  <span class=\\\"hljs-keyword\\\">return</span>(temp);\\n}\\n\\nsumAll([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">4</span>]);\\n</code></pre>\\n<h2>Code Explanation:</h2>\\n<ul>\\n<li>First create a variable to store the max number between two.</li>\\n<li>The same as before for the Smallest number.</li>\\n<li>We create a temporary variable to add the numbers.</li>\\n</ul>\\n<p>Since the numbers might not be always in order, using <code>max()</code> and <code>min()</code> will help organize.</p>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumAll</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Buckle up everything to one!</span>\\n\\n  <span class=\\\"hljs-comment\\\">// Using ES6 arrow function (one-liner)</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> sortedArr = arr.sort((a,b) =&gt; a-b);\\n  <span class=\\\"hljs-keyword\\\">var</span> firstNum = arr[<span class=\\\"hljs-number\\\">0</span>];\\n  <span class=\\\"hljs-keyword\\\">var</span> lastNum = arr[<span class=\\\"hljs-number\\\">1</span>];\\n  <span class=\\\"hljs-comment\\\">// Using Arithmetic Progression summing formula</span>\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> sum = (lastNum - firstNum + <span class=\\\"hljs-number\\\">1</span>) * (firstNum + lastNum) / <span class=\\\"hljs-number\\\">2</span>;\\n  <span class=\\\"hljs-keyword\\\">return</span> sum;\\n}\\n</code></pre>\\n<h2>Code Solution 3:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumAll</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> sum = <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-built_in\\\">Math</span>.min(...arr); i &lt;= <span class=\\\"hljs-built_in\\\">Math</span>.max(...arr); i++){\\n        sum += i;\\n    }\\n  <span class=\\\"hljs-keyword\\\">return</span> sum;\\n}\\n\\nsumAll([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">4</span>]);\\n</code></pre>\\n<h2>Code Explanation:</h2>\\n<ul>\\n<li>Creating a variable sum to store the sum of the elements.</li>\\n<li>Starting iteration of the loop from min element of given array and stopping when it reaches the max element.</li>\\n<li>Using a spread operator (…arr) allows passing the actual array to the function instead of one-by-one elements.</li>\\n</ul>\\n<h2>References &amp; Details:</h2>\\n<ul>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Arithmetic_progression#Sum\\\">Arithmetic Progression summing formula</a></li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Functions/Arrow_functions\\\">ES6 arrow function</a></li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Operators/Spread_operator\\\">Spread Operator</a></li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/max\\\">Using Spread Operator in Math.max()</a></li>\\n</ul>\\n<p>The line <code>var sortedArr = arr.sort((a,b) =&gt; a-b);</code> is probably what will have you more confused. This would be the same as creating a function that returns <code>a-b</code> for the <code>sort()</code> which is the standard way to sort numbers from smallest to largest. Instead using arrow or fat arrow function, we are able to do all that in one single line thus allowing us to write less.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @abhisekp for your help with Bonfire: Sum All Numbers in a Range</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Sum-All-Numbers-in-a-Range/index.md\n ** module id = 340\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Sum-All-Numbers-in-a-Range/index.md?");

