	eval("module.exports = {\"title\":\"Bonfire Sum All Odd Fibonacci Numbers\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>You will need to gather all the <strong>Fibonacci</strong> numbers and then check for the odd ones. Once you get the odd ones then you will add them all. The last number should be the number given as a parameter if it actually happens to be an off Fibonacci number.</p>\\n<h2>Hint: 1</h2>\\n<p>To get the next number of the series, you need to add the current one to the previous and that will give you the next one.</p>\\n<h2>Hint: 2</h2>\\n<p>To check if a number is even all you have to check is if that number % 2 == 0.</p>\\n<h2>Hint: 3</h2>\\n<p>As you get the next odd one, don’t forget to add it to a global variable that can be returned at the end. <code>result += currNumber;</code> Will do the trick.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution #1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumFibs</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> prevNumber = <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">var</span> currNumber = <span class=\\\"hljs-number\\\">1</span>;\\n    <span class=\\\"hljs-keyword\\\">var</span> result = <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">while</span> (currNumber &lt;= num) {\\n        <span class=\\\"hljs-keyword\\\">if</span> (currNumber % <span class=\\\"hljs-number\\\">2</span> !== <span class=\\\"hljs-number\\\">0</span>) {\\n            result += currNumber;\\n        }\\n\\n        currNumber += prevNumber;\\n        prevNumber = currNumber - prevNumber;\\n    }\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> result;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Create a variable to keep record of the current and previous numbers along with the result that will be returned.</li>\\n<li>Use a while loop to make sure we do not go over the number given as parameter.</li>\\n<li>We use the modulo operand to check if the current number is odd or even. If even add it to the result.</li>\\n<li>Complete the Fibonacci circle by rotating getting the next number and swapping values after.</li>\\n<li>Return the result.</li>\\n</ul>\\n<h2>Code Solution #2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumFibs</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// create an array of fib numbers till num</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> arrFib = [<span class=\\\"hljs-number\\\">1</span>];\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">1</span>; i &lt;=num;) {\\n      arrFib.push(i);\\n      i = arrFib[arrFib.length - <span class=\\\"hljs-number\\\">1</span>] + arrFib[arrFib.length - <span class=\\\"hljs-number\\\">2</span>];\\n  }\\n  \\n  <span class=\\\"hljs-comment\\\">// return the sum of odd numbers from the array</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> res = arrFib.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">prev, curr</span>) </span>{ \\n      <span class=\\\"hljs-keyword\\\">if</span> (curr%<span class=\\\"hljs-number\\\">2</span> !== <span class=\\\"hljs-number\\\">0</span>) <span class=\\\"hljs-keyword\\\">return</span> prev + curr;\\n      <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">return</span> prev;\\n    });\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> res;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>See comments</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @d3ddd for your help with Bonfire: Sum All Odd Fibonacci Numbers</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Sum-All-Odd-Fibonacci-Numbers/index.md\n ** module id = 341\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Sum-All-Odd-Fibonacci-Numbers/index.md?");

