	eval("module.exports = {\"title\":\"Bonfire Sum All Primes\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>The explanation for this problem is very simple. You will generate a list of prime numbers up to the number you are given as a parameter. Then you need to add them all up and return that value. The tricky part is on generating the list of prime numbers. I suggest you find a code or a good math algorithm that you can turn into code.</p>\\n<h2>Hint: 1</h2>\\n<p>Generate a list of all the numbers up to and including the one you got as a parameter. This will be needed to determine which numbers are prime or not.</p>\\n<h2>Hint: 2</h2>\\n<p>Check this <a href=\\\"http://stackoverflow.com/questions/11966520/how-to-find-prime-numbers-between-0-100\\\">link</a> if you prefer to find a solution for finding primes, or try learning and implementing your own <a href=\\\"https://en.wikipedia.org/wiki/Sieve_of_Eratosthenes\\\">Sieve of Eratosthenes</a></p>\\n<h2>Hint: 3</h2>\\n<p>This problem is hard if you have to create your own code to check for primes, so don’t feel bad if you had to use someone’s code for that bit. Either way, you are most likely using array, so once you generate an array of primes, then just add them all up and return the number you get.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumPrimes</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> res = <span class=\\\"hljs-number\\\">0</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// FUnction to get the primes up to max in an array</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">getPrimes</span>(<span class=\\\"hljs-params\\\">max</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> sieve = [];\\n    <span class=\\\"hljs-keyword\\\">var</span> i;\\n    <span class=\\\"hljs-keyword\\\">var</span> j;\\n    <span class=\\\"hljs-keyword\\\">var</span> primes = [];\\n    <span class=\\\"hljs-keyword\\\">for</span> (i = <span class=\\\"hljs-number\\\">2</span>; i &lt;= max; ++i) {\\n      <span class=\\\"hljs-keyword\\\">if</span> (!sieve[i]) {\\n        <span class=\\\"hljs-comment\\\">// i has not been marked -- it is prime</span>\\n        primes.push(i);\\n        <span class=\\\"hljs-keyword\\\">for</span> (j = i &lt;&lt; <span class=\\\"hljs-number\\\">1</span>; j &lt;= max; j += i) {\\n          sieve[j] = <span class=\\\"hljs-literal\\\">true</span>;\\n        }\\n      }\\n    }\\n\\n    <span class=\\\"hljs-keyword\\\">return</span> primes;\\n  }\\n\\n  <span class=\\\"hljs-comment\\\">// Add the primes</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> primes = getPrimes(num);\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> p = <span class=\\\"hljs-number\\\">0</span>; p &lt; primes.length; p++) {\\n    res += primes[p];\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> res;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Create a function that generates the numbers from 1 to <strong>num</strong> and check if they are prime along the way.</li>\\n<li>Declare the variables that will be needed.</li>\\n<li>Start with 2, if it has not been marked and added to the sieve array then it is a prime and we add it to the prime array.</li>\\n<li>Add the others to the sieve array.</li>\\n<li>Return the primes</li>\\n<li>Loop through the returned array and add all the elements to then return the final value.</li>\\n</ul>\\n<h2>Recursive Solution:</h2>\\n<pre><code class=\\\"language-JS\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sumPrimes</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// function to check if the number presented is prime</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isPrime</span>(<span class=\\\"hljs-params\\\">number</span>)</span>{\\n      <span class=\\\"hljs-keyword\\\">for</span> (i = <span class=\\\"hljs-number\\\">2</span>; i &lt;= number; i++){\\n          <span class=\\\"hljs-keyword\\\">if</span>(number % i === <span class=\\\"hljs-number\\\">0</span> &amp;&amp; number!= i){\\n          <span class=\\\"hljs-comment\\\">// return true if it is divisable by any number that is not itself. </span>\\n             <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n          }\\n       }\\n       <span class=\\\"hljs-comment\\\">// if it passes the for loops conditions it is a prime</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">// 1 is not a prime, so return nothing, also stops the recusrive calls.</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (num === <span class=\\\"hljs-number\\\">1</span>){\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">// Check if your number is not prime</span>\\n  <span class=\\\"hljs-keyword\\\">if</span>(isPrime(num) === <span class=\\\"hljs-literal\\\">false</span>){\\n  <span class=\\\"hljs-comment\\\">// for non primes check the next number down from your maximum number, do not add anything to your answer</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> sumPrimes(num - <span class=\\\"hljs-number\\\">1</span>);\\n  }\\n  \\n  <span class=\\\"hljs-comment\\\">// Check if your number is prime</span>\\n  <span class=\\\"hljs-keyword\\\">if</span>(isPrime(num) === <span class=\\\"hljs-literal\\\">true</span>){\\n  <span class=\\\"hljs-comment\\\">// for primes add that number to the next number in the sequence through a recursive call to our sumPrimes function.</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> num + sumPrimes(num - <span class=\\\"hljs-number\\\">1</span>);\\n  }\\n}\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @shadowfool for your help with Bonfire: Sum All Primes</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Sum-All-Primes/index.md\n ** module id = 342\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Sum-All-Primes/index.md?");

