	eval("module.exports = {\"title\":\"Bonfire Symmetric Difference\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<p>Symmetric Difference is the difference between <strong>two</strong> sets.</p>\\n<p>So in the Symmetric Difference Bonfire you would work through the arrays of numbers something like this -</p>\\n<p><code>sym(A, B, C)</code> Translates to <code>sym(sym(A,B),C)</code></p>\\n<p>Or in plain English - First find the Symmetric Difference of Set A and Set B. Then find the Symmetric Difference of this new set and Set C.</p>\\n<p>So -</p>\\n<p><code>sym([1, 2, 5], [2, 3, 5], [3, 4, 5])</code></p>\\n<p>would equal</p>\\n<p><code>[1,4,5]</code></p>\\n<p>Here’s a nice video tutorial (with an awful fake British accent!) -</p>\\n<p><a href=\\\"https://www.youtube.com/watch?v=PxffSUQRkG4\\\">YouTube - Symmetric Difference</a></p>\\n<h2>Hint: 1</h2>\\n<p>The arguments object is not an Array. It is similar to an Array, but does not have any Array properties except length. For example, it does not have the pop method. However it can be converted to a real Array:</p>\\n<p><code>var args = Array.prototype.slice.call(arguments);</code></p>\\n<h2>Hint: 2</h2>\\n<p>Write a function that returns the symmetric difference of array1 and array2.</p>\\n<p><code>yourFunction([1, 2, 3], [2, 4, 6])</code> must return <code>[1, 3, 4, 6]</code></p>\\n<h2>Hint: 3</h2>\\n<p>Use <code>Array.prototype.reduce</code> along with yourFunction to repeat the process on multiple arguments</p>\\n<p>Something a bit strange about the definition of symmetric difference is that if one identical item occurs in three different sets, it is a member of the symmetric difference.  An example is easier to explain:</p>\\n<pre><code>a = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">5</span>]\\nb = [<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">5</span>]\\nc = [<span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>]\\n\\nsym(a, b) = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">3</span>]\\nsym([<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">3</span>], c) = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>]\\n</code></pre>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sym</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n\\n  <span class=\\\"hljs-comment\\\">// Convert the argument object into a proper array</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> args = <span class=\\\"hljs-built_in\\\">Array</span>.prototype.slice.call(<span class=\\\"hljs-built_in\\\">arguments</span>);\\n\\n  <span class=\\\"hljs-comment\\\">// Return the symmetric difference of 2 arrays</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> getDiff = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n\\n    <span class=\\\"hljs-comment\\\">// Returns items in arr1 that don't exist in arr2</span>\\n    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">filterFunction</span>(<span class=\\\"hljs-params\\\">arr1, arr2</span>) </span>{\\n      <span class=\\\"hljs-keyword\\\">return</span> arr1.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">item</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">return</span> arr2.indexOf(item) === -<span class=\\\"hljs-number\\\">1</span>;\\n      });\\n    }\\n\\n    <span class=\\\"hljs-comment\\\">// Run filter function on each array against the other</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> filterFunction(arr1, arr2)\\n      .concat(filterFunction(arr2, arr1));\\n  };\\n\\n  <span class=\\\"hljs-comment\\\">// Reduce all arguments getting the difference of them</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> args.reduce(getDiff, []);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Read comments in code.</li>\\n</ul>\\n<h1>Related Links</h1>\\n<ul>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Symmetric_difference\\\">Symmetric Difference</a></li>\\n<li><a href=\\\"http://devdocs.io/javascript/global_objects/array/reduce\\\">Array.reduce()</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @guyjoseph @jjmax75 for your help with Bonfire: Symmetric Difference</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Symmetric-Difference/index.md\n ** module id = 343\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Symmetric-Difference/index.md?");

