	eval("module.exports = {\"title\":\"Bonfire Title Case a Sentence\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>We have to return a sentence with camel case. This means that the first letter will always be in uppercase and the rest lowercase.</p>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>You should start by splitting the string into an array of words.</li>\\n<li>Split the sentence.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>You should make the word lowercase before making the first letter uppercase.</li>\\n<li>Use replace method on each word to capitalize the first letter of each word.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>You will need to create a new string with pieces of the previous one and at the end merge everything into a single string again.</li>\\n<li>In replace method , give first argument as the position of the first letter using charAt. For second argument write a function to return the capitalized letter as the replacement.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">String</span>.prototype.replaceAt = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">index, character</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">this</span>.substr(<span class=\\\"hljs-number\\\">0</span>, index) + character + <span class=\\\"hljs-keyword\\\">this</span>.substr(index+character.length);\\n};\\n\\n\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">titleCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> newTitle = str.split(<span class=\\\"hljs-string\\\">' '</span>);\\n    <span class=\\\"hljs-keyword\\\">var</span> updatedTitle = [];\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> st <span class=\\\"hljs-keyword\\\">in</span> newTitle) {\\n        updatedTitle[st] = newTitle[st].toLowerCase().replaceAt(<span class=\\\"hljs-number\\\">0</span>, newTitle[st].charAt(<span class=\\\"hljs-number\\\">0</span>).toUpperCase());\\n    }\\n    <span class=\\\"hljs-keyword\\\">return</span> updatedTitle.join(<span class=\\\"hljs-string\\\">' '</span>);\\n}\\n</code></pre>\\n<p>Second Solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">titleCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> newstr=str.toLowerCase().split(<span class=\\\"hljs-string\\\">\\\" \\\"</span>);\\n  <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i=<span class=\\\"hljs-number\\\">0</span>;i&lt;newstr.length;i++){\\n  <span class=\\\"hljs-keyword\\\">var</span> f=newstr[i].charAt(<span class=\\\"hljs-number\\\">0</span>);\\n newstr[i]=newstr[i].replace(newstr[i].charAt(<span class=\\\"hljs-number\\\">0</span>),<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">replace</span>(<span class=\\\"hljs-params\\\">f</span>)</span>{\\n   <span class=\\\"hljs-keyword\\\">return</span> f.toUpperCase();\\n });\\n\\n  }\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(newstr);\\n  <span class=\\\"hljs-keyword\\\">return</span> newstr.join(<span class=\\\"hljs-string\\\">\\\" \\\"</span>);\\n}\\n\\ntitleCase(<span class=\\\"hljs-string\\\">\\\"hello world\\\"</span>);\\n</code></pre>\\n<p>Third Solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">titleCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  str = str.toLowerCase().split(<span class=\\\"hljs-string\\\">' '</span>);\\n  <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i <span class=\\\"hljs-keyword\\\">in</span> str) {\\n    str[i] = str[i].replace(str[i].charAt(<span class=\\\"hljs-number\\\">0</span>), str[i].charAt(<span class=\\\"hljs-number\\\">0</span>).toUpperCase());\\n  };\\n  <span class=\\\"hljs-keyword\\\">return</span> str.join(<span class=\\\"hljs-string\\\">' '</span>);\\n}\\n\\ntitleCase(<span class=\\\"hljs-string\\\">\\\"I'm a little tea pot\\\"</span>, <span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n</code></pre>\\n<p>Minimal Solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">titleCase</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> str.replace(<span class=\\\"hljs-regexp\\\">/\\\\w\\\\S*/g</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">word</span>)</span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> word.charAt(<span class=\\\"hljs-number\\\">0</span>).toUpperCase()+word.substr(<span class=\\\"hljs-number\\\">1</span>).toLowerCase();}); \\n}\\n\\ntitleCase(<span class=\\\"hljs-string\\\">\\\"I'm a little tea pot\\\"</span>, <span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n</code></pre>\\n<p>Minimaler Solution:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">titleCase</span>(<span class=\\\"hljs-params\\\">s</span>) </span>{<span class=\\\"hljs-keyword\\\">return</span> s.toLowerCase().replace(<span class=\\\"hljs-regexp\\\">/^[a-z]|\\\\s[a-z]/g</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">m</span>)</span>{<span class=\\\"hljs-keyword\\\">return</span> m.toUpperCase()})}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>We are modifying the <code>replaceAt</code> function using prototype to facilitate the use of the program.</p>\\n<p>Split the string by whitespaces, and create a variable to track the updated title. Then we use a loop to turn turn the first character of the word to uppercase and the rest to lowercase. by creating concatenated string composed of the whole word in lowercase with the first character replaced by it’s uppercase.</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @PoojaKumar @Hallaathrad for your help with Bonfire: Title Case a Sentence</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Title-Case-a-Sentence/index.md\n ** module id = 344\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Title-Case-a-Sentence/index.md?");

