	eval("module.exports = {\"title\":\"Bonfire Truncate a String\",\"order\":5,\"body\":\"<h1>Explanation:</h1>\\n<p>We need to reduce the length of the string or <strong>truncate</strong> it if it is longer than the given maximum lengths specified and add <code>...</code> to the end. If it is not that long then we keep it as is.</p>\\n<h2>Hint: 1</h2>\\n<p>Strings are immutable in JavaScript so we will need a new variable to store the truncated string.</p>\\n<h2>Hint: 2</h2>\\n<p>You will need to use slice and specify where to start and where to stop.</p>\\n<h2>Hint: 3</h2>\\n<p>Do not forget that when we truncate the word, we also must count the length added by <code>...</code></p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">truncate</span>(<span class=\\\"hljs-params\\\">str, num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (str.length &lt;= num)\\n    <span class=\\\"hljs-keyword\\\">return</span> str;\\n  \\n  <span class=\\\"hljs-keyword\\\">if</span> (num &lt;= <span class=\\\"hljs-number\\\">3</span>)\\n    <span class=\\\"hljs-keyword\\\">return</span> str.substr(<span class=\\\"hljs-number\\\">0</span>,num) + <span class=\\\"hljs-string\\\">\\\"...\\\"</span>;\\n  \\n  <span class=\\\"hljs-keyword\\\">return</span> str.substr(<span class=\\\"hljs-number\\\">0</span>,num-<span class=\\\"hljs-number\\\">3</span>) + <span class=\\\"hljs-string\\\">\\\"...\\\"</span>;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<p>First we need an if-statement to test if the length of the full string passed in as the first argument already fits within the size limit passed in as the second argument. If so we can just return the string that was passed in.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">if</span> (str.length &lt;= num)\\n  <span class=\\\"hljs-keyword\\\">return</span> str;\\n</code></pre>\\n<p>Then we need to check if the num fits into our special case, where the desired length is less than or equal to three. In this case we will return the string trimmed to our target length, followed by <code>&quot;...&quot;</code>. We don’t need to worry about the <code>&quot;...&quot;</code> being counted against the length of our output string in this case.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">if</span> (num &lt;= <span class=\\\"hljs-number\\\">3</span>)\\n  <span class=\\\"hljs-keyword\\\">return</span> str.substr(<span class=\\\"hljs-number\\\">0</span>,num) + <span class=\\\"hljs-string\\\">\\\"...\\\"</span>;\\n</code></pre>\\n<p>Finally, we write the return for what happens when neither of the previous if-statements have been true. This call to <code>substr()</code> gives us a string that is 3 less than the target length specified by <code>num</code>, which is done so that we have room to add on the <code>&quot;...&quot;</code> and fit within that target.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">return</span> str.substr(<span class=\\\"hljs-number\\\">0</span>,num-<span class=\\\"hljs-number\\\">3</span>) + <span class=\\\"hljs-string\\\">\\\"...\\\"</span>;\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @Rafase282 @richyvk @ltegman for your help with Bonfire: Truncate a String</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Truncate-a-String/index.md\n ** module id = 345\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Truncate-a-String/index.md?");

