	eval("module.exports = {\"title\":\"Bonfire Validate US Telephone Numbers\",\"order\":5,\"body\":\"<h1>Problem Explanation:</h1>\\n<ul>\\n<li>The task is not that hard to understand, implementing it is the hardest part. You have a to validate an US phone number. This means there is a certain amount of numbers required, while you don’t need to put the country code, you will still need the area code and use one of the few formats allowed.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>There is no way around it, you will need to brush up your regular expressions skills.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Try using a site like <a href=\\\"http://regexpal.com/\\\">http://regexpal.com/</a> to test the regex live while you create it.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Start by trying to get it to validate each format from the example, each one should take a new line, once you get to select them all, then add examples that should not be selected and make sure they are not selected.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution 1:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">telephoneCheck</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n    \\n   <span class=\\\"hljs-keyword\\\">var</span> regex = <span class=\\\"hljs-regexp\\\">/^(1\\\\s?)?(\\\\(\\\\d{3}\\\\)|\\\\d{3})[\\\\s\\\\-]?\\\\d{3}[\\\\s\\\\-]?\\\\d{4}$/</span>;\\n  \\n   <span class=\\\"hljs-keyword\\\">return</span> regex.test(str);\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li><code>^</code> denotes the beginning of the string <code>(1\\\\s?)?</code> checks allows for a “1” or a &quot;1 &quot; at the beginning.</li>\\n<li><code>\\\\d{n}</code> checks for exactly n number of digits so  <code>(\\\\(\\\\d{3}\\\\)|\\\\d{3})</code> checks for three digits that are allowed to be between parenthesis.</li>\\n<li><code>[\\\\s\\\\-]?</code> checks for spaces or dashes between the groups of digits.</li>\\n<li><code>$</code> denotes the end of the string. In this case the beginning and end of the string are used in the regex to prevent it from matching any longer string that might contain a valid phone number (eg. “s 555 555 5555 a”).</li>\\n<li>Lastly we use <code>regex.test(str)</code> to test if the string adheres to the regular expression and return <code>true</code> or <code>false</code>.</li>\\n</ul>\\n<h2>Code Solution 2:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">telephoneCheck</span>(<span class=\\\"hljs-params\\\">str</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Comprehensive regex from @dting </span>\\n  <span class=\\\"hljs-keyword\\\">var</span> re = <span class=\\\"hljs-regexp\\\">/^(?:(?:\\\\+?1\\\\s*(?:[.-]\\\\s*)?)?(?:\\\\(\\\\s*([2-9]1[02-9]|[2-9][02-8]1|[2-9][02-8][02-9])\\\\s*\\\\)|([2-9]1[02-9]|[2-9][02-8]1|[2-9][02-8][02-9]))\\\\s*(?:[.-]\\\\s*)?)?([2-9]1[02-9]|[2-9][02-9]1|[2-9][02-9]{2})\\\\s*(?:[.-]\\\\s*)?([0-9]{4})$/</span>;\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> re.test(str);\\n}\\n</code></pre>\\n<h1>Code Explanation</h1>\\n<ul>\\n<li>This is an example of a very comprehensive and robust solution to validating US phone numbers client side. In such cases it might be much better and easier to implement this library <a href=\\\"https://github.com/googlei18n/libphonenumber\\\">libphonenumber.</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 @guyjoseph @dting @jhalls @crisvdkooij for your help with Bonfire: Validate US Telephone Numbers</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Validate-US-Telephone-Numbers/index.md\n ** module id = 346\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Validate-US-Telephone-Numbers/index.md?");

