	eval("module.exports = {\"title\":\"Bonfire Where art thou\",\"order\":5,\"body\":\"<p><img src=\\\"http://i.imgur.com/IUY2p6Y.jpg\\\" alt=\\\"\\\"></p>\\n<h1>Problem Explanation</h1>\\n<p>Write an algorithm that will take an <code>array</code> for the first argument and return an <code>array</code> with all the  <code>object</code>s that matches all the properties and values in the <code>Object</code> passed as second parameter.</p>\\n<h2>Hint: 1</h2>\\n<p>You may use <code>for</code> loop or the <code>Array.prototype.filter</code> method.</p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+for\\\">http://devdocs.io/#q=js+for</a></li>\\n<li><a href=\\\"http://devdocs.io/#q=js+Array+filter\\\">http://devdocs.io/#q=js+Array+filter</a></li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<p>Try to use <code>Object.prototype.hasOwnProperty</code> method to know if the property name exists in an object (as its own property).</p>\\n<ul>\\n<li><a href=\\\"http://devdocs.io/#q=js+Object+hasOwnProperty\\\">http://devdocs.io/#q=js+Object+hasOwnProperty</a></li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<p>Check equivalence of <code>Object</code> in <code>collection</code> with <code>Object</code> passed as second parameter to <code>where</code> function.</p>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<h3>First</h3>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">where</span>(<span class=\\\"hljs-params\\\">collection, source</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// \\\"What's in a name? that which we call a rose</span>\\n  <span class=\\\"hljs-comment\\\">// By any other name would smell as sweet.”</span>\\n  <span class=\\\"hljs-comment\\\">// -- by William Shakespeare, Romeo and Juliet</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> srcKeys = <span class=\\\"hljs-built_in\\\">Object</span>.keys(source);\\n\\n  <span class=\\\"hljs-comment\\\">// filter the collection</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> collection.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; srcKeys.length; i++) {\\n      <span class=\\\"hljs-comment\\\">// check if obj in collection doesn't have the key</span>\\n      <span class=\\\"hljs-comment\\\">// or if it does have the key,</span>\\n      <span class=\\\"hljs-comment\\\">// then check if the property value doesn't match the value in source</span>\\n      <span class=\\\"hljs-keyword\\\">if</span>(!obj.hasOwnProperty(srcKeys[i]) || obj[srcKeys[i]] !== source[srcKeys[i]]) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n      }\\n    }\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n  });\\n}\\n</code></pre>\\n<h3>Second</h3>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">where</span>(<span class=\\\"hljs-params\\\">collection, source</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// \\\"What's in a name? that which we call a rose</span>\\n  <span class=\\\"hljs-comment\\\">// By any other name would smell as sweet.”</span>\\n  <span class=\\\"hljs-comment\\\">// -- by William Shakespeare, Romeo and Juliet</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> srcKeys = <span class=\\\"hljs-built_in\\\">Object</span>.keys(source);\\n\\n  <span class=\\\"hljs-comment\\\">// filter the collection</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> collection.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n    <span class=\\\"hljs-comment\\\">// return a Boolean value for `filter` method</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> srcKeys.every(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">key</span>) </span>{\\n      <span class=\\\"hljs-comment\\\">// reduce to Boolean value to be returned for `every` method</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> obj.hasOwnProperty(key) &amp;&amp; obj[key] === source[key];\\n    });\\n  });\\n}\\n</code></pre>\\n<h3>Third</h3>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">where</span>(<span class=\\\"hljs-params\\\">collection, source</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// \\\"What's in a name? that which we call a rose</span>\\n  <span class=\\\"hljs-comment\\\">// By any other name would smell as sweet.”</span>\\n  <span class=\\\"hljs-comment\\\">// -- by William Shakespeare, Romeo and Juliet</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> srcKeys = <span class=\\\"hljs-built_in\\\">Object</span>.keys(source);\\n\\n  <span class=\\\"hljs-comment\\\">// filter the collection</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> collection.filter(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">obj</span>) </span>{\\n    <span class=\\\"hljs-comment\\\">// return a Boolean value for filter callback using reduce method</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> srcKeys.reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">res, key</span>) </span>{\\n      <span class=\\\"hljs-comment\\\">// reduce to Boolean value to be returned by reduce method</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> obj.hasOwnProperty(key) &amp;&amp; obj[key] === source[key];\\n    }, <span class=\\\"hljs-literal\\\">false</span>);\\n  });\\n}\\n</code></pre>\\n<h3>Fourth</h3>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">where</span>(<span class=\\\"hljs-params\\\">collection, source</span>) </span>{\\n<span class=\\\"hljs-comment\\\">//Array for storing the matched objects</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> arr = [];\\n  <span class=\\\"hljs-comment\\\">//For maintaining the number of key-value matches</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> count ;\\n  collection.forEach(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">collObj</span>) </span>{ \\n  <span class=\\\"hljs-comment\\\">//Initialize to zero for each object in collection</span>\\n     count = <span class=\\\"hljs-number\\\">0</span> ; \\n     <span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> prop <span class=\\\"hljs-keyword\\\">in</span> source){\\n     <span class=\\\"hljs-comment\\\">//Check whether the key exists and the key-value is matched</span>\\n        <span class=\\\"hljs-keyword\\\">if</span>( collObj.hasOwnProperty(prop) &amp;&amp; collObj[prop] === source[prop])\\n        <span class=\\\"hljs-comment\\\">//Increase the count if matched</span>\\n        count++; \\n       }\\n     <span class=\\\"hljs-comment\\\">//Check whether all key-value pairs in source are matched</span>\\n     <span class=\\\"hljs-keyword\\\">if</span>(count&gt;=<span class=\\\"hljs-built_in\\\">Object</span>.keys(source).length){ \\n        arr.push(collObj);\\n      }\\n    \\n    });\\n    <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\n</code></pre>\\n<h2>Code Explanation:</h2>\\n<blockquote>\\n<p>Please read the comments in the source code.</p>\\n</blockquote>\\n<p>Check this <a href=\\\"http://repl.it/BFZQ/19\\\">http://repl.it/BFZQ/19</a> for pretty debugging and code explanation</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat: <strong><code>Thanks @abhisekp @dting @coded9 for your help with Bonfire: Where art Thou</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Bonfire-Where-art-thou/index.md\n ** module id = 347\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Bonfire-Where-art-thou/index.md?");

