	eval("module.exports = {\"title\":\"Brownie Points\",\"order\":5,\"body\":\"<p>The number beside your picture on Free Code Camp tells you how many Brownie Points you have.</p>\\n<p><img src=\\\"http://i.imgur.com/SsvbkDH.png\\\" alt=\\\"A user profile picture next to a with Brownie Points score\\\"></p>\\n<p>There are three ways you can get Brownie Points:</p>\\n<ol>\\n<li>Complete challenges - you get one point per challenge you complete</li>\\n<li>Post relevant links on <a href=\\\"https://freecodecamp.com/wiki/docs/Camper-News\\\">Camper News</a> - you get 1 point for posting a link, and another point for each upvote your link gets</li>\\n<li>Help other campers in chat - each time you help another camper and they thank you (by typing “thanks @yourname”), you will get a point</li>\\n</ol>\\n<blockquote>\\n<p>Brownie Points help you look like the kind of person who codes a lot, shares relevant links, and helps people.</p>\\n</blockquote>\\n<p><em>They also add to your <a href=\\\"https://freecodecamp.com/wiki/docs/streak/\\\">Streak</a>.</em></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Brownie-Points/index.md\n ** module id = 352\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Brownie-Points/index.md?");

