	eval("module.exports = {\"title\":\"Checkpoint Convert Celsius to Fahrenheit\",\"order\":5,\"body\":\"<h1>Details</h1>\\n<p>The algorithm to convert from Celsius to Fahrenheit is the temperature in Celsius times 9/5, plus 32.</p>\\n<p>You are given a variable <code>celsius</code> representing a temperature in Celsius. Create a variable <code>fahrenheit</code> and apply the algorithm to assign it the corresponding temperature in Fahrenheit.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.purplemath.com/modules/orderops.htm\\\">The Order of Operations: PEMDAS</a></li>\\n<li><a href=\\\"https://www.khanacademy.org/math/pre-algebra/order-of-operations/order_of_operations/v/order-of-operations\\\">Order of Operation: Video</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Explain what is asked in an easy to understand way.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Take a look at the code, there is an area that you’re not supposed to edit, from there ask yourself, what is used there that I don’t see before?</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Keep in mind the <code>order of operation</code> check the link in the <em>link</em> section for more information.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">convert</span>(<span class=\\\"hljs-params\\\">celsius</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Only change code below this line</span>\\n  <span class=\\\"hljs-keyword\\\">var</span> fahrenheit = (celsius * (<span class=\\\"hljs-number\\\">9</span>/<span class=\\\"hljs-number\\\">5</span>)) + <span class=\\\"hljs-number\\\">32</span>;\\n\\n  <span class=\\\"hljs-comment\\\">// Only change code above this line</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> ( <span class=\\\"hljs-keyword\\\">typeof</span> fahrenheit !== <span class=\\\"hljs-string\\\">'undefined'</span> ) {\\n  <span class=\\\"hljs-keyword\\\">return</span> fahrenheit;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">'fahrenheit not defined'</span>;\\n  }\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Change the inputs below to test your code</span>\\nconvert(<span class=\\\"hljs-number\\\">30</span>);\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Make sure the proper order is followed with arithmetic using <code>()</code> when needed.</li>\\n<li>Declare the <code>fahrenheit</code> variable.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 for your help with Checkpoint: Convert Celsius to Fahrenheit</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Convert-Celsius-to-Fahrenheit/index.md\n ** module id = 355\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Convert-Celsius-to-Fahrenheit/index.md?");

