	eval("module.exports = {\"title\":\"Checkpoint Counting Cards\",\"order\":5,\"body\":\"<h1>Checkpoint: Counting Cards</h1>\\n<p><strong><em>About Blackjack</em></strong></p>\\n<p>In the casino game Blackjack, a player can gain an advantage over the house by keeping track of the relative number of high and low cards remaining in the deck. This is called <a href=\\\"https://en.wikipedia.org/wiki/Card_counting\\\" title=\\\"Wikipedia entry on Card Counting\\\">Card Counting</a>.</p>\\n<p>Having more high cards remaining in the deck favors the player. Each card is assigned a value according to the table below. When the count is positive, the player should bet high. When the count is zero or negative, the player should bet low.</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Value</th>\\n<th style=\\\"text-align:center\\\">Cards</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>+1</td>\\n<td style=\\\"text-align:center\\\">2, 3, 4, 5, 6</td>\\n</tr>\\n<tr>\\n<td>0</td>\\n<td style=\\\"text-align:center\\\">7, 8, 9</td>\\n</tr>\\n<tr>\\n<td>-1</td>\\n<td style=\\\"text-align:center\\\">10, ‘J’, ‘Q’, ‘K’,‘A’</td>\\n</tr>\\n</tbody>\\n</table>\\n<p><strong><em>Instructions</em></strong></p>\\n<p>You will write a card counting function. It will receive a <strong>card</strong> parameter and increment or decrement the global <strong>count</strong> variable according to the card’s value (see table). The function will then return the current count and the string <strong>“Bet”</strong> if the count is positive, or <strong>“Hold”</strong> if the count is zero or negative.</p>\\n<p><strong>Example Output:</strong></p>\\n<ul>\\n<li>-3 Hold</li>\\n<li>5 Bet</li>\\n</ul>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-selecting-from-many-options-with-switch-statements\\\">Waypoint: Selecting from many options with Switch Statements</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-chaining-if-else-statements\\\">Waypoint: Chaining If Else Statements</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-increment-a-number-with-javascript\\\">Waypoint: Increment a Number with Javascript</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>// Only change code below this line</code> and up to <code>// Only change code above this line</code></li>\\n<li>Take note that you are editing the inside of the <code>cc</code> function</li>\\n<li>Use what you’ve learned to check the value of each <code>card</code> parameter passed into the function</li>\\n<li>Keep a running count of that number</li>\\n<li>If the final count is 1 or greater, return <strong># Hold</strong></li>\\n<li>If the final count is 0 or less, return <strong># Bet</strong></li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Use a <code>switch</code> (or <code>else if</code>) statement to count the value of each card.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Add/subtract the value of each card to variable <code>count</code>. If the card is worth 0, don’t do anything!</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>After you’ve counted the cards, use an <code>if</code> statement to check the value of <code>count</code>. Also, make sure your return has a space between the number and the string.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code><span class=\\\"hljs-function\\\">function <span class=\\\"hljs-title\\\">cc</span><span class=\\\"hljs-params\\\">(card)</span> </span>{\\n  <span class=\\\"hljs-comment\\\">// Only change code below this line</span>\\n  <span class=\\\"hljs-keyword\\\">switch</span>(card){\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">2</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">3</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">4</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">5</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">6</span>:\\n      count++;\\n      <span class=\\\"hljs-keyword\\\">break</span>;\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-number\\\">10</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-string\\\">\\\"J\\\"</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-string\\\">\\\"Q\\\"</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-string\\\">\\\"K\\\"</span>:\\n    <span class=\\\"hljs-keyword\\\">case</span> <span class=\\\"hljs-string\\\">\\\"A\\\"</span>:\\n      count--;\\n      <span class=\\\"hljs-keyword\\\">break</span>;\\n  }\\n  <span class=\\\"hljs-keyword\\\">if</span> (count &gt; <span class=\\\"hljs-number\\\">0</span>){\\n    <span class=\\\"hljs-keyword\\\">return</span> count + <span class=\\\"hljs-string\\\">\\\" Bet\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-keyword\\\">return</span> count + <span class=\\\"hljs-string\\\">\\\" Hold\\\"</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">// Only change code above this line</span>\\n}\\n\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Checks the value of each card via a <code>switch</code> statement</li>\\n<li>The variable <code>count</code>:\\n<ul>\\n<li>Increases by 1 if the card is a 2, 3, 4, 5, or 6</li>\\n<li>Since 7, 8, and 9 aren’t worth anything, we ignore those cards in our <code>switch</code> statement.</li>\\n<li>Decreases by 1 if the card is a 10, ‘J’, ‘Q’, ‘K’, or ‘A’</li>\\n</ul>\\n</li>\\n<li>Checks the value of <code>count</code> and returns the appropriate response</li>\\n</ul>\\n<p><strong><em>Example Run</em></strong></p>\\n<ul>\\n<li><code>cc(2);</code> runs</li>\\n<li>The <code>switch</code> statement hits <code>case 2</code>, jumps down and adds 1 to the variable <code>count</code></li>\\n<li>The <code>switch</code> statement then hits the <code>break</code> and <code>cc(3);</code> runs</li>\\n<li>This cycle continues until the final call is made, <code>cc('A');</code></li>\\n<li>After the <code>switch</code> statement, the <code>if</code> statement checks <code>count</code>, which is now 0</li>\\n<li>This then drops down to the <code>else</code> statement, which will return <strong>0 Hold</strong></li>\\n</ul>\\n<p><strong><em>Note</em></strong>\\nAs mentioned earlier, the <code>switch</code> statement could have also been an <code>else if</code> statment</p>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @leftynaut for your help with Checkpoint: Counting Cards</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Counting-Cards/index.md\n ** module id = 356\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Counting-Cards/index.md?");

