	eval("module.exports = {\"title\":\"Checkpoint Golf Code\",\"order\":5,\"body\":\"<h1>Details</h1>\\n<p>We will now use our knowledge about else if statements and comparison with equality, less and greater operators.</p>\\n<p>In the game of golf each hole has a par for the average number of strokes needed to sink the ball. Depending on how far above or below par your strokes are, there is a different nickname.</p>\\n<p>Your function will be passed a par and strokes. Return strings according to this table (based on order of priority - top (highest) to bottom (lowest)):</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\\"text-align:left\\\">Strokes</th>\\n<th style=\\\"text-align:left\\\">Return</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\\"text-align:left\\\">1</td>\\n<td style=\\\"text-align:left\\\">“Hole-in-one!”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">&lt;= par - 2</td>\\n<td style=\\\"text-align:left\\\">“Eagle”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">par - 1</td>\\n<td style=\\\"text-align:left\\\">“Birdie”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">par</td>\\n<td style=\\\"text-align:left\\\">“Par”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">par + 1</td>\\n<td style=\\\"text-align:left\\\">“Bogey”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">par + 2</td>\\n<td style=\\\"text-align:left\\\">“Double Bogey”</td>\\n</tr>\\n<tr>\\n<td style=\\\"text-align:left\\\">&gt;= par + 3</td>\\n<td style=\\\"text-align:left\\\">“Go Home!”</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>par and strokes will always be numeric and positive.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-chaining-if-else-statements\\\">Waypoint: Chaining If Else Statements</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-comparison-with-the-greater-than-equal-to-operator\\\">Waypoint: Comparison with the Greater Than Equal To Operator</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-comparison-with-the-less-than-equal-to-operator\\\">Waypoint: Comparison with the Less Than Equal To Operator</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>// Only change code below this line</code> and above <code>// Only change code above this line</code></li>\\n<li>Take note that you are editing the inside of the <code>golfScore</code> function.</li>\\n<li>You will have to make the function return exactly the same string as shown shown on table, depending on the value of the parameters <code>par</code> and <code>strokes</code> that are passed in to your function.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li><code>+number -number</code> can be used to increase or decrease a parameter in your condition.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>You can chain else if statements to return different values in different scenarios.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Control the flow of your function based on the tables order of priority - top (highest) to bottom (lowest) to return matching string values.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">golfScore</span>(<span class=\\\"hljs-params\\\">par, strokes</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Only change code below this line</span>\\n  <span class=\\\"hljs-keyword\\\">if</span> (strokes == <span class=\\\"hljs-number\\\">1</span>){\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Hole-in-one!\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (strokes &lt;= par -<span class=\\\"hljs-number\\\">2</span>){\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Eagle\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (strokes == par -<span class=\\\"hljs-number\\\">1</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Birdie\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (strokes == par) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Par\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (strokes == par +<span class=\\\"hljs-number\\\">1</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Bogey\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (strokes == par +<span class=\\\"hljs-number\\\">2</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Double Bogey\\\"</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Go Home!\\\"</span>;\\n  }\\n  <span class=\\\"hljs-comment\\\">// Only change code above this line</span>\\n}\\n<span class=\\\"hljs-comment\\\">// Change these values to test</span>\\ngolfScore(<span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">4</span>);\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Comparing the <code>parameters</code> stroke and par value to return appropriated string value.</li>\\n<li>Using else if statement for flow control</li>\\n<li>else will return string “Go home!” to every condition where strokes are equal to par +3 or higher</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @osterbergmarcus for your help with Checkpoint: Golf Code</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Golf-Code/index.md\n ** module id = 357\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Golf-Code/index.md?");

