	eval("module.exports = {\"title\":\"Checkpoint Profile Lookup\",\"order\":5,\"body\":\"<h1>Checkpoint: Profile Lookup</h1>\\n<p><strong><em>Instructions</em></strong></p>\\n<p>We have an array of objects representing different people in our contacts lists.</p>\\n<p>A <strong>lookUp</strong> function that takes <strong>firstName</strong> and a property (<strong>prop</strong>) as arguments has been pre-written for you.</p>\\n<p>The function should check if <strong>firstName</strong> is an actual contact’s <strong>firstName</strong> and the given property (<strong>prop</strong>) is a property of that contact.</p>\\n<p>If both are true, then return the “value” of that property.</p>\\n<p>If <strong>firstName</strong> does not correspond to any contacts then return <strong>“No such contact”</strong></p>\\n<p>If <strong>prop</strong> does not correspond to any valid properties then return <strong>“No such property”</strong></p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-accessing-objects-properties-with-bracket-notation\\\">Waypoint: Accessing Objects Properties with Bracket Notation</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-iterate-with-javascript-for-loops\\\">Waypoint: Iterate with JavaScript For Loops</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>// Only change code below this line</code> and up to <code>// Only change code above this line</code></li>\\n<li>Take note that you are editing the inside of the <code>lookUp</code> function\\n<ul>\\n<li>This function includes two parameters, <code>firstName</code> and <code>prop</code></li>\\n</ul>\\n</li>\\n<li>The function should check look through the <code>contact</code> list for the given <code>firstName</code> parameter\\n<ul>\\n<li>If there is a match found, the function should then look for the given <code>prop</code> parameter</li>\\n<li>If both <code>firstName</code> and the associated <code>prop</code> are found, you should return the value of the <code>prop</code></li>\\n<li>If <code>firstName</code> is found and no associated <code>prop</code> is found, you should return <code>&quot;No such property&quot;</code></li>\\n<li>If <code>firstName</code> isn’t found anywhere, you should return <code>&quot;No such contact&quot;</code></li>\\n</ul>\\n</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Use a <strong>for loop</strong> to cycle through the <code>contact</code> list</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Use a nested <code>if</code> statement to first check if the <code>firstName</code> matches, and then checks if the <code>prop</code> matches</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Leave your <code>return &quot;No such contact&quot;</code> out of the <code>for loop</code> as a final catch-all</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code><span class=\\\"hljs-keyword\\\">for</span> (var x = <span class=\\\"hljs-number\\\">0</span>; x &lt; contacts.<span class=\\\"hljs-property\\\">length</span>; x++){\\n    <span class=\\\"hljs-keyword\\\">if</span> (contacts[x].firstName === firstName) {\\n        <span class=\\\"hljs-keyword\\\">if</span> (contacts[x][<span class=\\\"hljs-keyword\\\">prop</span>]) {\\n<span class=\\\"hljs-command\\\">            return</span> contacts[x][<span class=\\\"hljs-keyword\\\">prop</span>];\\n        } <span class=\\\"hljs-keyword\\\">else</span> {\\n<span class=\\\"hljs-command\\\">            return</span> <span class=\\\"hljs-string\\\">\\\"No such property\\\"</span>;\\n        }\\n    }\\n}\\n<span class=\\\"hljs-command\\\">return</span> <span class=\\\"hljs-string\\\">\\\"No such contact\\\"</span>;\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>The <strong>for loop</strong> runs, starting at the first object in the <code>contacts</code> list</li>\\n<li>If the <code>firstName</code> parameter passed into the function matches the value of the <code>&quot;firstName&quot;</code> key in the first object, the <code>if</code> statement passes</li>\\n<li>Then, if the <code>prop</code> parameter passed into the function is present in that object, the value of the <code>prop</code> is returned\\n<ul>\\n<li>If the second <code>if</code> statement fails, <code>&quot;No such property&quot;</code> is returned</li>\\n</ul>\\n</li>\\n<li>If the first <code>if</code> statement fails, the <strong>for loop</strong> continues on to the next object in the <code>contact</code> list</li>\\n<li>If the <code>firstName</code> parameter isn’t matched by the final <code>contact</code> object, the <strong>for loop</strong> exits and <code>&quot;No such contact&quot;</code> is returned</li>\\n</ul>\\n<p><strong><em>Example Run</em></strong></p>\\n<ul>\\n<li><code>lookUp(&quot;Akira&quot;,&quot;likes&quot;);</code> runs</li>\\n<li><code>&quot;Akira&quot;</code> is matched to the <code>&quot;firstName&quot;</code> key in the first object, so the <code>if</code> statement returns true</li>\\n<li><code>&quot;likes&quot;</code> is found within the first object, so the second <code>if</code> statement returns true</li>\\n<li>The value of <code>&quot;likes&quot;</code> is returned - <code>&quot;Pizza&quot;, &quot;Coding&quot;, &quot;Brownie Points&quot;</code></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @leftynaut for your help with Checkpoint: Profile Lookup</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Profile-Lookup/index.md\n ** module id = 358\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Profile-Lookup/index.md?");

