	eval("module.exports = {\"title\":\"Checkpoint Record Collection\",\"order\":5,\"body\":\"<h1>Checkpoint: Record Collection</h1>\\n<p><strong><em>Instructions</em></strong></p>\\n<p>You are given a JSON object representing (a small part of) your record collection. Each album is identified by a unique id number and has several properties. Not all albums have complete information.</p>\\n<p>Write a function which takes an <strong>id</strong>, a property (<strong>prop</strong>), and a <strong>value</strong>.</p>\\n<p>For the given <strong>id</strong> in <strong>collection</strong>:</p>\\n<p>If <strong>value</strong> is non-blank (<strong>value !== “”</strong>), then update or set the <strong>value</strong> for the <strong>prop</strong>.</p>\\n<p>If the <strong>prop</strong> is <strong>“tracks”</strong> and <strong>value</strong> is non-blank, push the <strong>value</strong> onto the end of the <strong>tracks</strong> array.</p>\\n<p>If <strong>value</strong> is blank, delete that <strong>prop</strong>.</p>\\n<p>Always return the entire collection object.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-accessing-objects-properties-with-bracket-notation\\\">Waypoint: Accessing Objects Properties with Bracket Notation</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-add-new-properties-to-a-javascript-object\\\">Waypoint: Add New Properties to a JavaScript Object</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-delete-properties-from-a-javascript-object\\\">Waypoint: Delete Properties from a JavaScript Object</a></li>\\n<li>[Waypoint: Accessing Nested Objects in JSON] (<a href=\\\"http://www.freecodecamp.com/challenges/waypoint-accessing-nested-objects-in-json\\\">http://www.freecodecamp.com/challenges/waypoint-accessing-nested-objects-in-json</a>)</li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>// Only change code below this line</code> and up to <code>// Alter values below to test your code</code></li>\\n<li>Take note that you are editing the inside of the <code>update</code> function</li>\\n<li>For the given <code>id</code> parameter, which is associated to the <code>collection</code> object:\\n<ul>\\n<li>If the <code>value</code> parameter isn’t an empty string, update (or set) the <code>value</code> parameter for the <code>prop</code> parameter</li>\\n<li>If the <code>prop</code> parameter is equal to <code>&quot;tracks&quot;</code> and the <code>value</code> isn’t an empty string, push the <code>value</code> onto the end of the <code>tracks</code> array</li>\\n<li>If <code>value</code> is an empty string, delete that <code>prop</code> from the object</li>\\n</ul>\\n</li>\\n<li>Finally, return the <code>collection</code> object</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>Use an <code>else if</code> statement to check the needed steps.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>The second step listed in the instructions should be first in your <code>else if</code> statement.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>To access the value of a key in this object, you will use <code>collection[id][prop]</code></li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code>function update(<span class=\\\"hljs-property\\\">id</span>, <span class=\\\"hljs-keyword\\\">prop</span>, value) {\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">prop</span> === <span class=\\\"hljs-string\\\">\\\"tracks\\\"</span> &amp;&amp; value !== <span class=\\\"hljs-string\\\">\\\"\\\"</span>) {\\n    collection[<span class=\\\"hljs-property\\\">id</span>][<span class=\\\"hljs-keyword\\\">prop</span>].push(value);\\n  } <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (value !== <span class=\\\"hljs-string\\\">\\\"\\\"</span>){\\n    collection[<span class=\\\"hljs-property\\\">id</span>][<span class=\\\"hljs-keyword\\\">prop</span>] = value;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    delete collection[<span class=\\\"hljs-property\\\">id</span>][<span class=\\\"hljs-keyword\\\">prop</span>];\\n  }\\n<span class=\\\"hljs-command\\\">\\n  return</span> collection;\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>First checks if <code>prop</code> is equal to <code>tracks</code> AND if <code>value</code> isn’t a blank string. If both tests pass, <code>value</code> is pushed into the <code>tracks</code> array.</li>\\n<li>If that first check doesn’t pass, it next checks only if <code>value</code> isn’t a blank string. If that test passes, either a new key (<code>prop</code>) and value (<code>value</code>) are added to the object, or an existing key is updated if the <code>prop</code> already exists.</li>\\n<li>If both these checks fail (meaning <code>value</code> must be an empty string), then the key (<code>prop</code>) is removed from the object.</li>\\n</ul>\\n<p><strong><em>Example Run</em></strong></p>\\n<ul>\\n<li><code>update(5439, &quot;artist&quot;, &quot;ABBA&quot;);</code> runs</li>\\n<li><code>prop</code> is equal to “artist”, not “tracks”, so the first part of the <code>else if</code> statement fails</li>\\n<li><code>value</code> is not a blank string, so the second part of the else if statement passes</li>\\n<li><code>artist: &quot;ABBA&quot;</code> is added to the <code>5439</code> <code>id</code></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @leftynaut for your help with Checkpoint: Record Collection</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Record-Collection/index.md\n ** module id = 359\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Record-Collection/index.md?");

