	eval("module.exports = {\"title\":\"Checkpoint Shopping List\",\"order\":5,\"body\":\"<h1>Instructions</h1>\\n<p>Create a shopping list in the variable <code>myList</code>. The list should be a multi-dimensional array containing several sub-arrays.</p>\\n<p>The first element in each sub-array should contain a string with the name of the item. The second element should be a number representing the quantity.</p>\\n<p><code>[&quot;Chocolate Bar&quot;, 15]</code></p>\\n<p>There should be at least 5 sub-arrays in the list.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Link</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-nest-one-array-within-another-array\\\">Waypoint: Nest one Array within Another Array</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li><code>myList</code> should be an array.</li>\\n<li>The first elements in each of your sub-arrays must all be strings.</li>\\n<li>The second elements in each of your sub-arrays must all be numbers.</li>\\n<li>You must have at least 5 items in your list.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li>A multi-dimensional array would have the following outline <code>[[]]</code></li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Each sub-array should be separated by <code>,</code> as would any item in an array.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>Don’t forget the <code>;</code> at the end of your declaration.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> myList = [[<span class=\\\"hljs-string\\\">\\\"Canned Beans\\\"</span>, <span class=\\\"hljs-number\\\">3</span>],[<span class=\\\"hljs-string\\\">\\\"Milk Galon\\\"</span>, <span class=\\\"hljs-number\\\">1</span>],[<span class=\\\"hljs-string\\\">\\\"Cereal\\\"</span>, <span class=\\\"hljs-number\\\">2</span>],[<span class=\\\"hljs-string\\\">\\\"Toilet Paper\\\"</span>, <span class=\\\"hljs-number\\\">12</span>],[<span class=\\\"hljs-string\\\">\\\"Sack of Rice\\\"</span>, <span class=\\\"hljs-number\\\">1</span>]];\\n\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Created an array that has five arrays inside composed of a string and an integer in that order.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 for your help with Checkpoint: Shopping List</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Shopping-List/index.md\n ** module id = 360\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Shopping-List/index.md?");

