	eval("module.exports = {\"title\":\"Checkpoint Stand In Line\",\"order\":5,\"body\":\"<h1>Checkpoint: Stand In Line</h1>\\n<p><strong><em>About queues</em></strong></p>\\n<p>In Computer Science a <strong>queue</strong> is an abstract <em>Data Structure</em> where items are kept in order. New items can be added at the back of the queue and old items are taken off from the front of the <em>queue</em>.</p>\\n<p><strong><em>Instructions</em></strong></p>\\n<p>Write a function queue which takes an “array” and an “item” as arguments.</p>\\n<p>Add the item onto the end of the array, then remove the first element of the array.</p>\\n<p>The queue function should return the element that was removed.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-manipulate-arrays-with-push\\\">Waypoint: Manipulate Arrays With push()</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-manipulate-arrays-with-shift\\\">Waypoint: Manipulate Arrays With shift()</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-passing-values-to-functions-with-arguments\\\">Waypoint: Passing Values to Functions with Arguments</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>//Your Code here</code> and up to <code>//Change this line</code></li>\\n<li>Take note that you are editing the inside of the queue function</li>\\n<li>Use an array function you learned to add the <code>item</code> to the end of the array <code>arr</code></li>\\n<li>Use an array function you learned to remove the first element from array <code>arr</code></li>\\n<li>Return the element removed</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li><code>push</code> adds an item to the end of an array.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li><code>shift</code> removes the first element of an array. It also gives that element back to you.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li>The function queue uses <code>arr</code> and <code>item</code>. Those are what the tests will use to pass the arrays and elements they will test with and allows the function to be reusable. Do not hardcode any of the tests inside the function.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">queue</span>(<span class=\\\"hljs-params\\\">arr, item</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Your code here</span>\\n  arr.push(item);\\n  <span class=\\\"hljs-keyword\\\">var</span> removed = arr.shift();\\n  <span class=\\\"hljs-keyword\\\">return</span> removed;  <span class=\\\"hljs-comment\\\">// Change this line</span>\\n}\\n</code></pre>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Pushes item at the end of arr</li>\\n<li>Calls shift on arr to get the first item and stores it in removed</li>\\n<li>Returns removed</li>\\n</ul>\\n<p><strong><em>Example Run</em></strong></p>\\n<ul>\\n<li>Test <code>queue([2], 1);</code> runs</li>\\n<li>The <code>queue</code> function is called. <code>arr</code> becomes [2]. <code>item</code> becomes 1.</li>\\n<li><code>arr.push(item);</code> Pushes 1 to [2]. So <code>arr</code> is now [2,1]</li>\\n<li><code>var removed = arr.shift();</code> Removes the first element. So <code>arr</code> is now [1]. 2 has been removed and is stored in <code>removed</code></li>\\n<li><code>return removed;</code> 2 is returned</li>\\n</ul>\\n<p><strong><em>Note</em></strong>\\nYou don’t actually need to store it in a variable if you return it directly!</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">queue</span>(<span class=\\\"hljs-params\\\">arr, item</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Your code here</span>\\n  arr.push(item);\\n  <span class=\\\"hljs-keyword\\\">return</span> arr.shift();  <span class=\\\"hljs-comment\\\">// Change this line</span>\\n}\\n</code></pre>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @CaroleAnneHannon for your help with Checkpoint: Stand in Line</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Stand-In-Line/index.md\n ** module id = 361\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Stand-In-Line/index.md?");

