	eval("module.exports = {\"title\":\"Checkpoint Word Blanks\",\"order\":5,\"body\":\"<h1>Details</h1>\\n<p>We will now use our knowledge of strings to build a “Mad Libs” style word game we’re calling “Word Blanks”. You will create an (optionally humorous) “Fill in the Blanks” style sentence.</p>\\n<h2>Instructions</h2>\\n<p>You will need to use string operators to build a new string, result, using the provided variables: <code>myNoun</code>, <code>myAdjective</code>, <code>myVerb</code>, and <code>myAdverb</code>.</p>\\n<p>You will also need to provide additional strings, which will not change, in between the provided words.</p>\\n<p>Remember to use <a href=\\\"http://freecodecamp.com/wiki/docs/How-to-get-help-when-you-get-stuck\\\"> Read-Search-Ask</a> if you get stuck. Try to pair program. Write your own code.</p>\\n<h2>Useful Links</h2>\\n<ul>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Mad_Libs\\\">Mad Libs</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-constructing-strings-with-variables\\\">Waypoint: Constructing Strings with Variables</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-concatenating-strings-with-plus-operator\\\">Waypoint: Concatenating Strings with Plus Operator</a></li>\\n<li><a href=\\\"http://www.freecodecamp.com/challenges/waypoint-concatenating-strings-with-the-plus-equals-operator\\\">Waypoint: Concatenating Strings with the Plus Equals Operator</a></li>\\n</ul>\\n<h2>Problem Explanation:</h2>\\n<ul>\\n<li>Change the code below <code>//Your Code here</code> and up to <code>//Change this line</code>.</li>\\n<li>Take note that you are editing the inside of the <code>wordBlanks</code> function.</li>\\n<li>You will have basically create a sentence with the provided variables and strings you will make.</li>\\n</ul>\\n<h2>Hint: 1</h2>\\n<ul>\\n<li><code>+</code> can be used for <em>concatenating</em> with strings.</li>\\n</ul>\\n<h2>Hint: 2</h2>\\n<ul>\\n<li>Just as you can chain strings by concatenating, you can asign them to an existing variable instead of a new one.</li>\\n</ul>\\n<h2>Hint: 3</h2>\\n<ul>\\n<li><code>+=</code> will allow you use an existing variable, a string in this case. Remember to add your own <strong>non-letters</strong> in between each variable.</li>\\n</ul>\\n<h2>Spoiler Alert!</h2>\\n<p><a href=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"><img src=\\\"https://files.gitter.im/FreeCodeCamp/Wiki/nlOm/thumb/687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\" alt=\\\"687474703a2f2f7777772e796f75726472756d2e636f6d2f796f75726472756d2f696d616765732f323030372f31302f31302f7265645f7761726e696e675f7369676e5f322e676966.gif\\\"></a></p>\\n<p><strong>Solution ahead!</strong></p>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">wordBlanks</span>(<span class=\\\"hljs-params\\\">myNoun, myAdjective, myVerb, myAdverb</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> result = <span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\n    <span class=\\\"hljs-comment\\\">// Your code below this line</span>\\n    result+= <span class=\\\"hljs-string\\\">\\\"My \\\"</span>+myAdjective+<span class=\\\"hljs-string\\\">\\\" \\\"</span>+myNoun+<span class=\\\"hljs-string\\\">\\\" \\\"</span>+myVerb+<span class=\\\"hljs-string\\\">\\\" very \\\"</span>+myAdverb+<span class=\\\"hljs-string\\\">\\\".\\\"</span>;\\n\\n    <span class=\\\"hljs-comment\\\">// Your code above this line</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> result;\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Change the words here to test your function</span>\\nwordBlanks(<span class=\\\"hljs-string\\\">\\\"dog\\\"</span>, <span class=\\\"hljs-string\\\">\\\"big\\\"</span>, <span class=\\\"hljs-string\\\">\\\"ran\\\"</span>, <span class=\\\"hljs-string\\\">\\\"quickly\\\"</span>);\\n</code></pre>\\n<p><strong>Example Run</strong></p>\\n<ul>\\n<li>Test <code>wordBlanks(&quot;dog&quot;, &quot;big&quot;, &quot;ran&quot;, &quot;quickly&quot;);</code> runs.</li>\\n<li>Variable <code>result</code> is declared with an empty string <code>&quot;&quot;</code>.</li>\\n<li><code>result</code> will be changed with a new string composed of the concatenated strings “dog”, “big”, “ran”, “quickly” through the variables <code>myNoun</code>, <code>myAdjective</code>, <code>myVerb</code>, <code>myAdverb</code> respectively; the order is changed and whitespace added.</li>\\n<li><code>result</code> is returned.</li>\\n</ul>\\n<h1>Code Explanation:</h1>\\n<ul>\\n<li>Use <code>result</code> to concatenate the given variables separated by whitespace and added strings to forma full sentence.</li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:  <strong><code>thanks @Rafase282 for your help with Checkpoint: Word Blanks</code></strong></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Checkpoint-Word-Blanks/index.md\n ** module id = 363\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Checkpoint-Word-Blanks/index.md?");

