	eval("module.exports = {\"title\":\"Clear Your Browser's Local Storage\",\"order\":5,\"body\":\"<p>Removing all your locally stored challenges will solve many problems related to the browser crashing on FreeCodeCamp</p>\\n<p>In Chrome:</p>\\n<ul>\\n<li>On ’<a href=\\\"http://freecodecamp.com\\\">freecodecamp.com</a>’ open your console</li>\\n<li>Windows: Ctrl + Shift + J</li>\\n<li>Mac OS: Cmd + Opt + J</li>\\n<li>Go to resources tab(chrome).</li>\\n<li>There click on the localStorage link in the nav bar on the right.</li>\\n<li>Delete all the entries on the right side.</li>\\n<li>See if this solves your issue</li>\\n</ul>\\n<p><img src=\\\"https://cloud.githubusercontent.com/assets/6775919/9448820/911626ee-4a53-11e5-98c9-b2bf4ca50816.png\\\" alt=\\\"\\\"></p>\\n<p>Alternatively, if you are having issues with a specific challenge freezing your browser, <a href=\\\"https://freecodecamp.com/wiki/docs/How-to-clear-specific-values-from-your-browser's-local-storage\\\">find the name of that challenge in local storage and delete just that one</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Clear-Your-Browser's-Local-Storage/index.md\n ** module id = 364\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Clear-Your-Browser's-Local-Storage/index.md?");

