	eval("module.exports = {\"title\":\"Coding Help\",\"order\":5,\"body\":\"<h1>Coding Help</h1>\\n<p>I started this list while doing bonfires, noticing a few things that were common issues / questions but I think most of them are going to be useful to people coding in general. If you’ve got some tips to help people code I’d love to hear them.</p>\\n<ol>\\n<li>\\n<p>If you don’t know where to start, write some pseudocode. Plan out the logic you’re trying to implement in your native language before you try to put it into code.</p>\\n</li>\\n<li>\\n<p>Comment your code! Can’t stress that one enough, if you get lost or take a break then come back you need to know what your code is trying to do. It will also reinforce what the code means to you, and help other people understand what your code does if you get stuck and ask for help. If you’ve got a any other tips for campers I’d love to see them!</p>\\n</li>\\n<li>\\n<p>Use the chrome javascript debugger console in conjunction with something like netbeans IDE or sublime text to write your code. Both are free to download. <br />\\nThe free code camp window is great but you can get a lot more feedback on your code’s behaviour by using chrome’s JS debugger and a bunch of <strong>console.log(myVariableGoesHere);</strong> <br />\\n<a href=\\\"https://developer.chrome.com/devtools/docs/console\\\">https://developer.chrome.com/devtools/docs/console</a> <br />\\n<a href=\\\"http://www.sublimetext.com/\\\">http://www.sublimetext.com/</a> <br />\\n<a href=\\\"https://netbeans.org/downloads/\\\">https://netbeans.org/downloads/</a></p>\\n</li>\\n<li>\\n<p>Posting your code in gitter is as simple as adding a line consisting of only</p>\\n</li>\\n</ol>\\n<blockquote>\\n<p>```</p>\\n<p>Then your code on the next lines, followed by a final</p>\\n<p>```</p>\\n</blockquote>\\n<ol start=\\\"5\\\">\\n<li>Ask for help in gitter! I can personally relate to staring at a problem for hours, then seeing the solution as soon as I try to explain it to someone, or having someone say something like “typo on line 6” as soon as they see it.</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Coding-Help/index.md\n ** module id = 366\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Coding-Help/index.md?");

