	eval("module.exports = {\"title\":\"Contributions Guide   with Typo Demo\",\"order\":5,\"body\":\"<h1>Detailed Guide to Contributions.</h1>\\n<p>===================================\\nGuide first posted at <a href=\\\"https://natacseanc.wordpress.com/2015/09/07/beginners-guide-to-easy-contributions-to-free-code-camp/\\\">Sean Campbell’s Blog</a></p>\\n<p>The first 2 steps are <em>setting up</em> the environment.</p>\\n<h3>Step 1: Fork, Clone, Upstream Setup</h3>\\n<p>First - fork the <a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp\\\">Free Code Camp repo</a> to your GitHub account. Done by clicking the fork button at the top right of the page. You see a little animated image of the 'forking'. From there move to terminal. Running the commands below will create a copy of the Free Code Camp repo you just forked.</p>\\n<pre><code class=\\\"language-bash\\\">git <span class=\\\"hljs-built_in\\\">clone</span> https://github.com/[USERNAME]/freecodecamp <span class=\\\"hljs-comment\\\"># put in your [USERNAME]</span>\\n<span class=\\\"hljs-built_in\\\">cd</span> freecodecamp\\ngit remote add upstream https://github.com/FreeCodeCamp/FreeCodeCamp\\n</code></pre>\\n<p>The first line clones the repo to your local machine; making a directory called <code>freecodecamp</code> in the current folder you are in. Then move inside that folder with <code>cd freecodecamp</code>. The last line adds the original Free Code Camp repo as a remote upstream. This allows you to pull in the changes that are made to the main project to keep you local copy up to date. This is done by running…</p>\\n<pre><code class=\\\"language-bash\\\">git fetch upstream\\n</code></pre>\\n<p>If there were changes then run the commands below to merge; if nothing happens then skip these 2 commands.</p>\\n<pre><code class=\\\"language-bash\\\">git checkout staging <span class=\\\"hljs-comment\\\"># make sure I am on staging branch</span>\\ngit merge upstream/staging <span class=\\\"hljs-comment\\\"># merge the changing to my local machine</span>\\n</code></pre>\\n<p>Your local <code>staging</code> branch is up to date with the <a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp\\\">Free Code Camp repo</a> now.</p>\\n<h3>Step 2: Follow <a href=\\\"http://README.md\\\">README.md</a> Instructions for more Setup.</h3>\\n<p>This guide stresses importance of reading the <a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp#contributing\\\">README.md</a> on contributing. Please have <a href=\\\"http://eslint.org/docs/user-guide/integrations.html\\\">ESlinter</a> running, as the warning are there to help you.</p>\\n<h3>Prerequisites</h3>\\n<ul>\\n<li><a href=\\\"http://www.mongodb.org/downloads\\\">MongoDB</a></li>\\n<li><a href=\\\"http://nodejs.org\\\">Node.js</a></li>\\n<li><a href=\\\"http://eslint.org/docs/user-guide/integrations.html\\\">ESlinter</a></li>\\n</ul>\\n<p>These commands are straight from the FCC directions on the <a href=\\\"http://README.md\\\">README.md</a></p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># Install NPM dependencies</span>\\nnpm install\\n\\n<span class=\\\"hljs-comment\\\"># Install bower globally</span>\\nnpm install -g bower\\n\\n<span class=\\\"hljs-comment\\\"># Install Bower dependencies</span>\\nbower install\\n\\n<span class=\\\"hljs-comment\\\"># Install Gulp globally</span>\\nnpm install -g gulp\\n\\n<span class=\\\"hljs-comment\\\"># Create a .env file</span>\\ntouch .env\\n</code></pre>\\n<p>What goes in the .env file?? Well first if you do not have a <a href=\\\"https://mandrill.com/signup/?_ga=1.36983655.693747097.1440924471\\\">Mandrill account</a> you will need to set one up.\\nMandrill is an email service that is beyond the scope of this guide. A quick note; this file will not be included when pushing to GitHub as it will be listed in the <code>.gitignore</code> file.</p>\\n<h4>.env file contents</h4>\\n<pre><code><span class=\\\"hljs-constant\\\">\\nMONGOHQ_URL</span>='mongodb:<span class=\\\"hljs-comment\\\">//localhost:27017/freecodecamp' // do not change</span>\\n<span class=\\\"hljs-constant\\\">\\nFACEBOOK_ID</span>=stuff\\n<span class=\\\"hljs-constant\\\">FACEBOOK_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nGITHUB_ID</span>=stuff\\n<span class=\\\"hljs-constant\\\">GITHUB_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nGOOGLE_ID</span>=stuff\\n<span class=\\\"hljs-constant\\\">GOOGLE_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nLINKEDIN_ID</span>=stuff\\n<span class=\\\"hljs-constant\\\">LINKEDIN_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nMANDRILL_PASSWORD</span>=stuff <span class=\\\"hljs-comment\\\">// Your mandrill password</span>\\n<span class=\\\"hljs-constant\\\">MANDRILL_USER</span>=stuff <span class=\\\"hljs-comment\\\">// Your mandrill username</span>\\n<span class=\\\"hljs-constant\\\">\\nTRELLO_KEY</span>=stuff\\n<span class=\\\"hljs-constant\\\">TRELLO_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nTWITTER_KEY</span>=stuff\\n<span class=\\\"hljs-constant\\\">TWITTER_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">TWITTER_TOKEN</span>=stuff\\n<span class=\\\"hljs-constant\\\">TWITTER_TOKEN_SECRET</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nBLOGGER_KEY</span>=stuff\\n<span class=\\\"hljs-constant\\\">\\nSESSION_SECRET</span>=secretstuff <span class=\\\"hljs-comment\\\">// any word you like in small case I believe.</span>\\n<span class=\\\"hljs-constant\\\">COOKIE_SECRET</span>='this is a secret'\\n<span class=\\\"hljs-constant\\\">\\nPEER</span>=stuff\\n<span class=\\\"hljs-constant\\\">DEBUG</span>=<span class=\\\"hljs-literal\\\">true</span>\\n\\n</code></pre>\\n<h3>Setup is complete - next - the workflow of contributions</h3>\\n<p>=============================================================</p>\\n<h1>Start of issue fixing</h1>\\n<h3>Part 3: Start MongoDB</h3>\\n<p>Open up two terminal windows, one to run the mongodb:</p>\\n<pre><code class=\\\"language-bash\\\">mongod\\n</code></pre>\\n<p>Then minimize this terminal and move to the other which will be the one to complete the workflow.</p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># run mongodb</span>\\nmongo\\n\\n<span class=\\\"hljs-comment\\\"># switch to the free code camp database</span>\\nuse freecodecamp\\n\\n<span class=\\\"hljs-comment\\\"># exit mongo</span>\\npress Crtl + d\\n</code></pre>\\n<h3>Step 4: Finding Issue in the Code Base</h3>\\n<p>The issue on GitHub will look something like this.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/issue1.png\\\"><img class=\\\"alignnone wp-image-161\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/issue1.png?w=300\\\" alt=\\\"issue\\\" width=\\\"456\\\" height=\\\"205\\\" /></a></p>\\n<p>To find out what file the challenge will be in go to the FCC Map to find out which section the challenge is a part of; the example is <a href=\\\"http://freecodecamp.com/challenges/waypoint-learn-how-script-tags-and-document-ready-work\\\">Learn how Script Tags and Document Ready Work</a> and it is a part of the jQuery section.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/section.png\\\"><img class=\\\"alignnone size-medium wp-image-164\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/section.png?w=300\\\" alt=\\\"section\\\" width=\\\"300\\\" height=\\\"262\\\" /></a></p>\\n<p>The actual data for each challenge is located in the <code>seed/challenges/</code> directory. In this folder there are <code>.json</code> files. Each file is named for the section of challenges. So for this demo you need to be in the <code>jQuery.json</code> file.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/files.png\\\"><img src=\\\"https://natacseanc.files.wordpress.com/2015/09/files.png?w=287\\\" alt=\\\"files\\\" width=\\\"287\\\" height=\\\"300\\\" class=\\\"alignnone size-medium wp-image-171\\\" /></a></p>\\n<p>The file itself is of an object that has a <code>challenges</code> attribute which is a list of challenge objects. These have key/value pairs of the title, description, test, and other info that is needed for the other code to build the actual challenge.<a href=\\\"https://natacseanc.files.wordpress.com/2015/09/json1.png\\\"><img class=\\\"alignnone size-large wp-image-159\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/json1.png?w=809\\\" alt=\\\"JSON\\\" width=\\\"809\\\" height=\\\"665\\\" /></a></p>\\n<p>To fix a simple typo in the test output you should do a search for the challenge then navigate to the <code>&quot;test&quot;:</code> key to find the error. The test is explained in the next part. Any text wrapped in the <code>&lt;code&gt;</code> tags will appear in the red text that you see in the challenge description or test output.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/codetag.png\\\"><img class=\\\"alignnone size-full wp-image-140\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/codetag.png\\\" alt=\\\"codeTag\\\" width=\\\"384\\\" height=\\\"206\\\" /></a></p>\\n<h3>Step 5: Making the Change</h3>\\n<p>Go to your terminal and run the command below to make sure that nothing has changed to the main code base</p>\\n<pre><code class=\\\"language-bash\\\">git fetch upstream\\n</code></pre>\\n<p>If there was a change then merge in like Step 1. Create a branch that explains the change ie <code>fix/typo-jquery-challenge-test</code>. Include a brief description of the changes you have made. Include <code>closes #1337</code> for each issue that this pull request intends to close.</p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># create and move to branch</span>\\ngit checkout -b fix/typo-jquery-challange-test\\n</code></pre>\\n<p>Open the <code>jQuery.json</code> file; the issue that you is that there is parenthesis in the test output that should not be there. Each test has two parts to the <code>assert()</code> method. The first is the test(s), the second part which is separated by a comma is the output description. Please note this picture shows after the change has been made.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/test.png\\\"><img class=\\\"alignnone size-full wp-image-131\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/test.png\\\" alt=\\\"test\\\" width=\\\"809\\\" height=\\\"18\\\" /></a></p>\\n<p>The test is the <code>editor.match(/\\\\\\\\.parent\\\\\\\\(\\\\\\\\)\\\\\\\\.css/g)</code>, where the description section is <code>'You should use the &lt;code&gt;.parent()&lt;/code&gt; function to modify this element.'</code>. The issue is that in the description section there are actual <code>(</code> and <code>)</code>. Meaning the code used to be.</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/testbad.png\\\"><img class=\\\"alignnone size-full wp-image-130\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/testbad.png\\\" alt=\\\"testbad\\\" width=\\\"809\\\" height=\\\"17\\\" /></a></p>\\n<p>This causes the strange outputs that occur in the tests. By using the right <a href=\\\"http://character-code.com/\\\">character code</a> you will be able to replace the parenthesis and the period. At this point save the file but do <strong>not</strong> stage or commit anything with Git yet; you <strong>will want</strong> to run the app locally and see if the changes worked!</p>\\n<h3>Step 6: Run Free Code Camp App Locally</h3>\\n<p>Mental check that part 3 was done if not do it now. Then:</p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># Seed database with the challenges</span>\\nnode seed/\\n\\n<span class=\\\"hljs-comment\\\"># start the application</span>\\ngulp\\n</code></pre>\\n<p>The gulp command will take a second or too then there will be a IP address that I right click and open in my browser. Now I will navigate to that challenge to verify the changes were what I expected. This is the purple local URL:</p>\\n<p><a href=\\\"https://natacseanc.files.wordpress.com/2015/09/ipadress.png\\\"><img class=\\\"alignnone size-full wp-image-137\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/ipadress.png\\\" alt=\\\"ipadress\\\" width=\\\"674\\\" height=\\\"100\\\" /></a></p>\\n<h3>Step 7: Creating Pull Request</h3>\\n<p>After making changes and verification of you work run:</p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># check status for piece of mind to see unstaged changes</span>\\ngit status\\n\\n<span class=\\\"hljs-comment\\\">#check if anything changed in upstream</span>\\ngit fetch upstream\\n<span class=\\\"hljs-comment\\\"># ASSUMING no changes I can proceed.</span>\\n<span class=\\\"hljs-comment\\\"># if there are changes see Appendix A about stash.</span>\\n<span class=\\\"hljs-comment\\\"># DO NOT continue if there are changes as you may create conflicts</span>\\n\\n<span class=\\\"hljs-comment\\\"># stage the file</span>\\ngit add [FILENAME]\\n\\n<span class=\\\"hljs-comment\\\"># commit changes</span>\\ngit commit\\n</code></pre>\\n<p>You can have <a href=\\\"https://help.github.com/articles/associating-text-editors-with-git/\\\">Git open up Sublime when you want to commit a message.</a>. This allows and encourages meaningful commit messages. Make a title on the first line then go into more detail on new lines. So for this demo the message would be something like:</p>\\n<pre><code>fix typo on [CHALLENGE]\\n\\nthere were unnecessary parenthesis <span class=\\\"hljs-keyword\\\">in</span> the test outputs\\ncloses <span class=\\\"hljs-hexcolor\\\">#133</span>7\\n</code></pre>\\n<p>You are able to auto <a href=\\\"https://help.github.com/articles/closing-issues-via-commit-messages/\\\">close the issue when the PR is merged into the code base</a>. Save and close the commit message file; brings you back to the terminal</p>\\n<pre><code class=\\\"language-bash\\\">git push -u origin fix/typo-jquery-test\\n<span class=\\\"hljs-comment\\\"># where the part after origin is what ever you called the local branch</span>\\n</code></pre>\\n<p>Now the changes are on both you local machine and you GitHub account. Opening up a browser you can navigate to the forked copy on your GitHub account. There will be a green button just above the listing of files on the right that read Compare &amp; Pull Request.</p>\\n<img class=\\\"alignnone size-full wp-image-139\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/compare.png\\\" alt=\\\"compare\\\" width=\\\"500\\\" height=\\\"203\\\" />\\n<p>Clicking this takes you to the screen where you can review the changes once again and finalize the commit message. Then wait for the code to be merged in or possibly some tips on how to improve the changes.</p>\\n<img class=\\\"alignnone size-full wp-image-132\\\" src=\\\"https://natacseanc.files.wordpress.com/2015/09/pr.png\\\" alt=\\\"pr\\\" width=\\\"600\\\" height=\\\"489\\\" />\\n<p>Guide written by: <a href=\\\"https://github.com/natac13\\\">@natac13</a> on Twitter <a href=\\\"https://twitter.com/?lang=en\\\">@natac1311</a></p>\\n<h3>Appendix A: Stash</h3>\\n<p>Short explanation on what happens if during the time you were making changes there were some merged into the <a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp\\\"><code>upstream</code></a>. Meaning your local copy is not up to date. This puts you right <strong>before</strong> adding any files to be <em>staged</em> or <em>committed</em>. So:</p>\\n<pre><code class=\\\"language-bash\\\"><span class=\\\"hljs-comment\\\"># check changes to upstream</span>\\ngit fetch upstream\\n<span class=\\\"hljs-comment\\\"># changes have happened</span>\\n\\n<span class=\\\"hljs-comment\\\"># stash your changes</span>\\ngit stash\\n\\n<span class=\\\"hljs-comment\\\"># merge upstream into the working branch</span>\\ngit merge upstream/staging\\n\\n<span class=\\\"hljs-comment\\\"># reapply you changes</span>\\ngit stash apply\\n</code></pre>\\n<p>You are now back up to date with your changes ready to be staged and committed. <a href=\\\"https://git-scm.com/book/en/v1/Git-Tools-Stashing\\\">Git docs on stash</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Contributions-Guide---with-Typo-Demo/index.md\n ** module id = 367\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Contributions-Guide---with-Typo-Demo/index.md?");

