	eval("module.exports = {\"title\":\"Create, Upload and Link Animated GIF Image\",\"order\":5,\"body\":\"<ol>\\n<li>Download <a href=\\\"http://www.cockos.com/licecap/\\\">LICEcap</a> and install.</li>\\n<li>Open and start recording to create animated GIF.</li>\\n<li>Upload the <code>.gif</code> file in <a href=\\\"http://ezgif.com/optimize\\\">EZGIF.com</a>.\\n<ul>\\n<li>Crop, Resize and Optimize as many times or as required.</li>\\n</ul>\\n</li>\\n<li>Download animated GIF.</li>\\n<li>Upload image to <a href=\\\"http://imgur.com\\\">imgur.com</a>.</li>\\n<li>Link image using <code>![image title](http://i.imgur.com/RqgGcf5.gif)</code>.</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Create,-Upload-and-Link-Animated-GIF-Image/index.md\n ** module id = 368\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Create,-Upload-and-Link-Animated-GIF-Image/index.md?");

