	eval("module.exports = {\"title\":\"Creating a New Github Issue\",\"order\":5,\"body\":\"<p>Before submitting an issue try <a href=\\\"https://freecodecamp.com/wiki/docs/Searching-for-Your-Issue-on-Github\\\">Searching for Your Issue on Github</a></p>\\n<p>Crafting a good issue will make it much easier for the dev team to replicate and resolve your problem. Follow these steps to do it right:</p>\\n<ol>\\n<li>Go to FreeCodeCamp’s <a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp/issues\\\">Github Issues</a> page and click on <code>New Issue</code>.</li>\\n</ol>\\n<ul>\\n<li><strong>Have a useful title</strong></li>\\n<li>Write a meaningful title that describes the issue. Some good examples are <code>Logging in from the News and Field Guide pages doesn't redirect properly (using e-mail)</code> and <code>Typo: &quot;for&quot; instead of &quot;while&quot; loop</code>; bad examples include <code>A bug, HELP!!!11</code> and <code>I found this bug in a waypoint</code>.</li>\\n<li>Keep the title relatively short, the description is for further information. One example is to shorten long waypoint names, so instead of writing <code>Test case bug in 'Waypoint: Check Radio Buttons and Checkboxes by Default'</code>, you might want to write <code>Test case bug in 'Radio Buttons' waypoint</code>.</li>\\n<li>In the body, <strong>provide a link</strong> to the page on which you encountered this issue.</li>\\n<li><strong>Describe the problem</strong> and <strong>provide steps</strong> so that a developer can try to replicate the issue.  Include your operating system and browser version.</li>\\n<li>When referencing other issues or pull requests, simply write #issue/pr-number.</li>\\n<li>Paste in any relevant code using proper <a href=\\\"https://freecodecamp.com/wiki/docs/code-formatting\\\">Code Formatting</a></li>\\n<li><strong>Take a screenshot</strong> of the issue and include it in the post.</li>\\n<li>Click <code>Submit New Issue</code> and you are done! You will be automatically subscribed to notifications for any updates or future comments.</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Creating-a-New-Github-Issue/index.md\n ** module id = 369\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Creating-a-New-Github-Issue/index.md?");

