	eval("module.exports = {\"title\":\"Creating a new API endpoint\",\"order\":5,\"body\":\"<pre><code>&gt;&gt; yo angular-fullstack:endpoint whatsit\\n</code></pre>\\n<p>Using this line, you get Yeoman to automatically generate another API endpoint and new kind of collection for your database. Now we have <em>things</em> as well as <em>whatsits</em>! Feel free to open up <strong>/server/api/whatsit/whatsit.model.js</strong> and define your whatsit however you like.</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Backend-file-structure\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Fixing-exports.update\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Creating-a-new-API-endpoint/index.md\n ** module id = 370\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Creating-a-new-API-endpoint/index.md?");

