	eval("module.exports = {\"title\":\"Creating a new route\",\"order\":5,\"body\":\"<pre><code>&gt;&gt; yo angular-fullstack:route newpage \\n</code></pre>\\n<p>Typing the above into your command-line will generate a <strong>newpage/</strong> route for your app! It automatically generates all the necessary files within your <strong>/client/app/newpage</strong> folder, like your <strong>/client/app/main</strong> folder, with a <strong>newpage.controller.js</strong>, <strong>newpage.controller.spec.js</strong>, <strong>newpage.js</strong>, and <strong>newpage.html</strong>. These all pretty much behave like the ones in the <strong>main/</strong> route. If you’re accessing the database in your newpage controller, you’ll want to add <em>$http</em> to the list of dependencies in <strong>newpage.controller.js</strong> the same way it’s included in <strong>main.controller.js</strong>:</p>\\n<pre><code class=\\\"language-javascript\\\">angular.module(<span class=\\\"hljs-string\\\">'myApp'</span>)\\n  .controller(<span class=\\\"hljs-string\\\">'MainCtrl'</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">$scope, $http</span>) </span>{ ...\\n</code></pre>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Frontend-file-structure\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-directive\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Creating-a-new-route/index.md\n ** module id = 372\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Creating-a-new-route/index.md?");

