	eval("module.exports = {\"title\":\"Develop BaseJump locally and run on c9.io\",\"order\":5,\"body\":\"<p>If you like me develop basejump locally and want it run on c9, this may help you.</p>\\n<ol>\\n<li>push your project to github</li>\\n<li>create a new workspace in c9 and set ‘Clone from Git or Mercurial URL (optional)’ with your github repository URL. After submit your create page, c9 will clone your project for you.</li>\\n<li>run <code>echo &quot;export NODE_PATH=$NODE_PATH:/home/ubuntu/.nvm/v0.10.35/lib/node_modules&quot; &gt;&gt; ~/.bashrc &amp;&amp; source ~/.bashrc</code> in your c9 terminal window</li>\\n<li>run <code>bower install &amp;&amp; sudo npm install</code></li>\\n<li>run <code>mkdir data &amp;&amp; echo 'mongod --bind_ip=$IP --dbpath=data --nojournal --rest &quot;$@&quot;' &gt; mongod &amp;&amp; chmod a+x mongod &amp;&amp; ./mongod</code></li>\\n<li>run <code>grunt serve</code> in another terminal window</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Develop-BaseJump-locally-and-run-on-c9.io/index.md\n ** module id = 373\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Develop-BaseJump-locally-and-run-on-c9.io/index.md?");

