	eval("module.exports = {\"title\":\"Disable Code Auto Run\",\"order\":5,\"body\":\"<p>By default, the Free Code Camp site automatically loads and runs your last recorded solution.  If you have accidentally created an infinite loop or other irrecoverable error or simply don’t trust the code, you can disable code auto-run by putting the following in your URL:<br>\\n<code>run=disabled</code></p>\\n<h4>Example:</h4>\\n<p>URL: <code>http://www.freecodecamp.com/challenges/bonfire-meet-bonfire#?solution=function%20meetBonfire(argument)</code></p>\\n<p>No-Run URL: <code>http://www.freecodecamp.com/challenges/bonfire-meet-bonfire#?run=disabled&amp;solution=function%20meetBonfire(argument)</code></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Disable-Code-Auto-Run/index.md\n ** module id = 374\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Disable-Code-Auto-Run/index.md?");

