	eval("module.exports = {\"title\":\"Epilogue\",\"order\":5,\"body\":\"<p>If you have any issues not covered in this guide:</p>\\n<ol>\\n<li>google google google google duckduckgo</li>\\n<li>bug @freecodecamp and me (@clnhll) on twitter</li>\\n<li>did you miss a semicolon? a comma?</li>\\n<li>make a big loud stink in the freecodecamp help gitter.</li>\\n</ol>\\n<p>If you notice any inaccuracies or bad coding practices in this guide, please let me know ASAP!</p>\\n<p>I believe in you!\\n-<a href=\\\"https://github.com/clnhll\\\">clnhll</a></p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Bonus-SocketIO\\\">PREVIOUS</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Epilogue/index.md\n ** module id = 377\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Epilogue/index.md?");

