	eval("module.exports = {\"title\":\"Fixing exports.update\",\"order\":5,\"body\":\"<p>As it turns out, in <strong>thing.controller.js</strong> as well as in any other endpoints you may generate, the <em>exports.update</em> function that is called when you make an <em>$http.put</em> call from your frontend to modify an existing database object is broken. This is a <a href=\\\"https://github.com/DaftMonk/generator-angular-fullstack/issues/310\\\">known issue</a>, and can be fixed by changing the following line:</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-comment\\\">// Updates an existing thing in the DB.</span>\\nexports.update = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">req, res</span>) </span>{ \\n...    \\n    <span class=\\\"hljs-keyword\\\">var</span> updated = _.extend(thing, req.body); \\n    <span class=\\\"hljs-comment\\\">// change _.merge to _.extend</span>\\n... \\n };\\n</code></pre>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-API-endpoint\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Accessing-the-database-from-your-frontend\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Fixing-exports.update/index.md\n ** module id = 378\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Fixing-exports.update/index.md?");

