	eval("module.exports = {\"title\":\"Free Code Camp's Privacy Policy\",\"order\":5,\"body\":\"<p>Free Code Camp is committed to respecting the privacy of visitors to our web sites and web applications. The guidelines below explain how we protect the privacy of visitors to <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> and its features.</p>\\n<h3>Personally Identifiable Information</h3>\\n<p>Free Code Camp protects the identity of visitors to <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> by limiting the collection of personally identifiable information.</p>\\n<p>Free Code Camp does not knowingly collect or solicit personally identifiable information from or about children under 13, except as permitted by law. If we discover we have received any information from a child under 13 in violation of this policy, we will delete that information immediately. If you believe Free Code Camp has any information from or about anyone under 13, please email us at <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a>.</p>\\n<p>All personally identifiable information you provide to us is used by Free Code Camp and its team to process and manage your account, analyze the demographic of our users, or to deliver services through the site.</p>\\n<p>If you choose to provide personally identifiable information to us, you may receive occasional emails from us that are relevant to Free Code Camp, getting a job, or learning to code in general.\\nFree Code Camp may also use other third-party providers to facilitate the delivery of the services described above, and these third-party providers may be supplied with or have access to personally identifiable information for the sole purpose of providing these services, to you on behalf of Free Code Camp.</p>\\n<p>Free Code Camp may also disclose personally identifiable information in special legal circumstances. For instance, such information may be used where it is necessary to protect our copyright or intellectual property rights, or if the law requires us to do so.</p>\\n<h3>Anonymous Information</h3>\\n<p>Anonymous aggregated data may be provided to other organizations we associate with for statistical purposes. For example, we may report to an organization that a certain percentage of our site’s visitors are adults between the ages of 25 and 35.</p>\\n<h3>Cookies and Beacons—Use by Free Code Camp; Opting Out</h3>\\n<p>We use cookies and software logs to monitor the use of <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> and to gather non-personal information about visitors to the site. Cookies are small files that Free Code Camp transfers to the hard drives of visitors for record-keeping purposes. These monitoring systems allow us to track general information about our visitors, such as the type of browsers (for example, Firefox or Internet Explorer), the operating systems (for instance, Windows or Macintosh), or the Internet providers (for instance, Comcast) they use. This information is used for statistical and market research purposes to tailor content to usage patterns and to provide services requested by our customers. To delete these cookies, please see your browser’s privacy settings.</p>\\n<p>A beacon is an electronic file object (typically a transparent image) placed in the code of a Web page. We use third party beacons to monitor the traffic patterns of visitors from one Free Code <a href=\\\"http://Camp.com\\\">Camp.com</a> page to another and to improve site performance.\\nNone of the information we gather in this way can be used to identify any individual who visits our site.</p>\\n<h3>Security</h3>\\n<p>Any personally identifiable information collected through this site is stored on limited-access servers. We will maintain safeguards to protect these servers and the information they store.</p>\\n<h3>Surveys</h3>\\n<p>We may occasionally conduct on-line surveys. All surveys are voluntary and you may decline to participate.</p>\\n<h3>Copyright</h3>\\n<p>All of the content on <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> is copyrighted by Free Code Camp. If you’d like to redistribute it beyond simply sharing it through social media, please contact us at <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a>.</p>\\n<h3>Contacting Us</h3>\\n<p>If you have questions about Free Code Camp, or to correct, update, or remove personally identifiable information, please email us at <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a>.</p>\\n<h3>Links to Other Web sites</h3>\\n<p>Free Code Camp’s sites each contain links to other Web sites. Free Code Camp is not responsible for the privacy practices or content of these third-party Web sites. We urge all <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> visitors to follow safe Internet practices: Do not supply Personally Identifiable Information to these Web sites unless you have verified their security and privacy policies.</p>\\n<h3>Data Retention</h3>\\n<p>We retain your information for as long as necessary to permit us to use it for the purposes that we have communicated to you and comply with applicable law or regulations.</p>\\n<h3>Business Transfers</h3>\\n<p>As we continue to develop our business, we might sell or buy subsidiaries, or business units. In such transactions, customer information generally is one of the transferred business assets but remains subject to the promises made in any pre-existing Privacy Policy (unless, of course, the customer consents otherwise). Also, in the unlikely event that Free Code Camp, or substantially all of its assets are acquired, customer information will be one of the transferred assets, and will remain subject to our Privacy Policy.</p>\\n<h3>Your California Privacy Rights</h3>\\n<p>If you are a California resident, you are entitled to prevent sharing of your personal information with third parties for their own marketing purposes through a cost-free means. If you send a request to the address above, Free Code Camp will provide you with a California Customer Choice Notice that you may use to opt-out of such information sharing. To receive this notice, submit a written request to <a href=\\\"mailto:team@freecodecamp.com\\\" target=\\\"_blank\\\">team@freecodecamp.com</a>, specifying that you seek your “California Customer Choice Notice.” Please allow at least thirty (30) days for a response.</p>\\n<h3>Acceptance of Privacy Policy Terms and Conditions</h3>\\n<p>By using this site, you signify your agreement to the terms and conditions of this <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> Privacy Policy. If you do not agree to these terms, please do not use this site. We reserve the right, at our sole discretion, to change, modify, add, or remove portions of this policy at any time. All amended terms automatically take effect 30 days after they are initially posted on the site. Please check this page periodically for any modifications. Your continued use of <a href=\\\"http://FreeCodeCamp.com\\\">FreeCodeCamp.com</a> following the posting of any changes to these terms shall mean that you have accepted those changes.</p>\\n<p>If you have any questions or concerns, please send an email to <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp's-Privacy-Policy/index.md\n ** module id = 380\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp's-Privacy-Policy/index.md?");

