	eval("module.exports = {\"title\":\"Free Code Camp Deployment Workflow\",\"order\":5,\"body\":\"<ol>\\n<li>All code is written and pushed to a branch on the developers’ own fork of Free Code Camp.</li>\\n<li>Developers create pull requests, pulling code from their branch to Free Code Camp’s staging branch.</li>\\n<li>Someone other than the person who submitted the pull request QA’s the pull request and accepts it if everything is perfect. Otherwise they close the pull request with an explanation of why it isn’t perfect, and the developer opens another pull request once they’ve fixed things.</li>\\n<li>Staging is deployed to <a href=\\\"http://beta.freecodecamp.com\\\">beta.freecodecamp.com</a> by @berkeleytrue, @benmcmahon100 or @quincylarson periodically.</li>\\n<li>Master is deployed to <a href=\\\"http://freecodecamp.com\\\">freecodecamp.com</a> once the staging itself is fully QA’d.</li>\\n</ol>\\n<p>Notes:</p>\\n<ul>\\n<li>Currently <a href=\\\"http://freecodecamp.com\\\">freecodecamp.com</a> and <a href=\\\"http://beta.freecodecamp.com\\\">beta.freecodecamp.com</a> share a database, so we must be careful about seeding data and manipulating it on beta.</li>\\n<li>This is subject to change once we get better test coverage and continuous integration working.</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp-Deployment-Workflow/index.md\n ** module id = 381\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp-Deployment-Workflow/index.md?");

