	eval("module.exports = {\"title\":\"Free Code Camp Front End Development Certificate\",\"order\":5,\"body\":\"<h3>Here’s how to earn our verified Front End Development Certificate:</h3>\\n<p><img src=\\\"http://i.imgur.com/UrU2ki8.png\\\" alt=\\\"An image of a sample Front End Development Certificate\\\"></p>\\n<ol>\\n<li>Complete all of our current Basic Bonfires</li>\\n<li>Complete all of our current Basic Ziplines</li>\\n<li>Complete all of our current Intermediate Bonfires</li>\\n<li>Complete all of our current Intermediate Ziplines</li>\\n</ol>\\n<p>Once you’ve completed all of the above, you can complete our “Claim your Front End Development Certificate” challenge, which will require you to sign our Academic Honesty Pledge. Then we will instantly issue your verified certificate, which will become accessible from your portfolio page.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp-Front-End-Development-Certificate/index.md\n ** module id = 382\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp-Front-End-Development-Certificate/index.md?");

