	eval("module.exports = {\"title\":\"Free Code Camp completion language requirements\",\"order\":5,\"body\":\"<p>The last 800 hours of free code camp involve building projects for nonprofits. These nonprofit projects will involve lots of meetings, correspondence, and pair programming, all of which will be conducted in English.</p>\\n<p>You will need to be good enough with English to be able to participate in these meetings.</p>\\n<p>We are translating our challenges into native languages so that you can focus on learning to code, rather than focusing on learning English.</p>\\n<p>Many non-native English speakers have succeeded in our nonprofit project program. With some effort, you can, too.</p>\\n<p>If you need to practice or polish your English skills, try using <a href=\\\"https://www.duolingo.com/\\\">Duolingo</a>, it’s free and allows you practice and track your progress.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp-completion-language-requirements/index.md\n ** module id = 385\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp-completion-language-requirements/index.md?");

