	eval("module.exports = {\"title\":\"Free Code Camp is an open source community distributed across many platforms\",\"order\":5,\"body\":\"<p>Free Code Camp is an open source community. We have a free, self-paced web development curriculum located at <a href=\\\"http://freecodecamp.com\\\">http://freecodecamp.com</a>, but we are much larger than just that.</p>\\n<p>We leverage the power of these existing platforms to connect with one another and learn to code together:</p>\\n<p><a href=\\\"https://github.com/freecodecamp/freecodecamp\\\">GitHub</a> - for collaborating on open source projects and improving <a href=\\\"http://www.freecodecamp.com\\\">FreeCodeCamp.com</a><br>\\n<a href=\\\"https://gitter.im/freecodecamp/freecodecamp\\\">Gitter</a> - for real time chatting and getting immediate help on our challenges<br>\\n<a href=\\\"http://freecodecamp.com/news\\\">Camper News</a> - for sharing coding resources<br>\\n<a href=\\\"https://www.facebook.com/groups/free.code.campers\\\">Facebook Campsites</a> - for meeting campers in your city and coordinating events<br>\\n<a href=\\\"https://medium.freecodecamp.com\\\">Medium</a> - for publishing your long-form content<br>\\n<a href=\\\"https://twitch.tv/freecodecamp\\\">Twitch</a> - for live-streaming coding<br>\\n<a href=\\\"https://www.youtube.com/freecodecamp\\\">YouTube</a> - for publishing instructional videos</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp-is-an-open-source-community-distributed-across-many-platforms/index.md\n ** module id = 386\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp-is-an-open-source-community-distributed-across-many-platforms/index.md?");

