	eval("module.exports = {\"title\":\"Free Code Camp logo\",\"order\":5,\"body\":\"<h3>Free Code Camp’s logo</h3>\\n<p><img src=\\\"https://i.vimeocdn.com/video/520129377_1280x720.jpg\\\" alt=\\\"Free Code Camp's logo\\\"></p>\\n<p>It uses the typeface ‘saxmono’.</p>\\n<p>Like most of Free Code Camp’s design assets, it was created by <a href=\\\"https://gitter.im/rybar\\\">@rybar</a> with help from <a href=\\\"https://gitter.im/iheartkode\\\">@iheartkode</a>.</p>\\n<p>You can download all of our assets, which are Creative Commons licensed, from our <a href=\\\"https://github.com/FreeCodeCamp/FCCAssets\\\">Free Code Camp Assets repository</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Free-Code-Camp-logo/index.md\n ** module id = 387\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Free-Code-Camp-logo/index.md?");

