	eval("module.exports = {\"title\":\"Functional Programming   Higher Order Functions\",\"order\":5,\"body\":\"<h3>Links to help with functional programming!</h3>\\n<p>####Workshops\\n(<a href=\\\"https://github.com/timoxley/functional-javascript-workshop\\\">https://github.com/timoxley/functional-javascript-workshop</a>)</p>\\n<p>A node package workshop. More can be found at <a href=\\\"http://nodeschool.io/\\\">nodeschool</a></p>\\n<p>####Reading and videos\\n(<a href=\\\"https://github.com/timoxley/functional-javascript-workshop\\\">https://github.com/timoxley/functional-javascript-workshop</a>)</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Functional-Programming---Higher-Order-Functions/index.md\n ** module id = 389\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Functional-Programming---Higher-Order-Functions/index.md?");

