	eval("module.exports = {\"title\":\"Get info about the current user\",\"order\":5,\"body\":\"<p>You may have noticed if you opened up <strong>/client/app/admin/admin.controller.js</strong> that it calls the <em>Auth</em> module like so:</p>\\n<pre><code class=\\\"language-javascript\\\">.controller(<span class=\\\"hljs-string\\\">'AdminCtrl'</span>, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">$scope, $http, Auth …\\n</span></span></code></pre>\\n<p>You can include Auth in your other controllers the same way. It’s pretty useful to have <em>Auth</em> available in your controller to detect if a user is logged in, or to get information about the current user. In the body of your controller you can add</p>\\n<pre><code class=\\\"language-javascript\\\">$scope.getCurrentUser = Auth.getCurrentUser;\\n$scope.isLoggedIn = Auth.isLoggedIn;\\n</code></pre>\\n<p>And then you can use <em>isLoggedIn()</em> or <em>getCurrentUser()</em> in the HTML view for your controller!</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/More-useful-APIs\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Restrict-a-page-to-authenticated-users\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Get-info-about-the-current-user/index.md\n ** module id = 390\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Get-info-about-the-current-user/index.md?");

