	eval("module.exports = {\"title\":\"Gitter Moderation Policy\",\"order\":5,\"body\":\"<h2>Here’s how our chatroom moderators deal with inappropriate behavior.</h2>\\n<ol>\\n<li>\\n<p>Moderators will ban the following people immediately:<br>\\nSpammers<br>\\nPeople who violate our <a href=\\\"https://freecodecamp.com/wiki/docs/Code-of-Conduct\\\">code of conduct</a> (trolls)<br>\\nPeople who come across as excessively negative</p>\\n</li>\\n<li>\\n<p>Moderators will then send them this message:</p>\\n</li>\\n</ol>\\n<pre><code>Hey, I'm sorry but I had to temporarily ban you.\\n\\nI can consider unbanning you, but I need you to do something first.\\n\\n<span class=\\\"hljs-bullet\\\">1. </span>Read our [<span class=\\\"hljs-link_label\\\">Code of Conduct</span>](<span class=\\\"hljs-link_url\\\">https://freecodecamp.com/wiki/docs/Code-of-Conduct</span>).    \\n<span class=\\\"hljs-bullet\\\">2. </span>Please confirm that you've read it.    \\n<span class=\\\"hljs-bullet\\\">3. </span>Explain to me why you think I banned you.    \\n</code></pre>\\n<ol start=\\\"3\\\">\\n<li>\\n<p>Based on their reply, moderators can decide whether to unban the offender. If the offender hasn’t been banned by that moderator before, and if they seem respectful and apologetic, the moderator can unban them. As a matter of policy, moderators will be polite during this process, no matter how poorly the offender has behaved.</p>\\n</li>\\n<li>\\n<p>Moderators will summarize the event for other moderators.</p>\\n</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Gitter-Moderation-Policy/index.md\n ** module id = 394\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Gitter-Moderation-Policy/index.md?");

