	eval("module.exports = {\"title\":\"Grunt\",\"order\":5,\"body\":\"<p>Whenever you create a new route or directive, you have to use <code>control+c</code> in your <em>grunt</em> terminal window to quit the grunt process and re-run <code>grunt serve</code> for your new route/directive to be included in your project’s <strong>index.html</strong>. Sometimes <em>grunt</em> can be a little finnicky and refuses to run if it thinks something is wrong with your project. Obviously you should try to fix the problem, but grunt’s errors aren’t very helpful so don’t worry too much—grunt usually will still run totally fine with the command <code>grunt serve --force</code>.</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-directive\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Backend-file-structure\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Grunt/index.md\n ** module id = 396\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Grunt/index.md?");

