	eval("module.exports = {\"title\":\"Guide to Basejumps Table of Contents\",\"order\":5,\"body\":\"<p>###Table of contents</p>\\n<ul>\\n<li>Part 1: Frontend\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Frontend-file-structure\\\">Frontend file structure</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-route\\\">Creating a new route</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-directive\\\">Creating a new directive</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Grunt\\\">Grunt</a></li>\\n</ul>\\n</li>\\n<li>Part 2: Backend\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Backend-file-structure\\\">Backend file structure</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-new-API-endpoint\\\">Creating a new API endpoint</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Fixing-exports.update\\\">Fixing exports.update</a></li>\\n</ul>\\n</li>\\n<li>Part 3: Interfacing Between Frontend &amp; Backend\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Accessing-the-database-from-your-frontend\\\">Accessing the database from your frontend</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Seed-data\\\">Seed Data</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Quick-tip-keep-data-in-sync\\\">Quick tip: keep data in sync</a></li>\\n</ul>\\n</li>\\n<li>Part 4: Dynamic URLs using $routeParams, more useful APIs\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Dynamic-URLs-using-$routeParams\\\">Dynamic URLS using $routeParams</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/More-useful-APIs\\\">More Useful APIs</a></li>\\n</ul>\\n</li>\\n<li>Part 5: Auth, isLoggedInAsync()\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Get-info-about-the-current-user\\\">Get info about the current user</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Restrict-a-page-to-authenticated-users\\\">Restrict a page to authenticated users</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/isLoggedInAsync()\\\">isLoggedInAsync()</a></li>\\n</ul>\\n</li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Bonus-SocketIO\\\">Bonus: SocketIO</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Epilogue\\\">Epilogue</a></li>\\n</ul>\\n<p>###Legend\\n<strong>/bolded/names/with.extensions</strong> are directories and files in the project file structure<br>\\n<a href=\\\"#\\\">highlighted.items/are/hypothetical</a> URLs that allow access to different pages in your app<br>\\n<em>italicizedItems</em> are function and object names within your code</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Intro-to-Yeoman-Angular-Fullstack-Basejumps\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Frontend-file-structure\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Guide-to-Basejumps-Table-of-Contents/index.md\n ** module id = 397\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Guide-to-Basejumps-Table-of-Contents/index.md?");

