	eval("module.exports = {\"title\":\"Guide to Submitting Posts to Free Code Camp Medium Publication\",\"order\":5,\"body\":\"<p>Thousands of people read our <a href=\\\"https://medium.freecodecamp.com\\\">Medium publication</a>. Here’s how to submit posts, and what we look for in posts that we ultimately publish.</p>\\n<ol>\\n<li>Create a Medium account</li>\\n<li>Add a headshot and bio</li>\\n<li>Email <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a> to request to become a writer for our publication</li>\\n<li>Start submitting posts to us for us to review and potentially publish</li>\\n</ol>\\n<p>##Content tips:</p>\\n<ul>\\n<li>Read through articles that have already been published on our publication and write about things we haven’t covered yet.</li>\\n<li>Autobiographical posts need a unique perspective or a non-obvious takeaway.</li>\\n<li>Technical articles are welcome, and should be written so that most people who have only been coding for a year can still understand them</li>\\n<li>Humorous posts do quite well with our community, and even serious articles can be lightened up with humor</li>\\n<li><a href=\\\"https://medium.com/data-lab/the-optimal-post-is-7-minutes-74b9f41509b#.jxmxzdrfa\\\">7 minutes is technically the optimal post length</a>, but don’t dilute your content to reach that length</li>\\n<li>Keep your tone positive, and keep any criticism you may have metered and objective</li>\\n<li>Good writing takes time. A 7-minute medium post takes me (Quincy Larson) around 4 - 6 hours</li>\\n</ul>\\n<p>##Style tips:</p>\\n<ul>\\n<li>Feature a large, exciting image at the top of the page</li>\\n<li>Break up text with good, relevant images throughout</li>\\n<li>Break points down and use headlines and sub headlines where necessary</li>\\n<li>Avoid the “wall of text” affect by keeping paragraphs between 1 - 4 sentences</li>\\n<li>Use exclamation points and ellipsis sparingly</li>\\n<li>Avoid profanity and any statements that Lisa (the character from The Simpsons) would find offensive</li>\\n<li>Avoid using more than one conjunction in a sentence</li>\\n<li>Re-read your post to make sure there aren’t any obvious typos</li>\\n</ul>\\n<p>##Our goal is to publish as many camper submissions as possible while maintaining a baseline level of quality.</p>\\n<p>We get a lot of submissions. Please don’t take offense if we don’t publish your submission immediately. Instead, <a href=\\\"https://gitter.im/quincylarson\\\">message @QuincyLarson in Gitter</a> and I can give you the status of your submission and quick feedback.</p>\\n<p>Happy writing and coding!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Guide-to-Submitting-Posts-to-Free-Code-Camp-Medium-Publication/index.md\n ** module id = 398\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Guide-to-Submitting-Posts-to-Free-Code-Camp-Medium-Publication/index.md?");

