	eval("module.exports = {\"title\":\"Help I've Found a Bug\",\"order\":5,\"body\":\"<p>Thank you for taking the effort to report an issue with FreeCodeCamp.</p>\\n<p>If you think you’ve found a bug on FreeCodeCamp, please follow these steps to resolve your problem:</p>\\n<ol>\\n<li>If the page seems broken in any way, try to do a <a href=\\\"https://freecodecamp.com/wiki/docs/Refresh-Your-Browser-Cache\\\">Hard Refresh</a> of the page.  This will update any old code that may have been cached in your browser.</li>\\n</ol>\\n<ul>\\n<li>If your code crashes your browser, also try <a href=\\\"https://freecodecamp.com/wiki/docs/Clear-Your-Browser's-Local-Storage\\\">Clearing Your Browser’s Local Storage</a>.</li>\\n</ul>\\n<ol start=\\\"2\\\">\\n<li>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-Get-Help-on-Gitter\\\">Ask for Help on Gitter</a>.  You can usually get a quick response from a helpful community member there.</p>\\n</li>\\n<li>\\n<p>If your problem has baffled everyone in Gitter, try <a href=\\\"https://freecodecamp.com/wiki/docs/Searching-for-Your-Issue-on-Github\\\">Searching for Your Issue on GitHub</a> for anyone who has posted about a similar issue. If someone has, you can upvote the issue by replying to it with “+1” as your message.</p>\\n</li>\\n<li>\\n<p>If you can’t find any relevant issues on GitHub, then <a href=\\\"https://freecodecamp.com/wiki/docs/Creating-a-New-Github-Issue\\\">Create a New Issue</a> and our development team will take a look at your problem.</p>\\n</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Help-I've-Found-a-Bug/index.md\n ** module id = 399\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Help-I've-Found-a-Bug/index.md?");

