	eval("module.exports = {\"title\":\"Help Rooms\",\"order\":5,\"body\":\"<h1>Help Rooms</h1>\\n<ul>\\n<li>HTML/CSS/Bootstrap - <a href=\\\"https://gitter.im/FreeCodeCamp/Help\\\"><strong><code>[FreeCodeCamp/Help]</code></strong></a></li>\\n<li>Javascript/Algorimths - <a href=\\\"https://gitter.im/FreeCodeCamp/HelpJavaScript\\\"><strong><code>[FreeCodeCamp/HelpJavaScript]</code></strong></a></li>\\n<li>Front End -  <a href=\\\"https://gitter.im/FreeCodeCamp/HelpFrontEnd\\\"><strong><code>[FreeCodeCamp/HelpFrontEnd]</code></strong></a></li>\\n<li>Data Visualization - <a href=\\\"https://gitter.im/FreeCodeCamp/HelpDataViz\\\"><strong><code>[FreeCodeCamp/HelpDataViz]</code></strong></a></li>\\n<li>Back End - <a href=\\\"https://gitter.im/FreeCodeCamp/HelpBackEnd\\\"><strong><code>[FreeCodeCamp/HelpBackEnd]</code></strong></a></li>\\n<li>Non-profit Projects - <a href=\\\"https://gitter.im/FreeCodeCamp/NonprofitProjects\\\"><strong><code>[FreeCodeCamp/NonprofitProjects]</code></strong></a></li>\\n<li>Code Review - <a href=\\\"https://gitter.im/FreeCodeCamp/CodeReview\\\"><strong><code>[FreeCodeCamp/CodeReview]</code></strong></a></li>\\n<li>You Can Do This -  <a href=\\\"https://gitter.im/FreeCodeCamp/YouCanDoThis\\\"><strong><code>[FreeCodeCamp/YouCanDoThis]</code></strong></a></li>\\n</ul>\\n<p>Choose the right room for your question!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Help-Rooms/index.md\n ** module id = 400\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Help-Rooms/index.md?");

