	eval("module.exports = {\"title\":\"Heroku Deployment Guide\",\"order\":5,\"body\":\"<h1>Heroku Deployment Guide</h1>\\n<ol>\\n<li>\\n<p>Create a Heroku account.</p>\\n</li>\\n<li>\\n<p>After making an account, you can go to your dashboard at <a href=\\\"https://dashboard.heroku.com/apps\\\">https://dashboard.heroku.com/apps</a></p>\\n</li>\\n<li>\\n<p>Click the + sign in the top right hand corner and click Create New App (just like you’re making a new repo on github). Give it a name, and click Create.</p>\\n<img src=\\\"./images/Heroku-Deployment-Guide/new-heroku-app.png\\\" alt=\\\"Image for 'Create New Heroku App'\\\">\\n</li>\\n<li>\\n<p>After creating the app you’ll see its name in your dashboard. Click on it.</p>\\n</li>\\n<li>\\n<p>You’ll be taken to a dashboard for that app. Click on the Deploy tab.</p>\\n</li>\\n<li>\\n<p>There you’ll be pleased to find that you can connect to a github repo. In the Deployment Method section, choose Github and authenticate by signing into Github.</p>\\n</li>\\n<li>\\n<p>Right below that, fill in your github repo name. (This of course requires that you’ve pushed a repo to github from either cloud9 or your local machine…and that you’ve correctly configured it. More on that below.)</p>\\n</li>\\n<li>\\n<p>Scroll down again and click Automatic Deploy or scroll down even more and click Manual Deploy. After a few moments you should see your app running at <a href=\\\"http://your-repo-name.herokuapp.com\\\">your-repo-name.herokuapp.com</a>. Sweet.</p>\\n</li>\\n</ol>\\n<h2>Creating your app locally or on Cloud9</h2>\\n<ol>\\n<li>\\n<p>Make a new folder called timestamp-microservice (or whatever your project is called).</p>\\n<p><code>$ mkdir timestamp-microservice &amp;&amp; cd timestamp-microservice</code></p>\\n</li>\\n<li>\\n<p>Create the files you’re going to need:</p>\\n<p><code>$ touch .env .gitignore README.md index.html server.js</code></p>\\n</li>\\n<li>\\n<p>Install the packages that you need along the way</p>\\n<p>Examples:</p>\\n<p><code>$ npm install --save express</code></p>\\n<p><code>$ npm install --save moment</code></p>\\n<p>These will get added to a folder called node_modules in your root folder.</p>\\n</li>\\n<li>\\n<p>Initialize the project with a package.json by doing <code>$ npm init</code></p>\\n<p>It’ll ask you a series of questions and create a package.json file in your root folder based on your answers and its defaults. If you’ve already created a file called server.js as mentioned above, this <em>essential</em> line will get added to your package.json file:</p>\\n<p><code>&quot;scripts&quot;: { \\t&quot;start&quot;: &quot;node server.js&quot; }</code></p>\\n<p>If you name it anything else, though, like ‘index.js’, that line won’t get added and you’ll have to manually add that. That’s the default behavior as mentioned <a href=\\\"https://docs.npmjs.com/files/package.json#default-values\\\">here</a>. You can install node modules before or after this step and they will get added to package.json automatically.</p>\\n</li>\\n<li>\\n<p>When you’re ready, create a new repository on github, copy the remote URL, and initialize the project locally by doing:</p>\\n<p><code>$ git init</code></p>\\n<p><code>$ git add .</code></p>\\n<p><code>$ git commit -m &quot;initial commit&quot;</code></p>\\n<p><code>$ git remote add origin &lt;your github url&gt;</code></p>\\n<p><code>$ git push -u origin master</code></p>\\n</li>\\n</ol>\\n<p>Tip: In your server.js file, make sure to use <code>app.listen(process.env.PORT || &lt;default port&gt;)</code> so that the app works on heroku.</p>\\n<p>Return to step 7 above.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Heroku-Deployment-Guide/index.md\n ** module id = 401\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Heroku-Deployment-Guide/index.md?");

