	eval("module.exports = {\"title\":\"Home\",\"order\":5,\"body\":\"<h1>Welcome to the Free Code Camp Wiki!</h1>\\n<p>Our open source community’s Wiki focuses on answering your questions about learning to code and getting a coding job. We also cover in detail our:</p>\\n<ul>\\n<li>Curriculum</li>\\n<li>Local Campsite Communities</li>\\n<li>Nonprofit Projects</li>\\n</ul>\\n<p><img src=\\\"http://i.imgur.com/gyJwzkx.png\\\" alt=\\\"An illustration of CamperBot\\\"></p>\\n<p>The best way to access this wiki is via <a href=\\\"https://freecodecamp.com/wiki/docs/camperbot\\\">CamperBot</a>, located in our Gitter channels. CamperBot is a community designed tool useful for accessing our wiki content without ever leaving Gitter.</p>\\n<p>To contribute a wiki article for any of the bonfires, please use this <a href=\\\"https://freecodecamp.com/wiki/docs/Bonfire-Wiki-Template\\\">template</a>. This is essential for <a href=\\\"https://github.com/camperbot\\\">@CamperBot</a> to retrieve the article. Bonfire articles that do not use this template will be removed.</p>\\n<p>You will then need to fork the <a href=\\\"https://github.com/FreeCodeCamp/wiki\\\">wiki</a> and create a branch where you will make your changes to later submit a pull request to be merged before the changes goes live on the wiki. This is to filter any spam content or damage to <strong>our</strong> wiki. Detailed instructions with graphics found here: <a href=\\\"https://freecodecamp.com/wiki/docs/How-To-Contribute-To-The-Wiki\\\">How To Contribute To The Wiki.</a></p>\\n<p>If you have questions about contributing to the Free Code Camp Wiki message <a href=\\\"https://gitter.im/Rafase282\\\">@Rafase282 in Gitter</a>.</p>\\n<p>We look forward to collaborating with you on expanding and improving this wiki!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Home/index.md\n ** module id = 403\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Home/index.md?");

