	eval("module.exports = {\"title\":\"How Free Code Camp works\",\"order\":5,\"body\":\"<p>Free Code Camp offers you a free, self-paced, browser-based program that takes about 1,600 hours to complete.</p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-waypoints.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n<h2>how it works</h2>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-bonfires.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-ziplines.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-basejumps.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-nonprofit-projects.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/curriculum-diagram-full.jpg\\\" alt=\\\"An image of a table showing the different segments of Free Code Camp\\\"></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-Free-Code-Camp-works/index.md\n ** module id = 404\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-Free-Code-Camp-works/index.md?");

