	eval("module.exports = {\"title\":\"How GitHub Issue Moderators AKA Issue Mods Work\",\"order\":5,\"body\":\"<h2>Issue Moderators</h2>\\n<p>GitHub Issue Moderators, or “issue mods”, are volunteers who have the ability to close issues and accept or deny pull requests.<br>\\n<a href=\\\"https://github.com/orgs/FreeCodeCamp/teams/issue-moderators\\\">Issue Moderators Team Page</a></p>\\n<h3>Responsibilities</h3>\\n<p>Issue Mods have two primary responsibilities:</p>\\n<ol>\\n<li>Evaluating and responding to Issues</li>\\n<li>QAing and Merging Pull Requests</li>\\n</ol>\\n<h4>Issue Moderation</h4>\\n<p>Free Code Camp is an active open source project.  We get many tens of issues a day, all of which need to be triaged and labeled.</p>\\n<p>There are several general classes of Issues:</p>\\n<ol>\\n<li>\\n<p><strong>Code Help Requests</strong><br>\\nHelp Requests are not appropriate for Issues.  Do not provide code support in your response, gently point the user to the appropriate Help Chat, and close the issue.</p>\\n</li>\\n<li>\\n<p><strong>Bug or Clarification issues</strong><br>\\nConfirm or validate the bug if possible.  Seek additional clarification or details if needed.  Once the issue has been reproduced or at least deemed legitimate, label it <code>confirmed</code>.</p>\\n<ul>\\n<li>If it’s a simple change to an existing challenge, flag as <code>help wanted</code> and, optionally, as <code>easy</code>.  Use other tags as appropriate.</li>\\n<li>If the issue is more significant, flag as <code>bug</code></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Select-Issues-for-Contributing-Using-Labels\\\">Label Usage Guide</a></li>\\n</ul>\\n<p>If there is a question as to the proper course of action on an issue, feel free to tag @FreeCodeCamp/issue-moderators to give an opinion.  Flag as <code>Discussing</code>.</p>\\n</li>\\n<li>\\n<p><strong>Duplicate Issues</strong><br>\\nIf an issue is the same as another reported issue, the prior reported issue should take precedence.  Link to the other issue with #XXXX, where XXXX is the issue number and close the issue.</p>\\n</li>\\n<li>\\n<p><strong>Bike Shedding</strong><br>\\nBike Shedding is an example of <a href=\\\"https://en.wikipedia.org/wiki/Parkinson%27s_law_of_triviality\\\">Parkinson’s law of triviality</a>.  Some issues are simply not worth fixing.  If you believe an issue is just a waste of time, flag as such and close.</p>\\n</li>\\n</ol>\\n<h4>Pull Request Moderation</h4>\\n<p>Pull Requests (PRs) are how contributors to Free Code Camp submit changes to the repository for consideration.  It is important that these PRs are properly formatted and undergo thorough Quality Assurance Testing prior to being merged.</p>\\n<h5>PR Requirements and Formatting</h5>\\n<p>PRs must meet the following requirements:</p>\\n<ol>\\n<li>Must be against the <code>staging</code> branch</li>\\n<li>Must be from a properly named non-staging branch on the user’s fork</li>\\n<li>Title must clearly identify the affected area/change made</li>\\n<li>Title should NOT have an issue number in it</li>\\n<li>Body of the PR should give details about the change as well as level of testing (IE: untested, tested locally)</li>\\n<li>If the PR is in response to an open issue or issues, the body should also include <code>closes #XXXX</code> for each issue number closed</li>\\n<li>Change should only have 1 commit</li>\\n<li>Code should pass all tests and linting</li>\\n<li>Code should be of general high quality and a needed change or improvement</li>\\n</ol>\\n<p>If the issue does not meet one or more of these requirements, note the deficiencies in a comment and/or highlight lines.  New Contributors may be referred to the <a href=\\\"https://gitter.im/FreeCodeCamp/HelpContributors\\\">HelpContributors</a> Chat room.  At at the Mod’s discretion the issue may be closed.</p>\\n<h5>Quality Assurance</h5>\\n<p>Assuming that the basic requirements for the PR are met, all PRs should undergo some level of Quality Assurance testing.  The most basic QA is to simply checkout the PR on a local copy of the site and test the changed functionality.  Be sure to read through the code changes and understand what the potential side effects are. Exercise code and corner cases.  Be sure to try both negative and positive test cases.</p>\\n<p>If there is any doubt about the functionality, ask for the @FreeCodeCamp/issue-moderators to also take look.</p>\\n<p>For larger PRs, tag in <a href=\\\"https://gitter.im/berkeleytrue\\\">@BerkeleyTrue</a>.  In some cases it may make sense to test on the beta site.</p>\\n<h5>Special Requirements</h5>\\n<p>PRs which change the underlying function of the site or make non-trivial changes to the UI or UX of the site should be approved by <a href=\\\"https://gitter.im/berkeleytrue\\\">@BerkeleyTrue</a> or <a href=\\\"https://gitter.im/quincylarson\\\">@QuincyLarson</a>.  If you have any doubt, tag them in a comment and/or draw their attention to the PR via Gitter Chat.</p>\\n<h5>Take Care</h5>\\n<p>Though you will have write access to Free Code Camp’s repository, <strong>you should never write directly to the Free Code Camp repository</strong>. All code should enter Free Code Camp’s codebase in the form of a pull request.</p>\\n<h2>Becoming an Issue Mod</h2>\\n<p>In order to become an issue mod, you must first prove your helpfulness by leaving useful comments on outstanding issues, and submitting pull requests of your own to fix these issues.</p>\\n<p>If you’ve been doing these things, and want the additional power/responsibility that comes with helping Free Code Camp as an issue mod, please contact <a href=\\\"https://gitter.im/berkeleytrue\\\">@BerkeleyTrue</a> in Gitter.</p>\\n<p>If you are approved, we will add you to a GitHub Team, <a href=\\\"https://github.com/orgs/FreeCodeCamp/teams/issue-moderators\\\">Issue mods</a>.</p>\\n<p>The number of issue moderators will always remain small due to the nature of Github permissions.</p>\\n<h4>Additional Requirements</h4>\\n<ul>\\n<li>Two Factor Authentication enabled on your GitHub account</li>\\n<li>Profile Name set to at least your first name</li>\\n<li>Non-Default Profile Image set on GitHub</li>\\n</ul>\\n<h4>Activity Requirement</h4>\\n<p>Please note that we will frequently remove issue mods whom we think are inactive. If you are removed, please do not take this personally - we can add you back to the team, just message us and let us know you’re still active.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-GitHub-Issue-Moderators-AKA-Issue-Mods-Work/index.md\n ** module id = 406\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-GitHub-Issue-Moderators-AKA-Issue-Mods-Work/index.md?");

