	eval("module.exports = {\"title\":\"How JSONP is different from JSON\",\"order\":5,\"body\":\"<h2>JSONP is just JSON wrapped in a callback function.</h2>\\n<p>JSONP is useful for making cross domain requests, which are often otherwise forbidden by browsers for security reasons.</p>\\n<pre><code> <span class=\\\"hljs-comment\\\">// an example of JSON</span>\\n {<span class=\\\"hljs-string\\\">\\\"weapon\\\"</span>:<span class=\\\"hljs-string\\\">\\\"nunchucks\\\"</span>,<span class=\\\"hljs-string\\\">\\\"headband\\\"</span>:<span class=\\\"hljs-string\\\">\\\"yellow\\\"</span>}\\n\\n <span class=\\\"hljs-comment\\\">// an example of JSONP</span>\\n myCallback({<span class=\\\"hljs-string\\\">\\\"weapon\\\"</span>:<span class=\\\"hljs-string\\\">\\\"nunchucks\\\"</span>,<span class=\\\"hljs-string\\\">\\\"headband\\\"</span>:<span class=\\\"hljs-string\\\">\\\"yellow\\\"</span>});\\n</code></pre>\\n<p>Then to access the data stored in your JSONP, you define the callback function:</p>\\n<pre><code>myCallback = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span><span class=\\\"hljs-params\\\">(data)</span></span>{\\n  alert(<span class=\\\"hljs-type\\\">data</span>.weapon);\\n};\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-JSONP-is-different-from-JSON/index.md\n ** module id = 407\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-JSONP-is-different-from-JSON/index.md?");

