	eval("module.exports = {\"title\":\"How Long Free Code Camp Takes\",\"order\":5,\"body\":\"<p>It takes about 2,080 hours to complete Free Code Camp.</p>\\n<p>Free Code Camp is fully online, and there will always be other people at your skill level that you can pair program with, so you can learn at your own pace. Here are some example coding schedules:</p>\\n<table>\\n<thead>\\n<tr>\\n<th>Time budgeted</th>\\n<th>Hours per week</th>\\n<th>Weeks to complete</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>Weekends</td>\\n<td>10 hours/week</td>\\n<td>208 weeks (48 months)</td>\\n</tr>\\n<tr>\\n<td>Nights and Weekends</td>\\n<td>20 hours/week</td>\\n<td>104 weeks (24 months)</td>\\n</tr>\\n<tr>\\n<td>Full time</td>\\n<td>40 hours/week</td>\\n<td>52 weeks (12 months)</td>\\n</tr>\\n<tr>\\n<td>Traditional Bootcamp Pacing</td>\\n<td>80 hours/week</td>\\n<td>26 weeks (6 months)</td>\\n</tr>\\n</tbody>\\n</table>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-Long-Free-Code-Camp-Takes/index.md\n ** module id = 408\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-Long-Free-Code-Camp-Takes/index.md?");

