	eval("module.exports = {\"title\":\"How To Fork And Maintain a Local Instance of Free Code Camp\",\"order\":5,\"body\":\"<h1>Overview</h1>\\n<p>If you plan to write a <a href=\\\"https://freecodecamp.com/wiki/docs/How-To-Create-A-Pull-Request-for-Free-Code-Camp\\\">Pull Request for Free Code Camp</a>, you will almost certainly need a local copy of the site. Having a local copy of the site will give you additional capability with Git that are not available via the GitHub browser interface, including updating your fork and rebasing/squashing commits.</p>\\n<p>This guide will cover how to fork the FCC project, clone a local copy, and how to maintain your fork. All Git commands will be given for the command line, which we strongly recommend that you use, but most commands can be executed in a graphical Git environment as well.</p>\\n<h3>Need Help?</h3>\\n<p>Free Code Camp Issue Mods and staff are on hand to assist with Pull Request related issues on our <a href=\\\"https://gitter.im/FreeCodeCamp/HelpContributors\\\">Help Contributors Chat Room</a></p>\\n<h1>Initial Setup</h1>\\n<h3>Setting Up your System</h3>\\n<ol>\\n<li>Install <a href=\\\"https://git-scm.com/\\\">Git</a> or your favorite Git client</li>\\n<li>(Optional) <a href=\\\"https://help.github.com/articles/generating-ssh-keys/\\\">Setup an SSH Key</a> for Github.<br>\\nUsing SSH can greatly speed up your interactions with GitHub, since you will not be prompted for your password.</li>\\n<li>Create a parent projects directory on your system.  For the purposes of this document we will assume it is <code>/mean/</code></li>\\n</ol>\\n<h3>Forking Free Code Camp</h3>\\n<ol>\\n<li>Navigate to the top level Free Code Camp repository:<br>\\n<a href=\\\"https://github.com/FreeCodeCamp/freecodecamp\\\">https://github.com/FreeCodeCamp/freecodecamp</a></li>\\n<li>Click the “Fork” Button in the upper right hand corner of the interface. <a href=\\\"https://help.github.com/articles/fork-a-repo/\\\">More Details Here</a>.</li>\\n<li>After the project is forked, you will be taken to your copy of the FCC repo at <code>username/freecodecamp</code></li>\\n</ol>\\n<h3>Cloning Your Fork</h3>\\n<ol>\\n<li>From your fork of FCC, copy the HTTPS or SSH (if you installed SSH Keys) clone URL</li>\\n<li>Open a Bash Shell/Command Line/Terminal to your projects directory (IE: <code>/mean/</code>)</li>\\n<li>Clone your fork of git:<br>\\n<code>git clone https://github.com/yourUserName/FreeCodeCamp.git</code><br>\\nThis will download the entire FCC repo to your projects directory.</li>\\n</ol>\\n<pre><code>    $ git clone <span class=\\\"hljs-string\\\">https:</span><span class=\\\"hljs-comment\\\">//github.com/yourUserName/FreeCodeCamp.git</span>\\n    Cloning into <span class=\\\"hljs-string\\\">'FreeCodeCamp'</span>...\\n<span class=\\\"hljs-label\\\">    remote:</span> Counting <span class=\\\"hljs-string\\\">objects:</span> <span class=\\\"hljs-number\\\">37294</span>, done.\\n<span class=\\\"hljs-label\\\">    remote:</span> Compressing <span class=\\\"hljs-string\\\">objects:</span> <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">13</span>/<span class=\\\"hljs-number\\\">13</span>), done.\\n<span class=\\\"hljs-label\\\">    remote:</span> Total <span class=\\\"hljs-number\\\">37294</span> (delta <span class=\\\"hljs-number\\\">5</span>), reused <span class=\\\"hljs-number\\\">0</span> (delta <span class=\\\"hljs-number\\\">0</span>), pack-reused <span class=\\\"hljs-number\\\">37281</span>\\n    Receiving <span class=\\\"hljs-string\\\">objects:</span> <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">37294</span><span class=\\\"hljs-regexp\\\">/37294), 18.69 MiB | 3.99 MiB/</span>s, done.\\n    Resolving <span class=\\\"hljs-string\\\">deltas:</span> <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">26053</span>/<span class=\\\"hljs-number\\\">26053</span>), done.\\n    Checking connectivity... done.\\n    Checking out <span class=\\\"hljs-string\\\">files:</span> <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">573</span>/<span class=\\\"hljs-number\\\">573</span>), done.\\n</code></pre>\\n<h3>Setting up your Upstream</h3>\\n<ol>\\n<li>Change directory to the new <code>FreeCodeCamp</code> directory</li>\\n<li>Add a remote to the official FCC repo:<br>\\n<code>git remote add upstream https://github.com/FreeCodeCamp/FreeCodeCamp.git</code></li>\\n</ol>\\n<p>Congratulations, you now have a local copy of the FCC repo!</p>\\n<h1>Maintaining your Fork</h1>\\n<p>Now that you have a copy of your fork, there is work you will need to do to keep it current.</p>\\n<h3>Rebasing from Upstream</h3>\\n<p>Do this every time prior to creating a branch for a PR:</p>\\n<ol>\\n<li>Make sure you are in the <code>staging</code> branch</li>\\n</ol>\\n<pre><code>$ git status\\n<span class=\\\"hljs-keyword\\\">On</span> branch staging\\nYour branch <span class=\\\"hljs-keyword\\\">is</span> up-<span class=\\\"hljs-keyword\\\">to</span>-<span class=\\\"hljs-built_in\\\">date</span> <span class=\\\"hljs-keyword\\\">with</span> <span class=\\\"hljs-comment\\\">'origin/staging'.</span>\\n</code></pre>\\n<ol>\\n<li>If you are not on staging, resolve any outstanding files/commits and checkout staging<br>\\n<code>git checkout staging</code></li>\\n<li>Do a pull with rebase against <code>upstream</code><br>\\n<code>git pull --rebase upstream staging</code><br>\\nThis will pull down all of the changes on the official staging without making an additional commit in your local repo.</li>\\n<li>(Optional) Force push your updated staging to your GitHub fork<br>\\n<code>git push origin staging --force</code>\\nThis will overwrite the staging branch on your fork.</li>\\n</ol>\\n<pre><code>$ git push origin staging --force\\nCounting objects: <span class=\\\"hljs-number\\\">99</span>, done.\\nDelta compression <span class=\\\"hljs-keyword\\\">using</span> up to <span class=\\\"hljs-number\\\">12</span> threads.\\nCompressing objects: <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">38</span>/<span class=\\\"hljs-number\\\">38</span>), done.\\nWriting objects: <span class=\\\"hljs-number\\\">100</span>% (<span class=\\\"hljs-number\\\">38</span>/<span class=\\\"hljs-number\\\">38</span>), <span class=\\\"hljs-number\\\">16.14</span> KiB | <span class=\\\"hljs-number\\\">0</span> bytes/s, done.\\nTotal <span class=\\\"hljs-number\\\">38</span> (delta <span class=\\\"hljs-number\\\">25</span>), reused <span class=\\\"hljs-number\\\">0</span> (delta <span class=\\\"hljs-number\\\">0</span>)\\nTo git@github.com:yourUserName/FreeCodeCamp.git\\n   f7a525c.<span class=\\\"hljs-number\\\">.8</span>a2271d  staging -&gt; staging\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-To-Fork-And-Maintain-a-Local-Instance-of-Free-Code-Camp/index.md\n ** module id = 411\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-To-Fork-And-Maintain-a-Local-Instance-of-Free-Code-Camp/index.md?");

