	eval("module.exports = {\"title\":\"How To Log In To Your Local FCC Site\",\"order\":5,\"body\":\"<h1>Overview</h1>\\n<p>This guide will help you log in to your local FCC site using your GitHub account. This process should be similar for logging in with other social media accounts. This guide assumes you already have a local copy of FCC up and running.</p>\\n<h3>TL;DR</h3>\\n<ol>\\n<li>Register a new OAuth application at <a href=\\\"https://github.com/settings/developers\\\">https://github.com/settings/developers</a></li>\\n<li>Homepage field: <code>http://localhost:3000/</code></li>\\n<li>Callback field: <code>http://localhost:3000/auth/github/callback</code></li>\\n<li>Copy/paste the Client ID and Client Secret into your <code>.env</code> file</li>\\n<li>Use port 3000 when viewing your local FCC site</li>\\n</ol>\\n<h2>Need Help?</h2>\\n<p>If you need help getting FCC setup on your local machine, here are a few useful links to help you get started:</p>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-To-Fork-And-Maintain-a-Local-Instance-of-Free-Code-Camp\\\">How To Fork And Maintain a Local Instance of Free Code Camp</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-To-Create-A-Pull-Request-for-Free-Code-Camp\\\">How To Create a Pull Request for Free Code Camp</a></li>\\n<li><a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp/labels/help%20wanted\\\">Open Issues Labeled as Help Wanted</a></li>\\n</ul>\\n<p>Free Code Camp Issue Mods and staff are on hand to assist with Pull Request related issues on our <a href=\\\"https://gitter.im/FreeCodeCamp/HelpContributors\\\">Help Contributors Chat Room</a></p>\\n<h2>Disclaimer</h2>\\n<p>The output from running <code>$ gulp</code> mentions the <strong>Access Port</strong> is 3001. I have only successfully logged in with GitHub at port 3000 - the <strong>Proxy Port</strong>. If you understand how to log in using other ports, please consider submitting a pull request on this wiki.</p>\\n<h2>Log In Using Your GitHub Account</h2>\\n<ol>\\n<li>\\n<p>Register a new OAuth application at <a href=\\\"https://github.com/settings/developers\\\">https://github.com/settings/developers</a> and click <strong>Register new application</strong>\\n<br><br>\\n<em>Alternatively</em>, click your <strong>Profile Picture</strong> =&gt; <strong>Settings</strong> =&gt; <strong>Applications</strong> =&gt; <strong>Developer applications</strong> =&gt; <strong>Register new application</strong>\\n<br><br>\\n<img src=\\\"./images/How-To-Log-In-To-Your-Local-FCC-Site/register-github-oauth-app.png\\\" alt=\\\"Register GitHub OAuth App\\\">\\n<br><br></p>\\n</li>\\n<li>\\n<p>Fill out OAuth application fields</p>\\n</li>\\n</ol>\\n<ul>\\n<li><strong>Application name</strong> - choose any name, like <code>fcc-local</code></li>\\n<li><strong>Homepage URL</strong> - set to <code>http://localhost:3000/</code></li>\\n<li><strong>Application description</strong> - optional</li>\\n<li><strong>Authorization callback URL</strong> - set to <code>http://localhost:3000/auth/github/callback</code>\\n<br><br></li>\\n</ul>\\n<ol start=\\\"3\\\">\\n<li>\\n<p>Click <strong>Register application</strong> to see the newly registered application page with your Client ID and Client Secret\\n<br><br>\\n<img src=\\\"./images/How-To-Log-In-To-Your-Local-FCC-Site/client-id-and-secret.png\\\" alt=\\\"Client ID and Client Secret\\\">\\n<br><br></p>\\n</li>\\n<li>\\n<p>Copy and paste your Client ID and Client Secret into your <code>.env</code> file.\\n<br><br>\\n<em>Note: your Client ID and Client Secret will be long alphanumeric values.</em>\\n<br><br>\\n<img src=\\\"./images/How-To-Log-In-To-Your-Local-FCC-Site/update-env-file.png\\\" alt=\\\"Update .env file\\\"></p>\\n</li>\\n</ol>\\n<h2>Finished</h2>\\n<p>Congratulations! You can now successfully log into your local FCC site using your GitHub account.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-To-Log-In-To-Your-Local-FCC-Site/index.md\n ** module id = 412\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-To-Log-In-To-Your-Local-FCC-Site/index.md?");

