	eval("module.exports = {\"title\":\"How to Get Help on Gitter\",\"order\":5,\"body\":\"<p>Sorry that you are stuck. Luckily there are many campers who hang out on Gitter and can help you resolve most issues! Follow these simple steps to get help fast:</p>\\n<ol>\\n<li>Go to the <a href=\\\"https://gitter.im/FreeCodeCamp/Help\\\">Help Room</a></li>\\n</ol>\\n<ul>\\n<li>If the problem is code related, paste the problematic code in the chat room with the <a href=\\\"https://freecodecamp.com/wiki/docs/code-formatting\\\">Proper Formatting</a> and a description of the issue.</li>\\n<li>If the problem seems to be with the site itself, post a screenshot of the issue or describe it well.</li>\\n</ul>\\n<ol start=\\\"2\\\">\\n<li>\\n<p>Remember that the people there are campers just like you, so be courteous!</p>\\n</li>\\n<li>\\n<p>If your problem has baffled everyone in Gitter, try <a href=\\\"https://freecodecamp.com/wiki/docs/Searching-for-Your-Issue-on-Github\\\">Searching for Your Issue on Github</a> for anyone who has posted about a similar issue.</p>\\n</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-Get-Help-on-Gitter/index.md\n ** module id = 413\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-Get-Help-on-Gitter/index.md?");

