	eval("module.exports = {\"title\":\"How to best use the Global Control Shortcuts for Mac\",\"order\":5,\"body\":\"<p>These Global Control Shortcuts for Mac will save you hours by speeding up your typing.</p>\\n<p><a href=\\\"https://player.vimeo.com/video/107073108\\\">https://player.vimeo.com/video/107073108</a></p>\\n<p>These global shortcuts work everywhere on a Mac:</p>\\n<ul>\\n<li>Control + F = Forward</li>\\n<li>Control + B = Backward</li>\\n<li>Control + N = Next Line</li>\\n<li>Control + P = Previous Line</li>\\n<li>Control + H = Backspace</li>\\n<li>Control + D = Delete</li>\\n<li>Control + A = Beginning of Line</li>\\n<li>Control + E = End of Line</li>\\n<li>Control + K = Kill line</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-best-use-the-Global-Control-Shortcuts-for-Mac/index.md\n ** module id = 415\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-best-use-the-Global-Control-Shortcuts-for-Mac/index.md?");

