	eval("module.exports = {\"title\":\"How to clear specific values from your browser's local storage\",\"order\":5,\"body\":\"<p>Removing specific values from your browser’s local storage will solve many problems related to the browser crashing or freezing on FreeCodeCamp.</p>\\n<p>This solves, as example, a common problem with browser hanging out in a challenge’s page after saving a response with an infinite loop.</p>\\n<p>When this happens, you must delete the value in <code>localStorage</code> storing that response.</p>\\n<p>In Chrome:</p>\\n<ul>\\n<li>On <strong><a href=\\\"http://freecodecamp.com\\\">freecodecamp.com</a></strong>, open your developer tools.\\n<ul>\\n<li>More tools &gt; Developer tools (or <code>Ctrl</code> + <code>Shift</code> + <code>I</code> (Windows), <code>Cmd</code> + <code>Opt</code> + <code>I</code> (Mac))</li>\\n</ul>\\n</li>\\n<li>Navigate to the <code>Resources</code> tab</li>\\n<li>Expand the <code>Local Storage</code> item in the left pane</li>\\n<li>Select <code>http://www.freecodecamp.com</code></li>\\n<li>Find the challenge you wish to delete data in the right pane\\n<img src=\\\"http://i.imgur.com/O57tcuN.png\\\" alt=\\\"Finding a key in localStorage Chrome Developer Tools\\\"></li>\\n<li>Right click the desired challenge and select <code>Delete</code></li>\\n</ul>\\n<p>In Firefox:</p>\\n<ul>\\n<li>On <strong><a href=\\\"http://freecodecamp.com\\\">freecodecamp.com</a></strong>, open your web console with\\n<ul>\\n<li><code>Ctrl</code> + <code>Shift</code> + <code>K</code></li>\\n</ul>\\n</li>\\n<li>From there, using directly the console:\\n<ul>\\n<li>Type <code>console.log(localStorage);</code> and hit <code>Enter</code>.</li>\\n<li>Click in <code>Storage</code> link.\\n<img src=\\\"http://i.imgur.com/AsflWtv.png\\\" alt=\\\"Print the localStorage Object from web console and show the Storage\\\"></li>\\n<li>The <strong>Storage</strong> panel will appear at right.</li>\\n<li>Filter the results to find the bonfire, zipline or waypoint causing the problem.</li>\\n<li>When located, mouse over it and click the <code>x</code> at right.\\n<img src=\\\"http://i.imgur.com/3URr4jQ.png\\\" alt=\\\"Click the x for deleting the value entry.\\\"></li>\\n<li>Once removed, check if the problem was solved. Refresh or close and open the browser if necessary.</li>\\n</ul>\\n</li>\\n</ul>\\n<p><strong>Note:</strong> This can also be done with the <a href=\\\"https://developer.mozilla.org/en-US/docs/Tools/Storage_Inspector\\\">Storage Inspector</a>, but seems like Firefox hangs out when there are so many values.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-clear-specific-values-from-your-browser's-local-storage/index.md\n ** module id = 416\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-clear-specific-values-from-your-browser's-local-storage/index.md?");

