	eval("module.exports = {\"title\":\"How to clone the FreeCodeCamp website on a Windows pc\",\"order\":5,\"body\":\"<h1>How to clone and setup the FreeCodeCamp website on a Windows pc</h1>\\n<p>This list works with the FreeCodeCamp site and have been tested on this Angular tutorial <a href=\\\"https://docs.angularjs.org/tutorial\\\">https://docs.angularjs.org/tutorial</a> as well. Setting up the dev environment on a Windows pc is easy although it will give a ton of errors first in the process. The important part is to correct these errors.</p>\\n<h2>Toolchain</h2>\\n<ol>\\n<li>Git bash <a href=\\\"https://msysgit.github.io/\\\">https://msysgit.github.io/</a></li>\\n<li>Node.js <a href=\\\"https://nodejs.org/\\\">https://nodejs.org/</a></li>\\n<li>MongoDB <a href=\\\"https://www.mongodb.org/downloads\\\">https://www.mongodb.org/downloads</a></li>\\n<li>Python 2.7.10 <a href=\\\"https://www.python.org/downloads/release/python-2710/\\\">https://www.python.org/downloads/release/python-2710/</a></li>\\n</ol>\\n<p>Install the 4 downloaded prerequsites. When installing Python and Node it is important to check\\nthe option add to the path variable. The Node installer does that by default. It is optional to add Mongo to the path. Python should be installed in a subfolder in %programfiles%</p>\\n<ol>\\n<li>Open a command prompt with admin rights</li>\\n<li>Verify that Node is in th path with node -v</li>\\n<li>Verify that npm is in the path with npm -v</li>\\n<li><code>npm install npm -g</code>\\n<code>npm install bower -g</code><br>\\n<code>npm install gulp -g</code>\\n<code>npm install node-gyp -g</code>\\n<code>npm install babel -g</code></li>\\n<li>If you want to spare the time in explorer finding Mongo when it has to be started create a .cmd file on your desktop and write the path to Mongo. Probably  %programfiles%\\\\MongoDB\\\\Server\\\\3.0\\\\bin\\\\mongod.exe.</li>\\n<li>Create the default folder for mongo to store databases: C:\\\\data\\\\db</li>\\n</ol>\\n<p><strong>Every command from now on has to be executed from Git Bash. npm install and bower install is downloading components from Git repos and MUST have access to the Git commands</strong></p>\\n<ol>\\n<li>Follow the instructions here <a href=\\\"https://github.com/FreeCodeCamp/freecodecamp\\\">https://github.com/FreeCodeCamp/freecodecamp</a> and clone the project.</li>\\n<li>Run <code>npm install</code> This will produce some warnings and maybe some errors. The warnings and some of the errors can be disregarded. Stackoverflow has large\\nresources to solve the errors if they still come up the 2. time you run npm install.</li>\\n<li>Run <code>bower install</code>, <code>npm install</code> again and <code>bower install</code>again</li>\\n<li>Start mongo from the desktop shortcut and run <code>node seed</code>. You should now see a lot of activity in the window where you started mongo.</li>\\n<li>Run <code>gulp</code> and note what port it starts the site on. (Should be 3000) Open localhost:3000 (or whatever port it started)</li>\\n</ol>\\n<p><strong>you’re good to go</strong></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-clone-the-FreeCodeCamp-website-on-a-Windows-pc/index.md\n ** module id = 417\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-clone-the-FreeCodeCamp-website-on-a-Windows-pc/index.md?");

