	eval("module.exports = {\"title\":\"How to create a Campsite for your city\",\"order\":5,\"body\":\"<p>If you didn’t see your city on <a href=\\\"https://freecodecamp.com/wiki/docs/List-of-Free-Code-Camp-city-based-Campsites\\\">our list of Campsites</a>, you should create your own Facebook group for your city.</p>\\n<br> \\nPlease follow these steps: \\n- Sign in to Facebook. \\n- Click the down arrow in the upper right corner of the screen, then choose \\\"Create Group\\\" from the options.\\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/d01bb2bc-6260-4987-bedf-b2ce4c31972f/3eecbcff3109036cf90b69589360f407/deep/0/Facebook.png\\\" alt=\\\"A screenshot of Facebook showing the drop down menu that appears when you click the down arrow, with an arrow pointing to the &amp;quot;Create Group&amp;quot; option\\\"></p>\\n<br>\\n- Set the group name as \\\"Free Code Camp\\\" plus the proper name of your city.<br>Avoid using slang terms such as \\\"Philly\\\" for \\\"Philadelphia\\\". If your city is not the biggest city that uses its name, also include the state or province. For example, the Free Code Camp group in Paris, France should be called \\\"Free Code Camp Paris\\\". The Free Code Camp group in Paris, Texas should be called \\\"Free Code Camp Paris, Texas\\\".<br>If you are in North America, we suggest you add the initials of your state/province here.\\n- Set your group to public. \\n- You'll need to add at least one friend from your city to this group in order to create the group. \\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/4ed3197c-db1b-4103-a040-b42482ad232a/6c34948ebe12c57f0b7a54d7b2222ab3/deep/0/Facebook.png\\\" alt=\\\"A screenshot of the Facebook group creation modal saying that your group name should be Free Code Camp plus your city name, that your group should be public, and that you need to invite at least one Facebook friend.\\\"></p>\\n<br>\\n- Choose the graduation cap icon to indicate that this group is related to a school. \\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/00e461b3-e0a8-4ecd-9cbf-8b0ae9de75d1/59c4e9f25672b1b2ca2d7e6b06d55e0b/deep/0/Facebook.png\\\" alt=\\\"a screenshot telling you to choose the graduation icon, which is on the forth row of icons, seven icons from the left.\\\"></p>\\n<br>\\n- Click the \\\"...\\\" menu, then click \\\"Edit group settings\\\" in the dropdown menu. \\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/ae9a22e2-19a5-4309-b46c-f05a6be5644c/0870b25572d37d4d650cca1a0d59e407/deep/0/Free-Code-Camp-Testland.png\\\" alt=\\\"a screenshot telling you to click the &amp;quot;...&amp;quot; button then choose the &amp;quot;Edit group settings&amp;quot; option\\\"></p>\\n<br>\\n- Set the group's privacy setting to public. \\n- Set your group's membership approval to where any member can add or approve members ![a screenshot showing the Facebook settings panel and where you can click to set the group to public and allow all members to be able to add or approve members\\n<p><img src=\\\"https://www.evernote.com/l/AHTs6Ec_hylKyYWVhpZonOHPn8j8I5ydgv4B/image.png\\\" alt=\\\"A screen shot showing you the group description box on the Facebook page.\\\"></p>\\n<br>\\n- Click the \\\"Customize Address\\\" button.\\n- Enter \\\"free.code.camp.your.city.name\\\" with each word separated by periods. \\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/357b1bd9-7c40-4f72-8a9a-d918e632a5e8/c4714ca59360b2517dfffe90c60b1556/deep/0/Free-Code-Camp-Testland.png\\\" alt=\\\"a screenshot telling you to enter free.code.camp.your.city.name with each word seperated by periods.\\\"></p>\\n<br>\\n- Please feel free to personalize your city's group description, but be sure to include a link to Free Code Camp: \\\"http://www.freecodecamp.com\\\".  It makes it much easier for possible new members to find you if you mention the country your city is in (or its state/province if in North America).<br>**Note: in this image, we use Testland as an example.**\\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/e13808ea-f084-46f1-95bc-63db524383d5/0586484d44360e73e9acda956dad7f6a/deep/0/Free-Code-Camp-Testland.png\\\" alt=\\\"A screen shot showing you the group description box on the Facebook page.\\\"></p>\\n<br>\\n- Click the \\\"Upload a photo button. To start out, you'll probably just want to use Free Code Camp's banner (download it [here](https://s3.amazonaws.com/freecodecamp/wide-social-banner.png)), or a scenic shot of your city. Later you can update this with a picture from one of your city's Free Code Camp events. \\n<p><img src=\\\"https://www.evernote.com/shard/s116/sh/fabe226a-5a26-4508-b015-1dac35192a21/37f8119dc57845a31e972217714b038b/deep/0/Free-Code-Camp-Testland.png\\\" alt=\\\"A screenshot showing the &amp;quot;Upload a photo&amp;quot; button.\\\"></p>\\n<br>\\n- And finally, [message Justin (@hallaathrad on Gitter)](https://gitter.im/hallaathrad) with a link to your city's group page. He'll include it in the list.\\n- Join our [Local Leaders Facebook group](https://www.facebook.com/groups/freecodecampers/), where we share ideas about involving campers in your city. \\n<p>If you don’t have a Facebook account, we strongly recommend you create one, even if it’s just for the purpose of coordinating with campers in your city through this group.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-create-a-Campsite-for-your-city/index.md\n ** module id = 418\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-create-a-Campsite-for-your-city/index.md?");

