	eval("module.exports = {\"title\":\"How to deploy a website without writing any code at all\",\"order\":5,\"body\":\"<p>It’s possible to build dynamic, mobile-responsive websites without writing any code at all, in just a few minutes.</p>\\n<p><a href=\\\"https://player.vimeo.com/video/115194017\\\">https://player.vimeo.com/video/115194017</a></p>\\n<p>Here are the technologies we used here:</p>\\n<ul>\\n<li><a href=\\\"http://www.atom.io/\\\">atom.io</a> a free code editor</li>\\n<li><a href=\\\"http://www.startbootstrap.com/\\\">startbootstrap.com</a> a collection of free responsive (Bootstrap) templates</li>\\n<li><a href=\\\"http://www.powr.io/\\\">powr.io</a> a collection of free JavaScript plugins</li>\\n<li><a href=\\\"http://www.bitballoon.com/\\\">bitballoon.com</a> a tool for drag and drop website deployment</li>\\n</ul>\\n<p>You will quickly reach the limits of what you can do without actually coding, but it’s nice to be able to rapidly build working prototype websites like this.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-deploy-a-website-without-writing-any-code-at-all/index.md\n ** module id = 419\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-deploy-a-website-without-writing-any-code-at-all/index.md?");

