	eval("module.exports = {\"title\":\"How to get help when you get stuck\",\"order\":5,\"body\":\"<p>When you get stuck, remember: Read-Search-Ask.</p>\\n<ol>\\n<li><strong>Read</strong> the documentation or error</li>\\n<li><strong>Search</strong> Google</li>\\n<li><strong>Ask</strong> your friends for help</li>\\n</ol>\\n<p>This is the most time-efficient way to handle being stuck, and it’s the most respectful of other people’s time, too.</p>\\n<p>Most of the time, you’ll solve your problem after just one or two steps of this algorithm.</p>\\n<p>We have a special chat room just for getting help: <a href='https://gitter.im/freecodecamp/help/' target='_blank'>https://gitter.im/freecodecamp/help/</a></p>\\n<p>Camper Bianca Mihai has also written a 3 article series on what she does when she gets stuck:</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-start-when-you-are-stuck-(I)\\\">How to start when you are stuck (I)</a></p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-start-when-you-are-stuck-(II)\\\">How to start when you are stuck (II)</a></p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-start-when-you-are-stuck-(III)\\\">How to start when you are stuck (III)</a></p>\\n<p>Learning to code is hard. But it’s a lot easier if you ask for help when you need it!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-get-help-when-you-get-stuck/index.md\n ** module id = 420\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-get-help-when-you-get-stuck/index.md?");

