	eval("module.exports = {\"title\":\"How to get the MEAN stack running locally on OSX\",\"order\":5,\"body\":\"<h2>Requirements</h2>\\n<p>To install MongoDB, you should have Mac OS X 10.6 (Snow Leopard) or above. To find out which version of OS X you own, click the  icon in the top left corner of your screen and select <code>About This Mac</code>.</p>\\n<p>:warning: <strong>WARNING:</strong> do a Time Machine backup before carrying out any of the following steps!</p>\\n<h2>Step 1: installing MongoDB</h2>\\n<p>The easiest way to install MongoDB on OS X is using <a href=\\\"http://brew.sh/\\\">HomeBrew</a>. If you haven’t used HomeBrew before, simply execute the following command in a Terminal window:</p>\\n<pre><code class=\\\"language-sh\\\">ruby <span class=\\\"hljs-operator\\\">-e</span> <span class=\\\"hljs-string\\\">\\\"<span class=\\\"hljs-variable\\\">$(curl -fsSL https://raw.githubusercontent.com/Homebrew/install/master/install)</span>\\\"</span>\\n</code></pre>\\n<p>After HomeBrew is successfully installed, follow up with this command:</p>\\n<pre><code class=\\\"language-sh\\\">brew update &amp;&amp; brew install mongodb\\n</code></pre>\\n<p>HomeBrew will automatically install all the dependencies for you.</p>\\n<h2>Step 2: installing Node.js</h2>\\n<p>Again, we’ll let HomeBrew do the heavy lifting:</p>\\n<pre><code class=\\\"language-sh\\\">brew install node\\n</code></pre>\\n<p>The npm executable is already included in the Node.js package.</p>\\n<p>Before continuing, let’s make sure Node.js modules can be found by others (:warning: <strong>CAUTION</strong>: it’s best to copy and paste these commands, as you’d lose the original contents of your <code>.bashrc</code> file if you typed <code>&gt;</code> in place of <code>&gt;&gt;</code>):</p>\\n<pre><code class=\\\"language-sh\\\"><span class=\\\"hljs-built_in\\\">echo</span> <span class=\\\"hljs-string\\\">'export NODE_PATH=\\\"./node_modules:/usr/local/lib/node_modules\\\"'</span> &gt;&gt; ~/.bashrc &amp;&amp; <span class=\\\"hljs-built_in\\\">source</span> ~/.bashrc\\n</code></pre>\\n<p>To check if the configuration is in effect, execute:</p>\\n<pre><code class=\\\"language-sh\\\"><span class=\\\"hljs-built_in\\\">echo</span> <span class=\\\"hljs-variable\\\">$NODE_PATH</span>\\n</code></pre>\\n<p>You should see <code>./node_modules:/usr/local/lib/node_modules</code> printed out below your command.</p>\\n<p>If you use a different shell than Bash, simply replace <code>~/.bashrc</code> with your shell configuration file.</p>\\n<h2>Step 3: installing fullstack tools</h2>\\n<pre><code class=\\\"language-sh\\\">npm install -g express yo grunt grunt-cli generator-angular-fullstack bower\\n</code></pre>\\n<h2>Step 4: generating a fullstack app</h2>\\n<p>Make a directory for your Basejump projects. Assuming your desktop is your de facto workspace:</p>\\n<pre><code class=\\\"language-sh\\\">mkdir ~/Desktop/basejumps &amp;&amp; <span class=\\\"hljs-built_in\\\">cd</span> ~/Desktop/basejumps\\n</code></pre>\\n<p>Now that all the preparations are in place, it’s time for the main event:</p>\\n<pre><code class=\\\"language-sh\\\">yo angular-fullstack\\n</code></pre>\\n<p>Answer the questions according to checklist items #13-23 of <a href=\\\"http://www.freecodecamp.com/challenges/waypoint-get-set-for-basejumps\\\">Waypoint: Get Set for Basejumps</a>. Consult #24-27 if you run into errors. This will download ~350MB worth of files into your current directory.</p>\\n<p>Before going any further, we need to fix a <a href=\\\"https://github.com/clnhll/guidetobasejumps#fixing-exportsupdate\\\">known issue</a> in some generated files:</p>\\n<pre><code class=\\\"language-sh\\\"><span class=\\\"hljs-built_in\\\">echo</span> <span class=\\\"hljs-string\\\">\\\"sed -i '' -e 's/_.merge/_.extend/' server/api/*/*.controller.js\\\"</span> &gt; \\\\\\nfix-exports-update.sh &amp;&amp; chmod +x fix-exports-update.sh &amp;&amp; \\\\\\n./fix-exports-update.sh\\n</code></pre>\\n<p>You need to run <code>./fix-exports-update.sh</code> every time you generate a new API endpoint (until they fix this upstream, that is).</p>\\n<h2>Step 5: initialising local Git repository</h2>\\n<p>Tell Git not to track your database:</p>\\n<pre><code class=\\\"language-sh\\\"><span class=\\\"hljs-built_in\\\">echo</span> <span class=\\\"hljs-string\\\">\\\"data\\\"</span> &gt;&gt; .gitignore\\n</code></pre>\\n<p>Turn the directory in which your application is located into a Git repository by running the following commands:</p>\\n<pre><code class=\\\"language-sh\\\">git init &amp;&amp; git add . &amp;&amp; git commit -am <span class=\\\"hljs-string\\\">'initial commit'</span>\\n</code></pre>\\n<h2>Step 6: starting MongoDB</h2>\\n<p>To start MongoDB for the first time in your app’s directory, run the following commands in your terminal:</p>\\n<pre><code class=\\\"language-sh\\\">mkdir data &amp;&amp; <span class=\\\"hljs-built_in\\\">echo</span> <span class=\\\"hljs-string\\\">'mongod --config /usr/local/etc/mongod.conf --dbpath=data --rest \\\"$@\\\" --httpinterface'</span> &gt; mongod.sh &amp;&amp; chmod a+x mongod.sh &amp;&amp; ./mongod.sh\\n</code></pre>\\n<p>From this point on you can simply start MongoDB by executing <code>./mongod.sh</code>. A few things to note:</p>\\n<ul>\\n<li>The <code>.conf</code> file directs <code>mongod</code> to write messages to a log file instead of stdout. To view the log, run the following in a separate Terminal tab: <code>less /usr/local/var/log/mongodb/mongo.log</code>.</li>\\n<li>Since we’re not on Cloud9, we don’t need the <code>--nojournal</code> option. Journaling lets you recover the database in case of a <code>mongod</code> crash.</li>\\n<li>You have to make a clean database for each project. If you copied the <code>data</code> directory over from an earlier project, <code>mongod</code> will fail to start. If that’s the case, just <code>rm -rf data &amp;&amp; mkdir data &amp;&amp; ./mongod.sh</code>.</li>\\n</ul>\\n<h2>Step 7: starting Grunt</h2>\\n<p>Open a new Terminal tab by pressing <code>⌘T</code>, and run the following command:</p>\\n<pre><code class=\\\"language-sh\\\">grunt serve\\n</code></pre>\\n<p>Grunt should automatically open your new Angular site’s index page as soon as it finishes starting up.</p>\\n<p>Now you should be able to follow the rest of the Waypoint instructions to push to GitHub and Heroku. Just ignore the part about SSH key (#33-36) and replace <code>~/workspace</code> with your app directory’s path.</p>\\n<hr>\\n<h5>Footnote</h5>\\n<p>The above steps were tested under the following configuration:</p>\\n<ul>\\n<li>OS X 10.10.5</li>\\n<li>zsh 5.0.8 (x86_64-apple-darwin14.3.0)</li>\\n<li>node v0.12.7</li>\\n<li>npm 2.11.3</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-get-the-MEAN-stack-running-locally-on-OSX/index.md\n ** module id = 421\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-get-the-MEAN-stack-running-locally-on-OSX/index.md?");

