	eval("module.exports = {\"title\":\"How to install Screenhero\",\"order\":5,\"body\":\"<p><a href=\\\"http://links.screenhero.\\\">Download for Mac</a></p>\\n<p><a href=\\\"http://links.screenhero.\\\">Download for Windows</a></p>\\n<p>You’ll use Screenhero to pair program on the Bonfires and Zipline challenges.</p>\\n<p>Here are other alternatives to Screenhero as suggested by our fellow campers:</p>\\n<ul>\\n<li>TeamViewer (also works for Linux)</li>\\n<li>Skype + ScreenLeap</li>\\n<li><a href=\\\"http://Codeshare.io\\\">Codeshare.io</a></li>\\n<li><a href=\\\"http://Kobra.io\\\">Kobra.io</a></li>\\n<li>Google Hangouts</li>\\n<li>jsbin</li>\\n<li>Cloud 9</li>\\n<li><a href=\\\"http://Appear.in\\\">Appear.in</a></li>\\n<li><a href=\\\"http://tmate.io\\\">tmate</a> + some communication tool, e.g, Google Hangouts, Skype, <a href=\\\"http://appear.in\\\">appear.in</a></li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-install-Screenhero/index.md\n ** module id = 422\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-install-Screenhero/index.md?");

