	eval("module.exports = {\"title\":\"How to know who is in charge of your Campsite on Facebook\",\"order\":5,\"body\":\"<p>Local communities are ever-changing, and there can be more than one Volunteer Community Manager for your city. To become an Admin in the Facebook group, follow the steps below.</p>\\n<p>How to find out who is an Admin for your Campsite:</p>\\n<ul>\\n<li>First, click the Members tab below the cover photo. Then the click on the dropdown box that says “all members”**</li>\\n</ul>\\n<p><img src=\\\"http://i.imgur.com/qLx6kVZ.png?1\\\" alt=\\\"\\\"></p>\\n<ul>\\n<li>Next, use the drop down box to select “Admins”**</li>\\n</ul>\\n<p><img src=\\\"http://i.imgur.com/pfB2pDP.png?1\\\" alt=\\\"\\\"></p>\\n<ul>\\n<li>You should now be able to see who is designated as an Admin for your Campsite.</li>\\n</ul>\\n<p><img src=\\\"http://i.imgur.com/AwoYT01.png?1\\\" alt=\\\"\\\"></p>\\n<p>Message this person to introduce yourself and let them know you’re interested in being an admin. After this, go schedule your first meetup.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-know-who-is-in-charge-of-your-Campsite-on-Facebook/index.md\n ** module id = 423\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-know-who-is-in-charge-of-your-Campsite-on-Facebook/index.md?");

