	eval("module.exports = {\"title\":\"How to share your workspace selfie with FreeCodeCamp on instagram\",\"order\":5,\"body\":\"<h1>FreeCodecamp is on instagram! Here is how to take a workspace selfie and share it with us.</h1>\\n<h2>Take a selfie of you at your workspace with Free Code Camp open.</h2>\\n<p><img src=\\\"https://www.evernote.com/l/AkpdrY2nGrtBO69RoxdNq8rluri5K7B367YB/image.png\\\" alt=\\\"\\\"></p>\\n<h2>Share it on Instagram, Twitter or Facebook with the hashtag #freecodecamp.</h2>\\n<h2>Social media not your thing? No problem! Email your workspace selfie to <a href=\\\"mailto:team@freecodecamp.com\\\">team@freecodecamp.com</a></h2>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-share-your-workspace-selfie-with-FreeCodeCamp-on-instagram/index.md\n ** module id = 424\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-share-your-workspace-selfie-with-FreeCodeCamp-on-instagram/index.md?");

