	eval("module.exports = {\"title\":\"How to start when you are stuck (III)\",\"order\":5,\"body\":\"<p><strong><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-start-when-you-are-stuck-(I)\\\">How to start when you are stuck (I)</a></strong></p>\\n<p><strong><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-start-when-you-are-stuck-(II)\\\">How to start when you are stuck (II)</a></strong></p>\\n<h3>Tips</h3>\\n<ul>\\n<li>Always look at your logs, keep your console open. You can spot errors faster this way. To open the console log on chrome: click right -&gt; inspect -&gt; console There are so many errors that come from typos and so much time lost that you can save just by developing this very simple habit</li>\\n<li>Pair with other programmers as much as you can</li>\\n<li>Read the documentation. You can install a very helpful <a href=\\\"https://chrome.google.com/webstore/detail/mdn-search/ffpifaemeofjmncjdbegmbpcdaemkeoc\\\">MDN Chrome Extension</a> and use it as much and often as you need to</li>\\n<li>Follow the help tips provided by Free Code Camp in the “More informations” section. The answer is there!</li>\\n<li>Try to solve the problem in more than one way, always try to make it better, more readable, a lower complexity time, less memory</li>\\n<li>If none of the above steps work, ask for help :)</li>\\n</ul>\\n<p><img src=\\\"http://biancamihai.github.io/img/console.png\\\" alt=\\\"\\\"></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-to-start-when-you-are-stuck-(III)/index.md\n ** module id = 427\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-to-start-when-you-are-stuck-(III)/index.md?");

