	eval("module.exports = {\"title\":\"How you can get to Inbox Zero with Gmail shortcuts\",\"order\":5,\"body\":\"<blockquote>\\n<p>These Gmail Shortcuts will save you hours and help you get to Inbox Zero.</p>\\n</blockquote>\\n<p>See <a href=\\\"https://player.vimeo.com/video/115194016\\\">https://player.vimeo.com/video/115194016</a></p>\\n<h3>Gmail Shortcuts</h3>\\n<p>| shortcut \\t| description \\t|\\n|----------\\t|------------:\\t|\\n| j        \\t|   move down \\t|\\n| k        \\t|     move up \\t|\\n| o        \\t|        open \\t|\\n| r        \\t|       reply \\t|\\n| a        \\t|   reply all \\t|\\n| f        \\t|     forward \\t|\\n| c        \\t|     compose \\t|\\n| x        \\t|      select \\t|\\n| e        \\t|     archive \\t|\\n| !        \\t|   mark spam \\t|\\n| z        \\t|        undo \\t|\\n| #       \\t|     *delete \\t|</p>\\n<p>* This may not work on some EU Mac keyboards where # is accessed with, <code>ALT + 3</code>. Workaround <a href=\\\"http://toodlepip.co.uk/2010/blog-2010-09-gmail-delete-key-shortcut-uk-apple-users/\\\">here</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/How-you-can-get-to-Inbox-Zero-with-Gmail-shortcuts/index.md\n ** module id = 429\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/How-you-can-get-to-Inbox-Zero-with-Gmail-shortcuts/index.md?");

