	eval("module.exports = {\"title\":\"Html and CSS Cheat Sheet\",\"order\":5,\"body\":\"<h1>This a page that (hopefully) in time will grow to cover the basic and simple HTML and CSS solutions.</h1>\\n<h3>Please add to your alternate solutions if you know a different way.</h3>\\n<h2><hr> making a <code>&lt;hr&gt;</code> horizontal rule smaller</h2>\\n<pre><code>hr {\\n  width: 75%;\\n  margin-left: auto;\\n  margin-right: auto;\\n}\\n</code></pre>\\n<hr>\\n### Giving a `<div>` non scrolling background \\n<pre><code>#divName {\\n  padding-top: 50px;\\n  height: 500px;\\n  color: #fff;\\n  background-image: url(&quot;your_url.jpg&quot;);\\n  background-repeat: no-repeat;\\n  background-attachment: fixed;\\n  background-size: 100%;\\n}\\n</code></pre>\\n<p>try different values to see the how it affects the div<br>\\nand over in the html<br>\\n<code>&lt;div id=&quot;divName&quot; class=&quot;container-fluid&quot;&gt;</code></p>\\n<hr>\\n### Center a horizontal list\\n<p><a href=\\\"http://csswizardry.com/2011/01/create-a-centred-horizontal-navigation/\\\">http://csswizardry.com/2011/01/create-a-centred-horizontal-navigation/</a></p>\\n<hr>\\n<h3>Sections and Outlines of an HTML Document</h3>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document\\\">https://developer.mozilla.org/en-US/docs/Web/Guide/HTML/Sections_and_Outlines_of_an_HTML5_document</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Html-and-CSS-Cheat-Sheet/index.md\n ** module id = 432\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Html-and-CSS-Cheat-Sheet/index.md?");

