	eval("module.exports = {\"title\":\"IIFE\",\"order\":5,\"body\":\"<blockquote>\\n<p>IIFE — initialism for Immediately Invoked Function Expression</p>\\n</blockquote>\\n<p>Keep your data inside the <a href=\\\"https://freecodecamp.com/wiki/docs/js-closures\\\">closure</a>!</p>\\n<pre><code class=\\\"language-js\\\">(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>)</span>{\\n  <span class=\\\"hljs-comment\\\">//add your magic here</span>\\n})();\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/IIFE/index.md\n ** module id = 433\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/IIFE/index.md?");

