	eval("module.exports = {\"title\":\"If Free Code Camp is free, how does it make money\",\"order\":5,\"body\":\"<p>We will always be completely free for both students and for nonprofits.</p>\\n<p>Our name is Free Code Camp. We are a free code camp. If you had to pay us (or sign over future earnings), we’d have to change our name. And we are not going to do that.</p>\\n<p>Everyone working on our community and our open source projects is a volunteer.</p>\\n<p>We plan to eventually cover our operational costs by earning job placement bonuses from companies who hire our graduates. Note that we will not actually garnish any wages from our graduates - employers are already paying recruiters thousands of dollars to find successful candidates. Employers will simply pay the recruitment bonus to Free Code Camp instead of paying a recruiter.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/If-Free-Code-Camp-is-free,-how-does-it-make-money/index.md\n ** module id = 434\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/If-Free-Code-Camp-is-free,-how-does-it-make-money/index.md?");

