	eval("module.exports = {\"title\":\"Loop Protect\",\"order\":5,\"body\":\"<p>The Free Code Camp code runner has a built in Infinite Loop Protect feature, leveraged from <a href=\\\"https://github.com/jsbin/loop-protect\\\">JSBin’s Loop Protect</a>.  The loop protect injects some code into user created loops to allow a safe exit if more than ~500ms has passed without exiting the loop.  Loop protect will catch many, but not all infinite loop issues.\\nIf you see this message:<br>\\n<code>Error: Potential infinite loop at line X</code><br>\\nIt means you have been protected from an infinite loop.<br>\\n<strong>Note:</strong> Loop Protect cannot detect infinite recursion.</p>\\n<h3>Disable Loop Protect</h3>\\n<p>In some cases - a slow computer or a long loop - you may get an incorrect loop protect.  In order to disable loop protect, add the following comment over the line the loop protection message lists:<br>\\n<code>//noprotect</code></p>\\n<p><strong>Warning:</strong> Disabling loop protect means you may potentially allow your code to go into an infinite loop, causing your browser to be unresponsive.</p>\\n<h3>Recovering Unresponsive Code</h3>\\n<p>If you have erred and incorrectly disabled loop protection and now have an unresponsive solution, you can <a href=\\\"https://freecodecamp.com/wiki/docs/Disable-Code-Auto-Run\\\">Disable Code Auto-Run</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Loop-Protect/index.md\n ** module id = 443\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Loop-Protect/index.md?");

