	eval("module.exports = {\"title\":\"Math.pow\",\"order\":5,\"body\":\"<h1>Math.pow()</h1>\\n<p>The Math.pow() returns the <code>base</code> to the <code>exponent</code> power.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">Math</span>.pow(base, exponent);\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>base</strong></p>\\n<p>The base number</p>\\n<p><strong>exponent</strong></p>\\n<p>The exponent with which to raise the base number.</p>\\n<p>###Description</p>\\n<p>.pow() is a static method of the Math object, so you must always use it as <code>Math.pow()</code></p>\\n<h3>Examples</h3>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Simple exponents</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">2</span>);          <span class=\\\"hljs-comment\\\">// 4</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>);          <span class=\\\"hljs-comment\\\">// 8</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">10</span>);         <span class=\\\"hljs-comment\\\">// 1024</span>\\n\\n<span class=\\\"hljs-comment\\\">//Fractional exponents</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">9</span>, <span class=\\\"hljs-number\\\">0.5</span>);        <span class=\\\"hljs-comment\\\">// 3 (the square root of 9)</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">24</span>, <span class=\\\"hljs-number\\\">1</span>/<span class=\\\"hljs-number\\\">3</span>);       <span class=\\\"hljs-comment\\\">// 8 (the cubed root of 24)</span>\\n\\n<span class=\\\"hljs-comment\\\">//Signed exponents</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(<span class=\\\"hljs-number\\\">5</span>, -<span class=\\\"hljs-number\\\">2</span>);         <span class=\\\"hljs-comment\\\">// .04 (1/25)</span>\\n\\n<span class=\\\"hljs-comment\\\">//Signed bases</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(-<span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">2</span>);         <span class=\\\"hljs-comment\\\">// 25 (squares are positive)</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(-<span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">3</span>);         <span class=\\\"hljs-comment\\\">// -125 (cubes can be negative)</span>\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(-<span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">0.5</span>);       <span class=\\\"hljs-comment\\\">// NaN because negative numbers don't have a real square root</span>\\n\\n<span class=\\\"hljs-comment\\\">//Due to limits in the precision of floating point numbers, </span>\\n<span class=\\\"hljs-comment\\\">//a negative base with a fractional exponent will always return NaN</span>\\n\\n<span class=\\\"hljs-built_in\\\">Math</span>.pow(-<span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">1</span>/<span class=\\\"hljs-number\\\">2</span>);       <span class=\\\"hljs-comment\\\">// NaN</span>\\n\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Math/pow\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Math.pow/index.md\n ** module id = 447\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Math.pow/index.md?");

