	eval("module.exports = {\"title\":\"More useful APIs\",\"order\":5,\"body\":\"<p>There are two more things you have to do before this to be useful to you, however. Say you want to show all the <em>things</em> associated with the username requested with that page: you must first</p>\\n<ol>\\n<li>Have a “username” or “owner” field in your <em>thing</em> schema at <strong>/server/api/thing/thing.model.js</strong></li>\\n<li>Write a custom route in <strong>/server/api/thing/index.js</strong> to catch a request for a specific username. The request from your frontend might look something like:</li>\\n</ol>\\n<pre><code class=\\\"language-javascript\\\">\\n$http.get(<span class=\\\"hljs-string\\\">'/api/things/'</span> + username).success( …\\n</code></pre>\\n<p>so you’ll add a line into your <strong>index.js</strong> like:</p>\\n<pre><code class=\\\"language-javascript\\\">\\nrouter.get(<span class=\\\"hljs-string\\\">'/:user'</span>, controller.indexUser);\\n</code></pre>\\n<p>and then in <strong>thing.controller.js</strong> you’ll write an <em>exports.indexUser</em> function like so:</p>\\n<pre><code class=\\\"language-javascript\\\">exports.indexUser = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">req, res</span>) </span>{\\n    Thing.find({owner:req.params.user}, <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\">err, things</span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">if</span>(err) <span class=\\\"hljs-keyword\\\">return</span> res.send(<span class=\\\"hljs-number\\\">500</span>, err);\\n        res.json(<span class=\\\"hljs-number\\\">200</span>, things);\\n    });\\n};\\n</code></pre>\\n<p>Warning!!! this method only works right if usernames are absolutely unique between users. The default authentication system that comes with the angular-fullstack generator does not have unique usernames, so you’re probably better off using the _user.<em>id</em> field to determine unique users in your database for now, unless you want to implement unique user names yourself by altering your <strong>/api/user/user.model.js</strong>, <strong>/api/user/user.controller.js</strong>, and your <strong>/app/client/account/signup/signup.controller.js</strong>. Thankfully, you should know how to go about doing all that after reading this guide!</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Dynamic-URLs-using-%24routeParams\\\">PREVIOUS</a> <a href=\\\"https://freecodecamp.com/wiki/docs/Get-info-about-the-current-user\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/More-useful-APIs/index.md\n ** module id = 448\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/More-useful-APIs/index.md?");

