	eval("module.exports = {\"title\":\"Object.getOwnPropertyNames\",\"order\":5,\"body\":\"<h1>Object.getOwnPropertyNames()</h1>\\n<p>The <code>Object.getOwnPropertyNames()</code> method returns an array of all properties (enumerable or not) found directly upon a given object.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(obj)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>obj</strong></p>\\n<p>The object whose enumerable <em>and non-enumerable</em> own properties are to be returned.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/getOwnPropertyNames\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff688126%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\n<code>Object.getOwnPropertyNames()</code> returns an array whose elements are strings corresponding to the enumerable <em>and non-enumerable</em> properties found directly upon object. The ordering of the enumerable properties in the array is consistent with the ordering exposed by a <code>for...in</code> loop (or by <code>Object.keys()</code>) over the properties of the object. The ordering of the non-enumerable properties in the array, and among the enumerable properties, is not defined.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr = [<span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-string\\\">'c'</span>];\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(arr).sort()); <span class=\\\"hljs-comment\\\">// logs '0,1,2,length'</span>\\n\\n<span class=\\\"hljs-comment\\\">// Array-like object</span>\\n<span class=\\\"hljs-keyword\\\">var</span> obj = { <span class=\\\"hljs-number\\\">0</span>: <span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-number\\\">1</span>: <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-number\\\">2</span>: <span class=\\\"hljs-string\\\">'c'</span> };\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(obj).sort()); <span class=\\\"hljs-comment\\\">// logs '0,1,2'</span>\\n\\n<span class=\\\"hljs-comment\\\">// Logging property names and values using Array.forEach</span>\\n<span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(obj).forEach(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">val, idx, array</span>) </span>{\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(val + <span class=\\\"hljs-string\\\">' -&gt; '</span> + obj[val]);\\n});\\n<span class=\\\"hljs-comment\\\">// logs</span>\\n<span class=\\\"hljs-comment\\\">// 0 -&gt; a</span>\\n<span class=\\\"hljs-comment\\\">// 1 -&gt; b</span>\\n<span class=\\\"hljs-comment\\\">// 2 -&gt; c</span>\\n\\n<span class=\\\"hljs-comment\\\">// non-enumerable property</span>\\n<span class=\\\"hljs-keyword\\\">var</span> my_obj = <span class=\\\"hljs-built_in\\\">Object</span>.create({}, {\\n  getFoo: {\\n    value: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{ <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">this</span>.foo; },\\n    enumerable: <span class=\\\"hljs-literal\\\">false</span>\\n  }\\n});\\nmy_obj.foo = <span class=\\\"hljs-number\\\">1</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(my_obj).sort()); <span class=\\\"hljs-comment\\\">// logs 'foo,getFoo'</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">Pasta</span>(<span class=\\\"hljs-params\\\">grain, size, shape</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">this</span>.grain = grain; \\n    <span class=\\\"hljs-keyword\\\">this</span>.size = size; \\n    <span class=\\\"hljs-keyword\\\">this</span>.shape = shape; \\n}\\n\\n<span class=\\\"hljs-keyword\\\">var</span> spaghetti = <span class=\\\"hljs-keyword\\\">new</span> Pasta(<span class=\\\"hljs-string\\\">\\\"wheat\\\"</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-string\\\">\\\"circle\\\"</span>);\\n\\n<span class=\\\"hljs-keyword\\\">var</span> names = <span class=\\\"hljs-built_in\\\">Object</span>.getOwnPropertyNames(spaghetti).filter(CheckKey);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(names); \\n\\n<span class=\\\"hljs-comment\\\">// Check whether the first character of a string is 's'. </span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">CheckKey</span>(<span class=\\\"hljs-params\\\">value</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">var</span> firstChar = value.substr(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">1</span>); \\n    <span class=\\\"hljs-keyword\\\">if</span> (firstChar.toLowerCase() == <span class=\\\"hljs-string\\\">'s'</span>)\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>; \\n    <span class=\\\"hljs-keyword\\\">else</span>\\n         <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>; \\n}\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// size,shape</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Object.getOwnPropertyNames/index.md\n ** module id = 450\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Object.getOwnPropertyNames/index.md?");

