	eval("module.exports = {\"title\":\"Object.keys\",\"order\":5,\"body\":\"<h1>Object.keys()</h1>\\n<p>The <code>Object.keys()</code> method returns an array of a given object’s own enumerable properties, in the same order as that provided by a <code>for...in</code> loop (the difference being that a <code>for-in</code> loop enumerates properties in the prototype chain as well).</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">Object</span>.keys(obj)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>obj</strong></p>\\n<p>The object whose enumerable own properties are to be returned.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/keys\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff688127%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\n<code>Object.keys()</code> returns an array whose elements are strings corresponding to the enumerable properties found directly upon object. The ordering of the properties is the same as that given by looping over the properties of the object manually.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr = [<span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-string\\\">'c'</span>];\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.keys(arr)); <span class=\\\"hljs-comment\\\">// console: ['0', '1', '2']</span>\\n\\n<span class=\\\"hljs-comment\\\">// array like object</span>\\n<span class=\\\"hljs-keyword\\\">var</span> obj = { <span class=\\\"hljs-number\\\">0</span>: <span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-number\\\">1</span>: <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-number\\\">2</span>: <span class=\\\"hljs-string\\\">'c'</span> };\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.keys(obj)); <span class=\\\"hljs-comment\\\">// console: ['0', '1', '2']</span>\\n\\n<span class=\\\"hljs-comment\\\">// array like object with random key ordering</span>\\n<span class=\\\"hljs-keyword\\\">var</span> an_obj = { <span class=\\\"hljs-number\\\">100</span>: <span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-number\\\">2</span>: <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-number\\\">7</span>: <span class=\\\"hljs-string\\\">'c'</span> };\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.keys(an_obj)); <span class=\\\"hljs-comment\\\">// console: ['2', '7', '100']</span>\\n\\n<span class=\\\"hljs-comment\\\">// getFoo is property which isn't enumerable</span>\\n<span class=\\\"hljs-keyword\\\">var</span> my_obj = <span class=\\\"hljs-built_in\\\">Object</span>.create({}, { getFoo: { value: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{ <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">this</span>.foo; } } });\\nmy_obj.foo = <span class=\\\"hljs-number\\\">1</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-built_in\\\">Object</span>.keys(my_obj)); <span class=\\\"hljs-comment\\\">// console: ['foo']</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Create a constructor function.</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">Pasta</span>(<span class=\\\"hljs-params\\\">grain, width, shape</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">this</span>.grain = grain;\\n    <span class=\\\"hljs-keyword\\\">this</span>.width = width;\\n    <span class=\\\"hljs-keyword\\\">this</span>.shape = shape;\\n\\n    <span class=\\\"hljs-comment\\\">// Define a method.</span>\\n    <span class=\\\"hljs-keyword\\\">this</span>.toString = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\"></span>) </span>{\\n        <span class=\\\"hljs-keyword\\\">return</span> (<span class=\\\"hljs-keyword\\\">this</span>.grain + <span class=\\\"hljs-string\\\">\\\", \\\"</span> + <span class=\\\"hljs-keyword\\\">this</span>.width + <span class=\\\"hljs-string\\\">\\\", \\\"</span> + <span class=\\\"hljs-keyword\\\">this</span>.shape);\\n    }\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Create an object.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> spaghetti = <span class=\\\"hljs-keyword\\\">new</span> Pasta(<span class=\\\"hljs-string\\\">\\\"wheat\\\"</span>, <span class=\\\"hljs-number\\\">0.2</span>, <span class=\\\"hljs-string\\\">\\\"circle\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Put the enumerable properties and methods of the object in an array.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> arr = <span class=\\\"hljs-built_in\\\">Object</span>.keys(spaghetti);\\n<span class=\\\"hljs-built_in\\\">document</span>.write (arr);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// grain,width,shape,toString</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Object.keys/index.md\n ** module id = 451\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Object.keys/index.md?");

