	eval("module.exports = {\"title\":\"October 2015 Improvements\",\"order\":5,\"body\":\"<p>Our open source community has been hard at work throughout September on some major improvements. We’re going to keep up this tempo, and do a special live stream for our first birthday (October 15, 2015). Here are the improvements we just pushed to production:</p>\\n<p>###Certification</p>\\n<ul>\\n<li>New challenges have appeared called “Claim your Front End Developer Certificate” and “Claim your Full Stack Developer Certificate”.</li>\\n<li>We’ve built acceptance of our <a href=\\\"https://freecodecamp.com/wiki/docs/Academic-Honesty-Policy\\\">Academic Honesty Policy</a> into these certificate challenges.</li>\\n<li>Certificates are issued programmatically once you meet their requirements.</li>\\n<li>Certificates are available right from your Code Portfolio, and publicly viewable to all as long as you haven’t hidden your solutions.</li>\\n<li>Each certificate has a unique verifiable URL that employers can check. This makes it is impossible to forge our certificates without access to our production servers.</li>\\n</ul>\\n<p>###Code Portfolios</p>\\n<ul>\\n<li>All challenges and their solutions now show up on your code portfolio, including Waypoints.</li>\\n<li>You can hide your solutions from other people.</li>\\n</ul>\\n<p>###Unauthenticated Campers</p>\\n<ul>\\n<li>You can complete all of our challenges without being hassled to log in.</li>\\n<li>Once you complete a challenge, you will be redirected to the next logical challenge, even if you aren’t logged in.</li>\\n</ul>\\n<p>###Improved challenges</p>\\n<ul>\\n<li>@berkeleytrue figured out a way to make all challenge solutions 100% sharable. You can copy a URL directly from your browser and share it with others, and they will be able to run your code against the challenge’s tests. URLs update automatically when you run a challenge’s tests.</li>\\n<li>We completely rewrote all Bonfire tests to be as transparent as possible. By popular request, we no longer show the Chai tests themselves - just a message clearly explaining what each test is testing.</li>\\n<li>By popular request, we added gif-style challenges, and are replacing our video-style challenges with these. All of our old videos will remain available on our <a href=\\\"https://www.youtube.com/channel/UC8butISFwT-Wl7EV0hUK0BQ?sub_confirmation=1\\\">YouTube channel</a>.</li>\\n</ul>\\n<p>###Wiki improvements</p>\\n<ul>\\n<li>@rafase282 has nearly finished creating <a href=\\\"https://freecodecamp.com/wiki/docs/Map\\\">notes for every single challenge in Free Code Camp’s curriculum</a>, including hints and solutions.</li>\\n<li>@codenonprofit has started creating “portal” style wiki articles that serve as better entry points into our tangle of 400+ articles.</li>\\n</ul>\\n<p>###Resolved experiments</p>\\n<ul>\\n<li><a href=\\\"http://Plug.dj\\\">Plug.dj</a> shut down, and our <a href=\\\"http://plug.dj\\\">plug.dj</a> room with it. Some of our campers are working on building an open source music app to replace it.</li>\\n<li>We delisted several low-traffic casual Gitter rooms from our wiki and created a catch-all <a href=\\\"https://gitter.im/freecodecamp/casual\\\">Casual chat room</a> for non-coding-related chat.</li>\\n<li>We now recommend campers use their Campsite’s Facebook group for chatting instead of their campsite’s Gitter chatroom. Only a few of our Campsite Gitter chatroooms had active synchronous discussions, and about 1/3rd of all conversations consisted of someone saying “hello” and not getting a response. We’ve delisted all our Campsite Gitter rooms from our Campsite directory. Still, we will keep them open for archival purposes, and you can keep using it if you’d like. Here’s a short <a href=\\\"http://blog.freecodecamp.com/2015/09/jump-start-your-local-campsite-with-coffee-and-code.html\\\">blog post</a> about how our Campsites are evolving and growing.</li>\\n</ul>\\n<p>###Other exciting developments</p>\\n<ul>\\n<li>We just launched our first-ever <a href=\\\"https://teespring.com/get-free-code-camp-t-shirt\\\">t-shirt campaign</a> and added a second campaign for <a href=\\\"https://teespring.com/free-code-camp-shirt-eu\\\">EU fulfillment</a>.</li>\\n<li>We just launched Commit. Rather than going into detail on it here, read <a href=\\\"http://blog.freecodecamp.com/2015/10/commit-to-yourself-commit-to-nonprofit.html\\\">@codenonprofit’s blog post</a>.</li>\\n<li>We launched <a href=\\\"http://freecodecamp.com/labs\\\">Free Code Camp Labs</a> to showcase some unique projects our campers are building.</li>\\n<li>We started gathering <a href=\\\"http://freecodecamp.com/stories\\\">Stories from campers</a> and putting them all in one place. These are just a fraction of the campers who’ve advanced their careers and gotten coding jobs after learning with Free Code Camp, but it’s a pretty representative sample.</li>\\n</ul>\\n<p>###Improvements coming in the next few weeks:</p>\\n<ul>\\n<li>A clickable hint button on each challenge that cycles through a series of increasingly helpful hints.</li>\\n<li>Recommended solutions that you can compare your solution with once you complete each challenge.</li>\\n<li>We’ll re-record some of our dated-looking gifs.</li>\\n<li>We’ll finish the Get Set for Basejumps with Clementine.js (gif-style challenge)</li>\\n<li>We’ll finish the new Get Set for Ziplines (gif-style challenge)</li>\\n<li>We’ll move all Zipline and Basejump challenges to gif-style.</li>\\n<li>We’ll add a back button to our gif-style challenges.</li>\\n<li>We’ll launch our job board.</li>\\n<li>We’ll publish several new JSON API and AJAX-related challenges</li>\\n<li>We’ll finish a leaderboard creation mechanic designed for teachers to track students and campers to track their friends.</li>\\n<li>We’ll finish the Hikes interface (Hikes are Briana Swift’s <a href=\\\"https://www.youtube.com/watch?v=q7tlgZg4Q1o&amp;list=PLWKjhJtqVAbmfoj2Th9fvxhHIeqFO7wOy\\\">computer science theory challenges</a>)</li>\\n<li>We’ll close the ~30 pull requests that have piled up (thanks, contributors!)</li>\\n</ul>\\n<p>###And longer term goals we still haven’t forgotten:</p>\\n<ul>\\n<li>Support for major world languages (<a href=\\\"https://trello.com/b/m7zhwXka/fcc-translation\\\">translation is still underway</a>)</li>\\n<li>Turning Free Code Camp into a single-page isomorphic app</li>\\n<li>Creating a browser-based replacement for Screen Hero / Team Viewer that is well suited to pairing on Free Code Camp.</li>\\n<li>React.js curriculum</li>\\n<li>D3.js curriculum and data visualization Ziplines</li>\\n</ul>\\n<p>##Our codebase is improving quickly. If you see something that looks funky or broken, please click that “bug” button and create a GitHub issue for us. Thanks for your patience and support.</p>\\n<p>#Happy coding!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/October-2015-Improvements/index.md\n ** module id = 452\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/October-2015-Improvements/index.md?");

