	eval("module.exports = {\"title\":\"October 2015 Summit Agenda\",\"order\":5,\"body\":\"<p>Our October 3, 2015 Summit will begin at noon EST on Saturday on <a href=\\\"http://twitch.tv/freecodecamp\\\">twitch.tv channel</a> and be available afterward on our <a href=\\\"https://www.youtube.com/channel/UC8butISFwT-Wl7EV0hUK0BQ?sub_confirmation=1\\\">youtube channel</a>.</p>\\n<p>During this 1 hour live stream, we’ll:</p>\\n<ul>\\n<li>launch our free Front End and Full Stack Development Certificate programs</li>\\n<li>demo our new, more comprehensive portfolio pages</li>\\n<li>demo a new way that all our campers can immediately start helping nonprofits</li>\\n<li>talk with camper Blake Johnston, who created the Clementine.js boilerplate that Free Code Camp will use for our full stack Basejump challenges</li>\\n<li>launch our first-ever t-shirt campaign on <a href=\\\"http://teespring.com\\\">teespring.com</a></li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/October-2015-Summit-Agenda/index.md\n ** module id = 453\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/October-2015-Summit-Agenda/index.md?");

