	eval("module.exports = {\"title\":\"Official Free Code Camp Chat Rooms\",\"order\":5,\"body\":\"<p>The following are our official chat rooms.</p>\\n<p><strong>Please note that all chat rooms listed here are publicly accessible and indexed by search engines, so only share email addresses or other sensitive information in private messages.</strong></p>\\n<table>\\n<thead>\\n<tr>\\n<th>Chat Room</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/FreeCodeCamp\\\">FreeCodeCamp</a></td>\\n<td>our main chat room - hang out and chat about life and learning to code</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/Help\\\">Help</a></td>\\n<td>get help with our HTML, CSS and jQuery challenges from your fellow campers</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/HelpJavaScript\\\">HelpJavaScript</a></td>\\n<td>get help with our JavaScript and algorithm challenges from your fellow campers</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/HelpFrontEnd\\\">HelpFrontEnd</a></td>\\n<td>get help with our front end projects from your fellow campers</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/HelpDataViz\\\">HelpDataViz</a></td>\\n<td>get help with our data visualization projects from your fellow campers</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/HelpBackEnd\\\">HelpBackEnd</a></td>\\n<td>get help with our back end projects from your fellow campers</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/CodeReview\\\">CodeReview</a></td>\\n<td>give and receive constructive feedback from your fellow campers on your projects</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/YouCanDoThis\\\">YouCanDoThis</a></td>\\n<td>learning to code is hard - share your feelings and get moral support here</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/CodingJobs\\\">CodingJobs</a></td>\\n<td>chat about the process of getting a coding job, such as portfolios, networking, and interviewing</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/Casual\\\">Casual</a></td>\\n<td>you can chat about your non-coding interests with other campers here</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/LiveCoding\\\">LiveCoding</a></td>\\n<td>get set up to code live on our popular <a href=\\\"http://twitch.tv\\\">twitch.tv</a> channel</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/CurriculumDevelopment\\\">CurriculumDevelopment</a></td>\\n<td>help us improve our open source curriculum</td>\\n</tr>\\n<tr>\\n<td><a href=\\\"https://gitter.im/freecodecamp/DataScience\\\">DataScience</a></td>\\n<td>help us understand our gigs and gigs of public data</td>\\n</tr>\\n</tbody>\\n</table>\\n<p>By joining these chat rooms, you accept our <a href=\\\"https://freecodecamp.com/wiki/docs/Code-of-Conduct\\\">Code of Conduct</a>.</p>\\n<p>If you also want to hang out with other campers in person, be sure to join a <a href=\\\"https://freecodecamp.com/wiki/docs/List-of-Free-Code-Camp-city-based-Campsites-and-Chat-rooms\\\">Campsite in your city</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Official-Free-Code-Camp-Chat-Rooms/index.md\n ** module id = 454\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Official-Free-Code-Camp-Chat-Rooms/index.md?");

