	eval("module.exports = {\"title\":\"Other resources that Free Code Camp recommends to nonprofits\",\"order\":5,\"body\":\"<p>Please note that Free Code Camp is not partnered with, nor do we receive a referral fee from, any of the following providers. We simply want to help guide you toward a solution for your organization.</p>\\n<h3>Skills-based Volunteer Organizations:</h3>\\n<ul>\\n<li><a href=\\\"http://www.volunteermatch.com\\\">http://www.volunteermatch.com</a></li>\\n<li><a href=\\\"http://www.catchafire.org\\\">http://www.catchafire.org</a></li>\\n<li><a href=\\\"http://anyonecanhaveawebsite.com\\\">http://anyonecanhaveawebsite.com</a></li>\\n</ul>\\n<h3>Building a website:</h3>\\n<ul>\\n<li><a href=\\\"http://www.wix.com/\\\">http://www.wix.com/</a></li>\\n<li><a href=\\\"https://wordpress.com/\\\">https://wordpress.com/</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-deploy-a-website-without-writing-any-code-at-all\\\">Build it yourself for free with no code</a></li>\\n<li><a href=\\\"https://xprs.imcreator.com\\\">XPRS - another tool for building websites for free with no code</a></li>\\n</ul>\\n<h3>Donor and Volunteer Management Systems</h3>\\n<ul>\\n<li><a href=\\\"http://causesignal.com\\\">http://causesignal.com</a></li>\\n<li><a href=\\\"https://www.thedatabank.com/\\\">https://www.thedatabank.com/</a></li>\\n<li><a href=\\\"http://www.donorsnap.com/\\\">http://www.donorsnap.com/</a></li>\\n<li><a href=\\\"http://www.donorperfect.com/\\\">http://www.donorperfect.com/</a></li>\\n<li><a href=\\\"https://www.blackbaud.com/fundraising-crm/etapestry-donor-management\\\">https://www.blackbaud.com/fundraising-crm/etapestry-donor-management</a></li>\\n<li><a href=\\\"http://www.z2systems.com/\\\">http://www.z2systems.com</a></li>\\n<li><a href=\\\"http://www.regpacks.com/volunteer-management/\\\">http://www.regpacks.com/volunteer-management</a></li>\\n<li><a href=\\\"http://sumac.com/\\\">http://sumac.com</a></li>\\n<li><a href=\\\"http://www.volgistics.com\\\">http://www.volgistics.com</a></li>\\n</ul>\\n<h3>Inventory Management Systems</h3>\\n<ul>\\n<li><a href=\\\"https://www.ezofficeinventory.com/industries/non-profits\\\">https://www.ezofficeinventory.com/industries/non-profits</a></li>\\n<li><a href=\\\"https://www.ordoro.com\\\">https://www.ordoro.com</a></li>\\n<li><a href=\\\"http://www.unleashedsoftware.com\\\">http://www.unleashedsoftware.com</a></li>\\n</ul>\\n<h3>E-Learning platforms</h3>\\n<ul>\\n<li><a href=\\\"http://www.dokeos.com/\\\">http://www.dokeos.com</a></li>\\n<li><a href=\\\"http://www.efrontlearning.net/\\\">http://www.efrontlearning.net/</a></li>\\n<li><a href=\\\"https://moodle.org/\\\">https://moodle.org/</a></li>\\n<li><a href=\\\"https://sakaiproject.org/\\\">https://sakaiproject.org/</a></li>\\n</ul>\\n<h3>Community Management</h3>\\n<ul>\\n<li><a href=\\\"https://civicrm.org/\\\">https://civicrm.org/</a></li>\\n<li><a href=\\\"http://tcmgr.com/\\\">http://tcmgr.com/</a></li>\\n</ul>\\n<h3>Electronic Forms</h3>\\n<ul>\\n<li><a href=\\\"http://www.google.com/forms\\\">http://www.google.com/forms</a></li>\\n<li><a href=\\\"http://www.typeform.com\\\">http://www.typeform.com</a></li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Other-resources-that-Free-Code-Camp-recommends-to-nonprofits/index.md\n ** module id = 455\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Other-resources-that-Free-Code-Camp-recommends-to-nonprofits/index.md?");

