	eval("module.exports = {\"title\":\"Pair programming and why it is special\",\"order\":5,\"body\":\"<p>Pair Programming is an Agile Development practice that was born out of the <strong>Extreme Programming</strong> movement.</p>\\n<p>Working as a team of [exactly] two, at a single computer, the pair will slide the keyboard and mouse back-and-forth throughout a “pairing session”.  This increases the code quality by providing a “greater than the sum of its parts” effect of two developers working on a single problem domain.</p>\\n<p>The increase in quality of the code, combined with the effect of knowledge and understanding on the project being spread across multiple developers, can produce a large savings in cost on the project as a whole.</p>\\n<p>In a Test Driven Development (TDD) shop, it is most common for each member of the pair to take turns a) writing a test and b) writing code to pass the test.  This “ping pong” yields a cumulative effect on the overall quality of the final product.</p>\\n<p>To be most effective it is important that pairs are intermixed; not the same couple of developers <strong>always</strong> working together.</p>\\n<p>Pair programming is considered to be very “social”. It can be akin to a marriage because you learn to cooperate with a peer in a close, give-and-take relationship.  As such it is often very difficult to become comfortable with pair programming.  Some developers simply NEVER feel quite at-home.  In the end, the willingness to share, be a bit vulnerable and work cooperatively toward a better product will make you a far better developer (and a better person overall).</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Pair-programming-and-why-it-is-special/index.md\n ** module id = 456\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Pair-programming-and-why-it-is-special/index.md?");

