	eval("module.exports = {\"title\":\"Programming Fundamental\",\"order\":5,\"body\":\"<blockquote>\\n<p>First do it, then do it right, then do it better. This is one fundamental I always keep in mind when developing anything.\\nIf you’re a developer wishing to learn something new, regardless of skill-level, remember that as important as it is to read, it’s equally as important to get out there and <em>do</em>.\\nCreate a new gist or JSBin, pop open the console and experiment. It’s effing fun.\\n— <a href=\\\"http://addyosmani.com\\\">Addy Osmani</a></p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Programming-Fundamental/index.md\n ** module id = 457\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Programming-Fundamental/index.md?");

