	eval("module.exports = {\"title\":\"Promises\",\"order\":5,\"body\":\"<p>A new feature of ES6 to help with async programming.</p>\\n<h2>syntax</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Promise</span>(executor);\\n<span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Promise</span>(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">resolve, reject</span>) </span>{ ... });\\n</code></pre>\\n<p><img src=\\\"https://mdn.mozillademos.org/files/8633/promises.png\\\" alt=\\\"MDN image\\\"></p>\\n<p>read more at <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Promise\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Promises/index.md\n ** module id = 458\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Promises/index.md?");

