	eval("module.exports = {\"title\":\"Pseudoclassical class definition OOp\",\"order\":5,\"body\":\"<p>###Overview</p>\\n<p>Pseudoclassical class definition happens in 2 code blocks instead of one, which happens in other languages like Python and PHP.</p>\\n<p>The first block is called the “Constructor Function” which is where attributes of the class is declared. These are the aspects of the class that are unique to each new instance. Example with cars is that brand, color, and location can differ. In the second block of code you declare the methods that will be shared by each instance of the class. Examples are things the car can do, drive forward, stop, open door.</p>\\n<h3>Example</h3>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-keyword\\\">var</span> Car = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">brand, color, location</span>) </span>{\\n <span class=\\\"hljs-keyword\\\">this</span>.brand = brand;\\n <span class=\\\"hljs-keyword\\\">this</span>.color = color;\\n <span class=\\\"hljs-keyword\\\">this</span>.location = location\\n};\\n\\nCar.prototype = {\\n move: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{ <span class=\\\"hljs-keyword\\\">this</span>.location++; },\\n stop: <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{ <span class=\\\"hljs-keyword\\\">this</span>.location = <span class=\\\"hljs-number\\\">0</span>; },\\n};\\n</code></pre>\\n<p>###Explanation</p>\\n<p>The reason for declaring the entire class in 2 blocks is to save on memory when you start creating instances of the class. If the class declaration was “Functional” style then there is a new copy of the method(s) made for <strong>each</strong> instance. By declaring the class “Pseudoclassical” style only a <em>single</em> of copy of the methods are stored in memory.</p>\\n<p>When a instance of the class attempt to access a method:</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-keyword\\\">var</span> x_car = <span class=\\\"hljs-keyword\\\">new</span> Car(<span class=\\\"hljs-string\\\">'lexus'</span>, <span class=\\\"hljs-string\\\">'white'</span>, <span class=\\\"hljs-number\\\">0</span>);\\nx_car.move();\\n</code></pre>\\n<p>The interpreter will actually <em>first</em> fail to find the called method in the object itself since it was made from the Car constructor function. As you can see above there is no reference to any of the methods in the Car constructor function. From there the interpreter searches to the <code>Car.prototype</code> which is now shared between all instances. There the interpreter find the method that was called!</p>\\n<p>####Further reading:\\n<a href=\\\"https://natacseanc.wordpress.com/2015/08/04/javascript-object-create-and-classes/\\\">Natac’s Blog</a></p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Introduction_to_Object-Oriented_JavaScript\\\">MDN Classes</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Pseudoclassical-class-definition-OOp/index.md\n ** module id = 459\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Pseudoclassical-class-definition-OOp/index.md?");

