	eval("module.exports = {\"title\":\"Pull Request Contribute\",\"order\":5,\"body\":\"<blockquote>\\n<p>A (PR)pull request is a method of submitting contributions to an open source project. It is often the preferred way of submitting contributions to a project using a Distributed Version Control System (DVCS) such as Git.</p>\\n</blockquote>\\n<p>FreeCodeCamp is an Open Source project and all of the contents are freely editable.</p>\\n<ul>\\n<li><a href=\\\"https://help.github.com/articles/fork-a-repo/\\\">Fork</a> the project on GitHub.</li>\\n<li><a href=\\\"https://help.github.com/articles/cloning-a-repository/\\\">Clone</a> it to a local machine.  Do not edit online in <a href=\\\"http://github.com\\\">github.com</a>, as the editor may cause issues with JSON formatted data.</li>\\n<li><a href=\\\"https://help.github.com/articles/creating-and-deleting-branches-within-your-repository/\\\">Create a branch</a> with the form <code>fix/some-bug</code> or <code>feature/add-cool-thing</code> and make your changes in that branch and commit them.</li>\\n<li><a href=\\\"https://help.github.com/articles/pushing-to-a-remote/\\\">Push</a> the branch online (if editing locally).</li>\\n<li><a href=\\\"https://help.github.com/articles/creating-a-pull-request/\\\">Create a pull request</a> against the <strong>“staging”</strong> branch.</li>\\n<li>The title (also called the subject) of your PR should be descriptive of your changes. i.e. <code>fix typo in basic-javascript challenge</code></li>\\n<li>If the PR is meant to fix a specific issue, append to the end of your PR’s commit message <code>closes #1337</code>. This tells GitHub to close that issue if the PR is merged.</li>\\n<li>Do NOT add issue numbers to the PR’s title. i.e. <code>minor improvements in basic-javascript challenge</code></li>\\n</ul>\\n<p>These are general guidelines for PR’s that work across most projects. It gives everyone a quick guide to your changes when looking at the commit history of a project.</p>\\n<p><em>Note:  Not all pull requests are accepted. FCC project maintainers will explain the reason of non-acceptance.</em></p>\\n<h2>Further Reading</h2>\\n<ul>\\n<li><a href=\\\"https://www.youtube.com/playlist?list=PLg7s6cbtAD15G8lNyoaYDuKZSKyJrgwB-\\\">GitHub &amp; Git Foundations Training</a> - How to use Git and GitHub</li>\\n<li><a href=\\\"https://github.com/FreeCodeCamp/FreeCodeCamp#contributing\\\">FreeCodeCamp Contribution Guidelines</a></li>\\n<li><a href=\\\"http://chris.beams.io/posts/git-commit/\\\">How to write Git commit messages</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-clone-the-FreeCodeCamp-website-on-a-Windows-pc\\\">How to Clone FCC to a Windows PC</a></li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Pull-Request-Contribute/index.md\n ** module id = 460\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Pull-Request-Contribute/index.md?");

