	eval("module.exports = {\"title\":\"Quick tip keep data in sync\",\"order\":5,\"body\":\"<p>Say you want something to show up on the user view when you add it to the database. A new <em>thing</em> object will instantly show up in an <em>ng-repeat</em> loop in your HTML view if you simply add it to your local array with</p>\\n<pre><code class=\\\"language-javascript\\\">\\n$scope.awesomeThings.push(newThing);\\n</code></pre>\\n<p>But you’ll still need to add it to your database collection. Add it to your collection with</p>\\n<pre><code class=\\\"language-javascript\\\">\\n$http.post(<span class=\\\"hljs-string\\\">'/api/things'</span>, newThing);\\t\\n\\n</code></pre>\\n<p>But wait! You’ll soon realize that while all the other things in your <em>$scope.awesomeThings</em> array have unique ids assigned by MongoDB (under the <em>thing._id</em> property), your <em>newThing</em> object will not, which will make it hard for you at some point to make database actions on it (deleting it from your database requires you to use its <em>._id</em> property). So what you’ll want to do after you add it to your <em>$scope.awesomeThings</em> array (because we want it to show up on the user’s page immediately). Altogether, your code to add a newThing to your local array and database will look like:</p>\\n<pre><code class=\\\"language-javascript\\\">$scope.awesomeThings.push(newThing);\\n$http.post(<span class=\\\"hljs-string\\\">'/api/things'</span>, newThing).success(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">thatThingWeJustAdded</span>) </span>{\\n\\t$scope.awesomeThings.pop(); <span class=\\\"hljs-comment\\\">// let's lose that id-lacking newThing </span>\\n\\t$scope.awesomeThings.push(thatThingWeJustAdded); <span class=\\\"hljs-comment\\\">// and add the id-having newThing!</span>\\n};\\n</code></pre>\\n<p>This updates the local array for seemingly instant results for your user and then syncs it to your database and updates the local array in the background with the database’s version of your <em>newThing</em> object, unique <em>._id</em> and all. Notice the callback we pass to the <em>success</em> function receives the new <em>thing</em> back from the database as an argument! This way you can easily add it back to your local scope without too much overhead.</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Seed-data\\\">PREVIOUS</a>\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Dynamic-URLs-using-$routeParams\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Quick-tip-keep-data-in-sync/index.md\n ** module id = 461\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Quick-tip-keep-data-in-sync/index.md?");

