	eval("module.exports = {\"title\":\"RTFM\",\"order\":5,\"body\":\"<h2>RTFM comments generally useless</h2>\\n<blockquote>\\n<p>If everybody read the fine manual, most of the questions asked on the internet would go away!</p>\\n</blockquote>\\n<p><a href=\\\"http://meta.stackexchange.com/a/167765\\\">RTFM</a></p>\\n<p><strong>“RTFM”</strong> is <strong>rude</strong>, no doubt about it. However, <strong>links to the manual in comments are perfectly acceptable</strong>, and sometimes the only appropriate response to a question.</p>\\n<p>So when posting a manual link, be smart. <strong>Drop the RTFM and use nicer wording</strong> so the link survives. Suggestions:</p>\\n<ul>\\n<li>Check out the manual page: (link)</li>\\n<li>See the manual: (link)</li>\\n<li>This is explained in the manual: (link)</li>\\n</ul>\\n<p>If the OP was really lazy:</p>\\n<ul>\\n<li>Your question is answered in the manual: (link) For future reference, please always remember to look in the manual first. Thanks!</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/RTFM/index.md\n ** module id = 462\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/RTFM/index.md?");

