	eval("module.exports = {\"title\":\"Restrict a page to authenticated users\",\"order\":5,\"body\":\"<p>Let’s say you have a route that you want to restrict to logged-in users; maybe you have a <a href=\\\"#\\\">/profile</a> page that lets your users fill in some information about themselves, but it wouldn’t work if they weren’t logged in. Open <strong>/client/app/profile/profile.js</strong>, and add <code>authenticate: true</code> to the options passed to <em>$routeProvider.when</em> like so:</p>\\n<pre><code class=\\\"language-javascript\\\">    $routeProvider\\n      .when(<span class=\\\"hljs-string\\\">'/profile'</span>, {\\n        templateUrl: <span class=\\\"hljs-string\\\">'app/profile/profile.html'</span>,\\n        controller: <span class=\\\"hljs-string\\\">'ProfileCtrl'</span>,\\n        authenticate: <span class=\\\"hljs-literal\\\">true</span> <span class=\\\"hljs-comment\\\">// restrict to authenticated users</span>\\n      });\\n</code></pre>\\n<p>This way, if the user isn’t authenticated when they try to access the <A href=\\\"#\\\">/profile</a> page, they’ll be redirected to your login screen to authenticate before continuing to their profile page.</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Get-info-about-the-current-user\\\">PREVIOUS</a> <a href=\\\"https://freecodecamp.com/wiki/docs/isLoggedInAsync\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Restrict-a-page-to-authenticated-users/index.md\n ** module id = 465\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Restrict-a-page-to-authenticated-users/index.md?");

