	eval("module.exports = {\"title\":\"Saturday Summit August 2015\",\"order\":5,\"body\":\"<h3>Free Code Camp’s [August Live Stream] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs\\\">https://youtu.be/UhoxoYrJ6Qs</a>) was the largest yet.</h3>\\n<h2>The agenda included:</h2>\\n<ul>\\n<li>Opening words from Michael</li>\\n<li>New front end challenges [3:00] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=3m\\\">https://youtu.be/UhoxoYrJ6Qs?t=3m</a>)</li>\\n<li>Newly configured full-stack challenges</li>\\n<li>New Nonprofit Projects [12:32] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=12m32s\\\">https://youtu.be/UhoxoYrJ6Qs?t=12m32s</a>)</li>\\n<li>Wiki [22:49] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=22m49s\\\">https://youtu.be/UhoxoYrJ6Qs?t=22m49s</a>)</li>\\n<li>New chat rooms [29:40] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=29m40s\\\">https://youtu.be/UhoxoYrJ6Qs?t=29m40s</a>)</li>\\n<li>New Live Streams [35:34] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=35m34s\\\">https://youtu.be/UhoxoYrJ6Qs?t=35m34s</a>)</li>\\n<li>New Internet Radio Station DJ’d by campers [36:30] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=36m30s\\\">https://youtu.be/UhoxoYrJ6Qs?t=36m30s</a>)</li>\\n<li>FCC Bot [39:24] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=39m24s\\\">https://youtu.be/UhoxoYrJ6Qs?t=39m24s</a>)</li>\\n<li>Matt Yamamoto Zipline Demo [54:24] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=54m24s\\\">https://youtu.be/UhoxoYrJ6Qs?t=54m24s</a>)</li>\\n<li>Closing from Quincy [1:04:15] (<a href=\\\"https://youtu.be/UhoxoYrJ6Qs?t=1h4m15s\\\">https://youtu.be/UhoxoYrJ6Qs?t=1h4m15s</a>)</li>\\n<li>[Pull Request After Party with Quincy] (<a href=\\\"https://youtu.be/r0lCJ_TFYlI\\\">https://youtu.be/r0lCJ_TFYlI</a>)</li>\\n</ul>\\n<p><a href=\\\"http://www.youtube.com/watch?feature=player_embedded&v=UhoxoYrJ6Qs\\n\\\" target=\\\"_blank\\\">&lt;img src=“https://www.evernote.com/l/AnvmsUWWNeJFNbfm7fDa7SRLmnbn7jafRL4B/image.png”\\nalt=“Screen shot from our twitch feed on August 1 2015” width=“560” height=&quot;315&quot;border=“10” /&gt;</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Saturday-Summit-August-2015/index.md\n ** module id = 466\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Saturday-Summit-August-2015/index.md?");

