	eval("module.exports = {\"title\":\"Saturday Summit November 2015\",\"order\":5,\"body\":\"<p>Our November 7, 2015 Summit began at noon EDT on <a href=\\\"http://twitch.tv/freecodecamp\\\">our twitch.tv channel</a> and was available afterward on our <a href=\\\"https://www.youtube.com/channel/UC8butISFwT-Wl7EV0hUK0BQ?sub_confirmation=1\\\">youtube channel</a>.</p>\\n<p>This one-hour live-stream featured:</p>\\n<ol>\\n<li>Quincy showcasing <a href=\\\"https://medium.freecodecamp.com\\\">our new Medium publication</a></li>\\n<li>Berkeley explaining our recent curriculum improvements, and how you can contribute, too</li>\\n<li>Ben introducing the Challenge-o-matic 1000 tool for creating challenges</li>\\n<li>Mike demoing a way to get FCC running on your computer with just a few commands using Vagrant</li>\\n<li>Kristian demoing a <a href=\\\"http://musare.com/\\\">collaborative modern music app built by campers</a></li>\\n<li>Questions from our community</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Saturday-Summit-November-2015/index.md\n ** module id = 468\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Saturday-Summit-November-2015/index.md?");

