	eval("module.exports = {\"title\":\"Slack\",\"order\":5,\"body\":\"<h3>Slack is a popular chatroom service that Free Code Camp outgrew</h3>\\n<p><img src=\\\"https://www.evernote.com/l/AHRvSgBsEqZMBqugb3gWNG9jSKhPT8Dj5FAB/image.png\\\" alt=\\\"Free Code Camp's Slack usage stats\\\"></p>\\n<p>As much as we enjoyed using this service, it is a poor fit for large open source communities. This said, many open source communities still use Slack, and Slack does nothing to discourage this practice.</p>\\n<p>If you’re curious, you can read about <a href=\\\"http://blog.freecodecamp.com/2015/06/so-yeah-we-tried-slack-and-we-deeply-regretted-it.html\\\">Slack’s false advertising and the debacle this caused in June 2015</a>.</p>\\n<p>Free Code Camp now uses <a href=\\\"https://freecodecamp.com/wiki/docs/Gitter\\\">Gitter</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Slack/index.md\n ** module id = 475\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Slack/index.md?");

