	eval("module.exports = {\"title\":\"Start Here\",\"order\":5,\"body\":\"<h1>If you’re new to Free Code Camp, or just new to the wiki, start here:</h1>\\n<h2>Curriculum</h2>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/What-you-will-learn,-and-in-what-sequence-you-will-learn-it\\\">What you will learn, and in what sequence you will learn it</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-Long-Free-Code-Camp-Takes\\\">How long does Free Code Camp take?</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Brownie-Points\\\">What are these brownie points?</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Free-Code-Camp-Front-End-Development-Certificate\\\">The Front End Development Certificate</a></li>\\n<li>The Data Visualization Certificate</li>\\n<li>The Back End Development Certificate</li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Free-Code-Camp-Full-Stack-Development-Certificate\\\">The Full Stack Development Certificate</a></li>\\n<li>The Coding Interview Preparation</li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Guide-to-Basejumps-Table-of-Contents\\\">Guide to Basejumps</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Basejump-Resources\\\">Basejump Resources</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Why-does-Free-Code-Camp-use-JavaScript-instead-of-Ruby-or-Python\\\">Why JavaScript?</a></li>\\n</ul>\\n<h2>Community</h2>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Code-of-Conduct\\\">Code of Conduct</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Camper-News\\\">Camper News</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Campsites\\\">Campsites</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Official-Free-Code-Camp-Chat-Rooms\\\">Official Chat Rooms</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/camperbot\\\">How to use CamperBot</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-to-add-Free-Code-Camp-to-my-LinkedIn-profile\\\">Join the LinkedIn Community and Find Alumni</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-you-can-stream-your-live-coding-sessions-on-the-Free-Code-Camp-Twitch.tv-channel\\\">Stream your Coding Session on our Twitch.tv page</a></li>\\n</ul>\\n<h2>Nonprofit</h2>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/How-FreeCodeCamp-Nonprofit-Projects-work\\\">How Nonprofit Projects Work</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Free-Code-Camp-completion-language-requirements\\\">Natural Language Requirements</a></li>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Other-resources-that-Free-Code-Camp-recommends-to-nonprofits\\\">Resources that Free Code Camp recommends to Nonprofits Who Don’t Qualify</a></li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Start-Here/index.md\n ** module id = 477\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Start-Here/index.md?");

