	eval("module.exports = {\"title\":\"Streaks\",\"order\":5,\"body\":\"<p>Your user profile displays your recent activity. If you get <a href=\\\"https://freecodecamp.com/wiki/docs/Brownie-Points/\\\">Brownie Points</a> on several consecutive days, you will start a streak.</p>\\n<p><img src=\\\"https://www.evernote.com/l/AlyDvfhZplROUZxyMN8dIGGd-DQT7Bn8S9oB/image.png\\\" alt=\\\"A picture of a camper's streak readout showing a 21-day streak\\\"></p>\\n<p>This shows everyone that you are highly active in our community, and that you code a lot. When you’re learning to code, it’s important that you <a href=\\\"http://www.quora.com/How-does-one-become-a-great-coder/answer/Quincy-Larson\\\">code at least some everyday</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Streaks/index.md\n ** module id = 478\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Streaks/index.md?");

