	eval("module.exports = {\"title\":\"String.fromCharCode\",\"order\":5,\"body\":\"<h1>String.fromCharCode()</h1>\\n<p>The static <code>String.fromCharCode()</code> method returns a string created by using the specified sequence of Unicode values.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(num1[, ...[, numN]])\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>num1, …, numN</strong></p>\\n<p>A sequence of numbers that are Unicode values.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/fromCharCode\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/wb4w0k66%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nThis method returns a string and not a String object.</p>\\n<p>Because <code>fromCharCode()</code> is a static method of String, you always use it as <code>String.fromCharCode()</code>, rather than as a method of a String object you created.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(<span class=\\\"hljs-number\\\">65</span>, <span class=\\\"hljs-number\\\">66</span>, <span class=\\\"hljs-number\\\">67</span>);  <span class=\\\"hljs-comment\\\">// \\\"ABC\\\"</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> test = <span class=\\\"hljs-built_in\\\">String</span>.fromCharCode(<span class=\\\"hljs-number\\\">112</span>, <span class=\\\"hljs-number\\\">108</span>, <span class=\\\"hljs-number\\\">97</span>, <span class=\\\"hljs-number\\\">105</span>, <span class=\\\"hljs-number\\\">110</span>);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(test);\\n\\n<span class=\\\"hljs-comment\\\">// Output: plain</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/String.fromCharCode/index.md\n ** module id = 480\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/String.fromCharCode/index.md?");

