	eval("module.exports = {\"title\":\"String.length\",\"order\":5,\"body\":\"<h1>String.length</h1>\\n<p>The <code>length</code> property represents the length of a string.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.length\\n</code></pre>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/length\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/3d616214%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nThis property returns the number of code units in the string. UTF-16, the string format used by JavaScript, uses a single 16-bit code unit to represent the most common characters, but needs to use two code units for less commonly-used characters, so it’s possible for the value returned by length to not match the actual number of characters in the string.</p>\\n<p>For an empty string, length is 0.</p>\\n<p>The static property <code>String.length</code> returns the value 1.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> x = <span class=\\\"hljs-string\\\">'Mozilla'</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> empty = <span class=\\\"hljs-string\\\">''</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'Mozilla is '</span> + x.length + <span class=\\\"hljs-string\\\">' code units long'</span>);\\n<span class=\\\"hljs-comment\\\">/* \\\"Mozilla is 7 code units long\\\" */</span>\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'The empty string has a length of '</span> + empty.length);\\n<span class=\\\"hljs-comment\\\">/* \\\"The empty string has a length of 0\\\" */</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">\\\"every good boy does fine\\\"</span>;\\n        <span class=\\\"hljs-keyword\\\">var</span> start = <span class=\\\"hljs-number\\\">0</span>;\\n        <span class=\\\"hljs-keyword\\\">var</span> end = str.length - <span class=\\\"hljs-number\\\">1</span>;\\n        <span class=\\\"hljs-keyword\\\">var</span> tmp = <span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\n        <span class=\\\"hljs-keyword\\\">var</span> arr = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>(end);\\n\\n        <span class=\\\"hljs-keyword\\\">while</span> (end &gt;= <span class=\\\"hljs-number\\\">0</span>) {\\n            arr[start++] = str.charAt(end--);\\n        }\\n\\n<span class=\\\"hljs-comment\\\">// Join the elements of the array with a </span>\\n        <span class=\\\"hljs-keyword\\\">var</span> str2 = arr.join(<span class=\\\"hljs-string\\\">''</span>);\\n        <span class=\\\"hljs-built_in\\\">document</span>.write(str2);\\n\\n<span class=\\\"hljs-comment\\\">// Output: enif seod yob doog yreve</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/String.length/index.md\n ** module id = 481\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/String.length/index.md?");

