	eval("module.exports = {\"title\":\"Test issue with Bonfire truncate a string\",\"order\":5,\"body\":\"<p>Hi everyone,</p>\\n<p>There is an issue with “Bonfire:Truncate a String”.\\nFirst heres the code:</p>\\n<pre><code>    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">truncate</span><span class=\\\"hljs-params\\\">(str, num)</span> </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> truncd = <span class=\\\"hljs-string\\\">''</span>;\\n  <span class=\\\"hljs-keyword\\\">if</span> (str.length &gt; num) {\\n    truncd = str.slice(<span class=\\\"hljs-number\\\">0</span>, num - <span class=\\\"hljs-number\\\">3</span>) + <span class=\\\"hljs-string\\\">'...'</span>;\\n    <span class=\\\"hljs-keyword\\\">return</span> truncd;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> str;\\n}\\ntruncate(<span class=\\\"hljs-string\\\">\\\"A-tisket a-tasket A green and yellow basket\\\"</span>, <span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-string\\\">\\\"\\\"</span>);\\n</code></pre>\\n<p>It should not pass the first test that is\\n“A-tisket a-tasket A green and yellow basket”, 1 should return “A-tisket…”</p>\\n<p>According to this test the console should shoe &quot;A-tisket…“but the console says&quot;A-tisket a-tasket A green and yellow bask…”</p>\\n<p>but to my surprise it still passed… I hope I will get an explaination to this</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Test-issue-with-Bonfire-truncate-a-string/index.md\n ** module id = 482\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Test-issue-with-Bonfire-truncate-a-string/index.md?");

