	eval("module.exports = {\"title\":\"The Return Early Pattern\",\"order\":5,\"body\":\"<h2>The Return Early Pattern</h2>\\n<p>The return early pattern in JavaScript is a simple way to reduce the number of <code>else</code> statements within a function body to zero. There are many reasons to prefer this pattern over using <code>else</code> statements.</p>\\n<ul>\\n<li>Reducing the total amount of code on the page</li>\\n<li>Reduce line length by reducing logical complexity</li>\\n<li>Improve Readability</li>\\n</ul>\\n<p>The essence of the return early pattern is to replace the need for <code>else</code> conditionals in JavaScript functions by using the <code>return</code> keyword in the body of the <code>if</code> statement.</p>\\n<p>Let us create function that behaves differently under certain conditions (note: this is a trivial and contrived example just to get the point accross).</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">willItBlend</span>(<span class=\\\"hljs-params\\\">someObject</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> ItWillBlend;\\n\\n  <span class=\\\"hljs-keyword\\\">if</span> (someObject.blendable ==== <span class=\\\"hljs-string\\\">'It will blend'</span>) {\\n    itWillBlend = <span class=\\\"hljs-literal\\\">true</span>;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    itWillBlend = <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> itWillBlend;\\n}\\n</code></pre>\\n<p>While this does seem readable, let us add another condition to verify that the function was indeed called with an object instead of <code>undefined</code>.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">willItBlend</span>(<span class=\\\"hljs-params\\\">someObject</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> itWillBlend;\\n\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> someObject === <span class=\\\"hljs-string\\\">'object'</span>) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (someObject.blendable ==== <span class=\\\"hljs-string\\\">'It will blend'</span>) {\\n      itWillBlend = <span class=\\\"hljs-literal\\\">true</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n      itWillBlend = <span class=\\\"hljs-literal\\\">false</span>;\\n    }\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    itWillBlend = <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> itWillBlend;\\n}\\n</code></pre>\\n<p>This function is clear and its name is descriptive but is seems unnecessarily complicated. Can we use the return early pattern to increase readability and decrease the number of <code>else</code> statements? Let us give it a try.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">willItBlend</span>(<span class=\\\"hljs-params\\\">someObject</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> someObject !== <span class=\\\"hljs-string\\\">'object'</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">if</span> (someObject.blendable !== <span class=\\\"hljs-string\\\">'It will blend'</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n}\\n</code></pre>\\n<p>Using the return early pattern, we were able to remove all the unnecessary else statements and make our functions purpose and signature (the typeof of argument it expects) much clearer and concise.</p>\\n<h3>Bonus: One conditional statement</h3>\\n<p>We can further refactor this function to only use one if statement. Check it out:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">willItBlend</span>(<span class=\\\"hljs-params\\\">someObject</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (\\n    <span class=\\\"hljs-keyword\\\">typeof</span> someObject !== <span class=\\\"hljs-string\\\">'object'</span> ||\\n    someObject.blendable !== <span class=\\\"hljs-string\\\">'It will blend'</span>\\n    ) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n}\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/The-Return-Early-Pattern/index.md\n ** module id = 483\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/The-Return-Early-Pattern/index.md?");

