	eval("module.exports = {\"title\":\"The main advantages of Free Code Camp\",\"order\":5,\"body\":\"<p>Free Code Camp’s main advantages are that we’re accessible to busy adults who want to change careers.</p>\\n<p>Specifically, we’re:</p>\\n<ul>\\n<li>Free</li>\\n<li>Self-paced</li>\\n<li>Browser-based</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/The-main-advantages-of-Free-Code-Camp/index.md\n ** module id = 484\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/The-main-advantages-of-Free-Code-Camp/index.md?");

