	eval("module.exports = {\"title\":\"Tips on How To Become A Good Pair Programmer\",\"order\":5,\"body\":\"<p>Pair programming is a great way to learn programming! <a href=\\\"https://freecodecamp.com/wiki/docs/Why-You-Should-Try-Pair-Programming\\\">Read why.</a></p>\\n<ol>\\n<li>\\n<p><strong>Communicate well with your partner.</strong> Voice chat will make communication easy, let you focus on learning, and will allow you to use your time effectively.</p>\\n</li>\\n<li>\\n<p><strong>Before you start coding:</strong> decide together with your partner how your workflow should look so that both you and your partner can benefit from the time spent coding. An example of a good workflow:</p>\\n<ul>\\n<li>Read through and discuss the problem to make sure you understand it.</li>\\n<li>Solve the problem with pseudo-code by identifying the steps you need to take in order to get from the given inputs to the expected result.</li>\\n<li>Create your actual solution</li>\\n</ul>\\n</li>\\n<li>\\n<p><strong>When explaining things:</strong> Ask questions to guide your partner’s thoughts instead of just showing the answer right away. This will let him or her think about the problem and make it easier for them to learn.</p>\\n</li>\\n<li>\\n<p><strong>Finally</strong>, be <em>open to your partner’s ideas</em>, <em>respect each other</em> and <strong>have fun! :)</strong></p>\\n</li>\\n</ol>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Tips-on-How-To-Become-A-Good-Pair-Programmer/index.md\n ** module id = 485\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Tips-on-How-To-Become-A-Good-Pair-Programmer/index.md?");

