	eval("module.exports = {\"title\":\"Translating Free Code Camp into Your Native Language\",\"order\":5,\"body\":\"<p>Our translation effort is driven by bilingual campers like you.</p>\\n<p>First we plan to create wiki articles in your language for all of Free Code Camp’s challenges. We plan to eventually incorporate these translations into Free Code Camp itself.</p>\\n<p>If you’re are bilingual, and have time to help us, please join our <a href=\\\"https://gitter.im/FreeCodeCamp/Translators\\\">translation chat room</a>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Translating-Free-Code-Camp-into-Your-Native-Language/index.md\n ** module id = 486\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Translating-Free-Code-Camp-into-Your-Native-Language/index.md?");

