	eval("module.exports = {\"title\":\"Twitch\",\"order\":5,\"body\":\"<p>Free Code Camp uses <a href=\\\"http://Twitch.tv\\\">Twitch.tv</a> to broadcast live streams. These can be anything from live pair programming to their monthly Summit, where big news events and new developments are announced.</p>\\n<p>All levels of coders are encouraged to stream on the Free Code Camp twitch channel. If this is something that would interest you, please contact Briana on <a href=\\\"https://gitter.im/brianamarie\\\">gitter</a> or on <a href=\\\"https://twitter.com/brianamarie132\\\">twitter</a>.</p>\\n<p>More information on how to stream can be found <a href=\\\"https://freecodecamp.com/wiki/docs/Stream-Your-Coding-Sessions-on-Twitch.tv\\\">here</a>.</p>\\n<p>You can find the channel here: <a href=\\\"http://www.twitch.tv/freecodecamp\\\">http://www.twitch.tv/freecodecamp</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Twitch/index.md\n ** module id = 487\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Twitch/index.md?");

