	eval("module.exports = {\"title\":\"Waypoint Access Array Data with Indexes\",\"order\":5,\"body\":\"<h1>Access Array Data with Indexes</h1>\\n<p>We can access the data inside arrays using indexes.</p>\\n<p>Array indexes are written in the same bracket notation that strings use, except that instead of specifying a character, they are specifying an entry in the array.</p>\\n<p>For example:</p>\\n<pre><code>var<span class=\\\"hljs-instruction\\\"> array </span>= <span class=\\\"hljs-keyword\\\">[</span>1,2,3];\\narray<span class=\\\"hljs-keyword\\\">[</span>0]; //equals 1\\nvar data = array<span class=\\\"hljs-keyword\\\">[</span>1];\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Access-Array-Data-with-Indexes/index.md\n ** module id = 490\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Access-Array-Data-with-Indexes/index.md?");

