	eval("module.exports = {\"title\":\"Waypoint Access Multi Dimensional Arrays With Indexes\",\"order\":5,\"body\":\"<h1>Access Multi-Dimensional Arrays With Indexes</h1>\\n<p>One way to think of a <code>multi-dimensional</code> array, is as an array of arrays. When you use brackets to access your array, the first set of bracket refers to the entries in the outer-most array, and each subsequent level of brackets refers to the next level of entries inside.</p>\\n<h2>Example</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr = [\\n    [<span class=\\\"hljs-number\\\">1</span>,<span class=\\\"hljs-number\\\">2</span>,<span class=\\\"hljs-number\\\">3</span>],\\n    [<span class=\\\"hljs-number\\\">4</span>,<span class=\\\"hljs-number\\\">5</span>,<span class=\\\"hljs-number\\\">6</span>],\\n    [<span class=\\\"hljs-number\\\">7</span>,<span class=\\\"hljs-number\\\">8</span>,<span class=\\\"hljs-number\\\">9</span>],\\n    [[<span class=\\\"hljs-number\\\">10</span>,<span class=\\\"hljs-number\\\">11</span>,<span class=\\\"hljs-number\\\">12</span>], <span class=\\\"hljs-number\\\">13</span>, <span class=\\\"hljs-number\\\">14</span>]\\n];\\narr[<span class=\\\"hljs-number\\\">0</span>]; <span class=\\\"hljs-comment\\\">// equals [1,2,3]</span>\\narr[<span class=\\\"hljs-number\\\">1</span>][<span class=\\\"hljs-number\\\">2</span>]; <span class=\\\"hljs-comment\\\">// equals 6</span>\\narr[<span class=\\\"hljs-number\\\">3</span>][<span class=\\\"hljs-number\\\">0</span>][<span class=\\\"hljs-number\\\">1</span>]; <span class=\\\"hljs-comment\\\">// equals 11</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Access-Multi-Dimensional-Arrays-With-Indexes/index.md\n ** module id = 491\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Access-Multi-Dimensional-Arrays-With-Indexes/index.md?");

