	eval("module.exports = {\"title\":\"Waypoint Accessing Nested Arrays In Json\",\"order\":5,\"body\":\"<p>#Waypoint: Accessing Nested Arrays in JSON</p>\\n<p>As we have seen in earlier examples, JSON objects can contain both nested objects and nested arrays. Similar to accessing nested objects, Array bracket notation can be chained to access nested arrays.</p>\\n<p>Here is an example of how to access a nested array:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> ourPets = { \\n  <span class=\\\"hljs-string\\\">\\\"cats\\\"</span>: [\\n    <span class=\\\"hljs-string\\\">\\\"Meowzer\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"Fluffy\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"Kit-Cat\\\"</span>\\n  ],\\n  <span class=\\\"hljs-string\\\">\\\"dogs\\\"</span>: [\\n    <span class=\\\"hljs-string\\\">\\\"Spot\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"Bowser\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"Frankie\\\"</span>\\n  ]\\n};\\nourPets.cats[<span class=\\\"hljs-number\\\">1</span>]; <span class=\\\"hljs-comment\\\">// \\\"Fluffy\\\"</span>\\nourPets.dogs[<span class=\\\"hljs-number\\\">0</span>]; <span class=\\\"hljs-comment\\\">// \\\"Spot\\\"</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Accessing-Nested-Arrays-In-Json/index.md\n ** module id = 492\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Accessing-Nested-Arrays-In-Json/index.md?");

