	eval("module.exports = {\"title\":\"Waypoint Accessing Nested Objects In Json\",\"order\":5,\"body\":\"<p>#Waypoint: Accessing Nested Objects in JSON</p>\\n<p>The properties and sub-properties of JSON objects can be accessed by chaining together the dot or bracket notation.</p>\\n<p>Here is a nested JSON Object:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> ourStorage = {\\n  <span class=\\\"hljs-string\\\">\\\"desk\\\"</span>: {\\n    <span class=\\\"hljs-string\\\">\\\"drawer\\\"</span>: <span class=\\\"hljs-string\\\">\\\"stapler\\\"</span>\\n  },\\n  <span class=\\\"hljs-string\\\">\\\"cabinet\\\"</span>: {\\n    <span class=\\\"hljs-string\\\">\\\"top drawer\\\"</span>: { \\n      <span class=\\\"hljs-string\\\">\\\"folder1\\\"</span>: <span class=\\\"hljs-string\\\">\\\"a file\\\"</span>,\\n      <span class=\\\"hljs-string\\\">\\\"folder2\\\"</span>: <span class=\\\"hljs-string\\\">\\\"secrets\\\"</span>\\n    },\\n    <span class=\\\"hljs-string\\\">\\\"bottom drawer\\\"</span>: <span class=\\\"hljs-string\\\">\\\"soda\\\"</span>\\n  }\\n}\\nourStorage.cabinet[<span class=\\\"hljs-string\\\">\\\"top drawer\\\"</span>].folder2;  <span class=\\\"hljs-comment\\\">// \\\"secrets\\\"</span>\\nourStorage.desk.drawer; <span class=\\\"hljs-comment\\\">// \\\"stap</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Accessing-Nested-Objects-In-Json/index.md\n ** module id = 493\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Accessing-Nested-Objects-In-Json/index.md?");

