	eval("module.exports = {\"title\":\"Waypoint Accessing Objects Properties With Bracket Notation\",\"order\":5,\"body\":\"<p>#Waypoint: Accessing Objects Properties with Bracket Notation</p>\\n<p>The second way to access the properties of an object is bracket notation (<code>[]</code>). If the property of the object you are trying to access has a space in it, you will need to use bracket notation.</p>\\n<p>Here is a sample of using bracket notation to read an object property:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> myObj = {\\n  <span class=\\\"hljs-string\\\">\\\"Space Name\\\"</span>: <span class=\\\"hljs-string\\\">\\\"Kirk\\\"</span>,\\n  <span class=\\\"hljs-string\\\">\\\"More Space\\\"</span>: <span class=\\\"hljs-string\\\">\\\"Spock\\\"</span>\\n};\\nmyObj[<span class=\\\"hljs-string\\\">\\\"Space Name\\\"</span>]; <span class=\\\"hljs-comment\\\">// Kirk</span>\\nmyObj[<span class=\\\"hljs-string\\\">'More Space'</span>]; <span class=\\\"hljs-comment\\\">// Spock</span>\\n</code></pre>\\n<p>Note that property names with spaces in them must be in quotes (single or double).</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Accessing-Objects-Properties-With-Bracket-Notation/index.md\n ** module id = 494\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Accessing-Objects-Properties-With-Bracket-Notation/index.md?");

