	eval("module.exports = {\"title\":\"Waypoint Accessing Objects Properties With The Dot Operator\",\"order\":5,\"body\":\"<p>#Waypoint: Accessing Objects Properties with the Dot Operator</p>\\n<p>There are two ways to access the properties of an object: the dot operator (<code>.</code>) and bracket notation (<code>[]</code>), similar to an array.</p>\\n<p>The dot operator is what you use when you know the name of the property you’re trying to access ahead of time.</p>\\n<p>Here is a sample of using the dot operator (<code>.</code>) to read an object property:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> myObj = {\\n  prop1: <span class=\\\"hljs-string\\\">\\\"val1\\\"</span>,\\n  prop2: <span class=\\\"hljs-string\\\">\\\"val2\\\"</span>\\n};\\nmyObj.prop1; <span class=\\\"hljs-comment\\\">// val1</span>\\nmyObj.prop2; <span class=\\\"hljs-comment\\\">// val2</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Accessing-Objects-Properties-With-The-Dot-Operator/index.md\n ** module id = 495\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Accessing-Objects-Properties-With-The-Dot-Operator/index.md?");

