	eval("module.exports = {\"title\":\"Waypoint Comparison With The Equality Operator\",\"order\":5,\"body\":\"<p>##Waypoint: Comparison with the Equality Operator</p>\\n<p>There are many <code>Comparison Operators</code> in JavaScript. All of these operators return a boolean <code>true</code> or <code>false</code> value.</p>\\n<p>The most basic operator is the equality operator <code>==</code>. The equality operator compares two values and returns <code>true</code> if they’re equivalent or <code>false</code> if they are not. Note that equality is different from assignment (=), which assigns the value at the right of the operator to a variable in the left.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">equalityTest</span>(<span class=\\\"hljs-params\\\">myVal</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (myVal == <span class=\\\"hljs-number\\\">10</span>) {\\n     <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Equal\\\"</span>;\\n  }\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Not Equal\\\"</span>;\\n}\\n</code></pre>\\n<p>If <code>myVal</code> is equal to <code>10</code>, the function will return “Equal”. If it is not, the function will return “Not Equal”.</p>\\n<p>The equality operator will do its best to convert values for comparison, for example:</p>\\n<pre><code class=\\\"language-js\\\">   <span class=\\\"hljs-number\\\">1</span>   ==  <span class=\\\"hljs-number\\\">1</span>        <span class=\\\"hljs-comment\\\">// true</span>\\n  <span class=\\\"hljs-string\\\">\\\"1\\\"</span>  ==  <span class=\\\"hljs-number\\\">1</span>        <span class=\\\"hljs-comment\\\">// true</span>\\n   <span class=\\\"hljs-number\\\">1</span>   == <span class=\\\"hljs-string\\\">'1'</span>       <span class=\\\"hljs-comment\\\">// true</span>\\n   <span class=\\\"hljs-number\\\">0</span>   == <span class=\\\"hljs-literal\\\">false</span>     <span class=\\\"hljs-comment\\\">// true</span>\\n   <span class=\\\"hljs-number\\\">0</span>   == <span class=\\\"hljs-literal\\\">null</span>      <span class=\\\"hljs-comment\\\">// false</span>\\n   <span class=\\\"hljs-number\\\">0</span>   == <span class=\\\"hljs-literal\\\">undefined</span> <span class=\\\"hljs-comment\\\">// false</span>\\n <span class=\\\"hljs-literal\\\">null</span>  == <span class=\\\"hljs-literal\\\">undefined</span> <span class=\\\"hljs-comment\\\">// true</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Comparison-With-The-Equality-Operator/index.md\n ** module id = 538\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Comparison-With-The-Equality-Operator/index.md?");

