	eval("module.exports = {\"title\":\"Waypoint Introducing Else If Statements\",\"order\":5,\"body\":\"<p>#Waypoint: Introducing Else If Statements</p>\\n<p>If you have multiple conditions that need to be addressed, you can chain <code>if</code> statements together with <code>else if</code> statements.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">if</span> (num &gt; <span class=\\\"hljs-number\\\">15</span>) {\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Bigger than 15\\\"</span>;\\n} <span class=\\\"hljs-keyword\\\">else</span> <span class=\\\"hljs-keyword\\\">if</span> (num &lt; <span class=\\\"hljs-number\\\">5</span>) {\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Smaller than 5\\\"</span>;\\n} <span class=\\\"hljs-keyword\\\">else</span> {\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"Between 5 and 15\\\"</span>;\\n}\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Introducing-Else-If-Statements/index.md\n ** module id = 606\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Introducing-Else-If-Statements/index.md?");

