	eval("module.exports = {\"title\":\"Waypoint Introducing Javascript Object Notation Json\",\"order\":5,\"body\":\"<p>#Waypoint: Introducing JavaScript Object Notation JSON</p>\\n<p>JavaScript Object Notation or <code>JSON</code> uses the format of JavaScript Objects to store data. JSON is flexible because it allows for <code>Data Structures</code> with arbitrary combinations of <code>strings</code>, <code>numbers</code>, <code>booleans</code>, <code>arrays</code>, and <code>objects</code>.</p>\\n<p>Here is an example of a JSON object:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> ourMusic = [\\n  {\\n    <span class=\\\"hljs-string\\\">\\\"artist\\\"</span>: <span class=\\\"hljs-string\\\">\\\"Daft Punk\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"title\\\"</span>: <span class=\\\"hljs-string\\\">\\\"Homework\\\"</span>,\\n    <span class=\\\"hljs-string\\\">\\\"release_year\\\"</span>: <span class=\\\"hljs-number\\\">1997</span>,\\n    <span class=\\\"hljs-string\\\">\\\"formats\\\"</span>: [ \\n      <span class=\\\"hljs-string\\\">\\\"CD\\\"</span>, \\n      <span class=\\\"hljs-string\\\">\\\"Cassette\\\"</span>, \\n      <span class=\\\"hljs-string\\\">\\\"LP\\\"</span> ],\\n    <span class=\\\"hljs-string\\\">\\\"gold\\\"</span>: <span class=\\\"hljs-literal\\\">true</span>\\n  }\\n];\\n</code></pre>\\n<p>This is an array of objects and the object has various pieces of <code>metadata</code> about an album. It also has a nested <code>formats</code> array. Additional album records could be added to the top level array.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Introducing-Javascript-Object-Notation-Json/index.md\n ** module id = 608\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Introducing-Javascript-Object-Notation-Json/index.md?");

