	eval("module.exports = {\"title\":\"Waypoint Iterate Odd Numbers With a For Loop\",\"order\":5,\"body\":\"<h1>Iterate Odd Numbers With a For Loop</h1>\\n<p>For loops don’t have to iterate one at a time. By changing our <code>final-expression</code>, we can count by even numbers.</p>\\n<p>We’ll start at <code>i = 0</code> and loop while <code>i &lt; 10</code>. We’ll increment <code>i</code> by 2 each loop with <code>i += 2</code>.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> ourArray = [];\\n\\n<span class=\\\"hljs-keyword\\\">for</span>(<span class=\\\"hljs-keyword\\\">var</span> i = <span class=\\\"hljs-number\\\">0</span>; i &lt; <span class=\\\"hljs-number\\\">10</span>; i += <span class=\\\"hljs-number\\\">2</span>) {\\n\\n  ourArray.push(i);\\n\\n}\\n</code></pre>\\n<p>ourArray will now contain <code>[0,2,4,6,8]</code></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Iterate-Odd-Numbers-With-a-For-Loop/index.md\n ** module id = 610\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Iterate-Odd-Numbers-With-a-For-Loop/index.md?");

