	eval("module.exports = {\"title\":\"Waypoint Iterate Through An Array With A For Loop\",\"order\":5,\"body\":\"<p>#Waypoint: Iterate Through an Array with a For Loop</p>\\n<p>A common task in Javascript is to iterate through the contents of an array. One way to do that is with a <code>for</code> loop. This code will output each element of the array <code>arr</code> to the console:</p>\\n<pre><code class=\\\"language-js\\\">    <span class=\\\"hljs-keyword\\\">var</span> arr = [<span class=\\\"hljs-number\\\">10</span>,<span class=\\\"hljs-number\\\">9</span>,<span class=\\\"hljs-number\\\">8</span>,<span class=\\\"hljs-number\\\">7</span>,<span class=\\\"hljs-number\\\">6</span>];\\n    <span class=\\\"hljs-keyword\\\">for</span> (<span class=\\\"hljs-keyword\\\">var</span> i=<span class=\\\"hljs-number\\\">0</span>; i &lt; arr.length; i++) {\\n       <span class=\\\"hljs-built_in\\\">console</span>.log(arr[i]);\\n    }\\n</code></pre>\\n<p>Remember that Arrays have zero-based numbering, which means the last index of the array is length - 1. Our <code>condition</code> for this loop is i &lt; arr.length, which stops when i is at length - 1.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Iterate-Through-An-Array-With-A-For-Loop/index.md\n ** module id = 611\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Iterate-Through-An-Array-With-A-For-Loop/index.md?");

