	eval("module.exports = {\"title\":\"Waypoint Iterate over Arrays with map\",\"order\":5,\"body\":\"<p>Using <em>map</em> is the best way to iterate through an array or object. Map uses a function to pretty much do whatever you want it to do. It will pass each value to the callback function.</p>\\n<pre><code>//Use map to<span class=\\\"hljs-instruction\\\"> add </span>three to each value in the<span class=\\\"hljs-instruction\\\"> array\\n</span>var<span class=\\\"hljs-instruction\\\"> array </span>= <span class=\\\"hljs-keyword\\\">[</span>1,2,3,4,5];\\n<span class=\\\"hljs-instruction\\\">\\narray </span>=<span class=\\\"hljs-function\\\"> array.map(</span>function(val<span class=\\\"hljs-function\\\">)</span>{\\n <span class=\\\"hljs-instruction\\\"> return </span>val + 3;\\n}<span class=\\\"hljs-function\\\">)</span>;\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Iterate-over-Arrays-with-map/index.md\n ** module id = 612\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Iterate-over-Arrays-with-map/index.md?");

