	eval("module.exports = {\"title\":\"Waypoint Make Object Properties Private\",\"order\":5,\"body\":\"<p>Objects have their own attributes, called <em>properties</em>, and their own functions, called <em>methods</em>.</p>\\n<p>You can use the <code>this</code> keyword to reference <em>public properties and methods</em> of the current objects. However, when You need to create private ones so they are not accessible from the outside of the object you just remove the keyword <code>this</code> from the object property or method declaration and declare it with <code>var</code> so that it is private outside its scope.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> Bike = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> speed = <span class=\\\"hljs-number\\\">100</span>; <span class=\\\"hljs-comment\\\">// private</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">addUnit</span>(<span class=\\\"hljs-params\\\">value</span>) </span>{ <span class=\\\"hljs-comment\\\">// private</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> value + <span class=\\\"hljs-string\\\">\\\"KM/H\\\"</span>;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">this</span>.getSpeed = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> (<span class=\\\"hljs-params\\\"></span>) </span>{  <span class=\\\"hljs-comment\\\">// public</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> addUnit(speed);\\n  };\\n\\n};\\n</code></pre>\\n<p>Another example:</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> Cake = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> loot = <span class=\\\"hljs-number\\\">2</span>;\\n  <span class=\\\"hljs-comment\\\">// Getter to know how much loot you have</span>\\n  <span class=\\\"hljs-keyword\\\">this</span>.getLoot = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> loot;\\n  };\\n\\n  <span class=\\\"hljs-comment\\\">// Setter to change the ammount of loot</span>\\n  <span class=\\\"hljs-keyword\\\">this</span>.setLoot = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">num</span>)</span>{\\n    loot = num;\\n  };\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Make-Object-Properties-Private/index.md\n ** module id = 626\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Make-Object-Properties-Private/index.md?");

