	eval("module.exports = {\"title\":\"Waypoint Return A Value From A Function With Return\",\"order\":5,\"body\":\"<p>#Waypoint: Return a Value from a Function with Return</p>\\n<p>We can pass values into a function with <code>arguments</code>. You can use a <code>return</code> statement to send a value back out of a function.</p>\\n<p>##Example</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">plusThree</span>(<span class=\\\"hljs-params\\\">num</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> num + <span class=\\\"hljs-number\\\">3</span>;\\n}\\n<span class=\\\"hljs-keyword\\\">var</span> answer = plusThree(<span class=\\\"hljs-number\\\">5</span>); <span class=\\\"hljs-comment\\\">// 8</span>\\n</code></pre>\\n<p><code>plusThree</code> takes an <code>argument</code> for <code>num</code> and returns a value equal to <code>num + 3</code>.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Return-A-Value-From-A-Function-With-Return/index.md\n ** module id = 655\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Return-A-Value-From-A-Function-With-Return/index.md?");

