	eval("module.exports = {\"title\":\"Waypoint Return Early Pattern For Functions\",\"order\":5,\"body\":\"<p>#Waypoint: Return Early Pattern for Functions</p>\\n<p>When a <code>return</code> statement is reached, the execution of the current function stops and control returns to the calling location.</p>\\n<p>##Example</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">myFun</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>);\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"World\\\"</span>;\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"byebye\\\"</span>)\\n}\\nmyFun();\\n</code></pre>\\n<p>The above outputs “Hello” to the console, returns “World”, but <code>&quot;byebye&quot;</code> is never output, because the function exits at the <code>return</code> statement.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Waypoint-Return-Early-Pattern-For-Functions/index.md\n ** module id = 656\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Waypoint-Return-Early-Pattern-For-Functions/index.md?");

