	eval("module.exports = {\"title\":\"What to do if you speak a language that Free Code Camp does not yet support\",\"order\":5,\"body\":\"<p>Translation is an all-or-nothing proposal.</p>\\n<p>We won’t be able to add new languages to Free Code Camp until all of our challenges are translated into that language.</p>\\n<p>In addition to translating these initially, we’ll also need to maintain the translation as the challenges are gradually updated.</p>\\n<p>If you’re able to help us, you can join our <a href=\\\"https://trello.com/b/m7zhwXka/fcc-translation\\\">translation Trello board</a> by sending @quincylarson your email address in Gitter.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/What-to-do-if-you-speak-a-language-that-Free-Code-Camp-does-not-yet-support/index.md\n ** module id = 737\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/What-to-do-if-you-speak-a-language-that-Free-Code-Camp-does-not-yet-support/index.md?");

