	eval("module.exports = {\"title\":\"What you will learn, and in what sequence you will learn it\",\"order\":5,\"body\":\"<ul>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/HTML\\\">HTML5</a> - The structure of web pages.</li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/CSS\\\">CSS</a> - The visual style of web pages.</li>\\n<li><a href=\\\"http://getbootstrap.com/\\\">Bootstrap</a> - A “responsive design” tool that helps your websites look great on tablets and phones.</li>\\n<li><a href=\\\"https://jquery.com/\\\">jQuery</a> and <a href=\\\"https://developer.mozilla.org/en-US/docs/AJAX\\\">Ajax</a> - Easy tools for controlling content in the browser.</li>\\n<li><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript\\\">JavaScript</a> - The one programming language that all web browsers use.</li>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Algorithm\\\">Algorithms</a> - Step-by-step recipes for getting things done.</li>\\n<li><a href=\\\"https://git-scm.com/\\\">Git</a> - A version control system for saving and sharing your projects.</li>\\n<li><a href=\\\"https://www.mongodb.org/\\\">MongoDB</a> - A popular non-relational database.</li>\\n<li><a href=\\\"http://d3js.org/\\\">D3.js</a> - A JavaScript library for producing dynamic, interactive data visualizations in web browsers.</li>\\n<li><a href=\\\"http://expressjs.com/\\\">Express.js</a>- A powerful web development framework.</li>\\n<li><a href=\\\"https://nodejs.org/\\\">Node.js</a> - A platform for creating scalable network applications.</li>\\n<li><a href=\\\"http://sass-lang.com/\\\">SASS</a> - A scripting language that is interpreted into Cascading Style Sheets (CSS).</li>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Application_programming_interface\\\">API Development</a> -  A set of routines, protocols, and tools for building software and applications.</li>\\n<li><a href=\\\"https://en.wikipedia.org/wiki/Agile_software_development\\\">Agile</a> - A set of software development principles that focus the design and production of a project on the needs of its users</li>\\n</ul>\\n<p><img src=\\\"http://2.bp.blogspot.com/-CPfmVm56c7c/VTwEpZkHBtI/AAAAAAAAAks/0dEwiH-DjEE/s1600/curriculum-diagram-full.jpg%7Cwidth=600px\\\" alt=\\\"\\\"></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/What-you-will-learn,-and-in-what-sequence-you-will-learn-it/index.md\n ** module id = 738\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/What-you-will-learn,-and-in-what-sequence-you-will-learn-it/index.md?");

