	eval("module.exports = {\"title\":\"Why You Should Try Pair Programming\",\"order\":5,\"body\":\"<h4>When I started working through my first bonfires, I was really scared of speaking to strangers. What would this person think about me?</h4>\\n<p>Would I even be able to write good code with someone watching me?</p>\\n<p>Now, some weeks later I’ve pair programmed and reviewed code with more than 40 campers and let me tell you: it’s not as scary as it seems.\\nIt’s perfectly normal to feel that way. Most of the campers that I’ve talked to agree that they were nervous too.</p>\\n<p><strong>Here are a few good reasons to try pair programming</strong> (I wish I knew this when I started…):</p>\\n<h3>You can…</h3>\\n<ul>\\n<li>Build your professional network</li>\\n<li>Meet new friends - develop a support group</li>\\n<li>Improve social skills</li>\\n<li>Get motivation and encouragement from fellow campers</li>\\n<li>See other’s coding styles</li>\\n<li>Learn from each other</li>\\n<li>Strengthen your strengths and get help finding and improving your weaknesses</li>\\n<li>Pair with <strong>more</strong> experienced dev to <strong>improve your skills</strong></li>\\n<li>Pair with <strong>less</strong> experienced dev to <strong>test your knowledge</strong></li>\\n<li>Gain a new skill that will be useful for interviews and employment down the road</li>\\n</ul>\\n<p>With the right person, pair programming is one of the best ways to learn at the same time as you make new friends!\\n<a href=\\\"https://freecodecamp.com/wiki/docs/Tips-on-How-To-Become-A-Good-Pair-Programmer\\\">You might also want to know how you could be a good pair programmer!</a></p>\\n<p>// Samuel (gr33n) with help from Ryan (rsprice)</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Why-You-Should-Try-Pair-Programming/index.md\n ** module id = 739\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Why-You-Should-Try-Pair-Programming/index.md?");

