	eval("module.exports = {\"title\":\"Why does Free Code Camp use JavaScript instead of Ruby or Python\",\"order\":5,\"body\":\"<p>Like JavaScript, Ruby and Python are high-level scripting languages that can be used for full stack web development.</p>\\n<p>But even if you learned these languages, you’d still need to learn JavaScript. That’s because JavaScript is the only language that runs in web browsers. JavaScript has been around for 20 years, and it is still growing in popularity.</p>\\n<p>Because of this, JavaScript has more tools and online learning resources than any other language.</p>\\n<p><img src=\\\"https://s3.amazonaws.com/freecodecamp/github-repo-growth.png\\\" alt=\\\"A chart showing the volume of new GitHub repositories by year, with JavaScript growing and most languages declining.\\\"></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Why-does-Free-Code-Camp-use-JavaScript-instead-of-Ruby-or-Python/index.md\n ** module id = 740\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Why-does-Free-Code-Camp-use-JavaScript-instead-of-Ruby-or-Python/index.md?");

