	eval("module.exports = {\"title\":\"Why you need Free Code Camp\",\"order\":5,\"body\":\"<p>You need Free Code Camp because learning to code is hard.</p>\\n<p>Most people who successfully learn to code:</p>\\n<ul>\\n<li>Make friends with people who code</li>\\n<li>Code a little every day</li>\\n</ul>\\n<p>Free Code Camp gives you the structure and the community you need so you can successfully learn to code.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Why-you-need-Free-Code-Camp/index.md\n ** module id = 741\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Why-you-need-Free-Code-Camp/index.md?");

