	eval("module.exports = {\"title\":\"Wiki Style Guide\",\"order\":5,\"body\":\"<p>###“Wiki” is a Hawaiian word meaning “quick”. Keep this in mind when creating wiki articles.</p>\\n<p>We are always happy to help new contributors write, edit, and localize our wiki articles. Help us make Free Code Camp the best it can be.</p>\\n<p>You can create a new wiki page by clicking the “New Page” button at top right.</p>\\n<p>Keep your wiki articles short and focused.</p>\\n<p>You can include images if they help you better communicate your subject.</p>\\n<h4>Use descriptive, punctuation-free titles that follow a name convention as <code>Name of Page</code>.</h4>\\n<p>Our wiki articles are <a href=\\\"https://github.com/adam-p/markdown-here/wiki/Markdown-Cheatsheet\\\">written in GitHub-flavor Markdown</a>.</p>\\n<ul>\\n<li><a href=\\\"https://freecodecamp.com/wiki/docs/Bonfire-Style-Guide\\\">Bonfire Style Guide</a></li>\\n</ul>\\n<p>If you have questions about contributing to the Free Code Camp Wiki message <a href=\\\"https://gitter.im/rafase282\\\">@rafase282</a> in <a href=\\\"https://freecodecamp.com/wiki/docs/Gitter\\\">Gitter</a></p>\\n<p>We look forward to wiki-ing with you!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Wiki-Style-Guide/index.md\n ** module id = 742\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Wiki-Style-Guide/index.md?");

