	eval("module.exports = {\"title\":\"World Language Chat Rooms\",\"order\":5,\"body\":\"<p>The following are our language-specific chat rooms.</p>\\n<p><strong>Please note that all chat rooms listed here are publicly accessible and indexed by search engines, so only share email addresses or other sensitive information in private messages.</strong></p>\\n<ul>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Albanian\\\">Albanian</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Arabic\\\">Arabic</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Chinese\\\">Chinese</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Deutsch\\\">German</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Dutch\\\">Dutch</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Espanol\\\">Spanish</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Francais\\\">French</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Japanese\\\">Japanese</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Korean\\\">Korean</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Persian\\\">Persian</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Portugues\\\">Portugues</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Romanian\\\">Romanian</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Russian\\\">Russian</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Swedish\\\">Swedish</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Thai\\\">Thai</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Tagalog\\\">Tagalog</a></li>\\n<li><a href=\\\"https://gitter.im/freecodecamp/Vietnamese\\\">Vietnamese</a></li>\\n</ul>\\n<h3>Additional Chat Room Lists</h3>\\n<ul>\\n<li>[[Official Free Code Camp Chat Rooms|Official-Free-Code-Camp-Chat-Rooms]]</li>\\n<li>[[Casual Chat Rooms|Casual-Chat-Rooms]]</li>\\n<li>[[Campsite Chat Rooms|List-of-Free-Code-Camp-city-based-Campsites]]</li>\\n</ul>\\n<p>By joining these chat rooms, you accept our <a href=\\\"https://freecodecamp.com/wiki/docs/Code-of-Conduct\\\">Code of Conduct</a>.</p>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Official-Free-Code-Camp-Chat-Rooms\\\">Official Free Code Camp chat rooms</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/World-Language-Chat-Rooms/index.md\n ** module id = 743\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/World-Language-Chat-Rooms/index.md?");

