	eval("module.exports = {\"title\":\"Write and Run ES6 Code in Browser\",\"order\":5,\"body\":\"<blockquote>\\n<p>Include the following code in the page.</p>\\n</blockquote>\\n<pre><code class=\\\"language-html\\\"><span class=\\\"hljs-comment\\\">&lt;!-- Write these first. Here `bootstrap.js` doesn't mean Twitter Bootstrap. --&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">script</span> <span class=\\\"hljs-attribute\\\">src</span>=<span class=\\\"hljs-value\\\">\\\"https://google.github.io/traceur-compiler/bin/traceur.js\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">script</span>&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">script</span> <span class=\\\"hljs-attribute\\\">src</span>=<span class=\\\"hljs-value\\\">\\\"https://google.github.io/traceur-compiler/src/bootstrap.js\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">script</span>&gt;</span>\\n\\n<span class=\\\"hljs-comment\\\">&lt;!-- Edit the src. Write `type=\\\"module\\\"` (important) for linked script --&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">script</span> <span class=\\\"hljs-attribute\\\">src</span>=<span class=\\\"hljs-value\\\">\\\"app.js\\\"</span> <span class=\\\"hljs-attribute\\\">type</span>=<span class=\\\"hljs-value\\\">\\\"module\\\"</span>&gt;</span><span class=\\\"undefined\\\"></span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">script</span>&gt;</span>\\n\\n<span class=\\\"hljs-comment\\\">&lt;!-- Remember to write `type=\\\"module\\\"` for embedded script --&gt;</span>\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">script</span> <span class=\\\"hljs-attribute\\\">type</span>=<span class=\\\"hljs-value\\\">\\\"module\\\"</span>&gt;</span><span class=\\\"actionscript\\\">\\n    <span class=\\\"hljs-comment\\\">//→ write your script here</span>\\n</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">script</span>&gt;</span>\\n</code></pre>\\n<p><strong>See:</strong> <a href=\\\"https://github.com/google/traceur-compiler/wiki/Getting-Started\\\">Traceur Compiler Getting Started</a></p>\\n<p><strong>Demo:</strong> <a href=\\\"https://github.com/abhisekp/JS-Weird-Parts/tree/109ab3b0c94d1fbf9bbc402dd36e9bca60d5b456\\\">ES6 Demo Repo Source</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/Write-and-Run-ES6-Code-in-Browser/index.md\n ** module id = 744\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/Write-and-Run-ES6-Code-in-Browser/index.md?");

