	eval("module.exports = {\"title\":\"accessibility 101\",\"order\":5,\"body\":\"<h2>Accessibility basics: What is this thing you speak of?</h2>\\n<blockquote>\\n<p>“The Dark Arts are many, varied, ever-changing, and eternal.\\nFighting them is like fighting a many-headed monster, which, each time a neck is severed, sprouts a head even fiercer and cleverer than before.\\nYou are fighting that which is unfixed, mutating, indestructible.”</p>\\n<p>—Professor Severus Snape, Harry Potter Series</p>\\n</blockquote>\\n<p>In this day and age, more and more new technologies are invented to make the life of developers, as well as users easier.\\nTo what degree this is a good thing is a debate for another time, for now it’s enough to say the toolbox of a developer, especially a web developer, is as ever-changing as the so called “dark arts”  are according to our friend Snape. :)</p>\\n<p>One tool in that toolbox should be accessibility. It is a tool that should ideally be used in one of the very first steps of writing any form of web content.\\nHowever, this tool is often not all that well presented in the toolbox of most developers. This could be due to a simple case of not knowing it even exists to extreme cases like just not caring about it.</p>\\n<p>In my life as a user, and later a developer,  who benefits from accessibility in any form of content, I have seen both ends of that spectrum.\\nIf you are reading this article, I am guessing you are in one of the following categories:</p>\\n<ul>\\n<li>You are a novice web developer and  would like to know more about accessibility</li>\\n<li>You are a seasoned web developer and have lost your way (more on that later)</li>\\n<li>You are reading this while hearing an ominous humming noise  in the background and are being forced at lightsaber point to read this, because you just don’t care but have to know about it for your boss.</li>\\n</ul>\\n<p>If you fall outside these rather broad categories, please let me know. I always like to hear from the people who read what I write about.</p>\\n<h3>So, what is accessibility anyway?</h3>\\n<p>Accessibility in itself is a bit of a misleading term sometimes, especially if English is your second language.</p>\\n<p>If your site is on the internet, reachable by anyone with a web browser, in one sense that website is accessible to everyone with a web browser.</p>\\n<p>But, is all content on your website actually readable, usable and understandable for everyone? Are there no thresholds that bar certain people from ’ accessing’  all the information you are exposing?</p>\\n<p>You could ask yourself questions like the following ones:</p>\\n<ul>\\n<li>If you add information that is only contained in an audio file, can a deaf person still get that information?</li>\\n<li>If you denote an important part of your website with a certain color, will a colorblind person know about it?</li>\\n<li>If you add images on your website that convey important information, how will a blind person know about it?</li>\\n<li>You can even go as far as saying, if your website is very resource-heavy, will someone on a bad mobile 3G connection be able to read your content?</li>\\n</ul>\\n<p>This is where accessibility comes into play.  Accessibility basically entails making your content as friendly, as easy to ‘access’ as possible for the largest amount of people.\\nThis includes people who are deaf, blind, dyslexic, mute, on a slow connection, colorblind, suffering from epilepsy etc.</p>\\n<h3>Why implement accessibility?</h3>\\n<p>This is one for the final category I just listed. You may think that accessibility doesn’t apply to you or to your users, so why implement it? What would a blind person do with a photo editing tool?</p>\\n<p>The truth is, you’re right to a certain degree. If you have done meticulous user research and have excluded any chance of a certain group of people visiting your website, the priority for catering to that group of people diminishes quite a bit.</p>\\n<p>However, doing this research is key in actually defending such a statement. Did you know there were <a href=\\\"http://audiogames.net\\\">blind gamers?</a> and even <a href=\\\"http://peteeckert.com/\\\">blind photographers?</a>. Perhaps you knew <a href=\\\"http://mentalfloss.com/article/25750/roll-over-beethoven-6-modern-deaf-musicians\\\">musicians can be deaf</a>?</p>\\n<p>If you did, good for you. If not, I guess this drives my point home all the more. :)</p>\\n<p>The picture gets even more complicated when we look at legislation that actually forces you to make certain websites and web apps accessible.\\nA prime example is the US-based <a href=\\\"http://jimthatcher.com/webcourse1.htm\\\">section 508</a>. Right now, this law mainly refers to government organisations, public sector websites etc. However, laws change.</p>\\n<p>Last year, airline websites were included in this list which meant that even here in Europe, airline website devs scrambled to make their content accessible. Not doing so can get your company a fine of literally tens of thousands of dollars for each day the problem isn’t fixed.</p>\\n<p>There’s variations on this legislation all over the world, some more severe and all-encompassing than others. Not knowing about that fact doesn’t make the lawsuit go away, sadly. :)</p>\\n<h3>Ok, so accessibility is a big deal. Now how do we implement  it?</h3>\\n<p>That question, sadly, is harder to answer than it may seem. The Harry Potter quote at the top is there for a reason, and its not my being an avid Fantasy reader. :)</p>\\n<p>As I stated above, accessibility is important for a large group of different people, each with their own needs. Making your website work for literally everyone is a large, on-going task.</p>\\n<p>To bring a bit of a method to the madness, the Web Content Accessibility Guidelines or <a href=\\\"https://www.wuhcag.com/web-content-accessibility-guidelines/\\\">WCAG</a> were composed. This document contains a number of criteria you can use to check your website.\\nFor now, I will cover some of the most important basics here. I will point you at the low-hanging fruits, so to speak. In subsequent articles, I will discuss more advanced techniques like [WAI-ARIA]  which is important for JavaScript-based apps.</p>\\n<h4>Talk like the natives</h4>\\n<p>The HTML specification is a document that describes how the language should be used to build websites. Assistive technologies, like screenreaders, speech recognition programs etc. are aware of this document. Web developers however, often are not, or at least not enough, and think something like this is ok:</p>\\n<pre><code class=\\\"language-html\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">div</span> <span class=\\\"hljs-attribute\\\">class</span>=<span class=\\\"hljs-value\\\">\\\"awesome-button\\\"</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">div</span>&gt;</span>\\n\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">span</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">strong</span>&gt;</span>Huge heading I will style with CSS later<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">strong</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">span</span>&gt;</span>\\n\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">span</span> <span class=\\\"hljs-attribute\\\">class</span>=<span class=\\\"hljs-value\\\">\\\"clickable-with-JavaScript\\\"</span>&gt;</span>English<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">span</span>&gt;</span>\\n</code></pre>\\n<p>Guess what? All three of these elements break several criteria of WCAG and therefore are not accessible at all.</p>\\n<p>The first element breaks the so-called ‘name, role, value’-criterium, which states that all elements on a web page should expose their name, their role (like button) and their value (like the contents of an edit field) to assistive technologies. This div actually doesn’t provide any of the three, rendering it invisible to screenreaders.</p>\\n<p>The second element looks like a heading visually after styling it with CSS, but semantically is a span. Therefore, assistive technologies won’t know its a heading. A screenreader will read this as regular text, instead of a heading. Screenreaders often have a hotkey to quickly jump to the nearest heading, this heading will not be included in that scope.</p>\\n<p>The third element could for example be an element a user can click to change the language of the website. Maybe a fancy animated menu of languages will expand when it is clicked. However, this is also a span and does not expose its role (link, or button), making assistive technologies think this is just the word English with some styling.</p>\\n<p>Spans and divs are non-elements. They are meant to contain other elements, not to be elements themselves. You can fix these in two ways:</p>\\n<ul>\\n<li>You can manually add ARIA-attributes to the elements above. This is an advanced topic and outside the scope of this article.</li>\\n<li>Or, you can simply do this:</li>\\n</ul>\\n<pre><code class=\\\"language-html\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">button</span>&gt;</span>This is a button<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">button</span>&gt;</span>\\n \\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">h2</span>&gt;</span>Here's a heading level two<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">h2</span>&gt;</span>\\n \\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">a</span> <span class=\\\"hljs-attribute\\\">href</span>=<span class=\\\"hljs-value\\\">\\\"JavascriptThing\\\"</span>&gt;</span>English<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-title\\\">a</span>&gt;</span>\\n</code></pre>\\n<p>Boom. Suddenly, all these elements are now perfectly accessible, just by using native HTML. HTML the way it was meant to be used, in other words.</p>\\n<h4>A foundation cannot stand without structure</h4>\\n<p>A bit earlier, I touched upon a screenreader’s hotkeys to jump from heading to heading. There are in fact many hotkeys like this to quickly jump to the nearest table, form field, link etc.\\nMaking sure these headings are actually in logical places is therefore a good practice and really decreases your assistive technology users’  stress levels, which is good if you want visitors to keep coming back to your website.</p>\\n<p>Also remember that headings are hierarchical.  If you use an h2, make sure the h3’s that follow it actually have something to do with that h2. Don’t put an h3 for contact details under your h2 for recent blog posts.\\nA good analogy here is a book with chapters, that have subsections. You wouldn’t put a section on baking cookies in the middle of a chapter on preparing vegetables …or …you wouldn’t… right?</p>\\n<h4>What’s the alternative?</h4>\\n<p>Images on a website are great. They add a new layer to your content, can really make the experience your site visitors have way more emersive and generally just look good among all that text.\\nA picture can say more than a thousand words, right?</p>\\n<p>Certainly. That is, if you can see them. In the HTML5-specification, an img-attribute must always have an alt-attribute. This attribute is meant as an alternative to the image in case it can’t be seen.\\nThis would be true for blind visitors to your website, but also when your image can’t be loaded for some reason.\\nNot adding an alt-tag to an img-attribute is therefore not only breaking accessibility, but going against the HTML5-spec.</p>\\n<p>I implore any web developer who catches themselves doing this to eat their programmer’s hat and work on Windows 95 exclusively for a week. After the time is up, write an essay on what you have learnt from this ordeal so I can have a laugh during my afternoon coffee. :)</p>\\n<p>Now, there is one caveat here. Alt-attributes are mandatory according to the HTML5-spec, but it’s not mandatory to actually fill them in. <code>&lt;img src=&quot;awesome-image.jpg&quot;, alt=&quot;&quot;&gt;</code> is therefore legal HTML5 code.</p>\\n<p>Should you therefore fill in alt-tags for all images? It depends on the image, really. For background images, the answer is usually no, but you should use CSS for those anyway.</p>\\n<p>For purely decorative images that have no information in them at all, you’re basically free to choose. Either put in something useful and descriptive or nothing at all.</p>\\n<p>For images that contain information, like a brochure, a map, a chart etc., not adding alt text breaks WCAG unless you provide a textual alternative. This is usually an alt-attribute, but can also be a block of text right below or next to the image.</p>\\n<p>For images of text, the text can either be included in the alt-attribute or offered in some alternative manner. The problem is that adding the textual alternative on the same page would basically make the same content show twice for people who can see the image, which is why the alt-attribute is better in this case.</p>\\n<h4>I can’t read your scrawl, son</h4>\\n<p>Even people who don’t wear glasses and have no problem with their eyesight at all benefit from an easy to read font and proper contrast.\\nI’m sure you would cringe if you had to fill in a form where light yellow, hopelessly loopy letters are placed on a white background. For people who’s eyesight is not as good, like your grandma for example, this becomes hopelessly worse.</p>\\n<p>The WCAG has contrast ratios for smaller and larger letters and there’s plenty of tools out there to check if the contrast ratios are strong enough. The information and tooling is there, go use it :)</p>\\n<h4>What does this button do?</h4>\\n<p>While we are at the topic of forms, let’s quickly glance at the <label> tag. This little guy is kinda important.\\nWhen you put some input fields on a web page, you can use labels to …well …label them. However, putting them next to each other is not quite enough. The attribute you want is the for-attribute, which takes the ID of a subsequent input field. This way, assistive technologies know what label to associate with what form field.\\nI guess the best way to illustrate this is by giving an example:</p>\\n<pre><code class=\\\"language-html\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">label</span> <span class=\\\"hljs-attribute\\\">for</span>=<span class=\\\"hljs-value\\\">'username'</span>&gt;</span>\\n\\n<span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-title\\\">input</span> <span class=\\\"hljs-attribute\\\">type</span>=<span class=\\\"hljs-value\\\">'text'</span> <span class=\\\"hljs-attribute\\\">id</span>=<span class=\\\"hljs-value\\\">'username'</span>&gt;</span>\\n</code></pre>\\n<p>This will make for example a screenreader say “username, text edit field”, instead of just reporting’ text edit field’  and requiring the user to go look for a label.  This also really helps people who use speech recognition.</p>\\n<h4>That’s a tall order</h4>\\n<p>Let’s take a small break. I want you to go look at a really well-designed web page. It can be any page. Go on, I’ll wait.</p>\\n<p>Back? Ok, great. Now, look at the page again but disable all CSS.\\nDoes it still look good? Is the content on the page still in a logical order?If so, great. You found a page with decent HTML structure.</p>\\n<p>If not, great. Now you get an impression on what I have to deal with on a daily basis when I come across a badly structured website.</p>\\n<p>Full disclosure: I tend to curse when this happens. Loudly. With vigor.</p>\\n<p>Why is this such a big deal? I’ll explain.</p>\\n<p><em>spoiler alert!</em> To those who have only covered the HTML/CSS curriculum so far, we’re going to skip ahead a little.</p>\\n<p>Screenreaders and other assistive technologies render a top-to-bottom representation of a web page based on your website’s DOM. All positional CSS is ignored in this version of the web page.</p>\\n<p>DOM stands for Document Object Model and is a tree-like structure of your website’s HTML elements. All your HTML elements are nodes that hierarchically interlink based on the HTML tags you use and Javascript, as well as screenreaders, use this DOM tree to work with your HTML code.</p>\\n<p>If you put your <footer> element at the top of your <body> element, it will show up at the top of your dom tree as well. therefore, the screenreader will put it at the top as well, even if you move it to the bottom of the page using CSS.</p>\\n<p>So a final tip I want to give you all is to pay attention to the order of your HTML, not just your finished website with CSS added in. Does it still make sense without CSS? Great!</p>\\n<p>Oh … it doesn’t? In that case …you might one day hear a muffled curse carried to you on a chilly breeze while walking outside. That will most likely be me, visiting your website. :)\\nIn that case I really only have two words for you. Often have I heard those same two words directed at me when I wrote some bad code and it is with great pleasure that I tell you:  “go fix!” :)</p>\\n<h3>Conclusion</h3>\\n<p>I have told you about accessibility, what it is, what it’s not and why it’s important.\\nI have also given you the basics, the very basics, of getting accessibility right. These basics are however very powerful and can make your life a lot easier when coding for accessibility.\\nIf we talk in FCC terms, you should keep these in mind while doing the HTML/CSS curriculum as well as the JavaScript curriculum.\\nIn subsequent articles, I will touch on a number of more nitch topics. A number of questions I will answer are:</p>\\n<ul>\\n<li>Adding structure headings sounds like a good idea, but they don’t fit in my design. What do I do?</li>\\n<li>Is there a way for me to write content only screenreaders and other assistive technologies see?</li>\\n<li>How do I make custom JavaScript components accessible?</li>\\n<li>What is WAI-ARIA?</li>\\n</ul>\\n<p>Do you yourself have a question? Please, let me know. I will either answer you personally or add it to an article if the question comes up often.\\nFor now, good luck and see you in the next one. Mischief managed :)\\nFor now, good luck and see you in the next one. <em>Mischief managed.</em> :)</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/accessibility-101/index.md\n ** module id = 747\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/accessibility-101/index.md?");

