	eval("module.exports = {\"title\":\"bf bouncer\",\"order\":5,\"body\":\"<p>#:fire: Bonfire: Falsy Bouncer</p>\\n<h1>The problem</h1>\\n<p>Remove all falsy values from an array.</p>\\n<p>Falsy values in javascript are false, null, 0, “”, undefined, and NaN.</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">bouncer</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Don't show a false ID to this bouncer.</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> arr;\\n}\\n\\nbouncer([<span class=\\\"hljs-number\\\">7</span>, <span class=\\\"hljs-string\\\">\\\"ate\\\"</span>, <span class=\\\"hljs-string\\\">\\\"\\\"</span>, <span class=\\\"hljs-literal\\\">false</span>, <span class=\\\"hljs-number\\\">9</span>]);\\n</code></pre>\\n<h2>Analysis</h2>\\n<p>Using <img src=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/filter\\\" alt=\\\"Array.filter(callback)\\\"> to remove elements from an array.</p>\\n<p>The <em>callback</em> function is called for each array element to check if it will be filtered (removed).</p>\\n<h2>Example</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isBigEnough</span>(<span class=\\\"hljs-params\\\">value</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> value &gt;= <span class=\\\"hljs-number\\\">10</span>;\\n}\\n<span class=\\\"hljs-keyword\\\">var</span> filtered = [<span class=\\\"hljs-number\\\">12</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">8</span>, <span class=\\\"hljs-number\\\">130</span>, <span class=\\\"hljs-number\\\">44</span>].filter(isBigEnough);\\n<span class=\\\"hljs-comment\\\">// filtered is [12, 130, 44]</span>\\n</code></pre>\\n<h2>:warning: My Solution is coming up!</h2>\\n<p>Don’t scroll down if you don’t want to see it!</p>\\n<pre><code>                           <span class=\\\"hljs-number\\\">10.</span>..\\n                        <span class=\\\"hljs-number\\\">9.</span>..\\n                     <span class=\\\"hljs-number\\\">8.</span>..\\n                  <span class=\\\"hljs-number\\\">7.</span>..\\n               <span class=\\\"hljs-number\\\">6.</span>..\\n            <span class=\\\"hljs-number\\\">5.</span>..\\n         <span class=\\\"hljs-number\\\">4.</span>..\\n      <span class=\\\"hljs-number\\\">3.</span>..\\n   <span class=\\\"hljs-number\\\">2.</span>..\\n<span class=\\\"hljs-number\\\">1.</span>..\\n\\nGO!!!\\n   \\n</code></pre>\\n<h2>Code Solution:</h2>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">bouncer</span>(<span class=\\\"hljs-params\\\">arr</span>) </span>{\\n  <span class=\\\"hljs-comment\\\">// Don't show a false ID to this bouncer.</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isNotFalsy</span>(<span class=\\\"hljs-params\\\">value</span>) </span>{\\n      <span class=\\\"hljs-keyword\\\">return</span> value;\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">var</span> myArr = arr.filter(isNotFalsy);\\n\\n  <span class=\\\"hljs-keyword\\\">return</span> myArr;\\n}\\n</code></pre>\\n<h1>References</h1>\\n<ul>\\n<li><strong>Array.filter()</strong>: <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/filter\\\">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/filter</a></li>\\n<li><strong>Gorka Hernández Blog</strong>: <a href=\\\"https://www.gorkahernandez.com/blog/fcc-bonfire-series-115-falsey-bouncer/\\\">https://www.gorkahernandez.com/blog/fcc-bonfire-series-115-falsey-bouncer/</a></li>\\n</ul>\\n<h1>Credits:</h1>\\n<p>If you found this page useful, you can give thanks by copying and pasting this on the main chat:\\n<code>Thanks @StrongeLeeroy @HelioGuilherme66</code></p>\\n<blockquote>\\n<p><strong>NOTE:</strong> Please add your username only if you have added any <strong>relevant main contents</strong> to the wiki page. (Please don’t remove any existing usernames.)</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/bf-bouncer/index.md\n ** module id = 749\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/bf-bouncer/index.md?");

