	eval("module.exports = {\"title\":\"bot announce\",\"order\":5,\"body\":\"<h2>Announcing CamperBot!</h2>\\n<p>CamperBot is our new AI friend who’s going to make the FCC chatrooms more fun.\\nHe can get info from the wiki, share bonfire hints, and help you get brownie points for helping people!</p>\\n<p><a href=\\\"https://twitter.com/FreeCodeCamp/status/627338604134559744\\\">https://twitter.com/FreeCodeCamp/status/627338604134559744</a></p>\\n<h3>beta testing</h3>\\n<p>Currently in beta test in the #HelpBonfires channel. Try it out here:\\n<a href=\\\"https://gitter.im/FreeCodeCamp/HelpBonfires\\\">https://gitter.im/FreeCodeCamp/HelpBonfires</a></p>\\n<h3>read about what CamperBot features</h3>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/camperbot\\\">https://freecodecamp.com/wiki/docs/camperbot</a></p>\\n<h3>talk to the Dev Team</h3>\\n<p><a href=\\\"https://gitter.im/dcsan/gitterbot\\\">https://gitter.im/dcsan/gitterbot</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/bot-announce/index.md\n ** module id = 750\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/bot-announce/index.md?");

