	eval("module.exports = {\"title\":\"botdemo\",\"order\":5,\"body\":\"<p>We’ve added a bot to some of the chatrooms. We’ll be adding more features over time, but these are the starting features. We’d love to hear what you think!\\nThe main thing is pulling in content from our <a href=\\\"https://freecodecamp.com/wiki/docs\\\">brand new wiki</a>, right into the chat.</p>\\n<ul>\\n<li>\\n<p><code>find js</code> or <code>find css</code> or <code>find html</code><br>\\nshow a list of matching items.</p>\\n</li>\\n<li>\\n<p><code>help js ternary</code><br>\\nquick definition/help. click through to see more on the wiki</p>\\n</li>\\n<li>\\n<p><code>help video</code><br>\\ninline video</p>\\n</li>\\n<li>\\n<p><code>help bobbytables</code><br>\\nshows inline images</p>\\n</li>\\n<li>\\n<p><code>explain triphop</code>\\nyou can embed soundcloud tracks</p>\\n</li>\\n<li>\\n<p><code>topics</code><br>\\nshow a list of topics</p>\\n</li>\\n</ul>\\n<h1>Join the CamperBot DevTeam!</h1>\\n<p>we’re looking for some people to join the core dev team to work on new features for the bot.\\nping @dcsan on gitter or leave a message in <a href=\\\"https://gitter.im/camperbot/devteam\\\">gitter.com/camperbot/devteam</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/botdemo/index.md\n ** module id = 751\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/botdemo/index.md?");

