	eval("module.exports = {\"title\":\"camperbot\",\"order\":5,\"body\":\"<p>Hi, I’m <strong><a href=\\\"https://freecodecamp.com/wiki/docs/camperbot\\\">CamperBot</a></strong>! I can help you in this chatroom :smile:</p>\\n<h3>Basic Commands:</h3>\\n<ul>\\n<li><code>find TOPIC</code>  find all entries about topic. ex: <code>find js</code></li>\\n<li><code>wiki TOPIC</code> show contents of topic page</li>\\n<li><code>thanks @username</code>  send brownie points to another user</li>\\n<li><code>about @username</code>   shows info on that user</li>\\n<li><code>bonfire BONFIRENAME</code> info on a bonfire</li>\\n</ul>\\n<p>:speech_balloon: <a href=\\\"https://gitter.im/FreeCodeCamp/camperbotPlayground\\\">meet CamperBot in this room!</a></p>\\n<h2>Example Commands</h2>\\n<pre><code>find js   # <span class=\\\"hljs-built_in\\\">all</span> JS entries\\nwiki muta  # first <span class=\\\"hljs-built_in\\\">entry</span> with muta <span class=\\\"hljs-type\\\">in</span> <span class=\\\"hljs-keyword\\\">name</span>\\nwiki bobbytables  # showing images\\nwiki video  # and video\\nrollem    # secret sauce\\nbonfire roman   # <span class=\\\"hljs-built_in\\\">any</span> bonfire with roman <span class=\\\"hljs-type\\\">in</span> <span class=\\\"hljs-keyword\\\">name</span>\\n</code></pre>\\n<p>For playing with CamperBot please use the testing channel:\\n<a href=\\\"https://gitter.im/FreeCodeCamp/camperbotPlayground\\\">https://gitter.im/FreeCodeCamp/camperbotPlayground</a></p>\\n<h2>Help on Bonfires</h2>\\n<p>Live currently on the HelpBonFires channel on Gitter\\n<a href=\\\"https://gitter.im/FreeCodeCamp/HelpBonfires\\\">https://gitter.im/FreeCodeCamp/HelpBonfires</a></p>\\n<p>We’ve added some bonfire specific commands. If you type <code>bonfire $BONFIRENAME</code> (where $BONFIRENAME is part of a bonfire name) it will set the chat to be about that bonfire. Then you can use some other bonfire specific commands:</p>\\n<ul>\\n<li>bf details - more info</li>\\n<li>bf spoiler - show some hints</li>\\n</ul>\\n<h2>More  commands</h2>\\n<ul>\\n<li><code>update</code>  pulls new wiki edits asap</li>\\n<li><code>topics</code> selected pages from the wiki</li>\\n<li><code>rooms</code>  all rooms the bot is in</li>\\n<li><code>archives</code> show history</li>\\n<li><code>music</code> deprecated, plug DJ no longer exists.</li>\\n<li><code>twitch</code> show the twitch feed</li>\\n</ul>\\n<h2>Content for the wiki</h2>\\n<p>Feel free to make new pages, an example entry is here:\\n<a href=\\\"https://freecodecamp.com/wiki/docs/example\\\">https://freecodecamp.com/wiki/docs/example</a></p>\\n<h2>Source Repository</h2>\\n<h3><a href=\\\"https://github.com/FreeCodeCamp/camperbot\\\">https://github.com/FreeCodeCamp/camperbot</a></h3>\\n<p>Fork it and have fun!</p>\\n<h2>Roadmap</h2>\\n<p>We’re looking for ideas for new features to add, and some people to help working on the bot.\\nHave a look at Tickets with <a href=\\\"https://github.com/FreeCodeCamp/camperbot/issues?q=is%3Aopen+is%3Aissue+label%3A%22help+wanted%22\\\">help wanted</a> on the repo and maybe you can contribute?</p>\\n<p>In future, we’re planning:</p>\\n<ul>\\n<li>Bonfire step-by-step tutorials will be available via chat and from the CamperBot</li>\\n<li>realtime tagging and searching of chats by topic</li>\\n<li>a scripting language and natural language processing\\nGet involved and let us know what you’d like to see next!</li>\\n</ul>\\n<h2>Developer Chatroom</h2>\\n<ul>\\n<li><a href=\\\"https://gitter.im/FreeCodeCamp/camperbot\\\">Join us on our repository chat room</a> to discuss new features. Perhaps we can pair up to work on the bot 2.0!</li>\\n<li><a href=\\\"https://gitter.im/FreeCodeCamp/camperbotPlayground\\\">Join this chat room</a> to mess around with the CamperBot and try out commands, proofread your edits to wiki content etc.</li>\\n</ul>\\n<p><img src=\\\"https://avatars1.githubusercontent.com/camperbot?&amp;s=100\\\" alt=\\\"enjoy\\\"> Happy Coding!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/camperbot/index.md\n ** module id = 755\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/camperbot/index.md?");

