	eval("module.exports = {\"title\":\"chai cheat\",\"order\":5,\"body\":\"<h1>Chai.js</h1>\\n<h3>Assert</h3>\\n<pre><code>assert(val)\\nassert.fail(actual, expected)\\nassert.ok(val) // is truthy\\nassert.equal(actual, expected) // 'compare with =='\\nassert.strictEqual\\nassert.deepEqual\\n\\nassert.isTrue\\nassert.isFalse\\n\\nassert.isNull\\nassert.isNotNull\\nassert.isUndefined\\nassert.isDefined\\nassert.isFunction\\nassert.isObject\\nassert.isArray\\nassert.isString\\nassert.isNumber\\nassert.isBoolean\\n\\nassert.typeOf(/tea/, 'regexp') // Object.prototype.toString()\\nassert.instanceOf(chai, Tea)\\nassert.include([ a,b,c ], a)\\nassert.match(val, /regexp/)\\nassert.property(obj, 'tea') // 'tea' in object\\nassert.deepProperty(obj, 'tea.green')\\nassert.propertyVal(person, 'name', 'John')\\nassert.deepPropertyVal(post, 'author.name', 'John')\\n\\nassert.lengthOf(object, 3)\\nassert.throws(function() { ... })\\nassert.throws(function() { ... }, /reference error/)\\nassert.doesNotThrow\\n\\nassert.operator(1, '&lt;', 2)\\nassert.closeTo(actual, expected)\\n</code></pre>\\n<h3>Should: chains</h3>\\n<pre><code>.to .be .been .is .that .and .have .with .at .of .same\\n</code></pre>\\n<h3>Should not</h3>\\n<pre><code>expect(object).not.equal('x')\\n</code></pre>\\n<h3>Expectations</h3>\\n<pre><code>expect(object)\\n  .equal(expected)\\n  .eql\\n  .deep.equal(expected) // same as .eql\\n  .be.a('string')\\n  .include(val)\\n\\n  .be.ok(val)\\n  .be.true\\n  .be.false\\n\\n  .be.null\\n  .be.undefined\\n  .be.empty\\n  .be.arguments\\n  .be.function\\n  .be.instanceOf\\n\\n  .gt(5)  # or .above .greaterThan\\n  .gte    # or .at.least\\n  .lt(5)  # or .below\\n\\n  .respondTo('bar')\\n  .satisfy (n) -&gt; n &gt; 0\\n\\n  .have.members([2, 3, 4])\\n  .have.keys(['foo'])\\n  .have.key('foo')\\n\\n  .exist\\n\\nexpect(-&gt; ...)\\n  .throw /not a function/\\n</code></pre>\\n<h3>Chai-jQuery</h3>\\n<pre><code class=\\\"language-js\\\">    global.jQuery = ...;\\n    chai.use(<span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'chai-jquery'</span>));\\n\\n    expect($body)\\n\\n      .have.attr(<span class=\\\"hljs-string\\\">'foo'</span>)\\n      .have.prop(<span class=\\\"hljs-string\\\">'disabled'</span>)\\n      .have.css(<span class=\\\"hljs-string\\\">'background'</span>)\\n      .have.css(<span class=\\\"hljs-string\\\">'background-color'</span>, <span class=\\\"hljs-string\\\">'#ffffff'</span>)\\n      .have.data(<span class=\\\"hljs-string\\\">'foo'</span>)\\n\\n      .have.class(<span class=\\\"hljs-string\\\">'active'</span>)\\n      .have.id(<span class=\\\"hljs-string\\\">'id'</span>)\\n\\n      .have.html(<span class=\\\"hljs-string\\\">'&lt;em&gt;hi&lt;/em&gt;'</span>)\\n      .have.text(<span class=\\\"hljs-string\\\">'hello'</span>)\\n      .have.value(<span class=\\\"hljs-string\\\">'2013'</span>)\\n\\n      .be.visible\\n      .be.hidden\\n\\n      .be.checked\\n      .be.selected\\n\\n      .be.enabled\\n      .be.disabled\\n\\n      .be.empty\\n      .to.exist\\n      .to.contain(<span class=\\\"hljs-string\\\">'text'</span>)\\n      .to.have(<span class=\\\"hljs-string\\\">'.selector'</span>)\\n</code></pre>\\n<blockquote>\\n<p><a href=\\\"https://github.com/rstacruz/cheatsheets\\\">ricostacruz CheatSheets</a></p>\\n</blockquote>\\n<blockquote>\\n<p><a href=\\\"https://gitter.im/bothelp/testing\\\">Discuss on gitter</a></p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/chai-cheat/index.md\n ** module id = 757\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/chai-cheat/index.md?");

