	eval("module.exports = {\"title\":\"git rebase\",\"order\":5,\"body\":\"<p><strong>Were you referred to this page to get your PR accepted? Scroll right <a href=\\\"https://freecodecamp.com/wiki/docs/git-rebase#git-rebase-at-fcc\\\">to the bottom</a> then!</strong></p>\\n<p><code>git rebase</code> is an extremely useful tool that is all about rewriting git history, though most commonly used to <em>squash</em> multiple commits into one. While useful in this scenario, this is not the only function that the <code>git rebase</code> command can perform. It in fact proves to be far more useful when used for the intended function that its name suggests: to essentially <em>rebase</em> a branch. Let me explain what I mean by that.</p>\\n<p>Let us say that you have a repository such as this:</p>\\n<pre><code>                                                  <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">5</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">auth</span> <span class=\\\"hljs-comment\\\">branch</span>\\n                                                <span class=\\\"hljs-comment\\\">/</span>               \\n                                               <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">4</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">dev</span> <span class=\\\"hljs-comment\\\">branch</span> \\n                                             <span class=\\\"hljs-comment\\\">/</span>\\n <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">1</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">2</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">3</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">master</span> <span class=\\\"hljs-comment\\\">branch</span>\\n</code></pre>\\n<p>If you wanted to merge the <code>auth</code> branch with the <code>dev</code> branch, git will throw an error at you because your <code>auth</code> branch is out-of-date: it doesn’t account for Commit 4. You’ll have to bring your branch up-to-date.</p>\\n<p>Git provides you with two methods to do this: the <code>merge</code> command and the <code>rebase</code> command. For an exploration of the <code>merge</code> command, visit the relevant wiki article: <a href=\\\"https://freecodecamp.com/wiki/docs/git-merge\\\">https://freecodecamp.com/wiki/docs/git-merge</a></p>\\n<p>Let’s run <code>rebase</code> now:</p>\\n<pre><code><span class=\\\"hljs-title\\\">git</span> checkout auth\\ngit rebase dev\\n</code></pre>\\n<p>The repo will now look like this:</p>\\n<pre><code>                                                                 <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">5</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">auth</span> <span class=\\\"hljs-comment\\\">branch</span>\\n                                                               <span class=\\\"hljs-comment\\\">/</span>\\n                                               <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">4</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">dev</span> <span class=\\\"hljs-comment\\\">branch</span> \\n                                             <span class=\\\"hljs-comment\\\">/</span>\\n <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">1</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">2</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">Commit</span> <span class=\\\"hljs-comment\\\">3</span> <span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span><span class=\\\"hljs-literal\\\">-</span> <span class=\\\"hljs-comment\\\">master</span> <span class=\\\"hljs-comment\\\">branch</span>\\n</code></pre>\\n<p>Do you see what happened? Git essentially saved the commits in the <code>auth</code> branch, ‘removed’ it, and then created it again with the same commits <em>after</em> the commits in the <code>dev</code> branch. This means that <code>Commit 4</code> only exists in the <code>dev</code> branch and not the <code>auth</code> branch! And that is really all there is to it! This might seem a bit confusing at first, but try to understand the diagram. This is an extremely useful tool.</p>\\n<h2>git-rebase at FCC</h2>\\n<h3>Preventing merge conflicts</h3>\\n<p>If you contribute to the FCC codebase, or are planning to do it, always run this command before you make any changes in your local files and push them:</p>\\n<p><code>git pull --rebase upstream staging</code> (thanks, @SaintPeter)</p>\\n<p>If you don’t have <code>upstream</code> set up, then run this command before you run the above command (git will throw an error because it doesn’t know what upstream is):\\n<code>git remote add upstream https://github.com/freecodecamp/freecodecamp.git</code></p>\\n<p>This will pull the latest changes from the FCC staging branch and rebase them with your fork’s staging branch so that you will not have any conflicts when opening the PR :)</p>\\n<h3>Squashing multiple commits into one</h3>\\n<p>This is an awesome feature of <code>rebase</code> that can be used in the <code>interactive</code> mode. To squash the last <em>n</em> commits into one, run the following command:</p>\\n<pre><code>git rebase -<span class=\\\"hljs-tag\\\">i</span> HEAD~n\\n</code></pre>\\n<p>That will open up a text-editor with something similar to the following:</p>\\n<pre><code>pick commit_1\\npick commit_2\\npick commit_3\\n...\\npick commit_n\\n# <span class=\\\"hljs-variable\\\">Bunch</span> <span class=\\\"hljs-keyword\\\">of</span> comments\\n</code></pre>\\n<p>Leave the first commit alone, and change the rest of the <code>pick</code>s to <code>squash</code>. Save and exit the editor.</p>\\n<p>If you’ve already pushed to a remote before squashing your commits, you’ll have to push to the remote again, with the <code>-f</code> flag, otherwise git will throw an error at you.\\nHappy coding!</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/git-rebase/index.md\n ** module id = 769\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/git-rebase/index.md?");

