	eval("module.exports = {\"title\":\"isLoggedInAsync\",\"order\":5,\"body\":\"<p>Let’s say you have a public page, but if the user is logged in you want to show special information to them. You’ll need to detect if a user is logged in before you make an <em>$http</em> call, right? It’s not guaranteed that this will work, because <em>isLoggedIn()</em> is actually an async call. If you want to force something to wait until after <em>isLoggedIn()</em> is successful before it gets called, you should include <em>Auth.isLoggedInAsync</em>:</p>\\n<pre><code class=\\\"language-javascript\\\">$scope.isLoggedInAsync = Auth.isLoggedInAsync;\\n</code></pre>\\n<p><em>isLoggedInAsync</em> takes a callback function as an input, and passes the callback function a <em>true</em> boolean if the user is logged in, and a <em>false</em> if the user is not. You can call it like so:</p>\\n<pre><code class=\\\"language-javascript\\\">$scope.isLoggedInAsync(callback(bool) {\\n    <span class=\\\"hljs-keyword\\\">if</span> (bool) { <span class=\\\"hljs-comment\\\">/** do thing if they’re logged in **/</span> }\\n    <span class=\\\"hljs-keyword\\\">else</span> { <span class=\\\"hljs-comment\\\">/** do different thing if they’re not logged in **/</span> }\\n});\\n</code></pre>\\n<p><a href=\\\"https://freecodecamp.com/wiki/docs/Restrict-a-page-to-authenticated-users\\\">PREVIOUS</a> <a href=\\\"https://freecodecamp.com/wiki/docs/Bonus-SocketIO\\\">NEXT</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/isLoggedInAsync/index.md\n ** module id = 774\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/isLoggedInAsync/index.md?");

