	eval("module.exports = {\"title\":\"js Array prototype concat\",\"order\":5,\"body\":\"<h1>js Array prototype concat</h1>\\n<p>The <code>concat()</code> method returns a new array comprised of the array on which it is called joined with the array(s) and/or value(s) provided as arguments.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> new_array = old_array.concat(value1[, value2[, ...[, valueN]]])\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>valueN</strong></p>\\n<p>Arrays and/or values to concatenate into a new array. See the description below for details.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/concat\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/2e06zxh0%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\n<code>concat</code> creates a new array consisting of the elements in the object on which it is called, followed in order by, for each argument, the elements of that argument (if the argument is an array) or the argument itself (if the argument is not an array).</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> alpha = [<span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-string\\\">'b'</span>, <span class=\\\"hljs-string\\\">'c'</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> alphaNumeric = alpha.concat(<span class=\\\"hljs-number\\\">1</span>, [<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>]);\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(alphaNumeric); \\n<span class=\\\"hljs-comment\\\">// Result: ['a', 'b', 'c', 1, 2, 3]</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> a, b, c, d;\\na = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>(<span class=\\\"hljs-number\\\">1</span>,<span class=\\\"hljs-number\\\">2</span>,<span class=\\\"hljs-number\\\">3</span>);\\nb = <span class=\\\"hljs-string\\\">\\\"dog\\\"</span>;\\nc = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>(<span class=\\\"hljs-number\\\">42</span>, <span class=\\\"hljs-string\\\">\\\"cat\\\"</span>);\\nd = a.concat(b, c);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(d);\\n\\n<span class=\\\"hljs-comment\\\">//Output: </span>\\n<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-string\\\">\\\"dog\\\"</span>, <span class=\\\"hljs-number\\\">42</span>, <span class=\\\"hljs-string\\\">\\\"cat\\\"</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-concat/index.md\n ** module id = 776\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-concat/index.md?");

