	eval("module.exports = {\"title\":\"js Array prototype every\",\"order\":5,\"body\":\"<h1>js Array prototype every</h1>\\n<p>The <code>every()</code> method tests whether all elements in the array pass the test implemented by the provided function.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">arr.every(callback[, thisArg])\\n</code></pre>\\n<h3>Parameters</h3>\\n<ul>\\n<li>\\n<p><strong>callback</strong>\\nFunction to test for each element, taking three arguments:</p>\\n</li>\\n<li>\\n<p><strong>currentValue</strong> (required)\\nThe current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>index</strong> (optional)\\nThe index of the current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>array</strong> (optional)\\nThe array every was called upon.</p>\\n</li>\\n<li>\\n<p><strong>thisArg</strong>\\nOptional. Value to use as this when executing callback.</p>\\n</li>\\n</ul>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/every\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff679981%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nThe <code>every</code> method calls the <code>callback</code> function one time for each array element, in ascending index order, until the <code>callback</code> function returns false. If an element that causes <code>callback</code> to return false is found, the every method immediately returns <code>false</code>. Otherwise, the every method returns <code>true</code>.</p>\\n<p>The callback function is not called for missing elements of the array.</p>\\n<p>In addition to array objects, the every method can be used by any object that has a length property and that has numerically indexed property names.\\n<code>every</code> does not mutate the array on which it is called.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isBigEnough</span>(<span class=\\\"hljs-params\\\">element, index, array</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> element &gt;= <span class=\\\"hljs-number\\\">10</span>;\\n}\\n[<span class=\\\"hljs-number\\\">12</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">8</span>, <span class=\\\"hljs-number\\\">130</span>, <span class=\\\"hljs-number\\\">44</span>].every(isBigEnough);   <span class=\\\"hljs-comment\\\">// false</span>\\n[<span class=\\\"hljs-number\\\">12</span>, <span class=\\\"hljs-number\\\">54</span>, <span class=\\\"hljs-number\\\">18</span>, <span class=\\\"hljs-number\\\">130</span>, <span class=\\\"hljs-number\\\">44</span>].every(isBigEnough); <span class=\\\"hljs-comment\\\">// true</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Define the callback function.</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">CheckIfEven</span>(<span class=\\\"hljs-params\\\">value, index, ar</span>) </span>{\\n    <span class=\\\"hljs-built_in\\\">document</span>.write(value + <span class=\\\"hljs-string\\\">\\\" \\\"</span>);\\n\\n    <span class=\\\"hljs-keyword\\\">if</span> (value % <span class=\\\"hljs-number\\\">2</span> == <span class=\\\"hljs-number\\\">0</span>)\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n    <span class=\\\"hljs-keyword\\\">else</span>\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Create an array.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> numbers = [<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">6</span>, <span class=\\\"hljs-number\\\">8</span>];\\n\\n<span class=\\\"hljs-comment\\\">// Check whether the callback function returns true for all of the</span>\\n<span class=\\\"hljs-comment\\\">// array values.</span>\\n<span class=\\\"hljs-keyword\\\">if</span> (numbers.every(CheckIfEven))\\n    <span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"All are even.\\\"</span>);\\n<span class=\\\"hljs-keyword\\\">else</span>\\n    <span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"Some are not even.\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// 2 4 5 Some are not even.</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-every/index.md\n ** module id = 777\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-every/index.md?");

