	eval("module.exports = {\"title\":\"js Array prototype forEach\",\"order\":5,\"body\":\"<h1>js Array prototype forEach</h1>\\n<p>The <code>forEach()</code> method executes a provided function once per array element.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">arr.forEach(callback[, thisArg])\\n</code></pre>\\n<h3>Parameters</h3>\\n<ul>\\n<li>\\n<p><strong>callback</strong>\\nFunction to execute for each element, taking three arguments:</p>\\n</li>\\n<li>\\n<p><strong>currentValue</strong>\\nThe current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>index</strong>\\nThe index of the current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>array</strong>\\nThe array that forEach is being applied to.</p>\\n</li>\\n<li>\\n<p><strong>thisArg</strong>\\nOptional. Value to use as this when executing callback.</p>\\n</li>\\n</ul>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/forEach\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff679980%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\n<code>forEach()</code> executes the provided callback once for each element present in the array in ascending order. It is not invoked for index properties that have been deleted or are uninitialised (i.e. on sparse arrays). Unlike <code>map()</code> or <code>reduce()</code> it always returns the value <code>undefined</code> and is not <em>chainable</em>. The typical use case is to execute side effects at the end of a chain.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">logArrayElements</span>(<span class=\\\"hljs-params\\\">element, index, array</span>) </span>{\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'a['</span> + index + <span class=\\\"hljs-string\\\">'] = '</span> + element);\\n}\\n\\n<span class=\\\"hljs-comment\\\">// Note elision, there is no member at 2 so it isn't visited</span>\\n[<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">5</span>, , <span class=\\\"hljs-number\\\">9</span>].forEach(logArrayElements);\\n<span class=\\\"hljs-comment\\\">// logs:</span>\\n<span class=\\\"hljs-comment\\\">// a[0] = 2</span>\\n<span class=\\\"hljs-comment\\\">// a[1] = 5</span>\\n<span class=\\\"hljs-comment\\\">// a[3] = 9</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Create an array.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> numbers = [<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">11</span>, <span class=\\\"hljs-number\\\">12</span>];\\n\\n<span class=\\\"hljs-comment\\\">// Call the addNumber callback function for each array element.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> sum = <span class=\\\"hljs-number\\\">0</span>;\\nnumbers.forEach(\\n    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">addNumber</span>(<span class=\\\"hljs-params\\\">value</span>) </span>{ sum += value; }\\n);\\n\\n<span class=\\\"hljs-built_in\\\">document</span>.write(sum);\\n<span class=\\\"hljs-comment\\\">// Output: 33</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-forEach/index.md\n ** module id = 779\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-forEach/index.md?");

