	eval("module.exports = {\"title\":\"js Array prototype lastIndexOf\",\"order\":5,\"body\":\"<h1>js Array prototype lastIndexOf</h1>\\n<p>The <code>lastIndexOf()</code> method returns the last index at which a given element can be found in the array, or -1 if it is not present. The array is searched backwards, starting at <code>fromIndex</code>.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">arr.lastIndexOf(searchElement[, fromIndex = arr.length - <span class=\\\"hljs-number\\\">1</span>])\\n</code></pre>\\n<h3>Parameters</h3>\\n<ul>\\n<li><strong>searchElement</strong></li>\\n<li>Element to locate in the array.</li>\\n<li><strong>fromIndex</strong></li>\\n<li><em>Optional</em>. The index at which to start searching backwards. Defaults to the array’s length minus one, i.e. the whole array will be searched. If the index is greater than or equal to the length of the array, the whole array will be searched. If negative, it is taken as the offset from the end of the array. Note that even when the index is negative, the array is still searched from back to front. If the calculated index is less than 0, -1 is returned, i.e. the array will not be searched.</li>\\n</ul>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/lastIndexOf\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff679972%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nThe index of the last occurrence of <code>searchElement</code> in the array, or -1 if <code>searchElement</code> is not found.</p>\\n<p>##Description\\n<code>lastIndexOf</code> compares <code>searchElement</code> to elements of the Array using strict equality (the same method used by the ===, or triple-equals, operator).</p>\\n<p>##Remarks\\nThe search occurs in descending index order (last member first). To search in ascending order, use the <code>indexOf</code> method.</p>\\n<p>The optional <code>fromIndex</code> argument specifies the array index at which to begin the search. If <code>fromIndex</code> is greater than or equal to the array length, the whole array is searched. If <code>fromIndex</code> is negative, the search starts at the array length plus <code>fromIndex</code>. If the computed index is less than 0, -1 is returned.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> array = [<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">9</span>, <span class=\\\"hljs-number\\\">2</span>];\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">2</span>);     <span class=\\\"hljs-comment\\\">// 3</span>\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">7</span>);     <span class=\\\"hljs-comment\\\">// -1</span>\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>);  <span class=\\\"hljs-comment\\\">// 3</span>\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">2</span>);  <span class=\\\"hljs-comment\\\">// 0</span>\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">2</span>, -<span class=\\\"hljs-number\\\">2</span>); <span class=\\\"hljs-comment\\\">// 0</span>\\narray.lastIndexOf(<span class=\\\"hljs-number\\\">2</span>, -<span class=\\\"hljs-number\\\">1</span>); <span class=\\\"hljs-comment\\\">// 3</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Create an array.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> ar = [<span class=\\\"hljs-string\\\">\\\"ab\\\"</span>, <span class=\\\"hljs-string\\\">\\\"cd\\\"</span>, <span class=\\\"hljs-string\\\">\\\"ef\\\"</span>, <span class=\\\"hljs-string\\\">\\\"ab\\\"</span>, <span class=\\\"hljs-string\\\">\\\"cd\\\"</span>];\\n\\n<span class=\\\"hljs-comment\\\">// Determine the first location, in descending order, of \\\"cd\\\".</span>\\n<span class=\\\"hljs-built_in\\\">document</span>.write(ar.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"cd\\\"</span>) + <span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Output: 4</span>\\n\\n<span class=\\\"hljs-comment\\\">// Find \\\"cd\\\" in descending order, starting at index 2.</span>\\n<span class=\\\"hljs-built_in\\\">document</span>.write(ar.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"cd\\\"</span>, <span class=\\\"hljs-number\\\">2</span>) + <span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Output: 1</span>\\n\\n<span class=\\\"hljs-comment\\\">// Search for \\\"gh\\\" (which is not found).</span>\\n<span class=\\\"hljs-built_in\\\">document</span>.write(ar.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"gh\\\"</span>)+ <span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Output: -1</span>\\n\\n<span class=\\\"hljs-comment\\\">// Find \\\"ab\\\" with a fromIndex argument of -3.</span>\\n<span class=\\\"hljs-comment\\\">// The search in descending order starts at index 3,</span>\\n<span class=\\\"hljs-comment\\\">// which is the array length minus 2.</span>\\n<span class=\\\"hljs-built_in\\\">document</span>.write(ar.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"ab\\\"</span>, -<span class=\\\"hljs-number\\\">3</span>) + <span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n<span class=\\\"hljs-comment\\\">// Output: 0</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-lastIndexOf/index.md\n ** module id = 782\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-lastIndexOf/index.md?");

