	eval("module.exports = {\"title\":\"js Array prototype map\",\"order\":5,\"body\":\"<h1>Array.prototype.map()</h1>\\n<p>The method <code>map</code> of the Array prototype allows you to grab a hold of each element inside an array and apply a function to them. After <strong>map</strong> finishes iterating through the array, it will return a <strong>new array</strong> with the results of applying the function to the aforementioned elements.</p>\\n<h4>The syntax is as follows:</h4>\\n<p><code>myAwesomeArray.map(myAwesomeFunction)</code></p>\\n<p>Since <strong>map</strong> doesn’t mutate the original array, it should be used as a value, stored inside a variable, passed in as a <strong>returned value</strong> inside a function (the most common case) and many other things.\\nLet’s learn a little bit of what this powerful function can do! Say we have an array of  names and we want to create a new array with these names but UPPERCASED.</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-keyword\\\">var</span> names = [<span class=\\\"hljs-string\\\">\\\"Leia\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Anakin\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Luke\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Obi Wan Kenobi\\\"</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> uppercaseNames = names.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">name</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> name.toUpperCase();\\n};\\n</code></pre>\\n<p>Now if we <code>console.log(uppercaseNames)</code> we will get this:</p>\\n<blockquote>\\n<p><code>Array(4) -&gt; [&quot;LEIA&quot;, &quot;ANAKIN&quot;, &quot;LUKE&quot;, &quot;OBI WAN KENOBI&quot;]</code></p>\\n</blockquote>\\n<p>But how does it work? Let’s dive more into it.</p>\\n<h2>Let’s talk about the callback parameters</h2>\\n<p>The callback is the function that the Array.map() method accepts, it can be an anonymous function or an already declared function with the following parameters which, by the way, you can name as you please:</p>\\n<p>1- <strong>currentValue</strong>: As the name suggest, it’s the current element of the array being evaluated and waiting for your function to replace it with a new value in the new array (same index of course).</p>\\n<p>2- <strong>index</strong>: It equals to the numeric index of currentValue, say you are in “Anakin”, that means index, at the time, will equal to <strong>1</strong>.</p>\\n<p>3- <strong>array</strong>: The array that’s calling the method, in this case, it’s referring to <strong>names</strong>.</p>\\n<p>Examples work better than loose explanations, now we can make our callback function turn <code>[&quot;Leia&quot;, &quot;Anakin&quot;, &quot;Luke&quot;, &quot;Obi Wan Kenobi&quot;]</code> into <code>[&quot;My name is Leia, I'm #1&quot;, &quot;My name is Anakin, I'm #2&quot;, &quot;My name is Luke, I'm #3&quot;, &quot;And last but not less important, I'm #4 Obi Wan Kenobi&quot;]</code>. Sounds interesting and complex huh? It’s actually not if you put the first two parameters to use.</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-keyword\\\">var</span> jediMasters = [<span class=\\\"hljs-string\\\">\\\"Leia\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Anakin\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Luke\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Obi Wan Kenobi\\\"</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> jediMastersSayHi = jediMasters.map(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">jediName, jediIndex</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (jediName === <span class=\\\"hljs-string\\\">\\\"Obi Wan Kenobi\\\"</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"And last but not less important, I'm #\\\"</span> + (jediIndex + <span class=\\\"hljs-number\\\">1</span>) + <span class=\\\"hljs-string\\\">\\\" \\\"</span> + jediName;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"My name is \\\"</span> + jediName + <span class=\\\"hljs-string\\\">\\\", I'm #\\\"</span> + (jediIndex + <span class=\\\"hljs-number\\\">1</span>);\\n  }\\n}); <span class=\\\"hljs-comment\\\">// We're done mapping, now console.log the whole thing.</span>\\n</code></pre>\\n<p>If we now console out the values of the two arrays, we get this:</p>\\n<p><img src=\\\"https://www.evernote.com/shard/s539/sh/75d6da94-dd29-4dd6-98b7-9ee7260533ca/21e0ed3c9e391b9507128a42d2b12421/res/77e93999-b27c-46c5-b101-f9ed32d7aee0/skitch.png\\\" alt=\\\"Map in action\\\"></p>\\n<p>If you are asking why one of the values in the string concatenation is <code>(jediIndex + 1)</code>, that’s because <strong>indices are 0-based</strong>, we would get 0, 1, 2 and 3 for our Jedi’s and that’s not cool. Check that IF statement just sitting there, what does it do? Simple, it checks if the current Jedi is Obi Wan, if it is, then the new value of that element of the array (the new one) should be different from the rest.</p>\\n<p>It’s important to note that <strong>we can write the function outside the map method</strong> and call it with the name’s function. Let’s one more time re-write our code and see how we can achieve this (I think it’s cleaner):</p>\\n<pre><code class=\\\"language-javascript\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">sayHi</span>(<span class=\\\"hljs-params\\\">jedi, index</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">if</span> (jedi === <span class=\\\"hljs-string\\\">\\\"Obi Wan Kenobi\\\"</span>) {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"And last but not less important, I'm #\\\"</span> + (index + <span class=\\\"hljs-number\\\">1</span>) + <span class=\\\"hljs-string\\\">\\\" \\\"</span> + jedi;\\n  } <span class=\\\"hljs-keyword\\\">else</span> {\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-string\\\">\\\"My name is \\\"</span> + jedi + <span class=\\\"hljs-string\\\">\\\", I'm #\\\"</span> + (index + <span class=\\\"hljs-number\\\">1</span>);\\n  }\\n}\\n\\n<span class=\\\"hljs-keyword\\\">var</span> jediMasters = [<span class=\\\"hljs-string\\\">\\\"Leia\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Anakin\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Luke\\\"</span>, <span class=\\\"hljs-string\\\">\\\"Obi Wan Kenobi\\\"</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> jediMastersSayHi = jediMasters.map(sayHi); <span class=\\\"hljs-comment\\\">// We're done mapping, now console.log the whole thing.</span>\\n</code></pre>\\n<p>We can use map in strings and other types of objects if we use <code>Array.prototype.call(objectToBeMapped, callbackFunction)</code>, for more examples, go look other sites and practise it.</p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-map/index.md\n ** module id = 783\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-map/index.md?");

