	eval("module.exports = {\"title\":\"js Array prototype pop\",\"order\":5,\"body\":\"<h1>Array.prototype.pop()</h1>\\n<p>The JavaScript array method <code>.pop()</code> will remove the last element from an array and returns that element.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> array = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>];\\narray.pop();\\n</code></pre>\\n<h2>Description</h2>\\n<p><code>.pop()</code> ‘pops’ the last element in an array off and returns that element</p>\\n<p><code>.pop()</code> will return <code>undefined</code> if the array it is called on is empty.</p>\\n<h2>Examples</h2>\\n<p><strong>Popping off the last value in an array</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> array = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>];\\n<span class=\\\"hljs-built_in\\\">console</span>.log(array);\\n<span class=\\\"hljs-comment\\\">// Console will output 1, 2, 3, 4, 5</span>\\n\\narray.pop();\\n<span class=\\\"hljs-comment\\\">/* If we console.log(array.pop()); the console would output 5\\nbecause 5 was popped off the array by .pop(). */</span>\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(array);\\n<span class=\\\"hljs-comment\\\">/* Console will output 1, 2, 3, 4 and \\nthe variable array now contains the set [1, 2, 3, 4] */</span>\\n\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/pop\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-pop/index.md\n ** module id = 784\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-pop/index.md?");

