	eval("module.exports = {\"title\":\"js Array prototype push\",\"order\":5,\"body\":\"<h1>Array.prototype.push()</h1>\\n<p>The JavaScript array method <code>.push()</code> adds one or more new elements to the end of an array and returns the length of the newly expanded array.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> array = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>];\\narray.push(<span class=\\\"hljs-number\\\">6</span>);\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><code>.push</code> accepts one or multiple parameters.</p>\\n<h3>Returns</h3>\\n<p>The length of the array is returned by <code>.push()</code></p>\\n<h2>Description</h2>\\n<p><code>.push()</code> ‘pushes’ new values onto the end (the right side) of an array.</p>\\n<h2>Examples</h2>\\n<p><strong>Pushing a new element into an array</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> array = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>];\\n<span class=\\\"hljs-keyword\\\">var</span> totalArrayElements = array.push(<span class=\\\"hljs-number\\\">6</span>);\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(array);\\n<span class=\\\"hljs-comment\\\">// Console will output 1, 2, 3, 4, 5, 6</span>\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(totalArrayElements);\\n<span class=\\\"hljs-comment\\\">// Console will output 6</span>\\n\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/push\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-push/index.md\n ** module id = 785\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-push/index.md?");

