	eval("module.exports = {\"title\":\"js Array prototype reduce\",\"order\":5,\"body\":\"<h1>js Array prototype reduce</h1>\\n<p>The <code>reduce()</code> method applies a function against an accumulator and each value of the array (from left-to-right) to reduce it to a single value.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">arr.reduce(callback[, initialValue])\\n</code></pre>\\n<h3>Parameters</h3>\\n<ul>\\n<li>\\n<p><strong>callback</strong>\\nFunction to execute on each value in the array, taking four arguments:</p>\\n</li>\\n<li>\\n<p><strong>previousValue</strong>\\nThe value previously returned in the last invocation of the callback, or initialValue, if supplied. (See below.)</p>\\n</li>\\n<li>\\n<p><strong>currentValue</strong>\\nThe current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>currentIndex</strong>\\nThe index of the current element being processed in the array.</p>\\n</li>\\n<li>\\n<p><strong>array</strong>\\nThe array reduce was called upon.</p>\\n</li>\\n<li>\\n<p><strong>initialValue</strong>\\nOptional. Value to use as the first argument to the first call of the callback.</p>\\n</li>\\n</ul>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/Reduce\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/ff679975%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nThe accumulated result from the last call to the callback function.</p>\\n<p>##Description\\nCalls the specified callback function for all the elements in an array. The return value of the callback function is the accumulated result, and is provided as an argument in the next call to the callback function.</p>\\n<p>##Remarks\\nIf an <code>initialValue</code> is provided, the reduce method calls the <code>callback</code> function one time for each element present in the array, in ascending index order. If an <code>initialValue</code> is not provided, the reduce method calls the <code>callback</code> function on each element, starting with the second element.</p>\\n<p>The return value of the callback function is provided as the <code>previousValue</code> argument on the next call to the callback function. The return value of the last call to the callback function is the return value of the <code>reduce</code> method.</p>\\n<p>The callback function is not called for missing elements of the array.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> total = [<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>].reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> a + b;\\n});\\n<span class=\\\"hljs-comment\\\">// total == 6</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> flattened = [[<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">1</span>], [<span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>], [<span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>]].reduce(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">a, b</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">return</span> a.concat(b);\\n}, []);\\n<span class=\\\"hljs-comment\\\">// flattened is [0, 1, 2, 3, 4, 5]</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">// Define the callback function.</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">appendCurrent</span> (<span class=\\\"hljs-params\\\">previousValue, currentValue</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> previousValue + <span class=\\\"hljs-string\\\">\\\"::\\\"</span> + currentValue;\\n    }\\n\\n<span class=\\\"hljs-comment\\\">// Create an array.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> elements = [<span class=\\\"hljs-string\\\">\\\"abc\\\"</span>, <span class=\\\"hljs-string\\\">\\\"def\\\"</span>, <span class=\\\"hljs-number\\\">123</span>, <span class=\\\"hljs-number\\\">456</span>];\\n\\n<span class=\\\"hljs-comment\\\">// Call the reduce method, which calls the callback function</span>\\n<span class=\\\"hljs-comment\\\">// for each array element.</span>\\n<span class=\\\"hljs-keyword\\\">var</span> result = elements.reduce(appendCurrent);\\n\\n<span class=\\\"hljs-built_in\\\">document</span>.write(result);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">//  abc::def::123::456</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-reduce/index.md\n ** module id = 786\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-reduce/index.md?");

