	eval("module.exports = {\"title\":\"js Array prototype some\",\"order\":5,\"body\":\"<h1>Array.prototype.some()</h1>\\n<p>The JavaScript array method <code>.some()</code> will take a callback function to test each element in the array; once the callback returns <code>true</code> then <code>.some()</code> will return true immediately.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>];\\narr.some(callback[, thisArg]);\\n</code></pre>\\n<h3>Callback Function</h3>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> isEven = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isEven</span>(<span class=\\\"hljs-params\\\">currentElement, index, array</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span>(currentElement % <span class=\\\"hljs-number\\\">2</span> === <span class=\\\"hljs-number\\\">0</span>) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n    }\\n}\\n</code></pre>\\n<p><em>see wiki</em> on <a href=\\\"https://freecodecamp.com/wiki/docs/Arithmetic-Operators\\\">Arithmetic Operators</a> to see the remainder operator <code>%</code></p>\\n<p><strong>Has 3 arguments</strong></p>\\n<ul>\\n<li>currentElement\\n<ul>\\n<li>this is a variable that represents the element that is being passed to the callback.</li>\\n</ul>\\n</li>\\n<li>index\\n<ul>\\n<li>this is the index value of the current element starting at 0</li>\\n</ul>\\n</li>\\n<li>array\\n<ul>\\n<li>the array that <code>.some()</code> was call on.</li>\\n</ul>\\n</li>\\n</ul>\\n<p>The callback function should implement a test case.</p>\\n<h3>thisArg</h3>\\n<p>Is an optional parameter and more info can be found at the <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/some\\\">MDN</a></p>\\n<h2>Description</h2>\\n<p><code>.some()</code> will run the callback function for each element in the array. Once the callback returns true, <code>.some()</code> will return <code>true</code>. If the callback returns a <a href=\\\"https://developer.mozilla.org/en-US/docs/Glossary/Falsy\\\">falsy value</a> for <em>every</em> element in the array then <code>.some()</code> returns false.</p>\\n<p><code>.some()</code> will not change/mutate the array that called it.</p>\\n<h2>Examples</h2>\\n<p><strong>Passing a function to <code>.some()</code></strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> isEven = <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">isEven</span>(<span class=\\\"hljs-params\\\">currentElement, index, array</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span>(currentElement % <span class=\\\"hljs-number\\\">2</span> === <span class=\\\"hljs-number\\\">0</span>) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n    } <span class=\\\"hljs-keyword\\\">else</span> {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">false</span>;\\n    }\\n}\\n\\n<span class=\\\"hljs-keyword\\\">var</span> arr1 = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">6</span>];\\narr1.some(isEven);  <span class=\\\"hljs-comment\\\">// returns true</span>\\n<span class=\\\"hljs-keyword\\\">var</span> arr2 = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">7</span>];\\narr2.some(isEven);  <span class=\\\"hljs-comment\\\">// returns false</span>\\n</code></pre>\\n<p><strong>Anonymous function</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr3 = [<span class=\\\"hljs-string\\\">'Free'</span>, <span class=\\\"hljs-string\\\">'Code'</span>, <span class=\\\"hljs-string\\\">'Camp'</span>, <span class=\\\"hljs-string\\\">'The Amazing'</span>];\\narr3.some(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">curr, index, arr</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (curr === <span class=\\\"hljs-string\\\">'The Amazing'</span>) {\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">true</span>;\\n    } \\n    }); <span class=\\\"hljs-comment\\\">// returns true</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> arr4 = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">14</span>, <span class=\\\"hljs-number\\\">5</span>, <span class=\\\"hljs-number\\\">17</span>, <span class=\\\"hljs-number\\\">9</span>];\\narr4.some(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span>(<span class=\\\"hljs-params\\\">curr, index, arr</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> curr &gt; <span class=\\\"hljs-number\\\">20</span>;\\n    });  <span class=\\\"hljs-comment\\\">// returns false</span>\\n\\n<span class=\\\"hljs-comment\\\">// ES6 arrows functions</span>\\narr4.some((curr) =&gt; curr &gt;= <span class=\\\"hljs-number\\\">14</span>)  <span class=\\\"hljs-comment\\\">// returns true</span>\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/some\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-some/index.md\n ** module id = 790\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-some/index.md?");

