	eval("module.exports = {\"title\":\"js Array prototype sort\",\"order\":5,\"body\":\"<h1>js Array prototype sort</h1>\\n<p>The <code>sort()</code> method sorts the elements of an array <em>in place</em> and returns the sorted array.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">arr.sort([compareFunction])\\n</code></pre>\\n<h3>Parameters</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>Parameter</th>\\n<th>Description</th>\\n<th>Necessity</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>compareFunction</td>\\n<td>Optional. The name of the function used to determine the order of the elements. If omitted, the elements are sorted in ascending, Unicode character order.</td>\\n<td>Optional</td>\\n</tr>\\n</tbody>\\n</table>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/sort\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/4b4fbfhk%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nThe sorted array.</p>\\n<p>##Remarks</p>\\n<p>The <code>sort</code> method sorts the <code>Array</code> object in place; no new <code>Array</code> object is created during execution.</p>\\n<p>If you supply a function in the <code>compareFunction</code> argument, it must return one of the following values:</p>\\n<ul>\\n<li>\\n<p>A negative value if the first argument passed is less than the second argument.</p>\\n</li>\\n<li>\\n<p>Zero if the two arguments are equivalent.</p>\\n</li>\\n<li>\\n<p>A positive value if the first argument is greater than the second argument.</p>\\n</li>\\n</ul>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> fruit = [<span class=\\\"hljs-string\\\">'cherries'</span>, <span class=\\\"hljs-string\\\">'apples'</span>, <span class=\\\"hljs-string\\\">'bananas'</span>];\\nfruit.sort(); <span class=\\\"hljs-comment\\\">// ['apples', 'bananas', 'cherries']</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> scores = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">21</span>]; \\nscores.sort(); <span class=\\\"hljs-comment\\\">// [1, 10, 2, 21]</span>\\n<span class=\\\"hljs-comment\\\">// Watch out that 10 comes before 2,</span>\\n<span class=\\\"hljs-comment\\\">// because '10' comes before '2' in Unicode code point order.</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> things = [<span class=\\\"hljs-string\\\">'word'</span>, <span class=\\\"hljs-string\\\">'Word'</span>, <span class=\\\"hljs-string\\\">'1 Word'</span>, <span class=\\\"hljs-string\\\">'2 Words'</span>];\\nthings.sort(); <span class=\\\"hljs-comment\\\">// ['1 Word', '2 Words', 'Word', 'word']</span>\\n<span class=\\\"hljs-comment\\\">// In Unicode, numbers come before upper case letters,</span>\\n<span class=\\\"hljs-comment\\\">// which come before lower case letters.</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> a = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Array</span>(<span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">11</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">1</span>);\\n\\n<span class=\\\"hljs-keyword\\\">var</span> b = a.sort();\\n<span class=\\\"hljs-built_in\\\">document</span>.write(b);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// This is ASCII character order.</span>\\n<span class=\\\"hljs-comment\\\">// Output: 1,10,11,2,3,4)</span>\\n\\n<span class=\\\"hljs-comment\\\">// Sort the array elements with a function that compares array elements.</span>\\nb = a.sort(CompareForSort);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(b);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"&lt;br/&gt;\\\"</span>);\\n<span class=\\\"hljs-comment\\\">// Output: 1,2,3,4,10,11.</span>\\n\\n<span class=\\\"hljs-comment\\\">// Sorts array elements in ascending order numerically.</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">CompareForSort</span>(<span class=\\\"hljs-params\\\">first, second</span>)\\n</span>{\\n    <span class=\\\"hljs-keyword\\\">if</span> (first == second)\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">0</span>;\\n    <span class=\\\"hljs-keyword\\\">if</span> (first &lt; second)\\n        <span class=\\\"hljs-keyword\\\">return</span> -<span class=\\\"hljs-number\\\">1</span>;\\n    <span class=\\\"hljs-keyword\\\">else</span>\\n        <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-number\\\">1</span>; \\n}\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-sort/index.md\n ** module id = 791\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-sort/index.md?");

