	eval("module.exports = {\"title\":\"js Array prototype toString\",\"order\":5,\"body\":\"<h1>Array.prototype.toString()</h1>\\n<p>The JavaScript array method <code>.toString()</code> is used to convert an array into a single string, with each element joined by a comma. There are no parameters for the method.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> arr = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>];\\narr.toString();\\n</code></pre>\\n<p><strong>Usage</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str1 = [<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">5</span>].toString();  <span class=\\\"hljs-comment\\\">// str1 = '1,2,3,4,5';</span>\\n<span class=\\\"hljs-keyword\\\">var</span> str2 = [<span class=\\\"hljs-string\\\">'1'</span>, <span class=\\\"hljs-string\\\">'2'</span>, <span class=\\\"hljs-string\\\">'3'</span>, <span class=\\\"hljs-string\\\">'4'</span>].toString();  <span class=\\\"hljs-comment\\\">// str2 = '1,2,3,4';</span>\\n<span class=\\\"hljs-keyword\\\">var</span> str3 = [<span class=\\\"hljs-string\\\">'Free'</span>, <span class=\\\"hljs-string\\\">'Code'</span>, <span class=\\\"hljs-string\\\">'Camp'</span>].toString();  <span class=\\\"hljs-comment\\\">// str3 = 'Free,Code,Camp';</span>\\n<span class=\\\"hljs-keyword\\\">var</span> str4 = [<span class=\\\"hljs-string\\\">'phone'</span>, <span class=\\\"hljs-string\\\">'555-6726'</span>].toString();   <span class=\\\"hljs-comment\\\">// str4 = 'phone,555-6726';</span>\\n<span class=\\\"hljs-keyword\\\">var</span> str5 = [<span class=\\\"hljs-string\\\">'August'</span>, <span class=\\\"hljs-string\\\">'September'</span>, <span class=\\\"hljs-string\\\">'October'</span>].toString();  <span class=\\\"hljs-comment\\\">// str5 = 'August,September,October';</span>\\n<span class=\\\"hljs-keyword\\\">var</span> str6 = [<span class=\\\"hljs-string\\\">'Words'</span>, <span class=\\\"hljs-string\\\">'and'</span>, <span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">4</span>].toString();  <span class=\\\"hljs-comment\\\">// str6 = 'Words,and,3,4';</span>\\n</code></pre>\\n<p>Source: <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/toString\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Array-prototype-toString/index.md\n ** module id = 793\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Array-prototype-toString/index.md?");

