	eval("module.exports = {\"title\":\"js Boolean\",\"order\":5,\"body\":\"<p>The value passed as the first parameter is converted to a boolean value, if necessary. If value is omitted or is 0, -0, null, false, NaN, undefined, or the empty string (&quot;&quot;), the object has an initial value of false. All other values, including any object or the string “false”, create an object with an initial value of true.</p>\\n<p>Do not confuse the primitive Boolean values true and false with the true and false values of the Boolean object.</p>\\n<h2>More Details</h2>\\n<p>Any object whose value is not undefined or null, including a Boolean object whose value is false, evaluates to true when passed to a conditional statement. For example, the condition in the following if statement evaluates to true:</p>\\n<pre><code><span class=\\\"hljs-keyword\\\">var</span> x = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Boolean</span>(<span class=\\\"hljs-literal\\\">false</span>);\\n<span class=\\\"hljs-keyword\\\">if</span> (x) {\\n  <span class=\\\"hljs-comment\\\">// this code is executed</span>\\n}\\n</code></pre>\\n<p>This behavior does not apply to Boolean primitives. For example, the condition in the following if statement evaluates to false:</p>\\n<pre><code>var x = <span class=\\\"hljs-literal\\\">false</span>;\\n<span class=\\\"hljs-keyword\\\">if</span> (x) {\\n  <span class=\\\"hljs-regexp\\\">//</span> <span class=\\\"hljs-keyword\\\">this</span> code <span class=\\\"hljs-keyword\\\">is</span> <span class=\\\"hljs-keyword\\\">not</span> executed\\n}\\n</code></pre>\\n<p>Do not use a Boolean object to convert a non-boolean value to a boolean value. Instead, use Boolean as a function to perform this task:</p>\\n<pre><code><span class=\\\"hljs-variable\\\"><span class=\\\"hljs-keyword\\\">var</span> x</span> = <span class=\\\"hljs-typename\\\">Boolean</span>(expression);     <span class=\\\"hljs-comment\\\">// preferred</span>\\n<span class=\\\"hljs-variable\\\"><span class=\\\"hljs-keyword\\\">var</span> x</span> = new <span class=\\\"hljs-typename\\\">Boolean</span>(expression); <span class=\\\"hljs-comment\\\">// don't use</span>\\n</code></pre>\\n<p>If you specify any object, including a Boolean object whose value is false, as the initial value of a Boolean object, the new Boolean object has a value of true.</p>\\n<pre><code><span class=\\\"hljs-keyword\\\">var</span> myFalse = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Boolean</span>(<span class=\\\"hljs-literal\\\">false</span>);   <span class=\\\"hljs-comment\\\">// initial value of false</span>\\n<span class=\\\"hljs-keyword\\\">var</span> g = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Boolean</span>(myFalse);       <span class=\\\"hljs-comment\\\">// initial value of true</span>\\n<span class=\\\"hljs-keyword\\\">var</span> myString = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">String</span>(<span class=\\\"hljs-string\\\">'Hello'</span>); <span class=\\\"hljs-comment\\\">// string object</span>\\n<span class=\\\"hljs-keyword\\\">var</span> s = <span class=\\\"hljs-keyword\\\">new</span> <span class=\\\"hljs-built_in\\\">Boolean</span>(myString);      <span class=\\\"hljs-comment\\\">// initial value of true</span>\\n</code></pre>\\n<p>Do not use a Boolean object in place of a Boolean primitive.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Boolean\\\">Orininal</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-Boolean/index.md\n ** module id = 794\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-Boolean/index.md?");

