	eval("module.exports = {\"title\":\"js String prototype charAt\",\"order\":5,\"body\":\"<h1>js String prototype charAt</h1>\\n<p>The <code>charAt()</code> method returns the specified character from a string.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.charAt(index)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>index</strong></p>\\n<p>An integer between 0 and 1-less-than the length of the string.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/charAt\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/65zt5h10%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nCharacters in a string are indexed from left to right. The index of the first character is 0, and the index of the last character in a string called <code>stringName</code> is <code>stringName.length - 1</code>. If the index you supply is out of range, JavaScript returns an empty string.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> anyString = <span class=\\\"hljs-string\\\">'Brave new world'</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 0   is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">0</span>)   + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// 'B'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 1   is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">1</span>)   + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// 'r'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 2   is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">2</span>)   + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// 'a'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 3   is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">3</span>)   + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// 'v'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 4   is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">4</span>)   + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// 'e'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">\\\"The character at index 999 is '\\\"</span> + anyString.charAt(<span class=\\\"hljs-number\\\">999</span>) + <span class=\\\"hljs-string\\\">\\\"'\\\"</span>); <span class=\\\"hljs-comment\\\">// ''</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">\\\"ABCDEFGHIJKLMNOPQRSTUVWXYZ\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">document</span>.write(str.charAt(str.length - <span class=\\\"hljs-number\\\">1</span>));\\n\\n<span class=\\\"hljs-comment\\\">// Output: Z</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-charAt/index.md\n ** module id = 795\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-charAt/index.md?");

