	eval("module.exports = {\"title\":\"js String prototype charCodeAt\",\"order\":5,\"body\":\"<h1>js String prototype charCodeAt</h1>\\n<p>The <code>charCodeAt()</code> method returns the numeric Unicode value of the character at the given index (except for unicode codepoints &gt; 0x10000).</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.charCodeAt(index)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>index</strong></p>\\n<p>An integer greater than or equal to 0 and less than the length of the string; if it is not a number, it defaults to 0.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/charCodeAt\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/hza4d04f%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nNote that <code>charCodeAt()</code> will always return a value that is less than 65536. This is because the higher code points are represented by a pair of (lower valued) “surrogate” pseudo-characters which are used to comprise the real character. Because of this, in order to examine or reproduce the full character for individual characters of value 65536 and above, for such characters, it is necessary to retrieve not only <code>charCodeAt(i)</code>, but also <code>charCodeAt(i+1)</code> (as if examining/reproducing a string with two letters). See example 2 and 3 below.</p>\\n<p><code>charCodeAt()</code> returns <code>NaN</code> if the given <code>index</code> is less than 0 or is equal to or greater than the length of the string.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-string\\\">'ABC'</span>.charCodeAt(<span class=\\\"hljs-number\\\">0</span>); <span class=\\\"hljs-comment\\\">// returns 65</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">\\\"ABCDEFGHIJKLMNOPQRSTUVWXYZ\\\"</span>; \\n<span class=\\\"hljs-built_in\\\">document</span>.write(str.charCodeAt(str.length - <span class=\\\"hljs-number\\\">1</span>));\\n\\n<span class=\\\"hljs-comment\\\">// Output: 90 </span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-charCodeAt/index.md\n ** module id = 796\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-charCodeAt/index.md?");

