	eval("module.exports = {\"title\":\"js String prototype indexOf\",\"order\":5,\"body\":\"<h1>String.prototype.indexOf()</h1>\\n<p>The indexOf() method returns the index within the calling String object of the first occurrence of the specified value, starting the search at fromIndex. Returns -1 if the value is not found.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\">str.indexOf(searchValue[, *fromIndex*]);\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>searchValue</strong>\\nA character/string whose index is to be found.</p>\\n<p><strong>fromIndex</strong>\\nOptional. The location within the calling string to start the search from. It can be any integer. The default value is 0. If <code>fromIndex &lt; 0</code> the entire string is searched (same as passing 0). If <code>fromIndex &gt;= str.length</code>, the method will return -1 unless <code>searchValue</code> is an empty string in which case <code>str.length</code> is returned.</p>\\n<h2>Description</h2>\\n<p>Characters in a string are indexed from left to right. The index of the first character is 0, and the index of the last character of a string called <code>str</code> is <code>str.length - 1</code>.</p>\\n<h2>Examples</h2>\\n<p><strong>Finding a character in a string</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str1 = <span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'H'</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output: 0</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> str1 = <span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'Y'</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output: -1.</span>\\n\\n</code></pre>\\n<p><strong>indexOf() is case-sensitive</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str1 = <span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'ello'</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output 1</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> str1 = <span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'Ello'</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output -1</span>\\n\\n</code></pre>\\n<p><strong>indexOf() with fromIndex</strong></p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str1 = <span class=\\\"hljs-string\\\">\\\"FreeCodeCamp is a place for people to learn\\\"</span>;\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'Camp'</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output 8</span>\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(str1.indexOf(<span class=\\\"hljs-string\\\">'Camp'</span>, <span class=\\\"hljs-number\\\">9</span>));\\n<span class=\\\"hljs-comment\\\">// Console will output -1</span>\\n\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/indexOf\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-indexOf/index.md\n ** module id = 798\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-indexOf/index.md?");

