	eval("module.exports = {\"title\":\"js String prototype lastindexOf\",\"order\":5,\"body\":\"<h1>js String prototype lastIndexOf</h1>\\n<p>The <code>lastIndexOf()</code> method returns the index within the calling String object of the last occurrence of the specified value, or -1 if not found. The calling string is searched backward, starting at <code>fromIndex</code>.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.lastIndexOf(searchValue[, fromIndex])\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>searchValue</strong></p>\\n<p>A string representing the value to search for.</p>\\n<p><strong>fromIndex</strong></p>\\n<p>Optional. The location within the calling string to start the search at, indexed from left to right. It can be any integer. The default value is <code>str.length</code>. If it is negative, it is treated as 0. If <code>fromIndex &gt; str.length</code>, <code>fromIndex</code> is treated as <code>str.length</code>.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/lastIndexOf\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/6d20k718%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nReturns the last occurrence of a substring in the string.</p>\\n<p>##Description\\nCharacters in a string are indexed from left to right. The index of the first character is 0, and the index of the last character is <code>stringName.length - 1</code>.</p>\\n<p>The <code>lastIndexOf()</code> method is case sensitive. For example, the following expression returns <code>-1</code>:</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-string\\\">'canal'</span>.lastIndexOf(<span class=\\\"hljs-string\\\">'a'</span>);     <span class=\\\"hljs-comment\\\">// returns 3</span>\\n<span class=\\\"hljs-string\\\">'canal'</span>.lastIndexOf(<span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-number\\\">2</span>);  <span class=\\\"hljs-comment\\\">// returns 1</span>\\n<span class=\\\"hljs-string\\\">'canal'</span>.lastIndexOf(<span class=\\\"hljs-string\\\">'a'</span>, <span class=\\\"hljs-number\\\">0</span>);  <span class=\\\"hljs-comment\\\">// returns -1</span>\\n<span class=\\\"hljs-string\\\">'canal'</span>.lastIndexOf(<span class=\\\"hljs-string\\\">'x'</span>);     <span class=\\\"hljs-comment\\\">// returns -1</span>\\n<span class=\\\"hljs-string\\\">'Blue Whale, Killer Whale'</span>.lastIndexOf(<span class=\\\"hljs-string\\\">'blue'</span>); <span class=\\\"hljs-comment\\\">// returns -1</span>\\n\\n<span class=\\\"hljs-keyword\\\">var</span> anyString = <span class=\\\"hljs-string\\\">'Brave new world'</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'The index of the first w from the beginning is '</span> + anyString.indexOf(<span class=\\\"hljs-string\\\">'w'</span>));\\n<span class=\\\"hljs-comment\\\">// logs 8</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'The index of the first w from the end is '</span> + anyString.lastIndexOf(<span class=\\\"hljs-string\\\">'w'</span>)); \\n<span class=\\\"hljs-comment\\\">// logs 10</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'The index of \\\"new\\\" from the beginning is '</span> + anyString.indexOf(<span class=\\\"hljs-string\\\">'new'</span>));\\n<span class=\\\"hljs-comment\\\">// logs 6</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'The index of \\\"new\\\" from the end is '</span> + anyString.lastIndexOf(<span class=\\\"hljs-string\\\">'new'</span>));\\n<span class=\\\"hljs-comment\\\">// logs 6</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">\\\"time, time\\\"</span>;\\n\\n<span class=\\\"hljs-keyword\\\">var</span> s = <span class=\\\"hljs-string\\\">\\\"\\\"</span>;\\ns += <span class=\\\"hljs-string\\\">\\\"time is at position \\\"</span> + str.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"time\\\"</span>);\\ns += <span class=\\\"hljs-string\\\">\\\"&lt;br /&gt;\\\"</span>;\\ns += <span class=\\\"hljs-string\\\">\\\"abc is at position \\\"</span> + str.lastIndexOf(<span class=\\\"hljs-string\\\">\\\"abc\\\"</span>);\\n\\n<span class=\\\"hljs-built_in\\\">document</span>.write(s);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// time is at position 6</span>\\n<span class=\\\"hljs-comment\\\">// abc is at position -1</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-lastindexOf/index.md\n ** module id = 799\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-lastindexOf/index.md?");

