	eval("module.exports = {\"title\":\"js String prototype match\",\"order\":5,\"body\":\"<h1>js String prototype match</h1>\\n<p>The <code>match()</code> method retrieves the matches when matching a string against a regular expression.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.match(regexp)\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>regexp</strong></p>\\n<p>A regular expression object. If a non-RegExp object obj is passed, it is implicitly converted to a RegExp by using <code>new RegExp(obj)</code>.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/match\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/7df7sf4x%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nAn <code>Array</code> containing the matched results or <code>null</code> if there were no matches.</p>\\n<p>##Description\\nIf the regular expression does not include the <code>g</code> flag, returns the same result as <code>RegExp.exec()</code>. The returned <code>Array</code> has an extra input property, which contains the original string that was parsed. In addition, it has an index property, which represents the zero-based index of the match in the string.</p>\\n<p>If the regular expression includes the <code>g</code> flag, the method returns an <code>Array</code> containing all matched substrings rather than match objects. Captured groups are not returned. If there were no matches, the method returns <code>null</code>.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz'</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> regexp = <span class=\\\"hljs-regexp\\\">/[A-E]/gi</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> matches_array = str.match(regexp);\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(matches_array);\\n<span class=\\\"hljs-comment\\\">// ['A', 'B', 'C', 'D', 'E', 'a', 'b', 'c', 'd', 'e']</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">'For more information, see Chapter 3.4.5.1'</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> re = <span class=\\\"hljs-regexp\\\">/(chapter \\\\d+(\\\\.\\\\d)*)/i</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> found = str.match(re);\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(found);\\n\\n<span class=\\\"hljs-comment\\\">// logs ['Chapter 3.4.5.1', 'Chapter 3.4.5.1', '.1']</span>\\n\\n<span class=\\\"hljs-comment\\\">// 'Chapter 3.4.5.1' is the first match and the first value </span>\\n<span class=\\\"hljs-comment\\\">// remembered from `(Chapter \\\\d+(\\\\.\\\\d)*)`.</span>\\n\\n<span class=\\\"hljs-comment\\\">// '.1' is the last value remembered from `(\\\\.\\\\d)`.</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-match/index.md\n ** module id = 800\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-match/index.md?");

