	eval("module.exports = {\"title\":\"js String prototype substr\",\"order\":5,\"body\":\"<h1>js String prototype substr</h1>\\n<p>Gets a substring beginning at the specified location and having the specified length.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.substr(start[, length])\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>start</strong></p>\\n<p>Location at which to begin extracting characters. If a negative number is given, it is treated as strLength + start where strLength is the length of the string (for example, if start is -3 it is treated as strLength - 3.)</p>\\n<p><strong>length</strong></p>\\n<p>Optional. The number of characters to extract.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/substr\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/0esxc5wy%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Returns\\nThe characters in a string beginning at the specified location through the specified number of characters.</p>\\n<p>##Description\\n<code>start</code> is a character index. The index of the first character is 0, and the index of the last character is 1 less than the length of the string. <code>substr()</code> begins extracting characters at start and collects length characters (unless it reaches the end of the string first, in which case it will return fewer).</p>\\n<p>If <code>start</code> is positive and is greater than or equal to the length of the string, <code>substr()</code> returns an empty string.</p>\\n<p>If <code>start</code> is negative, <code>substr()</code> uses it as a character index from the end of the string. If <code>start</code> is negative and <code>abs(start)</code> is larger than the length of the string, <code>substr()</code> uses 0 as the start index. Note: the described handling of negative values of the start argument is not supported by Microsoft JScript.</p>\\n<p>If <code>length</code> is 0 or negative, <code>substr()</code> returns an empty string. If length is omitted, <code>substr()</code> extracts characters to the end of the string.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> str = <span class=\\\"hljs-string\\\">'abcdefghij'</span>;\\n\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(1, 2): '</span>   + str.substr(<span class=\\\"hljs-number\\\">1</span>, <span class=\\\"hljs-number\\\">2</span>));   <span class=\\\"hljs-comment\\\">// '(1, 2): bc'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(-3, 2): '</span>  + str.substr(-<span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">2</span>));  <span class=\\\"hljs-comment\\\">// '(-3, 2): hi'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(-3): '</span>     + str.substr(-<span class=\\\"hljs-number\\\">3</span>));     <span class=\\\"hljs-comment\\\">// '(-3): hij'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(1): '</span>      + str.substr(<span class=\\\"hljs-number\\\">1</span>));      <span class=\\\"hljs-comment\\\">// '(1): bcdefghij'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(-20, 2): '</span> + str.substr(-<span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-number\\\">2</span>)); <span class=\\\"hljs-comment\\\">// '(-20, 2): ab'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'(20, 2): '</span>  + str.substr(<span class=\\\"hljs-number\\\">20</span>, <span class=\\\"hljs-number\\\">2</span>));  <span class=\\\"hljs-comment\\\">// '(20, 2): '</span>\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> s = <span class=\\\"hljs-string\\\">\\\"The quick brown fox jumps over the lazy dog.\\\"</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> ss = s.substr(<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">5</span>);  \\n<span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"[\\\"</span> + ss + <span class=\\\"hljs-string\\\">\\\"] &lt;br&gt;\\\"</span>);\\n\\nss = s.substr(<span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"[\\\"</span> + ss + <span class=\\\"hljs-string\\\">\\\"] &lt;br&gt;\\\"</span>);\\n\\nss = s.substr(<span class=\\\"hljs-number\\\">10</span>, -<span class=\\\"hljs-number\\\">5</span>);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(<span class=\\\"hljs-string\\\">\\\"[\\\"</span> + ss + <span class=\\\"hljs-string\\\">\\\"] &lt;br&gt;\\\"</span>);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// [brown] </span>\\n<span class=\\\"hljs-comment\\\">// [brown fox jumps over the lazy dog.] </span>\\n<span class=\\\"hljs-comment\\\">// []</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-substr/index.md\n ** module id = 804\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-substr/index.md?");

