	eval("module.exports = {\"title\":\"js String prototype substring\",\"order\":5,\"body\":\"<h1>js String prototype substring</h1>\\n<p>The <code>substring()</code> method returns a subset of a string between one index and another, or through the end of the string.</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\">str.substring(indexStart[, indexEnd])\\n</code></pre>\\n<h3>Parameters</h3>\\n<p><strong>indexStart</strong></p>\\n<p>An integer between 0 and the length of the string, specifying the offset into the string of the first character to include in the returned substring.</p>\\n<p><strong>indexEnd</strong></p>\\n<p>Optional. An integer between 0 and the length of the string, which specifies the offset into the string of the first character not to include in the returned substring.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/substring\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-us/LIBRary/3cz15ahb%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\n<code>substring()</code> extracts characters from <code>indexStart</code> up to but not including <code>indexEnd</code>. In particular:</p>\\n<ul>\\n<li>If <code>indexStart</code> equals <code>indexEnd</code>, <code>substring()</code> returns an empty string.</li>\\n<li>If <code>indexEnd</code> is omitted, <code>substring()</code> extracts characters to the end of the string.</li>\\n<li>If either argument is less than 0 or is <code>NaN</code>, it is treated as if it were 0.</li>\\n<li>If either argument is greater than <code>stringName.length</code>, it is treated as if it were <code>stringName.length</code>.</li>\\n</ul>\\n<p>If <code>indexStart</code> is greater than <code>indexEnd</code>, then the effect of <code>substring()</code> is as if the two arguments were swapped; for example, <code>str.substring(1, 0) == str.substring(0, 1)</code>.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> anyString = <span class=\\\"hljs-string\\\">'Mozilla'</span>;\\n\\n<span class=\\\"hljs-comment\\\">// Displays 'Moz'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">3</span>));\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">3</span>, <span class=\\\"hljs-number\\\">0</span>));\\n\\n<span class=\\\"hljs-comment\\\">// Displays 'lla'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">4</span>, <span class=\\\"hljs-number\\\">7</span>));\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">7</span>, <span class=\\\"hljs-number\\\">4</span>));\\n\\n<span class=\\\"hljs-comment\\\">// Displays 'Mozill'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">6</span>));\\n\\n<span class=\\\"hljs-comment\\\">// Displays 'Mozilla'</span>\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">7</span>));\\n<span class=\\\"hljs-built_in\\\">console</span>.log(anyString.substring(<span class=\\\"hljs-number\\\">0</span>, <span class=\\\"hljs-number\\\">10</span>));\\n</code></pre>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> s = <span class=\\\"hljs-string\\\">\\\"The quick brown fox jumps over the lazy dog.\\\"</span>;\\n<span class=\\\"hljs-keyword\\\">var</span> ss = s.substring(<span class=\\\"hljs-number\\\">10</span>, <span class=\\\"hljs-number\\\">15</span>);\\n<span class=\\\"hljs-built_in\\\">document</span>.write(ss);\\n\\n<span class=\\\"hljs-comment\\\">// Output:</span>\\n<span class=\\\"hljs-comment\\\">// brown</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-substring/index.md\n ** module id = 805\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-substring/index.md?");

