	eval("module.exports = {\"title\":\"js String prototype toUpperCase\",\"order\":5,\"body\":\"<h1>String.prototype.toUpperCase()</h1>\\n<p>The JavaScript method <code>.toUpperCase()</code> returns the same string it was called on, but in all upper case.</p>\\n<p><strong>Syntax</strong></p>\\n<pre><code class=\\\"language-js\\\">str.toUpperCase()\\n</code></pre>\\n<h2>Examples</h2>\\n<pre><code>\\nconsole.<span class=\\\"hljs-built_in\\\">log</span>(<span class=\\\"hljs-string\\\">\\\"hello world\\\"</span>.toUpperCase()); <span class=\\\"hljs-comment\\\">// Console will output \\\"HELLO WORLD\\\"</span>\\n\\n</code></pre>\\n<p>Source <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/String/toUpperCase\\\">MDN</a></p>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-String-prototype-toUpperCase/index.md\n ** module id = 807\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-String-prototype-toUpperCase/index.md?");

