	eval("module.exports = {\"title\":\"js closures\",\"order\":5,\"body\":\"<p>Closures are functions that refer to independent (free) variables. In other words, the function defined in the closure ‘remembers’ the environment in which it was created.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">init</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">var</span> name = <span class=\\\"hljs-string\\\">\\\"Mozilla\\\"</span>; <span class=\\\"hljs-comment\\\">// name is a local variable created by init</span>\\n  <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">displayName</span>(<span class=\\\"hljs-params\\\"></span>) </span>{ <span class=\\\"hljs-comment\\\">// displayName() is the inner function, a closure</span>\\n    alert(name); <span class=\\\"hljs-comment\\\">// use variable declared in the parent function    </span>\\n  }\\n  displayName();    \\n};\\ninit();\\n</code></pre>\\n<p>See <a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Closures\\\">MDN</a></p>\\n<blockquote>\\n<p>tags: closure, javascript, js</p>\\n</blockquote>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/js-closures/index.md\n ** module id = 809\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/js-closures/index.md?");

