	eval("module.exports = {\"title\":\"latex\",\"order\":5,\"body\":\"<p>LaTeX is designed for the production of technical and scientific documentation.\\nYou can create matrix, arrays or several other mathmatical functions.</p>\\n<p><code>$$ (latex language) $$</code></p>\\n<p>You can embed Latex in GitterIM. Examples:</p>\\n<p><strong>Array</strong>:\\n$$\\\\begin{array} {c c}\\narr11 &amp; arr12\\\\\\narr21 &amp; arr22\\\\\\n\\\\end{array}$$</p>\\n<p><strong>Matrix</strong>:\\n$$\\\\begin{pmatrix} 1 &amp; 0 \\\\ 0 &amp; 1 \\\\end{pmatrix}$$</p>\\n<p><strong>formatting</strong>:\\n$$\\\\huge\\\\textstyle\\\\color{#F00}{BigRed}\\\\small\\\\textstyle\\\\color{#0F0}{SmallGreen}$$</p>\\n<p><a href=\\\"https://github.com/Khan/KaTeX/wiki/Function-Support-in-KaTeX\\\">Function Support</a></p>\\n<h2>details</h2>\\n<p><a href=\\\"https://github.com/Khan/KaTeX\\\">KaTeX Github Repo</a>\\nLaTeX is a high-quality typesetting system; it includes features designed for the production of technical and scientific documentation. LaTeX is the de facto standard for the communication and publication of scientific documents.\\nHis advantages are noticable in long documents like books, papers or thesis.</p>\\n<p>Gitter uses Katex (an custom implementation of LaTeX) and it can be used introducing the following code:</p>\\n<pre><code class=\\\"language-latex\\\"><span class=\\\"hljs-label\\\">$$</span>\\\\<span class=\\\"hljs-keyword\\\">begin{array} </span>{c c}\\n<span class=\\\"hljs-keyword\\\">item11 </span>&amp; <span class=\\\"hljs-keyword\\\">item12\\\\\\n</span><span class=\\\"hljs-keyword\\\">item21 </span>&amp; <span class=\\\"hljs-keyword\\\">item </span><span class=\\\"hljs-number\\\">22</span>\\\\\\n\\\\<span class=\\\"hljs-preprocessor\\\">end</span>{array}\\n<span class=\\\"hljs-label\\\">$$</span>\\n</code></pre>\\n<p>Text:</p>\\n<ul>\\n<li><code>$$\\\\huge\\\\textstyle{some text}$$</code> -&gt; $$\\\\huge\\\\textstyle{some text}$$</li>\\n<li><code>$$\\\\color{#F90}{some text}$$</code> -&gt; $$\\\\color{#F90}{some text}$$</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/latex/index.md\n ** module id = 822\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/latex/index.md?");

