	eval("module.exports = {\"title\":\"parseInt\",\"order\":5,\"body\":\"<h1>parseInt()</h1>\\n<p>The <code>parseInt()</code> function parses a string argument and returns an integer of the specified <code>radix</code> (the base in mathematical numeral systems).</p>\\n<h2>Syntax</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-built_in\\\">parseInt</span>(string, radix);\\n</code></pre>\\n<h2>Parameters</h2>\\n<p><strong>string</strong></p>\\n<p>The value to parse. If string is not a string, then it is converted to a string (using the ToString abstract operation). Leading whitespace in the string is ignored.</p>\\n<p><strong>radix</strong></p>\\n<p>An integer between 2 and 36 that represents the radix (the base in mathematical numeral systems) of the above mentioned string. Specify 10 for the decimal numeral system commonly used by humans. Always specify this parameter to eliminate reader confusion and to guarantee predictable behavior. Different implementations produce different results when a radix is not specified, usually defaulting the value to 10.</p>\\n<p><a href=\\\"https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/parseInt\\\">MDN link</a> | <a href=\\\"https://msdn.microsoft.com/en-US/library/x53yedee%28v=vs.94%29.aspx\\\">MSDN link</a></p>\\n<p>##Description\\nThe parseInt function converts its first argument to a string, parses it, and returns an integer or NaN. If not NaN, the returned value will be the decimal integer representation of the first argument taken as a number in the specified radix (base). For example, a radix of 10 indicates to convert from a decimal number, 8 octal, 16 hexadecimal, and so on. For radices above 10, the letters of the alphabet indicate numerals greater than 9. For example, for hexadecimal numbers (base 16), A through F are used.</p>\\n<p>For arithmetic purposes, the <code>NaN</code> value is not a number in any radix. You can call the <code>isNaN</code> function to determine if the result of <code>parseInt</code> is NaN. If <code>NaN</code> is passed on to arithmetic operations, the operation results will also be <code>NaN</code>.</p>\\n<p>To convert number to its string literal in a particular radix use <code>intValue.toString(radix)</code>.</p>\\n<h2>Examples</h2>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-comment\\\">//The following examples all return 15:</span>\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\" 0xF\\\"</span>, <span class=\\\"hljs-number\\\">16</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\" F\\\"</span>, <span class=\\\"hljs-number\\\">16</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"17\\\"</span>, <span class=\\\"hljs-number\\\">8</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-number\\\">021</span>, <span class=\\\"hljs-number\\\">8</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"015\\\"</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-number\\\">15.99</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"15,123\\\"</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"FXX123\\\"</span>, <span class=\\\"hljs-number\\\">16</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"1111\\\"</span>, <span class=\\\"hljs-number\\\">2</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"15*3\\\"</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"15e2\\\"</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"15px\\\"</span>, <span class=\\\"hljs-number\\\">10</span>);\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"12\\\"</span>, <span class=\\\"hljs-number\\\">13</span>);\\n\\n<span class=\\\"hljs-comment\\\">//The following examples return NaN:</span>\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"Hello\\\"</span>, <span class=\\\"hljs-number\\\">8</span>); <span class=\\\"hljs-comment\\\">// Not a number at all</span>\\n<span class=\\\"hljs-built_in\\\">parseInt</span>(<span class=\\\"hljs-string\\\">\\\"546\\\"</span>, <span class=\\\"hljs-number\\\">2</span>);   <span class=\\\"hljs-comment\\\">// Digits are not valid for binary representations</span>\\n</code></pre>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/parseInt/index.md\n ** module id = 825\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/parseInt/index.md?");

